(101, 'An Overview about Overseas Education after Graduation ', 'Webinar', '2021-04-10 15:30:00', '2021-04-10 14:30:00', '1 Hours', 'Online', 'IT_SE,IT_TE,IT_BE', 'his webinar will be really helpful for those who wish to enroll in post graduate programs overseas.\r\n\r\nThe speakers will be able to guide the students about the GRE / GMAT examinations.\r\n Also, the students will get clarity about the timeline to apply for the same and other related important information.\r\n\r\n Students will get clarity on what type of questions are asked and how they are to be answered.\r\n\r\n You must fill the google form to register wherein you have to mention the list of questions you would like the speaker to answer.\r\n', 'Mr. Banit Sawhney,Mr. Rahul Bhatt,Ms. Alisha Chhabra', 'Uday Rote, Prashant Sawant', 'Computer Society of India (CSI)', '', '', 0, '', '', 'udayrote@somaiya.edu', 'https://forms.gle/TkBVCCGqLYJhn88H9', '', 'confirm', 0, 'Department of Information Technology', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'An Overview about Overseas Education after Graduation _Computer Society of India (CSI).pdf', NULL, 'YES', 'Department of IT and Computer Engineering', '', 9, NULL, NULL, NULL),
(111, 'Career Opportunities in Indian\r\nDefence Research and Development Organisation (DRDO)', 'Webinar', '2021-04-19 18:00:00', '2021-04-19 16:55:00', '1 Hours 5 minutes', 'Online', 'CE_FE,CE_SE,CE_TE,CE_BE,IT_FE,IT_SE,IT_TE,IT_BE,EXTC_FE,EXTC_SE,EXTC_TE,EXTC_BE,ETRX_FE,ETRX_SE,ETRX_TE,ETRX_BE,AI-DS_FE,AI-DS_SE,AI-DS_TE,AI-DS_BE', 'It will introduce you to the concept of honor, patriotism, cohesion and stipulate how to achieve it.\r\nIt will also help the students to know more of the Indian Research and Development Organization and its measures.\r\nThe speaker will also introduce various opportunities for students in the DRDO', 'Mrs.Yamuna Shivprasad', 'Mrs. Sandhya Deshpande, Convener, COEPS Cell', 'COEPS Cell', 'Mrs Devaki mam', 'IWSA members', 1000, '', '', 'sandhya.d@somaiya.edu', '', '---', 'confirm', 94, 'Department of Electronics and Telecommunication Engineering', NULL, NULL, NULL, NULL, NULL, 'https://www.youtube.com/watch?v=Qc85HDU2aO4', 'http://kjsieit.in/ems/Certificate-Generation-Portal/speaker_photo/WhatsApp Image 2021-04-01 at 7.48.23 PM.jpeg', 'Mrs. Yamuna Shivprasad', '', '', '', 1, 'Career Opportunities in Indian Defense Research and Development Organization (DRDO)_CAREER OPPORTUNITIES FOR ENGINEERS IN PUBLIC SECTOR CELL (COEPS CELL).pdf', NULL, 'YES', 'Indian Women Scientist Association (IWSA),Vashi', 'All KJSIEIT Students,External Students', 1, NULL, NULL, NULL),
