(114, 'Stock Market: An Overview', 'Webinar', '2021-04-12 17:00:00', '2021-04-12 16:00:00', '1 Hours', 'Online', 'CE_SE,CE_TE,CE_BE,IT_SE,IT_TE,IT_BE,EXTC_SE,EXTC_TE,EXTC_BE,ETRX_SE,ETRX_TE,ETRX_BE,AI-DS_SE,AI-DS_TE,AI-DS_BE', 'This webinar will aid in increasing the students awareness about the fundamental and technical working of stocks, commodities and the Stock Markets.', 'Hitesh Gadling & Sujoy Bhattacharya', 'Uday Rote', 'Student Council', '', '', 0, '', '', 'udayrote@somaiya.edu', 'https://forms.gle/aW897u3FDr53rJ5e7', '', 'confirm', 0, 'Department of Information Technology', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'Stock Market: An Overview_Student Council.pdf', NULL, 'YES', '', '', 4, NULL, NULL, NULL),
(115, '\'Feynwick\', The Coding Competition ', 'Coding Competition ', '2021-04-24 19:00:00', '2021-04-24 16:00:00', '3 Hours', 'Online', 'CE_FE,CE_SE,CE_TE,CE_BE,IT_FE,IT_SE,IT_TE,IT_BE,EXTC_FE,EXTC_SE,EXTC_TE,EXTC_BE,ETRX_FE,ETRX_SE,ETRX_TE,ETRX_BE,AI-DS_FE,AI-DS_SE,AI-DS_TE,AI-DS_BE', 'Agenda:-\n\nThe above mentioned contest aims to promote competitive programming among like-minded students and create awareness among the beginners from our college as well as around the world. \n\nThe contest also aims to expose the current working team of the competition to the various aspects such as marketing, publicity and problem setting.\n\n \n\nObjective:- \n\nTo provide students a platform to test their coding proficiency and prepare them for the interviews they might face in the future.\n\nTo provide a competitive environment to the students so that they can gauge their DSA skills with some of the leading coders in the world.\n\n \n\nTarget audience:-\n\nPrimary focus of the contest will be to introduce the FE students with a competitive programming environment.\n\nWe target all the programming enthusiasts be it beginners or world-class professionals by providing a well curated set of questions with varied difficulties.\n\nHosting the contest on a worldwide popular platform like HackerRank opens the gates for programmers all across the world to test their problem solving skills.\n\n \n\nOutcome:-\n\nThe participants of the contest will get the exposure to many demanding topics of data structures and algorithms. \n\nThe students will get the opportunity to test their time management skills and competition temperament.\n', '', ' uday rote, Prashant Sawant', 'Computer Society of India (CSI)', '', '', 0, '', 'Others', 'udayrote@somaiya.edu', NULL, NULL, 'confirm', NULL, 'Department of Information Technology', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'Feynwick, The Coding Competition _Computer Society of India (CSI).pdf', NULL, 'YES', 'Department of IT and Computer Engineering', 'All KJSIEIT Students,External Students', 9, NULL, NULL, NULL),
