(233, 'COEPS CELL 7th online workshop_App development using MIT App Inventor', 'online training /two day workshop', '2021-07-01 16:30:00', '2021-06-30 14:00:00', '2 Hours 30 minutes', 'Online', 'CE_FE,CE_SE,CE_TE,CE_BE,IT_FE,IT_SE,IT_TE,IT_BE,EXTC_FE,EXTC_SE,EXTC_TE,EXTC_BE,ETRX_FE,ETRX_SE,ETRX_TE,ETRX_BE,AI-DS_FE,AI-DS_SE,AI-DS_TE,AI-DS_BE', 'On students demand request was sent to NSC to conduct online training /Two day workshop on  on App development.\n\n Each day the duration of the workshop will be for 2 Hours and 30 Minutes and as discussed, charges for participation will be Rupees 500/- per seat. NSC is ready to arrange the workshop anytime between 28th June to 2nd July. Number of participants may range upto 25 to 40  Students.\nPre-requisites:\n1. Fast Internet Connection \n2. Desktop or laptop with Windows 10/8.1 OS & Zoom app\n3. Smartphone for Testing apps/ Communication.\n\nContents: App development using MIT App Inventor\n- Introduction\n- App Inventor Online User Interface\n- About Components and their Properties\n- Programming Blocks\n- Simple Program to understand Programming features\n- Projects from Templates\n- Make an .apk and testing of projects\n- Design your own Project\n\n\nHardcopy of certificate will be provided .', '', 'sandhya Deshpande', 'COEPS Cell', 'Mr. Waman Sathe Technical Officer Nehru Science Centre Wolli, Mumbai', 'Technical Officer Nehru Science Centre Wolli, Mumbai', 0, '', 'Others', 'sandhya.d@somaiya.edu', NULL, NULL, 'confirm', NULL, 'Department of Electronics and Telecommunication Engineering', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, ' 7th online workshop on App development using MIT App Inventor in collaboration with NSC_The KJSIEIT\'s COEPS CELL .pdf', NULL, 'YES', 'NSC', 'All KJSIEIT Students,External Students', 0, NULL, NULL, NULL),
