(241, 'Awareness on Current Trends - IoT/VLSI/RF', 'Webinar', '2021-06-26 12:00:00', '2021-06-26 10:30:00', '1 Hours 30 minutes', 'Online', 'CE_FE,CE_SE,CE_TE,CE_BE,IT_FE,IT_SE,IT_TE,IT_BE,EXTC_FE,EXTC_SE,EXTC_TE,EXTC_BE,ETRX_FE,ETRX_SE,ETRX_TE,ETRX_BE,AI-DS_FE,AI-DS_SE,AI-DS_TE,AI-DS_BE', 'Today Colleges and universities are considered a stepping stone into the corporate world. They not only have the responsibility of providing their students with top-class education but are also expected to provide them with quality placements with well-established companies. Colleges and universities have realized that there is an urgent need for them to take up the responsibility to make a student, industry-ready from day-1. Hence, the main agenda of this program is to create awareness about current trends in the Internet of things (IoT) / Very Large Scale Integration (VLSI) / Radio- Frequency (RF) Domain to prepare the students to be industry-ready through the best online/offline internship on the following topics from the industry experts:1. VLSI Programs2. RF & Antenna Design Programs3. Electronics Circuit Design and Simulation4. ANSYS Mechanical /HFSS tool5. IoT and Data Science', 'Mr Dhamdhara M S (Business Manager, Entuple Technologies, Bangalore)', 'Mr. Kiran Ramesh Rathod', 'Department of Electronics and Telecommunication Engineering', 'Ms. Divyavani S M', 'Manager', 0, '', '', 'kiran.rathod@somaiya.edu', 'https://forms.gle/a9ZU1PngLtLvwiyy6', 'damodara.ms@entuple.com', 'confirm', 114, 'Department of Electronics and Telecommunication Engineering', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'Awareness on Current Trends - IoT-VLSI-RF_Department of Electronics and Telecommunication Engineering.pdf', NULL, 'YES', 'IEEE and IEI', 'All KJSIEIT Students,External Students', 10, NULL, NULL, NULL),
(243, 'A Quiz Competition - \"QUIZ MASTER GOGO\"', 'Quiz Competition ', '2021-06-27 17:00:00', '2021-06-27 16:00:00', '1 Hours', 'Online', 'CE_FE,IT_FE,EXTC_FE,AI-DS_FE', 'Objectives:\nTo improve the cognitive abilities of the students.\nTo improve the time management skills of the participants by providing them a timed environment.\nTo underline the importance of current affairs and inform the students about the advancements in technology.\nTo interact with the first-year students and get them more involved in the co-curricular activities and the idea of technical committees.', '', '', 'Computer Society of India (CSI)', '', '', 0, '', 'Others', 'udayrote@somaiya.edu', NULL, NULL, 'confirm', NULL, 'Department of Information Technology', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'A Quiz Competition - Quiz Master GoGo_Computer Society of India (CSI).pdf', NULL, 'YES', '', '', 1, NULL, NULL, NULL),
