(293, 'KJSIEIT\'S COEPS CELL CYBER SECURITY AND INVESTIGATION WORKSHOP \"', 'online  5days workshop followed by one months internship with real time case study provided by  Maharashtra police cyber crime branch  ', '2021-09-03 18:30:00', '2021-07-31 17:00:00', '1 Hours 30 minutes', 'Zoom', 'CE_FE,CE_SE,CE_TE,CE_BE,IT_FE,IT_SE,IT_TE,IT_BE,EXTC_FE,EXTC_SE,EXTC_TE,EXTC_BE,ETRX_FE,ETRX_SE,ETRX_TE,ETRX_BE,AI-DS_FE,AI-DS_SE,AI-DS_TE,AI-DS_BE', 'KJSIEIT\'S COEPS CELL CYBER SECURITY AND INVESTIGATION WORKSHOP \"\nIt is proposed that this workshop on Cyber crime investigation can take\nthe students from a unsecured state in the Cyber Space to a secured\nstate. This can also be an opportunity for them to enhance their skills\nupon cyber crime investigation and increase the detection rates in the\nstate. Dinosys has experts and technologies in place and the proposers\nhave extensive experience in providing the best possible training on the\nSubject.\nWorkshop Details:Objectives:\nThe objectives for the project include:\n Awareness on the Cyber Crimes in Trend\n Understanding of tactics used by Criminals in Cyber Crime\n Practical Hands on Learning\n Advance methodologies for investigation\n To provide deep understanding of OSINT\n Providing clarity upon Chain of Action and Evidence Handling\n\n Five days workshop followed by one months internship Real Time Cases by Cyber Cell and Police will be given to students so that they would implement their training practically and learn more by implementing in real cases .Working On real time case study provided by Cyber Crimes Implementing their Training Knowledge and Technical Skills to Solve it\nExposure to work for Law and Enforcement Agencies \nStudent will get certificate from Maharashtra police cyber crime branch  \nAssessment:\nAfter the internship period , getting an exposure to work with government\nagencies under our supervision .We will be holding and assessment test\n.Students who are up to our expectation in Internship and workshop will\ngo under final assessment ,and will be receiving an offer letter to work\nwith us.\n\nBasic Details:\nRegistration fee For Workshop +Internship : 2000 / student +GST ..\nTiming for Workshop : 5 to 6.30 pm\nDates for Training : 31 July to 4 August\nMode of Workshop : Online\nPer Badge students : 80\nAfter Completing of training Internship for one month will be\nprovided to them.\nPerks of choosing this workshop:\nYou will be trained By one of best Cyber Expert in India Who have trained more than 50 thousands people Across country and worked with various Govt Agencies.\nTrainers Profile:\nLinkedin :https://www.linkedin.com/in/govindray\nWebsite:https://govindray.com/\nSocial Media Handle:https://www.instagram.com/govindray.official\n\n\nbenefits to the students :\nThis is one of the unique course which gives us ability to implement our\ntechnical knowledge to solve real life cyber crimes . Will be getting To work on real time cases and getting exposure to work for Law Enforcement Agencies including various Cyber Cell of Maharashtra Police Certification for completing training Certification for Internship from Dinosys and Cyber cell Respectively Selected students might get a chance to work with us After qualifying for Assessment.', '', 'Sandhya Deshpande ', 'COEPS Cell', 'Expertise from Maharashtra crime branches officer', 'Maharashtra police crime branch officer  ', 0, '', 'Others', 'sandhya.d@somaiya.edu', NULL, NULL, 'confirm', NULL, 'Department of Electronics and Telecommunication Engineering', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'KJSIEIT\'S COEPS CELL _KJSIEIT\'s COEPS Cell.pdf', NULL, 'YES', 'COEPS cell ', 'All KJSIEIT Students,External Students', 0, NULL, NULL, NULL),
