(2, 'Developing Artificial Intelligence based Innovations for Society.', 'Department of Information Technology', '2020-12-15', '4:00 AM', '', 'Students and Faculties - Department of Information Technology', 210, 0, 'To kindle awareness and motivation about various opportunities in the field of Artificial Intelligence for pursuing high-quality research and development towards societal contribution.', 'Dr. Asif Ekbal is a Professor at the Indian Institute of Technology, Patna and. is an expert in Artificial Intelligence. He holds a post-doctorate from the University of Trento, Italy as well as Heidelberg University, Germany. He has authored / co-authored around 150 papers in the journals like ACM Transactions, PLOSONE, Knowledge Engineering etc.; and conferences like ACL, COLING, EACL, EMNLP, etc. His research is sponsored by Industries Elsevier, Accenture, Samsung, LG Soft; and the Govt. Agencies MeiTY, DST, MHRD, CDOT, etc. He was conferred Best Innovative Project Award from the Indian National Academy of Engineering (INAE), JSPS Invitation Fellowship from the Govt. of Japan, Visvesvaraya Young Faculty Research Fellowship Award from Govt. of India, etc. and works to expand AI for societal benefits.\r\n ', 'Dr. Asif discussed how AI can be used in various applications areas such as Healthcare, Agriculture, Smart Cities & Infrastructure, Smart Mobility & Transportation, Surveillance, Sports, Education, Finance, Travel, Social Media, CRM, etc. He also discussed how other emerging areas such as Internet of Things, Robotics, etc. can use AI for their enhanced functioning.  Further, he highlighted some initiatives of the government in AI such as National Artificial Intelligence Mission; establishing various Centre of Excellence (CoE) for AI; formations of committee on platforms and data for AI, committee on leveraging AI for identifying National Missions in key sectors, etc. to create a policy framework for Artificial Intelligence, Ministry of Electronics & Information Technology (MeitY) and other. The talk was followed by a Question-Answer session, facilitating the participants to take up projects in AI for societal contributions.', 'The interest of participants to pursue research on Artificial Intelligence for the development of solutions to real-world problems amplified significantly. Ideas on Artificial Intelligence for Healthcare, Agriculture, Surveillance, Education, Security, etc. were discussed for prospective Research and Development.         ', 'Dr. Radhika Kotecha, Associate Professor and Head - Department of Information Technology', '', '', '', '', 'qrcode_ems.kjsieit.in.png', 'Screenshot 2021-08-05 021430.png', 'Error.png', 'IIS7 splash screen.png', 'Dr. Asif Ekbal, IIT Patna-Department of Information Technology.jpg', 'AS', NULL, NULL),
(27, 'Web Development with React', 'Institution of Electronics and Telecommunication Engineers (IETE)', '2021-03-14', '11:00 AM', 'Online', 'students', 76, 35, 'To learn about the  JavaScript Library React and how to make single page applications out of it.\r\n', ' Wahab Shaikh, TE Computer, CEO at IETE-KJSIEIT\r\nNidhi Bhanushali ,TE Computer ,Treasurer at IETE-KJSIEIT', 'The Web Development with React workshop was a one-day workshop, which was conducted on the 14th of March,2021 from 11:30 AM till 4:00 PM\r\nWe had an enthusiastic audience of 40 participants, all of them were very active.\r\n\r\nThe session started with showing the course website, that contains the source code and notes, followed by giving the demo of the project.The link for the same is: https://wahabshaik.github.io/react-workshop\r\n\r\nThe speakers then introduced the participants about React and its role in Web Development. They also explained how React is used in creating Single Page Web Applications. The speakers carried on with the introduction of JSX and simplified its complicated Javascript Code.\r\n\r\nThe speaker then settled up the tools which were required for creating and building React Applications and showed how to start with create-react-app. Explaining this they started developing a Netflix-like application giving each and every detailed information on the topics used to develop the application. The topics which were covered were State and State Management, Fetching data from an external API, Routing in Single Page Applications.\r\n\r\nThe speakers then gave a short introduction about Class Components. The session ended with distribution of links to other resources which would help the participants to learn more about React which was followed by an Q&A session.\r\n', ' Participants learnt about React and learnt the following : \r\n1)Building reactive, performant, single-page applications\r\n2)Declarative programming and component-based layout\r\n3)Ecosystem around React\r\n', 'Muffaddal Miyajiwala, TE EXTC\r\nAziz Bohra, TE COMP', 'Web Development Introduction', 'Wahab Teaching the basics of React', 'Explaining  about how to create React App ', '', 'Screenshot (80).png', 'Screenshot (81).png', 'Screenshot (82).png', '', 'Web development using react.jpeg', NULL, NULL, NULL),
(8, 'Career Talk by Internshala', 'Training and Placement Committee', '2021-03-23', '3:30 PM', 'Online', 'SE, TE, BE COMP, ETRX, EXTC, IT', 83, 0, 'To create awareness about internships and the internship platform Internshala', 'Ms. Jignasha Dalal\r\nAssistant Professor,\r\nPlacement Co-Ordinator,\r\nComputer engineering,\r\nKJSIEIT, Sion\r\n', 'The event was conducted after the registration of our college with Internshala. Internshala is platform which provides 10,000+ internship opportunities to students across India in the fields like Engineering, Arts, Hospitality, Marketing, etc.\r\n\r\nThe event was oranised by Placement cell of KJSIEIT and Internshala. The speaker for the event,  Ms. Jignasha Dalal covered the following topics:\r\n1. Importance of Internship\r\n2. How to apply for the internship through internshala\r\n3. Tips for online interview\r\n4. Making most of your internship\r\n5. Keeping relationship with the company, mentors and colleagues after internship\r\n\r\n\r\n', 'Students Understood the Importance of Internship,  How to apply for the internship through Internshala, Tips for the online interview, Making most of your internship, Keeping the relationship with the company, mentors and colleagues after internship.\r\nThey appreciated the session.', '1. Ms. Medha Asurlekar\r\n2. Ms. Rashmi Adatkar\r\n3. Ms. Rupali Kadu\r\n4. Ms. Vijaya Pinjarkar\r\n5. Ms. Sarita Rathod\r\n6. Mr. Amit Kukreja', '', '', '', '', '', 'internshala2.png', 'internshala4.png', 'internshala3.png', 'internshala carerrtalk.jpg', NULL, NULL, NULL),
(33, 'Innovathon 2021', 'Institution\'s Innovation Council (IIC)', '2021-03-21', '3:30 PM', '', '', 43, 16, 'To conduct a 24 hours Virtual Hackathon competition which aims to bring all the innovative minds into a healthy competitive environment where they put in their best efforts and gain exposure to solving intricate problem statements.', 'Mr. Harshal Khandare, Mr. Rahul Lad, Mr. Pushkar Gavandi, Mr. Niket Kharat, Mr. Nikhil Pawar\r\nExperts from Industry', 'Every team was composed of 1-4 people. The chosen medium for the competition was discord.\r\nParticipants were allowed to use open standard repositories, APIs and publicly available libraries. Progress of the projects were continuously tracked during the entire Hackathon. A total for 4 problem statements were provided to the participants. Each problem statement was given by an industry expert. ', 'Participants got an opportunity to work on industry-based problem statements. They also received an opportunity to interact with the industry experts who guided them during all the rounds.   ', 'Dr. Radhika Kotecha and Mr. Harsh Bhor (Faculty Coordinators)\r\nMr. Parth Maniar and Ms. Shreya Shetty (Student Coordinators)', 'Inaugration of Hackathon', 'Group Picture', 'Glimpse of Event', '', 'Innovathon.PNG', 'Innovathon6.PNG', 'Innovathon3.PNG', '', 'INNOVATHON 2021 Banner.png', 'Hackhathon', NULL, NULL),
(40, 'Innovation Debate', 'Institution\'s Innovation Council (IIC)', '2021-03-18', '3:30 PM', '', 'Students from various organizations', 21, 7, 'To provide an online platform for students to showcase their innovation and communication skills while sharing their valuable insights to represent their stand on the relevant and innovative topics.\r\n', '', 'The competition was conducted in a total of 3 rounds. All the teams were given their topic 5 minutes prior to the commencement of their rounds. Each side had 2 minutes to put forward their points, followed by a rebuttal round. Each topic was based on the domain of innovation and technology. Every team had 1-2 members. The participants were judged on the basis of their points put forward, usage of relevant examples, questions asked during the rebuttal round and their confidence and communication skills shown throughout the contest. ', 'Participants got an opportunity to think and discuss the key notions and role of technology in innovation.  ', 'Dr. Radhika Kotecha and Mr. Harsh Bhor', 'Glimpse of Competition', 'Winners of Debate', '', '', 'debate3.PNG', 'debate7__01.jpg', '', '', 'KJ-INNOVATHON (11).png', 'Debate', NULL, NULL),
(54, 'Treasure Hunt', 'Computer Society of India (CSI)', '2021-03-15', '4:00 PM', 'Online', 'Students', 20, 8, 'Educating participants in a fun and interesting way, about topics such as Space, Space Exploration, Encryption, Decryption through a gradual and immersive story told through the Treasure Hunt Hints.\r\n', 'NA', 'Introduction - The event started at sharp 4pm, with a total of 28 Participants joining in. The Introduction was given by one of the Team Members, along with a display of the Event Sponsors. This was followed by a brief introduction of the Event Heads and a small interaction with the participants. Shortly after, Rules of the Event were explained in detail by Event Heads. The doubts of the participants, regarding the rules and the conduction of the event were cleared as well. Following this, a Google Drive Link containing the Hints of Round 1 was shared with the Participants, and the Main Event Round 1 was started.\r\nRound 1  The first Round of the Event was conducted from 4:30pm to 5:45pm with all the participants enthusiastically involved in solving the Hints, and learning about the Technicalities of Encryption and Decryption of Clues involved. After the first 10 participants solved all the Hints provided in Round 1, the round was concluded, and the results of the Participants who had qualified were displayed. The remaining participants were eliminated. \r\nRound 2  After a brief break of 10 minutes, the Qualified participants were taken through the Rules once more, by the Event Heads, and soon after, were provided with the Google Drive Link for the Hints of Round 2, followed by Commencement of Round 2.  From 6:00pm to 6:35, participants were involved in solving the clues, as fast as they could, making use of all the resources of information that they could, as the clues got trickier and more difficult to solve. After 5 participants had solved all the Hints provided in Round 2, the Round was ended. The results of the qualified Participants were displayed once again, and the remaining participants were disqualified.\r\nRound 3  After another brief break of 10 minutes, the final 5 qualified participants were taken through the rules and the story once again, so as to get a clearer idea of all the technical things they have learned and applied. Following this, a small interaction with the Participants was conducted by Event Heads, and participants were asked about the Event conduction so far, and the perceived difficulty of Hints. After this, a Google Drive Link containing all the hints of Round 3 was shared with the five participants, and Round 3 was commenced. The first participant to solve all the clues provided was declared the winner, and the second participant to solve all the clues was declared the Runner-up. \r\nConclusion  Group Pictures were taken with all the 5 participants, but more importantly, with Winners and Runners Up as well. Following this, a small vote of thanks was given, and the Event was concluded. \r\n\r\nRules : \r\nThe event will be divided into 3 rounds. Participants are requested to be present 10 mins prior to the allotted time.\r\nYou will be given the clues as and when the rounds progress. The Clues and Hints will be provided to you in the form of Password Protected PDFs. The answer of each Hint will be the Password to open the next Password Protected PDF containing the next hint.\r\nUnless mentioned otherwise, all the passwords have to be entered in lowercase, without any capitalization. If the Answer to a hint has spaces in it, the password for the next PDF will be the exact same, with Spaces as it is. The answers to final Clues of Round 2 and Round 3 Need to be texted personally to Event Heads, once you have solved them, on WhatsApp Personal Chat.  Participants are requested to keep a Notebook, Pen/Pencil handy, as they may be required to solve some hints faster. Participants are also requested to keep their Mobile Phones nearby. The first 60% of the participants to crack all the clues in Round 1 will be qualified to Round 2. The first 5 participants to crack all the clues in Round 2 will be qualified to the Final Round 3. The first participant to complete the Final Round will be crowned as the Winner. The second participant to complete the Final Round will be declared Runner Up. In case of any doubts, queries or issues during the event, please contact Event Heads directly over WhatsApp Text, or a Phone Call. Please do not hesitate to contact any of the Event Heads, and clear your doubts as soon as possible! Reasons like No Internet Connection or Poor Connectivity during an event will not be entertained. All the participants should be present from the first round and at the commencement of any rounds or shall face disqualification. Any communication with other participants during the event will directly lead to disqualification. Participants shall not disclose any hints or answers on the zoom meeting or whatsapp group. Doing so will lead to disqualification. Tampering with the clues and logistics in the event will directly lead to disqualification. Participants arguing with the Event Heads, causing disruption in the flow of the event, in case of any situation will be disqualified. For any and all disputes and issues, the decision of the Event Heads will be final and has to be accepted by all the participants.', 'The Event of Treasure Hunt was conducted efficiently, without any glitches, disruptions or untoward incidents, and achieved the objective of educating participants about various things, such as Space, Interstellar travel, Encryption, Decryption, Cryptography, etc. in a fun and entertaining way.\r\n\r\n', 'Ms. Nisha Vanjari\r\nAssistant Professor-Department of Computer Engineering\r\nEmail: nvanjari@somaiya.edu\r\n\r\nMr. Uday Rote\r\nAssistant Professor - Department of Information Technology\r\nEmail: udayrote@somaiya.edu\r\n', 'Sponsors Banner being displayed during the Event', 'A small video segment being shown regarding the Storyline', 'Continuation of the Video Segment', 'Continuation of the Video Segment', 'pic 1.jpg', 'pic 2.png', 'pic 3.png', 'pic 4.png', 'Banner.jpg', NULL, NULL, NULL),
(55, 'Chess', 'Computer Society of India (CSI)', '2021-03-15', '6:30 PM', 'Online', 'Students', 57, 53, ' The main motive of our chess tournament was to enlighten as many people as we can with the knowledge of chess, which will strengthen their analytical, logical and mathematical skills, which will help them in other walks of career as well. And to provide a chance to all the students to showcase their skills as well.\r\n', 'NA', 'Rules and Instructions:\r\nThe participant should have a chess.com username All the participants should join the Whatsapp group after registration of the event.\r\nAll the standard chess competition rules will be followed throughout the tournament. This event will be conducted in a knockout phase and the number of rounds will be informed on the Whatsapp group itself. Following will be the time-control of the matches : Blitz (5+3) for all the knockout rounds. Two rounds will be conducted in both finals and semifinals: Blitz (5+3) and Rapid (10+0). In case of a draw between players, a blitz (3+2) will be conducted to decide a winner. In case any of the participants is found to disobey the standard rules or usage of Chess engines will be straightaway disqualified from the tournament.  All the participants are supposed to send a screenshot of the result of their respective matches after each round. If a player loses due to reasons regarding internet connection, we wont be responsible for the following.  A form will be circulated in the tournaments Whatsapp group, all the participants should fill it with their respective chess.com username. In case of any other queries, please contact the event heads. The first-place winner will be rewarded with prizes worth 3000 Any kind of violent, NSFW conversation while the match or during the tournament will not be tolerated and will lead to direct  isqualification from the tournament.  The organizers decision will be the final decision. Disruption of the events flow will result in direct disqualification.\r\n', 'Chess tournament was successfully conducted by the event heads and their respective team members. The tournament led to a successful participation of a lot of students which led to an increase in the number of students into a logical and analytical game of Chess, which will further help them in other aspects of their career. Participants also gained the experience of participation in social activities. Also enlightened about new platforms like Zoom and chess.com.\r\n', 'Ms. Nisha Vanjari\r\nAssistant Professor-Department of Computer Engineering\r\nEmail: nvanjari@somaiya.edu\r\n\r\nMr. Uday Rote\r\nAssistant Professor - Department of Information Technology\r\nEmail: udayrote@somaiya.edu\r\n', 'Sponsors', 'User Page', 'Starting Page', 'Winners', 'pic 1.png', 'pic 2.png', 'pic 3.png', 'pic 4.png', 'Banner.png', NULL, NULL, NULL),
(118, 'Innovation in Cyber Security', 'Cyber Security and Research Cell ', '2021-04-15', '4:00 PM', 'Online', 'Students ', 54, 20, 'Student\'s are able to know: \r\n1)What is cyber security? \r\n2) Common Cyber threats.\r\n3)Rise in cyber attack. \r\n4) Training students how to detect ransomware attack, analyzing it, reducing the risk and preventing it. ', 'Mr. Aadarsh Kant, Cyber Security Researcher, Cyber Forensics Investigator, Penetration Tester, Cyber Security Auditor, Business Developer, Entrepreneur.', 'Dr. Vaishali Gaikwad welcomed the participants, introduced the speaker to the audience and coordinated the workshop.\r\nThe expert speaker, Mr. Adarsh Kant started the session by explaining the concept of Ransomware and Penetration Testing.\r\nJignasha Dalal gave vote of thanks to the speaker, participants and KJSIEIT. \r\nThe lecture was followed by a Question-Answer session, facilitating the participants to get inputs from speakers on their queries related to the topic of the lecture. All speakers addressed the questions and provided their valuable recommendations for the same to the participants.', 'Students will be able to: \r\n1. Apply ethical principles and commit to professional ethics, responsibilities, and norms of the engineering practice towards the society. \r\n2. Enhance communication and ability to apply modern tools and technology applying Ransomware and Crypto Currency.\r\n3. Investigate forensics case in independent and life-long learning in the broadest context of technological change through Ransomware and Penetration testing.\r\n4. Engineering knowledge in developing and designing solutions for different problems through the security.\r\n', 'Dr. Vaishali Gaikwad, Convener-CSRC, Assistant Professor, IT\r\nProf. Jignasha Dalal, Coordinator-CSRC, Assistant Professor, COMP', 'Speaker\'s Presentation', 'Participants', '', '', 'Speaker\'s presentation.jpeg', 'Participants.png', '', '', 'Innovation in Cyber Security.jpg', NULL, NULL, NULL),
(96, 'Gate preparation tips', 'Training and Placement Committee', '2021-04-16', '5:30 PM', 'Online', 'All FE, SE, TE, BE students and faculties', 32, 5, 'To prepare students for GATE preparation', 'Mr. Jaydeep Pawar', 'Mr. Jaydeep has given tips to students for preparation of GATE and suggested following books for preparation. \r\n1. For Algorithms: book by CLRSCormen, textbook practice problems\r\n2. For COA: book by Hammature\r\n3. For CN: Book by Forozen, Tanenbaum; Sumary from Forozen is good for revising CN concepts \r\n4. For DBMS: Book by Sudarshan; solve exercise, Book by Navathe-for indexing DBMS\r\n5. For OS: Boom by Galvin (preferred), then book by W Stalling\r\n6. Solve previous year GATE questions for udnertsanding for concepts\r\n7. For compiler: Book by Holeman\r\n7. For Discrete Math-textbook problems\r\n', 'AT the end of webibar students will be able to \r\n1: Study well for GATE\r\n2: Effectively manage time for preparation for GATE\r\n3: Understand how to Revise main concepts beofre exam ', 'Ms. Jignasha Dalal\r\nMs. Pradnya Patil\r\nProf. Mansi Kmabli\r\nTraining and Placement Committee', '', '', '', '', '2.jpg', '1.jpg', '', '', 'WhatsApp Image 2021-04-07 at 5.19.29 PM.jpeg', NULL, NULL, NULL),
(121, 'Cyberware Attacks & Its Mitigation', 'Cyber Security and Research Cell ', '2021-04-24', '4:00 PM', 'Online', 'Students ', 33, 19, '1. To investigate cyber attacks in independent and life-long learning in the broadest context of technological change through cyber crime investigation methods.\r\n2. To make students familiar with Cyber Security.\r\n3. To get insight into kinds of cyber crime happening and precautions to prevent them for mitigation.\r\n', 'Adarsh Kant, Cyber Security Researcher, Cyber Forensics Investigator, Penetration Tester, Cyber Security Auditor, Business Developer Entrepreneur', 'Dr. Vaishali Gaikwad welcomed the participants, introduced the speaker to the audience and coordinated the workshop.\r\nThe expert speaker, Mr. Adarsh Kant started the session by explaining the concept of Ransomware and Penetration Testing.\r\nProf. Jignasha Dalal gave vote of thanks to the speaker, participants and KJSIEIT. \r\nThe lecture was followed by a Question-Answer session, facilitating the participants to get inputs from speakers on their queries related to the topic of the lecture. All speakers addressed the questions and provided their valuable recommendations for the same to the participants.\r\n', '1. Able to apply engineering knowledge in developing and designing solutions for different   problems through the cyber security steps.\r\n2: Able to apply ethical principles and commit to professional ethics, responsibilities, and norms of the engineering practice towards the society. \r\n3: Enhance the communication of and ability to apply modern tools and technology apply for mitigation of cyber attacks.\r\n4: Ability to investigate ransomware in independent and life-long learning in the broadest context of technological change through cyber crime investigation methods.\r\n\r\n', 'Dr. Vaishali Gaikwad, Convener-CSRC, Assistant Professor, IT\r\nProf. Jignasha Dalal, Coordinator-CSRC, Assistant Professor, COMP\r\n', 'Speaker\'s presentation', 'Demonstration of Ransomware Attack', 'Workshop Participants', '', 'Speaker\'s Presentation.jpg', 'Demonstration of Ransomware Attack.jpg', 'Workshop Participants.jpg', '', 'Banner.jpeg', NULL, NULL, NULL),
(150, 'Effective Approaches for Development of Innovative Projects', 'Department of Information Technology', '2021-04-26', '6:00 PM', 'Online', 'SE, TE, BE Students', 127, 0, 'AO1: To understand the process of selecting innovative project ideas.\r\nAO2: To understand the process of project development in industry.\r\nAO3: To learn project progress tracking in a group.', 'Ms. Anupriya Srivastava, Assistant Vice President, Ugam Solutions Private Limited, Mumbai, India. ', 'Prof. Reena Lokare welcomes the speaker and the participants. Head of the department-Dr. Radhika Kotecha addressed the participants with the highlights of the event and explained the aim of organizing the event to the speaker as well.\r\nThe speaker, Ms. Anupriya Srivastava, started the session by explaining students how projects are being developed, tracked successfully in the organization. She also explained the role of stakeholders in project development. She also gave examples of stakeholders involved in project development directly or indirectly. \r\nSpeaker explained how progress of the project is being tracked in the industry. She also explained how to select project development methodology for a project and thrown a light on available project development methodologies. \r\nLastly she explained the importance of project documentation. How documentation is done in the industry, is also explained with the help of examples by the speaker. \r\nThe session ending with the series of question answers by the participants. Speaker explained all the doubts and session ended by thanking the speaker and inviting her for future project-related activities by the head. \r\n', 'Students were able to-\r\n1. Select innovative project idea.\r\n2. Get an idea of project development process in industry.\r\n3. Understand project progress tracking for effective team work. ', 'Prof. Reena Lokare, Assistant Professor, Department of Information Technology', 'Introduction to the topic', 'Idea of project', 'Project management techniques', '', 'Capture1.PNG', 'Capture2.PNG', 'Capture3.PNG', '', 'Slide1.PNG', NULL, NULL, NULL),
(51, 'Setting up AR/ VR Projects with Unity 2020 LTS', 'Institution of Electronics and Telecommunication Engineers (IETE)', '2021-03-19', '4:00 PM', 'Online', 'students', 60, 0, 'To explain students about AR/VR technologies and exploring packages such as the XR Interaction Toolkit and AR Foundation in the recently released LTS version of Unity Editor.\r\n', 'Mr. Aniruddha Hardikar\r\nSolutions Engineer,Unity Technologies\r\n', 'Introduce a quick start workflow for setting up AR/ VR projects with the recently released LTS version of the unity editor, with packages such as the XR interaction toolkit and AR foundation.\r\n\r\n\r\n', 'After the workshop, participants will be able to :\r\nUnderstand how to navigate the Unity app and control AR/VR objects via scripts.\r\nConfigure a Unity Project for AR/VR development.\r\nDevelop interactive mechanics.\r\nIntegrate scripts to create a controller with keyboard and touch input.\r\nPublish AR/VR applications for various platforms.\r\n', '1)Prince Gada , TE-Comp, IETE-ISF at KJSIEIT\r\n2)Hussain Lokhandwala,TE-Comp, IETE-ISF at KJSIEIT\r\n', 'Group Picture with Resource person', 'Banner for AR/VR projects', 'Mr Anirudh Explaining about VR', 'Mr Anirudh Explaining about VR', 'Screenshot (104).png', 'Screenshot (76).png', 'WhatsApp Image 2021-03-19 at 18.10.19 (2).jpeg', 'WhatsApp Image 2021-03-19 at 18.10.42.jpeg', '51.jpg', NULL, NULL, NULL),
(12, 'Career opportunities in Telecom Sector', 'Department of Electronics and Telecommunication Engineering', '2021-03-13', '4:00 PM', 'Online', '', 77, 0, '	Webinar aims to address the Electronics and Telecommunication Engineering students in prospective of career opportunities in Telecom sector.\r\n	 Webinar also aims to impart the knowledge regarding the skill set required to seek the Telecom industry jobs Introduce new upcoming technologies and its applications in market to the students. \r\n', 'Mr. Anupam Upadhyay ,Senior Buyer at British Telecom Gurgaon, Haryana, India (2008 EXTC Alumnus).is at present a Senior Buyer at British Telecom, Gurgaon, India from Mar 2018  Present, Closely handling the following activities\r\n1.working with Sales/Account team to understand the present/future requirements and build negotiation strategy to create YoY Savings/Efficiencies and support in the Bidding Process.\r\n2. Stakeholder management covering Product, Finance, Sales and the Users who are responsible for spend in the category located across the globe.\r\n3. Drive RFP/RFI activities, supplier selection, supplier due diligence, negotiation, Deal Structuring, contract management.\r\n4. Lead and drive negotiations, commercial terms, finalization & adherence of contract\r\n5. As a Part of Procurement Transformation Programs with a goal of improving Bottom Line, Responsible for improving Data Repository, Standardizing the Saving Targets, Tail Optimization, Renewal program.\r\n6. Spend Managed GBP 50M.\r\nHe worked as Manager Commercial at Ericsson India Global Services Pvt Ltd. Assistant Manager - Global Procurement and Contracts at Tata Communications, Assistant Manager (West SCM: Enterprise Business) at Bharti Airtel Limited and Sr. Associate at Reliance Jio Infocomm Limited. He is an Alumnus of KJSIEIT, EXTC Department, 2004-2008 batch pass out. \r\n\r\n\r\n\r\n\r\n\r\n', 'Mr. Anupam Mr. Anupam Upadhyay, Enlighted students with a technical content on different telecom policies, entities involved in the planning and commissioning of telecom network, security aspects in telecom and associated job opportunities and certification courses. Satisfying an objective of a webinar. He solved all the queries asked by the participants. The webinar was attended by 71 participants. He also wishes to continue his support towards our institute. Mr. Anupam also provided challenges and solutions to the emergent technologies in Telecom sector in the near future. The crux of his presentation encompassed platforms & opportunities available globally mapping it with the road-map of education with skill-sets. There was a question and answer session followed by a thank you note by Prof. Pradnya Kamble. The participants were provided an E-Certificate for their successful participation & completion of feedback formalities of the webinar session.\r\n\r\n', 'The webinar enabled the learners to acquire a relevant outlook on opportunities and skill-sets of for emergent technologies in the domain of Mobile Technology and Cyber Security.\r\n\r\n', 'Mrs. Pradnya Kamble, Assistant Professor, Department of Electronics and Telecommunication Engineering,KJSIEIT', 'Event Group picture with Resource person Mr. Anupam Upadhyay', 'Mr. Anupam Upadhyay explaining the concepts in Telecom', '', '', 'PHOTO-2021-03-13-17-19-39.jpg', 'IMG-8409.jpg', '', '', '', NULL, NULL, NULL),
(19, 'Counter Strike (CS - GO) - Round I', 'Institute of Electrical and Electronics Engineers (IEEE)', '2021-03-16', '6:00 PM', 'Online', 'Students and Faculties all across the nation', 20, 80, '1.	Have some fun in this competitive world\r\n2.	Group play provides social benefits\r\n3.	Promotes teamwork and build confidence', '', 'Event was held succesfully and teams from all over India and also abroad participated in the same.', 'The motive behind this gaming event was to attract people towards E-Sports and develop skills like team-work, sportsmanship. In these difficult times of COVID and lockdown, this online gaming event would bring smiles to everyone and and we made it a successful event with all the up votes.', 'Prof Sandeep Mishra\r\nProf Pranali Hatode', '', '', '', '', 'ss.jpg', 'ss1.jpg', '', '', 'banner1.png', NULL, NULL, NULL),
(20, 'Counter Strike (CS - GO) - Round II', 'Institute of Electrical and Electronics Engineers (IEEE)', '2021-03-19', '5:00 PM', 'Online', 'Students and Faculties all across the nation', 20, 80, '1.	Have some fun in this competitive world\r\n2.	Group play provides social benefits\r\n3.	Promotes teamwork and build confidence', '', 'Event was held succesfully and teams from all over India and also abroad participated in the same.', 'The motive behind this gaming event was to attract people towards E-Sports and develop skills like team-work, sportsmanship. In these difficult times of COVID and lockdown, this online gaming event would bring smiles to everyone and and we made it a successful event with all the up votes.', 'Prof Sandeep Mishra\r\nProf Pranali Hatode', '', '', '', '', 'ss1.jpg', 'ss.jpg', '', '', 'banner1.png', NULL, NULL, NULL),
(18, 'Level Up Games', 'Institute of Electrical and Electronics Engineers (IEEE)', '2021-03-16', '4:30 PM', 'Online', 'Students all across the nation', 30, 25, 'It a set of 6 games and main objective of each game is to answer as many questions as you know. The objective for each individual game is given below  \r\n1.	Logo Quiz - Identify the logo of the company and write the companys name. \r\n2.	Do you have a Sense of Humor - See if your sense of humor is as good as you think it is .\r\n3.	Tag Line - Identify the organization whose tagline has been provided.\r\n4.	Guess Who??  Identify the items related to some famous personalities and guess who it is.\r\n5.	Brain Puzzles  Solve the given puzzles that make you mind go crazy.\r\n6.	Sense out of the Senseless - You will be shown some random phrases and you have to make sense out of it.\r\n', '', 'It is a serious of games which tests your brain power and your ability to reason. It puts your mind in a stressful situation to get the answer to the question and win the game.', 'The event was a great success and all the participants had fun while using their brains to solve the problems and win the games', 'Prof Sandeep Mishra\r\nProf Pranali Hatode', '', '', '', '', 'ss3.png', 'ss4.png', 'ss5.png', '', 'banner2.jpeg', NULL, NULL, NULL),
(21, 'Idea / Paper Presentation', 'Institute of Electrical and Electronics Engineers (IEEE)', '2021-03-19', '4:00 PM', 'Online', 'Students and Faculties of the Institute', 69, 0, 'To provide a platform to participants for presenting their innovative ideas and solutions to real-world problems in the form of papers.', 'Competition', 'The competition was attended by students and faculty members of all departments of the institute.\r\nOverall, the workshop resulted in a superior understanding about Idea / Paper Presentation', 'The competition generated a surge in the involvement of students in development of various innovations by converting ideas into reality.', 'Prof Sandeep Mishra', 'Glimpse - 1 of the Event', 'Glimpse - 2 of the Event', '', '', '1.jpeg', '2.jpg', 'WhatsApp Image 2021-04-29 at 7.03.42 PM (1).jpeg', '', 'Idea  Paper Presentation.jpg', NULL, NULL, NULL),
(22, 'Treasure Hunt', 'Institute of Electrical and Electronics Engineers (IEEE)', '2021-03-17', '3:30 PM', 'Online', '', 80, 30, '1. To build up team participation. \r\n2. To challenge ones general knowledge', '', 'The IEEE-KJSIEIT student body had organized an online\r\nTreasure Hunt event for the students. This event is a team event\r\nwherein the students had to solve unique stand alone puzzles\r\none by one to advance to the next puzzle.The first team to\r\nanswer all the challenging questions will win the event', 'Overall impression of the event was great. Majority of the\r\nparticipants found the questions difficult to crack. As a result the\r\nevent was thoroughly enjoyed by all the students. Almost all the\r\nregistered students participated in this event', 'Prof Sandeep Mishra\r\nProf Pranali Hatode', '', '', '', '', 'WhatsApp Image 2021-04-29 at 7.04.42 PM (1).jpeg', 'WhatsApp Image 2021-04-29 at 7.04.42 PM.jpeg', '', '', 'WhatsApp Image 2021-04-29 at 6.52.15 PM.jpeg', NULL, NULL, NULL),
(23, 'Digital Manufacturing using IOT ', 'Institute of Electrical and Electronics Engineers (IEEE)', '2021-03-17', '5:30 PM', 'Online', 'Students and Faculties all across the nation', 86, 0, 'This webinar is organized by IEEE Students\' Body of K. J. Somaiya Institute of Engineering and Information Technology and delivered by Mr. Dattatraya Kulkarni. Her aim was to shed light upon major topics like Digital Manufacturing AND covered IOT, IIOT, AR/VR, Machine Learning, Artificial Intelligence and Blockchain.', 'Mr. Dattatraya Kulkarni', 'The IEEE Students\' Body of K. J. Somaiya Institute of Engineering and Information Technology (KJSIEIT), Sion, Mumbai had organized a webinar on \"Digital Manufacturing using IOT\" for all the students and faculty members of various departments and institutes. \r\nIn this illuminating session, the speaker, Mr. Dattatraya Kulkarni, shed light upon major topics like Digital Manufacturing AND covered IOT, IIOT, AR/VR, Machine Learning, Artificial Intelligence and Blockchain.\r\n', 'Students got a keen interest in IoT and Digital Manufacturing in this webinar ', 'Prof Sandeep Mishra\r\nProf Pranali Hatode', '', '', '', '', 'ss7.png', 'ss8.png', 'ss9.png', '', 'WhatsApp Image 2021-04-29 at 6.54.06 PM.jpeg', NULL, NULL, NULL),
(92, 'Induction Session of FE to IEEE', 'Institute of Electrical and Electronics Engineers (IEEE)', '2021-04-06', '4:30 PM', 'Online', 'KJSIEIT FE Students', 95, 0, 'To address the FE about IEEE Committee and how the Committee contributes towards developing a technical and learning environment. ', '', 'Information about how a committee functions were discussed and how to become a part of them.', 'The first year students showed great participation and the session was very interactive. Many of their doubts were cleared throughout the session.', 'Prof Sandeep Mishra\r\nProf Pranali Hatode', '', '', '', '', '', '', '', '', 'WhatsApp Image 2021-04-29 at 7.15.40 PM.jpeg', NULL, NULL, NULL),
(122, 'Business Model Canvas', 'K. J. Somaiya Institute of Engineering & Information Technology - Institutions Innovation Council (KJSIEIT - IIC)', '2021-04-23', '4:00 PM', 'Online', 'Faculty and students', 56, 5, 'To understand BMC and develop skills and required analysis for developing it.\r\n', 'Prof. Shrikant Jagatp,\r\nAssociate Professor,\r\nNBN Sinhgad College, Solapur', 'As per the guidelines provided by MoE\'s Innovation Cell (MIC), India, the Workshop on Business Model Canvas (BMC) with Associate Professor, NBN Sinhgad College, Solapur, Prof. Shrikant Jagatp was organized by K. J. Somaiya Institute of Engineering & Information Technology - Institution Innovation Council (KJSIEIT - IIC). \r\nThis workshop has motivated the students to establish their own ventures and better analyze the business ideas to develop business models.\r\n\r\n', 'The attendees learned to analyze a business idea and develop a precise BMC for it, motivating the aspiring entrepreneurs to establish their ventures.', 'Prof. Sejal Shah\r\nMember - KJSIEIT IIC\r\n\r\nDr. Radhika Kotecha\r\nConvener - KJSIEIT IIC\r\n\r\nDr. Suresh Ukarande\r\nPrincipal - KJSIEIT IIC\r\n', 'Glimpse - 1 of the Event', 'Glimpse - 2 of the Event', 'Screenshot 3', 'Screenshot 3', '8--2.jpeg', '8-1.jpeg', 'Screenshot3.png', 'Screenshot5.png', 'BMC banner.png', NULL, NULL, NULL),
(119, 'How to plan for Start-up and legal & Ethical Steps', 'Institution\'s Innovation Council (IIC)', '2021-04-18', '4:00 PM', 'Online', 'Students and Faculties of Institute', 63, 0, 'To impart knowledge of various legal and ethical steps in establishing start-ups linked to the value and success of the enterprise.', 'Mr.Sanket Talathi, \r\nSenior Test Analyst - Cognizant Technology Solutions,\r\nFounder member - Indian Basket', 'As per the guidelines provided by MoE\'s Innovation Cell (MIC), India, the Workshop on How to plan for Start-up and legal & Ethical Steps with Senior Test Analyst at Cognizant Technology Solutions and Founder member of Indian Basket Mr. Sanket Talathi was organized by K. J. Somaiya Institute of Engineering & Information Technology - Institutions Innovation Council (KJSIEIT - IIC). \r\n\r\nThe workshop has given directions about starting a new venture and participants also got the knowledge about what are the legal and ethical aspects involved in start up. \r\n\r\n', 'All the participant got the idea of how to do the start-up and the basic steps involved in doing successful start-up. Also paticipants came to know various legal and ethical aspects involved in a start-up.', 'Mrs. Minal Sonkar, \r\nMember, KJSIEIT - IIC\r\n\r\nDr. Radhika Kotecha,\r\nConvener - KJSIEIT IIC\r\n\r\nDr. Suresh Ukarande,\r\nPrincipal - KJSIEIT IIC', 'Glimpse - 1 of the Event', 'Glimpse - 2 of the Event', 'Challenges in start-up', 'Challenges in start-up', 'Business Model.png', 'Legal and Ethical steps.png', 'challenges.png', 'Success story of speaker.png', 'IIC-Banner.jpg', NULL, NULL, NULL),
(48, 'Web Scraping and Automation using Python', 'Institution of Electronics and Telecommunication Engineers (IETE)', '2021-03-20', '4:00 PM', 'Online', 'students', 83, 52, 'To explain students Web Scraping and Automation using Python.\r\n', '1)Aziz Bohra,  IETE Student member\r\n2)Vaibhav Lakhani ,IETE Student member', 'This workshop taught participants the basics of Python and then explained them how to scrape data from the Web and automate the entire process. Also the participants were able to learn of creating a WhatsApp bot using Python.', ' Students learnt about:\r\nPython Basics \r\nWeb Scraping using bs4. \r\nAutomation using Selenium.\r\nDemonstration of WhatsApp Bot.\r\n', '1. Medha Asurlekar ,Asst Professor ,IETE Convener, Department of Electronics Engineering\r\n2.Aziz Bohra,  IETE Student member\r\n3)Vaibhav Lakhani ,IETE Student member', 'Walkthrough over Functions in Python', 'How to build whatsapp Bot', 'Web Scraping using bs4', 'Web Scraping using bs4', 'Screenshot (330).png', '66unknown.png', '2unknown.png', 'Screenshot 2021-03-20 161011.png', '48.jpg', NULL, NULL, NULL),
(50, ' Binge Bingo', 'Institution of Electronics and Telecommunication Engineers (IETE)', '2021-03-21', '3:02 PM', 'Online', 'students', 55, 0, 'To test the alertness and problem solving skills of the students through a fun event. To also provide a platform for healthy competition among students.\r\n', '', 'Binge Bingo was a game of traditional housie with a slight, fun twist. Participants had a bingo ticket with 15 names of famous movies and web series each. Each movie and web series had a clue which had a clue. Clue numbers were called at random, and the clues were displayed according to the numbers called. The participants had to guess the movie or web series from the clue and strike it out if it was present in their ticket. \r\nTraditional housie prizes were there like:\r\nFast Five\r\nFour Corners\r\n1st Row\r\n2nd Row\r\n3rd Row\r\n1st Full House\r\n2nd Full House\r\n3rd Full House\r\nLucky Number 1\r\nLucky Number 2\r\n', 'Students developed the following skills:\r\nProblem-solving\r\nCompetitive spirit\r\n', '\r\n1)Prince Gada, IETE Student Member\r\nAziz Bohra IETE Student Member\r\n\r\n', 'Event group screen shot', 'Guessing the TV show', 'Guessing the Movie', 'Guessing the movie by listening to an audio clip', 'Screenshot (108) (1).png', 'Screenshot (105).png', 'Screenshot (106).png', 'Screenshot (107).png', '50.jpg', NULL, NULL, NULL),
(95, 'How to Choose your Career and Abroad Education Opportunities', 'Institution of Engineering and Technology (IET)', '2021-04-10', '4:00 AM', 'Online', 'Faculties and Students', 76, 0, '	Choosing your desired Career field\r\n	Career prospects: India Vs Abroad\r\n	Creative Career fields and scope\r\n	Unconventional Career Options \r\n	How to build your profile to target Top Universities\r\n	Introduction to Abroad Education & process for countries like USA, UK, Canada, Australia, Europe, etc\r\n\r\n\r\n', 'Mrs.Vini Shah', 'K. J. Somaiya Institute of Engineering and Information Technology (KJSIEIT) Sion, Mumbai, IET organized a live session on \'How to choose your Career and Abroad Education Opportunities\' for the students and faculty presented by Aara Education Consultancy. Aara is a unique Education Consultancy Group, it performs a detailed and comprehensive analysis of the attributes and expertise possessed by the candidate and then provides them with the best and suitable career advice. We have successfully counselled more than 100 students into choosing their respective careers to perform efficiently in their course of careers. We provide end to end solutions with various services namely Overseas Admission and counselling, Visa Assistance, Preparation of Statement of Purpose (SOPs) and Letter of Recommendation (LOR).\r\nIn this session,students from various colleges asked various questions related to their career and higher education, while the Speaker answered them well so that students could clarify their doubts.\r\n', '1.	Students asked their doubts and questions related to their career prospects and choices they should make for Indian and Abroad higher education\r\n2.	They got a lot of advice and clarity regarding their doubts and confusion.\r\n3.	It was very beneficial to the students as they were now clear with what decisions they should be taking for their higher education in India or Abroad.\r\n\r\n', '1.Prof.Chitra Bhole, Assistant Professor\r\n2.Dr.Vaishali Gaikwad, Assistant Professor', 'Speakar Session', 'Speaker addressing the students doubts ', '', '', '2.jpg', '1.jpg', '', '', 'aara.jpg', NULL, NULL, NULL),
(111, 'Career Opportunities in Indian Defense Research and Development Organization (DRDO)', 'CAREER OPPORTUNITIES FOR ENGINEERS IN PUBLIC SECTOR CELL (COEPS CELL)', '2021-04-19', '4:55 PM', 'Online', '', 28, 70, 'It will also help the students to know more of the Indian Research and Development Organization and its measures.\r\nThe speaker will also introduce various opportunities for students in Indian Defense Research and Development Organization (DRDO)\r\n', 'Mrs.Yamuna Shivprasad', 'To get knowledge about various researches in DRDO and their contribution in COVID-19 pandemic. \r\nResearches done in defense sector.\r\nKnow more about career opportunities in Development and Research organization after graduation. ', 'The interest of participants to pursue research for development. \r\nIdeas on development for healthcare, agriculture, education, surveillance, education, security, etc were discussed in the webinar.', '1.Prof Sandhya Deshpande, Assistant Professor, Dept. of EXTC', '', '', '', '', 'WhatsApp Image 2021-04-11 at 8.30.33 PM.jpeg', 'WhatsApp Image 2021-04-19 at 2.42.24 PM.jpeg', 'Screenshot (129).png', 'Screenshot (124).png', 'WhatsApp Image 2021-04-11 at 8.30.33 PM.jpeg', NULL, NULL, NULL),
(57, 'Merge It UP(Technical Event)', 'Institution of Engineering and Technology (IET)', '2021-03-20', '3:30 PM', 'Online', 'students', 30, 0, '	To inculcate a tendency to be fast and efficient in coding in the students\r\n	To make students aware of the principles and logic of coding\r\n	To utilize the free time in pandemic to brush up the coding skills of the students\r\n	To create an environment for students where they learn to compete in online mode in an ethical and fair manner.\r\n', '', 'The event was divided into 2 groups, one for FE and the other for SE-TE-BE combined. Each candidate was provided a Google Drive folder link which consisted  of 3 files : \r\n1. 8 problem statements.\r\n2. Surveillance meet link.\r\n3. Locked treasure file.\r\nCandidates had to solve problem statements to obtain expected outputs.\r\n  After obtaining all the outputs , candidates have to merge all those outputs into a valid string.\r\n  The string which will be formed using all the outputs is the password to unlock the treasure file of gift coupons.\r\n  The first candidate has to open the treasure file and will be considered as the winner. So, the event terminates then and there.\r\nNOTE:\r\n1.	Each code will be served into the following languages => C,C++,JAVA and PYTHON , so that candidates can debug the codes in their preferred language.\r\n', '1.	Winners were selected on the basis of corrected output submitted by them\r\n2.	They were awarded internships in a startup company.\r\n3.	Students understood where they stand in the crowd in regards to their coding skills and where they need to improve.\r\n', 'Prof.Chitra Bhole', 'Merge it up Competition', 'Students in Competition', 'Students in comepetition', '', '3.jpg', '4.jpg', '5.jpg', '', '', NULL, NULL, NULL),
(81, 'Creative Lockdown', 'Institution of Engineering and Technology (IET)', '2021-03-20', '3:30 PM', 'Online', 'Students', 36, 0, '	To bring out the hidden creative skill or talent of students\r\n	To give an opportunity to students to get exposed to various forms of art and appreciate it\r\n	To let students practice and compete with their artistic talent in a fun and loving community\r\n', '', 'Agenda:\r\nPost your clip or picture regarding any creativity skill such music, art or dance that you have. The post owner gets the prize who has maximum likes on his post by the visitors. A single participant can have multiple entries and can showcase other forms of artwork too which are not mentioned above. \r\nThe events will be open to Junior and Degree college students where everyone can submit a maximum of three (category independent) acts/pieces of work and it can be submitted as an individual or as a team (wherein the total number of members cannot exceed 3\r\nThe categories allowed were:\r\n-	Painting / Art\r\n-	Dance\r\n-	Singing / Performing (includes instruments and other such acts)\r\n-	Speeches / Monologues \r\n-	Stand-up Comedy / Mimicry \r\n-	Craft / Handiwork\r\n-	Poetry / Essays \r\n-	Modelling / Cosplay\r\n', '1.	Winners were selected on the basis of Instagram likes their post had got\r\n2.	They were awarded various cash prizes \r\n3.	Students were brought in touch with various other artists who share common interests.\r\n\r\n', 'Dr.Vaishali Gaikwad', 'Students Participation', 'Students Participation', 'Students Participation', '', '6.jpg', '7.jpg', '8.jpg', '', '', NULL, NULL, NULL);
