(88, 'Business Plan/Prototype to Invite Innovative Business Models from Students', 'K. J. Somaiya Institute of Engineering & Information Technology - Institution Innovation Council', '2021-04-03', '1:00 PM', 'Online', 'KJSIEIT Students ', 124, 0, 'To aim for development of entrepreneurship skills with business plan that will reflect fundamental change via innovation.', 'Ms. Radhika Laddha, \r\nAssociate Project Manager, \r\nFyntune Solutions. ', 'As per the guidelines provided by MoE\'s Innovation Cell (MIC), India, the Competition on Business Plan/Prototype to Invite Innovative Business Models from Students with Associate Project Manager at Fyntune Solutions Ms. Radhika Laddha  was organized by K. J. Somaiya Institute of Engineering & Information Technology - Institutions Innovation Council (KJSIEIT - IIC). \r\n\r\nThis competition has given students brief idea for developing business model and made them to think creatively. \r\n', 'The competition ignited innovative ideas through brainstorming for establishing business model, enriching domains of critical thinking for businesses.', 'Dr. Vrushali Deole,\r\nMember - KJSIEIT IIC\r\n\r\nDr. Radhika Kotecha,\r\nConvener - KJSIEIT IIC\r\n\r\nDr. Suresh Ukarande,\r\nPrincipal - KJSIEIT IIC\r\n', 'Glimpse - 1 of the Event', 'Glimpse - 2 of the Event', '', '', '7_1.jpg', '7_2.jpg', '', '', '7.jpeg', NULL, NULL, NULL),
(85, 'AlumNite 21', 'Alumni Committee (ALCOM)', '2021-04-24', '8:00 PM', 'Online', 'KJSIEIT Alumni', 270, 0, 'The Institute for the first time, organized its first everKJSIEIT -VIRTUAL ALUMNITE21 on 24th April, 2021 from 8.00pm-10.00 pm. The grand annual feature had a theme of \'Keep -in -Touch\'! The evening witnessed a vibrant celebration with our illustrious Alumni with live interaction with fun experience & performances by Alumni & in-house students. \r\nThe student anchors for the event wereNitya Davalia, Kinjal Vaghasia & Sankesh Shah all from TE EXTC. \r\nObjectives: The AlumNite21 was aimed to:\r\n1.	To connect and create dedicated and committed community of KJSIEIT alumni to support the institution in its quest to become a premier Institution.\r\n2.	To motivate alumni to participate in various institute activities\r\n3.	To keep the Alumni records updated in database.\r\n4.	To ensure Alumni are kept updated about the different ventures and activities of college. \r\n', 'NA', 'Key Points: The traditional Somaiya campus prayer was followed the display of a nostalgic video of the campus.  Dr. Vrushali Deole through a welcome note apprised the Alumni Committee (Alcom) activities undertaken during 2019-2020. Vice-Principal Dr. Sunita Patil applauded the efforts of Alumni in all ventures. She appreciated the endeavours of the Alumni to contribute towards the progressive vision of the Institute. Principal Dr. Suresh Ukarande appealed the Alums for the Helping Hand scheme as well as expressed the expectations from the Alumni to be a productive contributory part of autonomy status, recently conferred upon the Institute. The felicitation of Star Alumni was a remarkable occasion, its details as under:', 'Outcomes: \r\n1.	The AlumNite witnessed felicitation of the Star Alumni of each department for their outstanding contribution to the society & their alma mater. \r\n2.	The events were marked with Alumni interactive sessions with an aim to benefit the Institute in milieu of establishing region-specific groups (national and international through surveys etc) useful for in-house career networking, funding etc. This results in attainment of the NAAC/NBA criteria of having to retain the best practices of Alumni, including the surveys conducted during the Covid-19 pandemic\r\n\r\n', 'Dr. Vrushali Deole', '', '', '', '', '', '', '', '', 'Alumnite Banner.png', NULL, NULL, NULL),
(52, 'Rocket league', 'Computer Society of India (CSI)', '2021-03-14', '1:00 PM', 'Online', 'Students', 14, 18, '-	To Learn a competitive game mode based on teamwork and outmaneuvering opponents.\r\n-	Rocket League is a technical game that involves both high-level dexterity and fast-paced gameplay.\r\n-	Rocket League requires a tremendous amount of critical thinking, communication, collaboration, and creativity from players to achieve and sustain success. \r\n\r\n', 'NA', 'Introduction: Before the tournament started we had a Zoom meeting at 12:30 pm where a total of 24 Participants joined in, to discuss all the rules and regulations of the tournament with a display of the Event Sponsors. The doubts of the participants, regarding the rules and the conduction of the event were cleared as well.\r\n-	Round 1: The Round 1 of the event Started at 1:00 pm to 3:00 on 14/3/21, 16 teams were drawn into 8 matches against each other.All the matches were Best of 3.Teams joined the discord channels before the matches and were directed to join the party in game.Each match was of 5 mins &  winning 8 teams were sent into the next round.\r\n-	Round 2: The Round 2 began at 3:00 pm and 4 matches were conducted between the winning teams of round 1.Similar to round 1 round 2 was also best of 3.Round 2 was streamed live on our CSI discord server. Round ended at 4:00 pm and the 4 winners of this round were sent into the semi finals i.e Round 3. \r\n-	Semi Finals (Round 3): Semi Finals had started at 4:00 pm till 4:45, where 2 matches were played.Semi Finals was streamed live on our CSI discord server.Those were very close matches but we got our 2 winning Teams which were sent into the Finals.\r\n-	Finals: FInals were commenced on the second day i.e. 15/3/21 at 5:30 till 6:00 pm.Both teams gave their best but at last 1 team had to win & we got our winner for the tournament that Duo was of Manav and  Derrick.They scored a 4:2 in their first match and 2:1 in their second match.\r\n\r\n', '-	Schools and players in high school have had a great experience with the game, and continue to experience its benefits.\r\n-	Esports bring out the best in people and really show the flame of passion that people have towards a game where it takes grit and grime to play at a competitive level.\r\n\r\n', 'Ms. Nisha Vanjari\r\nAssistant Professor-Department of Computer Engineering\r\nEmail: nvanjari@somaiya.edu\r\n\r\nMr. Uday Rote\r\nAssistant Professor - Department of Information Technology\r\nEmail: udayrote@somaiya.edu', 'Final match 1', 'Final match 2', 'Round 1', 'Round 1', 'pic 1 - final match 1.png', 'pic 2 - final match 2.png', 'pic 3 - round 1.png', 'pic 4 - goal screenshot.png', 'RL banner.png', NULL, NULL, NULL),
(9, 'Prototype Development using Raspberry Pi', 'Department of Electronics and Telecommunication Engineering', '2021-03-13', '03:00 PM', 'Online', 'Students and Faculties of the Institute', 55, 0, 'To enable students to convert their ideas into prototypes.\r\n', 'Mr. Utkarsh Tiwari, \r\nAssistant Manager, Jio, Mumbai\r\n', 'This workshop enabled students to convert their ideas into prototypes.\r\nThe workshop was attended by students and faculty members of all departments of the institute.\r\nThe talk was followed by Question-Answers and the speaker solved queries of all the participants and served as a huge motivation.\r\nOverall, the workshop resulted in a superior understanding about Prototype Development using Raspberry Pi.\r\n\r\n', 'Students learned to develop prototypes for various societal and environmental problem along with training in relevant technical domain.\r\n ', 'Prashant Upadhyay\r\nAssistant Professor,\r\nDepartment of Electronics and Telecommunication. \r\n\r\nDr. Radhika Kotecha\r\nConvener - KJSIEIT IIC\r\n\r\nDr. Suresh Ukarande\r\nPresident - KJSIEIT IIC\r\n', 'Glimpse - 1 of the Event', 'Glimpse - 2 of the Event', '', '', '1_jpeg.jpeg', '2_jpeg.jpeg', '', '', 'Prototype Development using Raspberry Pi.jpeg', NULL, NULL, NULL),
(34, 'COD Mobile', 'Computer Society of India (CSI)', '2021-03-14', '3:00 PM', 'Online', '', 19, 0, 'To Build Teamwork, communication, strategy, and sportsmanship can be learned through participating in organized esports. Cognitive & Social Developmeny\r\nCollegiate Scholarships\r\nCollegiate Scholarships\r\nProblem Solving Skills', '', 'Call of Duty is a 2003 first-person shooter video game developed by Infinity Ward and published by Activision. It is the first installment in the Call of Duty franchise, released on October 29,2003.In the 1st Round  There are 12 teams participating, round 1 will be conducted as knockout in Team Deathmatch, 12 out of the one team directly qualified for the final, and the rest of the 4 teams qualified for the playoffs (2nd round). In the 2nd Round  There are 4 teams qualified for the playoffs and the second round will be conducted as Double Elimination in Team Deathmatch\r\nRules:\r\n1. Schedule of only those teams will be announced who have filled the google form and joined the WhatsApp group and discord server.\r\n2. No Emulators will be allowed.\r\n3. No Hacks or Cheats will be allowed.\r\n4. Maps will be random so make sure you download all the maps.\r\n5. Flow of the tournament will be as follows: Round 1: Knockouts (Team Deathmatch) Round 2:\r\nDouble Elimination (Team Deathmatch) Round 3: Finals (Team Deathmatch & Search and Destroy)\r\n6. If an odd no. of teams is left after Round 1 then the team with the most points difference will qualify for finals.\r\n7. In finals based on total points of Team Deathmatch & Search and Destroy, the winner will be declared.\r\n8. Time slots once allotted to the team will not be changed under any circumstances.\r\n9. Teams must be ready 15mins before the allotted time.\r\n10. Teams failing to be ready on the allotted time be disqualified.\r\n11. In case a team member is not available at the moment then the Leader must inform the event heads and submit the id proof, IGN name and discord name of the substitute player before the match.\r\n12. Team captains will be called for veto and side selection 15 mins\r\n13. In case if the player is facing network problems/low client fps/disconnected the match will not stop. \r\n14. All the matches will be full length i.e., 1st team to score 40 kills.\r\n15. All the teams have the liberty to forfeit or surrender the match if they want to.\r\n16. Since we promote fair play, we request each and every player to not spam or abuse your opponents in the chats.\r\n17. Warning will be issued on abuse and spam but if the teams continue to do so then they will be disqualified.\r\n18. The decision of the management will be final and have the complete rights to disqualify a team on any grounds without their discretion.', 'Able to work with team.', 'Mr.Tomal Gosh,BE IT\r\nProf.Prashant Sawant,Department of  IT\r\nProf.Uday Rote,Department of IT', '', '', '', '', 'assss.JPG', 'winn.JPG', '', '', 'banner.JPG', NULL, NULL, NULL),
(158, 'Design Thinking', 'Department of Information Technology', '2021-05-01', '2:00 PM', 'Online', 'Students of Information Technology Department', 81, 0, 'To enhance proficiency in designing innovations considering public health, safety, cultural, societal, and environmental issues.', 'Prof. Vaibhav Kulkarni\r\nMr. Kulkarni is  associated with NK Orchid College of Engineering & Technology, Solapur in the capacity of Head E-Cell & Institute Innovation Council. \r\nHe is a Design Evangelist trained by IIM Lucknow on Establishing  Innovation & Startup Ecosystems in Technical Institutes.\r\nHe has 18+ Years of Experience including Teaching and Industry as well. \r\nSince 2013 he is Working closely in Association with Corporates as  a TPO and E-Cell In charge.\r\nHe has 4 Patents Filed and Published.\r\nHe is an Anchor also for Live Broadcasting Events of Doordarshan.\r\n', 'Design thinking is a process for creative problem solving. Design thinking has a human-centered core. It encourages organizations to focus on the people they\'re creating for, which leads to better products, services, and internal processes; And it redefines problems in an attempt to identify alternative strategies and solutions that might not be instantly apparent with our initial level of understanding.\r\n\r\nDesign Thinking revolves around a deep interest in developing an understanding of the people for whom were designing the products or services. It helps us observe and develop empathy with the target user. Design Thinking helps us in the process of questioning: questioning the problem, questioning the assumptions, and questioning the implications. \r\n\r\nDesign Thinking is extremely useful in tackling problems that are ill-defined or unknown, by re-framing the problem in human-centric ways, creating many ideas in brainstorming sessions, and adopting a hands-on approach in prototyping and testing. Design Thinking also involves ongoing experimentation: sketching, prototyping, testing, and trying out concepts and ideas.\r\n\r\nThe five phases of Design Thinking are as follows:\r\n1. Empathize:  with your users\r\n2. Define: your users needs, their problem, and your insights\r\n3. Ideate:  by challenging assumptions and creating ideas for innovative solutions\r\n4. Prototype: to start creating solutions\r\n5. Test: solutions\r\n\r\nIt is important to note that the five phases, stages, or modes are not always sequential. They do not have to follow any specific order and can often occur in parallel and repeat iteratively. Given that, you should not understand the phases as a hierarchical or step-by-step process. Instead, you should look at it as an overview of the modes or phases that contribute to an innovative project, rather than sequential steps.\r\n', 'Participants have: \r\n1. Understood insights of Design Thinking\r\n2. Been able to create Efficient Design Problem Statements using Activity Cards.\r\n3. Understood difference between Traditional and Design Approach.\r\nParticipants will be able to generate easy solutions to complex real world problems using Design Thinking Approach. ', '1. Ms. Sweta Jain, Assistant Professor, Department of Information Technology\r\n2. Ms. Madhura Talele, Assistant Professor, Department of Information Technology', 'Eminent Speaker: Prof. Vaibhav Kulkarni', 'Some of the Attendees of the Expert Talk', 'Design Opportunities', 'Pillars of Innovation', 'Screenshot (15).png', 'Photo.JPG', 'Design Thinking Photo.JPG', 'Design Thinking 2.JPG', '158.jpg', NULL, NULL, NULL),
(35, 'Code Crackers Hackathon', 'Computer Society of India (CSI)', '2021-03-16', '4:00 PM', 'Online', 'Students and Faculties of the Institute', 46, 11, 'To educate participants by challenging their cognitive skills & testing their ability to think deeply, intelligently, logically & creatively.\r\n', 'Computer Society of India (CSI)', 'This competition enabled students to convert their ideas into prototypes.\r\nThe competition was attended by students and faculty members of all departments of the institute.\r\nOverall, the competition resulted in a superior understanding about Code Crackers Hackathon.', 'The event developed participants\' skills for cognitive and creative thinking - with a special focus on innovation.', '1. Prof. Uday Rote, Assistant Professor, Department of Information Technology.\r\n2. Prof. Prashant Sawant, Assistant Professor, Department of Information Technology.', 'Glimpse - 1 of the Event', 'Glimpse - 2 of the Event', '', '', '2.jpeg', 'image9.jpg', '', '', 'Code Crackers.jpg', NULL, NULL, NULL),
(164, 'Basics of Raspberry-Pi & It\'s Applications', 'Department of Electronics Engineering ', '2021-04-30', '11:00 AM', 'Online', 'TE& BE Students', 52, 0, 'The objectives of the webinar are:\r\n1. To understand the Basics of Raspberry-Pi \r\n2. To understand the usage of Raspberry-Pi in IoT Applications \r\n', '1) Rohit Mehta  ROBOCON Team Member\r\n2) Yash  Gondaliya   ROBOCON Team Member   \r\n', 'Raspberry-Pi boards, Specifications \r\nRole of IoT\r\nRaspberry-Pi based application', 'After attending the workshop students will be able to,\r\n1) Compare different  Raspberry-Pi boards\r\n2) Develop an Raspberry-Pi based application', 'Prof. Sarika Mane', '', '', '', '', 'R-Pi 1.jpg', '', '', '', '', NULL, NULL, NULL),
(127, 'Value added course Trends and Technologies for Digital Innovations', 'Department of Computer Engineering and Department of Information Technology', '2021-04-26', '3:30 PM-5:30 PM', 'Online', '', 226, 0, '1.	To make students Industry Ready.\r\n2.	To understand key elements of Digital Adoption.\r\n3.	To Analyze the essentials of Cyber security and its importance.\r\n4.	To provide an understanding of principal concepts, major issues, technologies, and basic approaches in the Cloud Computing field.\r\n5.	To Grasp the Machine Learning and Artificial Intelligence foundation and various technologies related to it.\r\n6.	To Realize the essentials of the Internet of Things and Blockchain.\r\n', 'TCS Experts :\r\nSpeaker: Mr.Gaurav Ghelani (13+ years of experience in TCS. Regional Head for Academic Interface Program of TCS. Managing relationships with Engineering and management institutes in India West and Central for TCS.)\r\n\r\nSpeaker : Mr.Devesh K. Mathur (13+ years of experience in TCS and with TCS Cyber Security Practice since 2013. Currently working as a functional consultant in TCS Cyber Security Practice with experience in SOx Compliance, Access Reviews, Cloud Security, Data Privacy, IT Risk Management, Six Sigma, AWS Fundamentals and Project Management. Worked in India and UK geographies for customers ranging in business areas such as Aerospace Manufacturing, Banking and Finance, Life Insurance, Transportation, Health Insurance, Life Sciences and Oil Field Production.\r\n\r\nSpeaker: Saurabh Lohar (Working as a Technical Architech at TCS Kolkata since Oct 2015. Also worked on public and private cloud technology and IT automation.)\r\n\r\nSpeaker : Mr.Vimal Chaubey (currently working as scientist in R&I Team, TCS ADD (Life Science) Platforms. 6 years of Industry Experience. Experienced in IT/ITIS operation Automation & Orchestration, Data Science, AI/ML, Data Analytics, Data Visualization, NLP.\r\n \r\nSpeaker : Mr.Prasad Ghag (15 Yrs of IT experience in Development, Operations & Research portfolio. Passionate on IoT based use case development and research in IoT with Blockchain implementation.Solution implemented in various Blockchain Platform Technologies like Ethereum, Hyperledger Fabric, Quorum, R3 Corda.Currently working with TCS Blockchain Services as Technical Architect to serve various Blockchain solutions.) \r\n', 'Overview of TCS and its Digital Adoption : (Day 1 - April 26, 2021)\r\nMr. Gaurav Ghelani from TCS has given overview of TCS.  TCS is a diversified organization and offers various opportunities for everyone. It is a growing organization mainly focused on delivering high quality products and services to the customers. TCS core values are Integrity, Leading change, Excellence, Learning and sharing and Respect for Individuals. TCS has adopted digital innovation as a growth strategy and already implemented digital platforms such as Business 4.O mainly focusing on key areas such as creating exponential values, mass customization, leverage ecosystem, and embrace risk. TCS has a strong presence in sectors such as banking, pharma, insurance, passport seva services etc. which makes them very successful.\r\n\r\nCyber Security & its Importance :  (Day 2 - April 27, 2021)\r\nMr. Devesh Mathur from TCS provided overview of Cyber Security. He discussed the threats and defences. He has shown the use of tool have I pwned to detect whether a person has been hacked or not. He aadvised the participants to be careful while using social media. He also focused on personal data stealing theough mail, mobile, etc.  The Speaker discussed data protection using cryptography concepts. He also advised participants to launch the complain in case of any cybercrime.\r\n\r\n\r\nOverview of Cloud Computing : (Day 3 - April 28, 2021)\r\nMr. Saurabh Lohar from TCS provided overview of Cloud Computing. He provided information about the types of cloud services and storage. He also discussed Deployment models and cloud migration. The speaker also provided information about various AI/ML cloud services and discussed the career opportunities in Cloud computing.\r\n\r\nMachine Learning & Artificial Intelligence : (Day 4 - April 29, 2021)\r\nArtificial intelligence is a technology which enables a machine to simulate human behavior. Machine learning is a subset of AI which allows a machine to automatically learn from past data without programming explicitly Mr. Vimal Chaubey from TCS discussed the details about AI and machine Learning. He discussed various models and limitations of AI/ML.  He also discussed about ethical cerns in the field of AI/ML. The speaker gave detailed information about the machine learning packages like Pandas, Keras, Spark , Tensorflow etc. The speaker also gave details about the proprietary software like RapidMinor, Amazon machine Learning. He discussed the application areas like NLP, NLG. Chatops and Chatbots where AI/ML can be used.\r\n\r\nOverview of IOT & Blockchain : (Day 5 - April 30, 2021)\r\nThe speker Mr. Prashant Ghag from TCS explained the core concept of Blockchain and IoT. The Internet of Things can go beyond real-time data and alerts to enable self-aware devices and systems to act on their own. The speaker discussed basic concept of Blockchain, types of Blockchains and  platforms like Bitcoin, Ethereum, IOTA, CORDA and Hyperledger Fabric.  He gave detailed explanation about detail  where IOT can be used, connectivity of IOT devices , IOT architecture and IOT cloud.\r\n\r\n\r\n\r\n\r\n\r\n', 'After attending this course participants\r\n1.	Received the knowledge about the digital Trends and Technologies in Industries.\r\n2.	Came to know about the research activities going on in TCS.\r\n3.	Received information about about the tools and technologies currently used in Industry.\r\n4.	Be able to Analyze various career opportunities in the field like Cyber security, ML and AI, IOT, Blockchain and Cloud Computing.\r\n', '1. Prof.Jignasha Dalal, Faculty Coordinator, Department of Computer Engineering\r\n Faculty Co-coordinators, Department of Computer Engineering\r\n1. Prof.Bhagyashree Ingle 2.Prof.Pallavi Patil 3. Prof.Minal Sonkar 4. Prof.Rupali Suroshe 5. Dr.Shivi Sharma\r\n\r\n', 'Cyber Security and its importance', 'Cloud Service Models', 'Machine Learning and Artificial Intelligence', 'Machine Learning and Artificial Intelligence', 'cyber security1.png', 'cloud Computing1.png', 'Artificial Intelligence1.png', 'Bitcoin1.png', 'ALL speakers together banner- Modify.jpg', NULL, NULL, NULL),
(149, 'Hands-on Session On Use of Modern Tools for Innovation ', 'Department of Information Technology', '2021-05-04', '6:00 PM', '', 'Student & Faculty', 100, 0, 'To Understand available Modern Tools for Hardware Simulation', 'Mr Jatin Desai,\r\nAssistant Professor\r\nFr. C. Rodrigues Institute of Technology, Vashi, Navi Mumbai.', 'Tinkercard\r\nMultisim\r\nArduino IDE', 'Understood available Open Source Tools for Hardware Simulation.\r\nAble to Design Application based on simulator   ', 'Prof.Prashant Sawant,Assistant Professor', '', '', '', '', 'jd3.PNG', 'jd2.PNG', '', '', 'Expert Talk Banner.pptx.jpg', 'Kindle', NULL, NULL),
(10, 'India\'s Independence Struggle', 'Student Council', '2021-03-12', '4:00 PM', '', 'Students & Faculties across the nation', 77, 0, 'To shed light upon the struggle faced by our forefathers for the Freedom of India', 'Anuradha Vishnu Gore ', 'The Student Council, KJSIEIT Chapter of K. J. Somaiya Institute of Engineering and Information Technology (KJSIEIT), Sion, Mumbai in association with the COEPS cell organized an interactive webinar by Mrs. Anuradha Vishnu Gore. She has given talks to students and others on the Army, soldiers, and their work. She has written columns in newspapers on the same. She has authored eight books in Marathi, and is presently penning what could be the first book in Marathi on Siachen and what it takes to guard it. ', 'The students were inspired by the webinar and got to know more about the freedom struggle that India faced. ', '1. Prof. Uday Rote, Dean - Student Welfare\r\n2. Prof. Sandhya Deshpande, Convener - COEPS Cell', 'Resource person during the webinar', 'Screenshot of the participants', '', '', '111.png', 'ss.png', '', '', 'indiasindependence.png', NULL, NULL, NULL),
(83, 'Freshers party for FE Students', 'Student Council', '2021-03-27', '3:30 PM', '', 'Students of First Year Engineering of KJSIEIT', 67, 0, 'The Freshers party is a popular cultural activity that appeals to your creative side and one that brings people together and participants get to know and understand each other. It was a fun-filled, entertaining and knowledgeable event.\r\nMost importantly this was a great platform that motivated and boosted the morale of the freshmen by making them feel included and part of the family. The KJSIEITian FAMILY.\r\n', 'Students\' Council Team', 'The Students Council of K. J. Somaiya Institute of Engineering and Information Technology (KJSIEIT), Sion, Mumbai organized Freshers, a fun event for first-year students to help them know their college and also act as an icebreaker between themselves and between them and their seniors.\r\nWe had 6 Sub-events for the Freshers\' Party namely games like Taboo, Movie Mania, Trivia, Among Us, Skribbl & Mr. & Mrs. Freshers', 'The freshers had fun and interacted with their seniors through the games and got a sense of competition instilled among them by this event.\r\n ', 'Mr. Uday Rote (Dean of Student Welfare)', 'Participants playing the game of movie mania', 'Participants playing the game of trivia', 'Guest celebrity judges judging the talent show', 'Guest celebrity judges judging the talent show', '1111.png', 'trivia.png', 'talent1.png', 'talent2.png', 'freshers.png', NULL, NULL, NULL),
(114, 'Stock Market: An Overview', 'Student Council', '2021-04-12', '4:00 PM', '', 'Students & Faculties', 155, 0, 'This webinar is organized by Student Council of KJSIEIT and delivered by Mr. Hitesh Gadling and Mr. Sujoy Bhattacharya. Their aim was to shed light upon major topics like Stock Markets, Sensex and Nifty and also share her views toward smart finance investment and management.', 'Hitesh Gadling & Sujoy Bhattacharya', 'The Student Council, KJSIEIT Chapter of K. J. Somaiya Institute of Engineering and Information Technology (KJSIEIT), Sion, Mumbai organized an interactive webinar by Mr. Hitesh Gadling and Mr. Sujoy Bhattacharya, who encourages participants to manage their finances smartly and not recklessly in the Stock Market. The speakers introduced the Stock Market to the participants and gave them examples of how studied and careful stocktrading can help them multiply their finances. They also gave the participants tips on how to trade safely without incurring major losses and keeping away from any kind of frauds, etc.  ', 'Participants got a glimpse of the Stock Market and a brief introduction about Sensex and Nifty.  ', 'Mr. Uday Rote (Dean of Student Welfare) ', 'Participants attending the webinar', 'Resource Person explaining the working of the stock markets', '', '', 'stock1.jpeg', 'stock2.jpeg', '', '', 'stock.png', NULL, NULL, NULL),
(116, 'Virtual Reunion for batch 2020', 'Alumni Committee in association with Students\' Council', '2021-04-18', '7:30 PM', '', 'Batch 2020 Alumni of KJSIEIT ', 116, 0, 'To bring together (virtually) the batch of 2020 for a farewell/reunion before Alumnite 2021.\r\n', '', 'The event started at sharp 7:30PM, with a total of 114 Participants joining in. The link was active for participants to join from 7:15 PM. A short welcome address was given to the participants by the event heads. Shortly after, we began with the first game, the crossword. Students were supposed to solve the crossword with the clues provided. They were allowed to give their answers by unmuting themselves or simply typing the answer in the chat box.\r\nAfter the crossword was completely solved, we gave the participants a short break in between to interact with each other, and in the meantime, we prepared ourselves for the next game. The second game was truth or dare in which the enthusiastic participants raised their hands and were added to a list. Each round consisted of one of the event heads spinning the wheel, and the other would read out the statement. The students enjoyed this game as it refreshed their college memories.\r\nNext, a 7-minute long video compiled from the students responses was played for them. It was a short trip down memory lane for them and the event organizers received some positive feedback from the participants.\r\nLastly, faculty members from various departments joined in to interact with the students from the 2020 batch. \r\nWe then concluded the event after a short vote of thanks with a promise that the alumni would keep in touch.\r\n', 'The event was a success since the purpose with which it was organized  was met. The students had a great time patching up with their batchmates virtually after a long time. ', '1. Prof. Vrushali Deole, Dean - Alumni\r\n2. Prof. Uday Rote, Dean - Student Welfare', 'Alumni being shown a nostalgic video made by juniors to reminisce their college days', 'Faculty interacting with the batch of 2020', 'Alumni playing a fun game', '', 'reunion.png', 'reunion2.png', 'reunion3.png', '', 'bannerreunion.jpeg', NULL, NULL, NULL),
(166, 'How to Approach GATE 2022', 'Student Council', '2021-05-01', '3:01 PM', 'Online', 'Students appearing for GATE examination ', 100, 0, 'This webinar is organized by Students Council of KJSIEIT and delivered by Mr. Pranshu Mahajan, M-Tech, IIT Ropar. His aim was to shed light upon the importance of the GATE exam and how we can work so as to crack it in our first attempt.', 'Pranshu Mahajan, MTech IIT Ropar, Btech NIT Kurukshetra', 'The Student Council, KJSIEIT Chapter of K. J. Somaiya Institute of Engineering and Information Technology (KJSIEIT), Sion, Mumbai in association with the Department of Information Technology and Department of Computer Engineering organized an interactive webinar by Mr. Pranshu Mahajan. He discussed with students about how to crack the GATE exam in our first attempt and how important the\r\nexam is for students willing to pursue their masters in India or abroad. He gave tips to students to use their time wisely so as to score well and get into a great university. This was followed by a mock exam to test the students capabilities and knowledge about the subjects.', 'Students got to know what exactly the GATE exam is, its portion, its scope and how important it is to shape their careers as successful individuals.', '1. Mr. Uday Rote, Dean - Student Welfare\r\n2. Dr. Radhika Kotecha, HOD - Information Technology\r\n3. Dr. Sarita Ambadekar, HOD - Computer Engineering', 'Resource person explaining the scope of GATE examination in various fields', 'Resource person explaining the various latest R&D projects being worked on', '', '', 'gate1.png', 'gate2.png', '', '', 'pranshu webinar (2).png', NULL, NULL, NULL),
(120, 'State-of-the-art in Information Technology', 'Department of Information Technology', '2021-04-20', '3:00 PM', 'Online', 'Students of Information Technology Department', 224, 0, '        1. Better teamwork and coordination.\r\n        2. To improve presentation skills and communication skills  \r\n        3. To build knowledge in recent technologies.', '', 'Students are giving the presentations on recent trends in Information Technology by doing following actions for improving knowledge in recent technology, building confidence for giving presentation and improving skills like team management, time management and communication:\r\n1) Make a group of four students and they all from different classes compulsory as this is inter-class activity. \r\nExample:- Two students from SE, one from TE & one from BE/  Two students from TE, one from SE & one from BE/ Two students from BE, one from TE & one from SE  \r\n2) Select state of art topics in the field of Innovation/ Invention/ Technology and prepare the presentation.\r\n3) Total duration for the presentation is 15 min per group which is divided as: 10 mins for presentation and 5 mins for Q&A.\r\n\r\nWe conducted presentations for 56 groups with different recent topics.\r\n\r\n', '1. Rate the enhancement in your ability to apply engineering knowledge in developing solutions to problems assigned to you.\r\n2. Rate your understanding of the responsibility towards issues related to society, health, and culture under consideration, and your ability to apply the same.\r\n3. Rate the enhancement of your ability to work in a team.\r\n4. Rate the enhancement in your communication, presentation, and report-preparation skills.', 'Dr. Vaishali Gaikwad\r\nProf. Nasim Shah', 'Presentation  ', 'Presentation', '', '', 'Group 1.jpg', 'Group 3.jpg', '', '', 'Banner.jpg', NULL, NULL, NULL),
(151, 'Getting Started with Arduino Day 1 ', 'Institute of Electrical and Electronics Engineers (IEEE)', '2021-05-01', '11:00 AM', 'Online', '', 60, 10, 'To teach about what Arduino is and a detailed explanation about how it works and its applications were all explained. ', '', 'Students were able to learn what arduino is and its applications. An online demonstration was also conducted using Tinkercad . Information about sensors was also given.', 'Students were able to benefit from this session as they learned about Arduino and Arduino IDE and also how to simulate Arduino online using Tinkercad.', 'Prof Sandeep Mishra\r\nProf Pranali Hatode', '', '', '', '', '22.jpeg', 'WhatsApp Image 2021-05-07 at 6.42.22 PM.jpeg', '', '', 'WhatsApp Image 2021-05-07 at 6.50.14 PM.jpeg', NULL, NULL, NULL),
(157, 'INNOVATIONS AND OPPORTUNITIES IN E-MOBILITIES', 'Institution of Engineering and Technology (IET)', '2021-05-01', '4:00 PM', 'Online', 'Faculties and Students', 50, 0, '	The automobile industry is one of the largest industries in the world soon to be transformed into the automobile electric vehicle industry.\r\n	The government of India is taking a keen interest in the rapid growth of this industry looking at the vast advantages of the use of Electric Vehicles like pollution control, noise control, freedom from import of fuels, etc.\r\n In the current budget, it has announced a number of favorable schemes benefiting to all like tax benefits on EMI purchase of EVs, GST reduction to 5 % on Electric vehicles, reduction on import duty, and promotion of the manufacture of components and charging infrastructure in India\r\n \r\n\r\n GoGoA1.com wants to fulfill the governments dream to adopt this green technology by empowering our youth with Electric Vehicle Technology\r\n', 'Mr.Shrikant Shinde', 'K. J. Somaiya Institute of Engineering and Information Technology (KJSIEIT) Sion, Mumbai, IET organized webinar on \'Innovations and Opportunities in E-mobilities\' for the students and faculty by CMD Mr. Shrikant Shinde. GoGo Foundation, from the date of its inception in January 2019, has already reached and generated awareness in more than 10,000 plus students of various colleges in Maharashtra regarding the future of EV and opportunities therein and trained 1000+ students from across India, from Jammu & Kashmir in the North to Tamilnadu in the South. In this session students from various colleges asked various questions related to their career in E-Mobilities, while the Speaker answered them well so that students could clarify their doubts.', '1. Students asked their doubts and questions related to increasing market demand of automobile electric vehicle industry.\r\n2. They got a lot of advice and clarity regarding their doubts and confusion.\r\n3. It was very beneficial to the students as they were now clear with all the stuffs related to E vehicles and future scope of this industy.\r\n', 'Dr.Vaishali Gaikwad\r\nProf.Chitra Bhole', 'Speakar Session', 'Students Participation', '', '', '10.jpg', '11.jpg', '', '', '157 (1).jpg', NULL, NULL, NULL),
(152, 'Getting Started with Arduino Day 2', 'Institute of Electrical and Electronics Engineers (IEEE)', '2021-05-02', '11:00 AM', 'Online', '', 50, 10, 'To teach about what Arduino is and a detailed explanation about how it works and its applications were all explained.', '', 'Students were able to learn what arduino is and its applications. An online demonstration was also conducted using Tinkercad . Information about sensors was also given.', 'Students were able to benefit from this session as they learned about Arduino and Arduino IDE and also how to simulate Arduino online using Tinkercad.', 'Prof Sandeep Mishra\r\nProf Pranali Hatode', '', '', '', '', 'WhatsApp Image 2021-05-07 at 6.42.23 PM.jpeg', 'WhatsApp Image 2021-05-07 at 6.42.23 PM (2).jpeg', '', '', '', NULL, NULL, NULL),
(155, 'Roles and Responsibilities of Innovators towards Society', 'Department of Information Technology', '2021-04-30', '6:00 PM', 'Online', 'Student, faculty', 108, 0, 'Apply reasoning informed by the contextual knowledge to assess societal, health, safety, legal and cultural issues and the consequent responsibilities relevant to the professional engineering practice.', 'Nisha Iyer\r\nCloud Support Associate - Big Data at Amazon Web Services (AWS), Herndon, Virginia, United States', 'In the talk Roles and Responsibilities of Innovators towards Society Innovation discuss important point to the advancement of society as it solves these kinds of social problems and enhances society\'s capacity to act. It\'s responsible for resolving collective problems in a sustainable and efficient way, usually with new technology.\r\nWith continued pressure from consumers, responsible innovation has become an important factor when informing business decisions. What is considered responsible innovation will change as consumer attitudes and heirarchies of concern adapt in a rapidly evolving world\r\nThe engineer and society: Apply reasoning informed by the contextual knowledge to assess societal, health, safety, legal and cultural issues and the consequent responsibilities relevant to the professional engineering practice.', 'Speaker explain current new technology, issue and its solution. As Roles and Responsibilities of Innovators towards Society Innovation speaker explain with Current COVID\'19 situation. Session end with question - answer session, all student are satisfactory with seminar. ', 'Prof. Harsh Namdeo Bhor, Asst. Professor, Department of Information Technology', 'Resource Person Profile with Pic', 'Session started', '', '', '(2) Meeting _ Microsoft Teams - Google Chrome 4_30_2021 6_12_27 PM.png', '(2) Meeting _ Microsoft Teams - Google Chrome 4_30_2021 6_58_09 PM.png', 'Screenshot (1355).png', 'Screenshot (1361).png', 'Slide1.JPG', NULL, NULL, NULL),
(163, 'Innovations  in the Era of IoT and its industry applications', 'Department of Electronics and Telecommunication Engineering in association with Alumni Committee', '2021-05-03', '10:00 AM', 'online', '', 106, 0, '1. Students will be able to understand the architecture and design principles of IoT. \r\n2. Students will be able to understand industry implementation of IoT. \r\n3.Students will be able to know Technology behind IoT ', 'Mr. Dharmin Mehta, Full Stack Developer @ Reliance Jio Infocomm Ltd,Mumbai.\r\n Current Role : Web Application Developer\r\no Communicating directly with Senior Technical Architect to establish project parameters.\r\no Understanding of Design and Architecture related to the Business Products\r\no Part of coding team and handling programming for Frontend as well as Backend\r\no Debugging and resolving Production Environment Issues\r\n Previous Roles :\r\no Part of Integration Architecture Team in Designing Solutions for various Business\r\nRequirements\r\no Conducted Group Discussions and Technical Interview rounds for Jio Bond Recruitment\r\nProgram Drive as part of Recruitment Team\r\no Mumbai Indians (MI - IPL) Team Engineer as a Technical Troubleshooter (Year - 2017)\r\no Head of Device Category(Service Validation Team), following up with network team\r\nunderstanding the issue and involved in resolving it.\r\no Part of Service Validation Team, actively involved in Testing and Deployment of the product', 'Mr. Dharmin Mehta, Full Stack Developer at Reliance Jio Infocomm Limited, Mumbai, India gave a brief introduction of Internet of Things with its basic requirement and definition. He explained the benefits and features of IoT with real time applications. He also elaborated on architecture of IoT and emphasized on IoT ecosystem and industry implementations with multiple real world examples, in explaining them in a very interactive and creative way. He also provided information to upskill in the area of IoT.  He very well solved all the queries asked by the students  with giving real world examples. The webinar was attended by Electronics and Telecommunication Engineering final year students. He also wishes to continue his support towards our institute.', '1. Students understood the architecture and design principles of IoT. \r\n2. Students understood  the industry implementation of IoT. \r\n3.Students came to know Technology behind IoT ', 'Mrs. Pradnya Kamble\r\nAssistant Professor, Electronics and Telecommunication Engineering.', '', '', '', '', 'OiT-photo1.JPG', 'IoT photo-02.JPG', '', '', 'Banner-Dharmin.JPG', NULL, NULL, NULL),
(28, 'Matlab workshop', 'Institution of Engineers (IEI)', '2021-03-15', '3:30 PM', 'Online', 'Students', 50, 0, 'To awareness about matlab coding and GUI.', 'Mr Dhaval bhanusali\r\nstudent,KJSIEIT', 'MATLAB introduction, basic of matlab,plotting a graph.', 'Students will be able to plot a graph in matlab GUI.\r\n', 'Yagnesh Ghatage', '', '', '', '', '', 'IMG-20210509-WA0029.jpg', 'IMG-20210509-WA0033.jpg', '', 'IMG-20210312-WA0016.jpg', NULL, NULL, NULL),
(29, 'PYTHON WORKSHOP', 'Institution of Engineers (IEI)', '2021-03-14', '11:30 AM', 'Online', 'Students', 103, 0, 'To awareness about Python coding.', 'Ajinkya Desai\r\nstudent,KJSIEIT', 'Data structures and their medhods,function,operator.', 'Students are able to use python compiler.', 'Peetamber pancharia.', '', '', '', '', '', 'IMG-20210509-WA0030 (1).jpg', 'IMG-20210509-WA0031.jpg', '', 'python.jpg', NULL, NULL, NULL),
