(112, 'Develop Covid 19 tracker app using python & streamlit.', 'Institution of Engineers (IEI)', '2021-04-11', '10:30 AM', 'Online', 'Students', 74, 0, 'To familiarizing students on project developing using python and streamlit library.', 'Mr.Parth Sharma\r\nChief data Scientist,\r\nJasper Colin Research.', 'The session was very informative, create a frond end app using StreamLit.\r\nlearn about REST API.', 'Students learn about REST API.', 'Pinakin Kataria.', '', '', '', '', 'IMG-20210411-WA0011.jpg', 'IMG-20210411-WA0012.jpg', 'IMG-20210509-WA0027.jpg', '', 'ct.jpg', NULL, NULL, NULL),
(168, 'Innovative projects using Raspberry pi-Board', 'Department of Electronics and Telecommunication Engineering', '2021-05-02', '3:00 PM', 'Online', 'STUDENTS OF KJSIEIT', 67, 0, 'to develop innovative solution for various societal and environmental problem by training student in relevant\r\ntechnical domain', 'Mr. Utkarsh Tiwari\r\nDesignation: Software Development Engineer- Analytics COE Team, Reliance Jio.\r\nAs Part of his corporate life he is data engineer. His other interest are Machine learning, Full Stack Web\r\nDevelopment and hardware tinkering', 'In This Event, Students learned, various communication protocol, Different types of Raspberry Pi,  OS details which can be installed on Rapberry- PI, Imager, and How to connect it wirelessly.\r\nThis Workshop will enable student to develop their hardware project with the help of Raspberry Board.', 'Student is able to deploy a mini computer using Raspberry PI', 'Prashant Upadhyay', 'Presentation Slides', '', '', '', '', '', '', '', '168 (3).jpg', NULL, NULL, NULL),
(170, 'Investigations for Developing Innovations', 'Department of Information Technology', '2021-05-08', '7:00 PM', 'Online', ' Students of all Branches and Faculty ', 80, 1, 'The objective of the event is to make the student aware of how to apply research-based knowledge and research methods including design of experiments, analysis, interpretation of data, and synthesis of the information to provide valid conclusions.\r\n', 'Mr. Eshan Bhatt, is a  level 2 Data Scientist at Humana University of North Carolina Charlotte, United States. Humana is a leading healthcare services provider in the United States of America. Eshan has worked in different industries like Education, Transportation, Retail, Utilities, and Healthcare. As a Data Scientist, Eshan leads and implements use cases involving applications of Traditional Machine Learning, Deep Learning, NLP, and Computer Vision. He holds a Master\'s in Computer Science and Data Science from UNCC and is currently based in Dallas, Texas.', 'The main objective of the event is to make the student aware of how to apply research-based knowledge and research methods including design of experiments, analysis, interpretation of data, and synthesis of the information to provide valid conclusions. \r\n\r\nWhat is innovation? The answer to this is, it can be a new product, idea or it can be a new method. A new or improved product or process that significantly from the unit\'s previous products or processes and that has been made available to potential users or brought into use by the unit. \r\n\r\nTypes of Innovation are as follows:\r\n1.Organization\r\n2. Process\r\n3. Market\r\n4. Product\r\n5. Business\r\n\r\n1. Why innovations is required?\r\n2. What can be done?\r\n3. How innovations can be done?\r\n\r\n1. Why innovations is required?\r\n     -To bring desired change into a process, product, or procedure.\r\n2. What can be done?\r\n     -What to make more informed decisions for innovation. For that design of experiments is required.\r\n3. How innovations can be done? or How to conduct research studies?\r\n     - One way to conduct the research is to through A/B Statistical Test. By using terminologies that include evaluation metrics, test and control, sample size, effect size, Alpha value, and confidence level.\r\n\r\nUse of different Statistical methods in Armoury are:\r\n1. One Way\r\n2. Two way \r\n3. Two-way Replication\r\n\r\n\r\n\r\n\r\n', 'The interest of the participants to pursue research on Artificial Intelligence for the development of a solution to real-world problems amplified significantly. The participants can understand the importance of innovation, what to do, and how to do innovations as well as the analysis required for problem definition', '1. Prof.Seema K. Yadav, Assistant Professor, Department of Information Technology.', 'Resource person Eshan Bhatt', 'Title of Seminar', 'What is to be done for Analysis (Figure to show flow for analysis)', 'What is to be done for Analysis (Figure to show flow for analysis)', 'Meeting _ Microsoft Teams - Google Chrome 5_8_2021 7_01_43 PM.png', 'Meeting _ Microsoft Teams - Google Chrome 5_8_2021 7_10_54 PM.png', 'Meeting _ Microsoft Teams - Google Chrome 5_8_2021 7_48_48 PM.png', 'Meeting _ Microsoft Teams - Google Chrome 5_8_2021 7_20_55 PM.png', 'SeminarBannerfinal.jpeg', NULL, NULL, NULL);
