(94, 'Code Crackers Hackathon', 'Computer Society of India (CSI)', '2021-03-16', '4:00 PM', 'Online', 'Students and Faculties of the Institute', 46, 11, 'Educating participants in a fun and interesting way, challenge their cognitive skills & test their ability to think deeply, intelligently, logically & creatively.', 'NA', 'Rules: \r\n1.	You have applied in an independent detectives agency & this is an examination you are going through.\r\n2.	Everything will be communicated through the WhatsApp group. If you have any query, problem contact us on the group itself.\r\n3.	Contacting any of the moderators personally (Calling/Texting on WhatsApp) will not be entertained.\r\n4.	Reasons like No Internet Connectivity or any such issues shall not be accepted.\r\n5.	Any communication with the other players will result in immediate disqualification. \r\n6.	Any kind of plagiarism or malpractice will lead to immediate disqualification.\r\n7.	As soon as the round starts, a 45 min timer will be started simultaneously.\r\n8.	The timer will be visible to participants for the whole round and a warning will be announced when the timer hits the 10 mins mark.\r\n9.	The event is divided into 3 rounds:\r\nA.	Pre-game:\r\n	Players will be added to a zoom meeting.\r\n	Rules of the game will be explained.\r\n	Any doubts regarding the event or rules will be cleared out in this 10 mins pre-game session.\r\nB.	Round 1:\r\n	Consists of 16 problems.\r\n	A drive link will be posted on the group for round 1 questions.\r\n	You have to solve each and every problem and keep moving forward.\r\n	1st PDF is open, but 2nd PDF onwards the answer of 2nd PDF will be key for 3rd PDF.\r\n	When you reach the last question, you have to answer the question by going to a form link provided in the 16th PDF.\r\n	Remember the passwords for every pdf is in lowercase letters and w/o space.\r\nC.	Round 2:\r\n	8 Problems\r\n	A drive link will be posted on the group for round 1 questions.\r\n	You have to solve each and every problem and keep moving forward.\r\n	1st PDF is open, but 2nd PDF onwards the answer of 2nd PDF will be key for 3rd PDF.\r\n	When you reach the last question, you have to answer the question by going to a form link provided in the 8th PDF.\r\n	Remember the passwords for every pdf is in lowercase letters.\r\nD.	Round 3:\r\n	3 PDFs\r\n	A drive link will be posted on the group for round 1 questions.\r\n	You have to solve each and every problem and keep moving forward.\r\n	Remember the passwords for every pdf is in lowercase letters.\r\n10.	The first player to complete all these tasks, will be given a chance to work with the pro detectives and learn from them.\r\n', 'The Event of Code Crackers was conducted efficiently, without any glitches, disruptions or untoward incidents, and achieved the objective of educating participants about various things, such as Cipher Cracking, Encryption, Decryption, Cryptography, etc. in a fun and entertaining way.', 'Ms. Nisha Vanjari\r\nAssistant Professor-Department of Computer Engineering\r\nEmail: nvanjari@somaiya.edu\r\n\r\nMr. Uday Rote\r\nAssistant Professor - Department of Information Technology\r\nEmail: udayrote@somaiya.edu', 'Glimpse - 1 of the Event', 'Glimpse - 3 of the Event', '', '', '2.jpeg', 'image9.jpg', 'Winner - Sakina.png', 'Participant Screenshot.png', 'Code Crackers.jpg', NULL, NULL, NULL),
(180, 'Evolution in Electromagnetic interference and Electromagnetic Compatibility testing technology and career opportunities in todays Technology', 'Department of Electronics and Telecommunication Engineering', '2021-05-09', '4:00 PM', 'Online', '', 48, 0, 'To understand the basics of EMC as well as the practical implementation of EMC in electronic circuits. Also, after completion of this session students are able to understand the technical specifications of EMI EMC testing and standards. ', 'Mr. Sandeep Dagade, Sr. EMC Laboratory Executive', 'This session highlights the following topics.\r\n1. Practical implementation of EMC in the electronics industry.\r\n2. History and basic concepts of EMI EMC. \r\n3. Technical specifications of EMI EMC testing and standards. ', 'After completion of the session, students are able to \r\n1. To understand the basics of EMC as well as its practical implementation in electronic circuits. \r\n2. To understand the technical specifications of EMI EMC testing and standards. ', 'Prof. Kiran Ramesh Rathod, Assistant Professor, Electronics and Telecommunication Engineering', '', '', '', '', '', '', '', '', '', NULL, NULL, NULL),
(175, ' \"UI/UX Design Tools\"', 'Department of Computer Engineering', '2021-05-08', '10:00 AM', 'Online', 'Final Year Students', 40, 0, '1) To aware of UI and UX Design Tools used in the industry.\r\n2) To motivate students to choose a career as UI/UX Designer.\r\n', 'Ms. Shraddha Upadhyay\r\nUI/Ux Designer,\r\nEverestek Technology Solutions Pvt. Ltd.', 'Ms. Shraddha Upadhyay commenced her interactive session by providing a brief introduction to different day-to-day application designs. She explained the concept of User Interface elements. She discussed the terms used in the design- UI, UX, IXD, UCD, Graphic design, HCI and briefed about Different types of interfaces - CLI, GUI, TUI, VUI, NUI. She explained different Designing Tools, Auxillary Tools, and Prototyping Tools.\r\nMs. Shraddha demonstrated the application design with the help of Figma and XD Design Tool. Hands-on session with the help of Figma also conducted by the Expert. She has shared the resources which are useful for designing any application.\r\n', 'The workshop resulted in creating awareness about User Interface Design Tools. The application designing with the help of Figma demonstration helped to achieve this outcome.', 'Prof. Jyoti Wadmare', 'Resource Person ', 'Demonstration with the help of Figma Tool ', 'Resources of Different types of Tools.', 'Resources of Different types of Tools.', 'resource person.jpg', 'Demonstration with the help of Figma Tool.jpg', 'Resouces for different types of Tools.jpg', 'Resources.jpg', '', NULL, NULL, NULL),
(176, 'Menstrual Health and Hygiene Session', 'Department of Electronics and Telecommunication Engineering', '2021-05-13', '4:00 PM', 'Online', 'Girls Students (SE,TE, BE), Female Faculty and Staff', 55, 0, 'To empower girls with right and comprehensive knowledge on menstruation\r\nEliminate the feeling of shame, embarrassment and hesitation towards menstruation\r\nTo assess restrictions practiced by adolescent girls during menstruation\r\nTo be the first hand source of information on menstrual hygiene and aspects related with it', 'Mrs. Nitya Chaudhary, Unicharm India', 'Menstrual Hygiene Day (MH Day), May 28, is an annual global event to raise awareness about the challenges women and girls face due to menstruation and to highlight solutions that address these challenges. Department of Electronics and Telecommunication Engginerring had organized a webinar for Female candidates to mark this day.\r\nMenstruation is a natural process but it is rarely talked about because of cultural taboos. Menstrual hygiene  how to manage menstruation safely and with dignity  has also been largely neglected by the water, sanitation and hygiene (WASH) sector and others focusing on reproductive health and education. As a result, the menstrual hygiene challenges faced by women and girls are made even more\r\ndifficult, and millions continue to be denied their rights to WASH, health, education, dignity and gender equity.\r\n\r\nDifferent topics related to menstrual hygiene, what are the different phases that a female body goes through and the ways to cope up with the different mental and physical trauma that she goes through during the cycle.\r\n\r\nLater topics related to PCOD, Thyroid and Mesopause were discussed and ways to deal with same through healthy diet and through proper consultant of doctor.\r\n\r\nAlso Ms. Nitya went ahead discussing the various the proper usage of Sanitary napkins, Tampons and Menstrual cups.\r\n\r\nThe session ended with a question answer section from active Participants', 'We were able to empower girls with right and comprehensive knowledge on menstruation\r\nWe could to some extent eliminate the feeling of shame, embarrassment and hesitation towards menstruation and make they outspoken over the topic\r\n', 'Prof. Rashmi Adatkar\r\nProf. Rupali Kadu', 'Event Pic with Participants and Speaker', 'Menstrual Management ', 'Menstrual Abnormilities', 'Menstrual Abnormilities', 'Event Pic.JPG', 'Menstrual Health.JPG', 'Menstrual Abnormilities.JPG', 'Healthy Lifestyle.JPG', 'Banner.JPG', NULL, NULL, NULL),
(159, 'Reimagining the Information Profession: iSchools, The Way forward!', 'Departments (all together)', '2021-04-29', '2:00 PM', 'Online', 'Faculties of Somaiya Trust', 110, 0, 'To chart a new path to education in the emerging areas through brainstorming with renowned national and international invited experts in the field.', '1. Prof. Michael Seadle, Professor, Humboldt-Universitt zu, Berlin, Germany, Director, HEADT Centre, Executive Director, iSchools, Inc.\r\n2. Prof. S. Sadagopan, Director IIIT, Bangalore\r\n3. Prof. Sohaimi Zakaria, Professor, Faculty of Information Management, Universiti Teknologi MARA (UiTM), Shah Alam, Selangor, Malaysia\r\n4. Prof. K. R. Srivathsan, Visiting Professor, School of Electrical Sciences, IIT Bhubaneshwar, Former Director, CIT Kannur, Kerala, Pro-VC, IGNOU, Director IIITM, Kerala\r\n5. Prof. George Buchanan, Director of the iSchool, University of Melbourne, Australia\r\n6. Prof. Deepak Phatak, Professor - Computer Science & Engineering, IIT Bombay,\r\n7. Prof. Sugimoto, Shigeo, Professor Emeritus University of Tsukuba, Japan\r\n8. Prof. Gobinda Chowdhury, Professor of Information Science, Department of Computer & Information Sciences, University of Strathclyde, Glasgow, UK Chair, iSchools Organization\r\n9. Prof. Saji Gopinath, VC, Kerala University of Digital Science, Innovation & Technology, Digital University, Kerala\r\n10. Prof. R.K. Shevgaonkar, IIT B, Professor EE, Ex. VC, Pune University, Ex. Director, IIT Delhi, Ex. VC, Bennett Colman, TOI\r\n11. Prof. Gangan Pratap, Director-Research, Vidya Academy of Science & Technology, Kerala, Scientist, National Institute for Interdisciplinary Science and Technology (NIIST), Thiruvananthapuram\r\n12. Prof. Shalini Urs, Founder & Trustee, MYRA School of Business, Mysuru', 'The experts shared their experiences about iSchools, managing multidisciplinary studies and community building, sustaining, and scaling up institutions, new institutional models, academia-industry collaborations, emergent disciplinary frameworks, trends in higher education, etc.', 'Newer avenues of education in the emerging areas were discovered through brainstorming with renowned national and international invited experts in the field.', 'Departments of K. J. Somaiya Institute of Engineering and Information Technology, Sion, Mumbai', 'Glimpse of the Session', '', '', '', 'Reimagining.png', '', '', '', 'Reimagining2.JPG', NULL, NULL, NULL),
(87, 'Overseas Masters Programs - A Pool of Opportunities', 'Computer Society of India (CSI)', '2021-04-03', '3:30 PM', 'Online', 'Students from India wanting to go abroad for higher education (MS)', 83, 0, 'To be a useful webinar for students who wish to enroll in post graduate programs overseas.', 'Mr. Vijay Sonawane has over 27 years of experience in the area of business development, performance, and productivity management. Vijay has worked across the value chain and has proven expertise in nurturing nascent businesses and transforming them into successful business models. Before establishing Arrham Intelligence Institute, Vijay has worked with multinational groups like GTL, DHL Worldwide, ATC Shipping, Wilson Logistics, Kotak Mahindra, Aviva, and Principal Financial Group in various capacities.', 'The Computer Society of India, KJSIEIT Chapter of K. J. Somaiya Institute of Engineering and\r\nInformation Technology (KJSIEIT), Sion, Mumbai in association with the Arrham Classes has organized an interactive webinar on \" Overseas Master\'s Program - a pool of opportunities\" for all the students of various departments and institutes, delivered by Mr. Vijay Sonawane. The speaker highlighted the steps to prepare and to get admits to the premier universities for MS along with some tips and tricks. The talk was followed by a Question-Answer session, facilitating the participants to get inputs from the speakers on their queries related to the topic of the webinar. The speakers addressed the questions and provided their valuable recommendations for the same to the participants. The e-certificate and resources provided by the resource personages were shared with the participants via email.\r\n', 'The webinar provided proper insights for students planning to secure admits to top universities for MS. The webinar also created a strong motivation among participants to start preparing for the same with a proper goal in mind.  ', 'Mr. Uday Rote (Dean of Student Welfare)', 'Screenshot 1 of Session on Zoom', 'Screenshot 2 of Session on Zoom', 'Screenshot 3 of Session on Zoom', '', '1.jpg', '2.jpg', '3.jpg', '', 'WhatsApp Image 2021-03-26 at 01.23.02.jpeg', 'webinar, study abroad, overseas education, gre, gmat', NULL, NULL),
(101, 'An Overview about Overseas Education after Graduation ', 'Computer Society of India (CSI)', '2021-04-10', '2:30 PM', '', 'Students from India wanting to go abroad for higher education (MS)', 124, 0, 'To be a useful webinar for students who are keen to secure admits to top universities for MS.', 'Mr. Banit Sawhney is an Engineer and MBA graduate. He overlooks the overall functioning of the organization.\r\nMr. Rahul Bhatt is an engineer with over 8 years of industry experience in the field of mechanical engineering. He is currently the Quantitative Head and a senior counselor at Imperial Overseas Education.\r\nMs. Alisha Chhabra completed MBA from the Delhi school of Economics in 2019. She is currently a Verbal instructor for GRE, GMAT and SAT examinations.\r\n', 'The Computer Society of India, KJSIEIT Chapter of K. J. Somaiya Institute of Engineering and\r\nInformation Technology (KJSIEIT), Sion, Mumbai in association with the Imperial Overseas has organized an interactive webinar on \"An overview about Overseas Education after Graduation\" for all the students of various departments and institutes, delivered by Mr. Banit Sawhney, Mr. Rahul Bhatt and Ms. Alisha Chhabra. The speakers highlighted the steps to prepare and appear for GRE to get admits to the premier universities for MS along with some tips and tricks. \r\nThe talk was followed by a Question-Answer session, facilitating the participants to get inputs from the speakers on their queries related to the topic of the webinar. The speakers addressed the questions and provided their valuable recommendations for the same to the participants.\r\nThe e-certificate and resources provided by the resource personages were shared with the participants via email.\r\n', 'The webinar provided proper insights for students planning to secure admits to top universities for MS. The webinar also created a strong motivation among participants to start preparing for the same with a proper goal in mind.    ', 'Mr. Uday Rote (Dean of Student Welfare)', 'Screenshot 1 of Session on Zoom', 'Screenshot 2 of Session on Zoom', 'Screenshot 3 of Session on Zoom', 'Screenshot 4 of Session on Zoom', '11111.jpg', '222.jpg', '333.jpg', '444.jpg', 'Webinar Poster.jpg', 'webinar, study abroad, overseas education, gre, gmat', NULL, NULL),
(115, 'Feynwick, The Coding Competition ', 'Computer Society of India (CSI)', '2021-04-24', '4:00 PM', 'Online', 'Programming enthusiasts from various fields', 104, 1902, '- To be a global level coding competition aimed for beginners to get acquainted with competitive coding.\r\n- To extend an exciting opportunity for the established programmers to test their knowledge.\r\n- To foster logical thinking along with problem solving and time management skills among the participants for problem-solving.\r\n', '', 'Feynwick was a global level coding competition aimed for beginners to get acquainted with competitive coding. It provided an exciting opportunity for the established programmers to test their knowledge. The questions were prepared, keeping diversity as a priority. Various data structures like arrays, stacks, graphs and algorithms like convex hull and A* were tested in the course of 7 questions of increasing difficulty. The contest was not merely a coding contest. The questions fostered logical thinking among the participants for problem-solving. The duration was 3 hours. The participant solving the questions in the least amount of time and with the least space-time complexity won the contest. ', 'As an outcome of Feynwick, our institute saw a surge in the involvement of students in various Competitive Programming events. Students got more engrossed in algorithms and data structures using competitive coding platforms like Hackerrank and CodeChef. The overwhelming response received by the committee also paves the potential for a grander contest in future.\r\n', 'Mr. Uday Rote (Dean of Student Welfare)', 'Contest conducted on Hackerrank.com', 'Problem Statements for the contest', 'Winners of Feynwick', 'Winners of Feynwick', '1.png', '2.png', '3.jpg', '4.png', 'banner.jpg', NULL, NULL, NULL),
(173, ' \'Profile Building for Higher Education & Placements\'', 'Student Council', '2021-05-08', '4:00 PM', 'Online', 'Students wishing to improve their profile', 140, 13, 'To be a helpful session for those who are worried about their future after Engineering.', 'Mr. Nitin Ravi, a National Eminent Speaker at Byju\'s, Founding member - CareerLabs', 'The speaker explained the concept of \'X-factors\'. He also explained how one can improve one\'s profile. He also suggested various options one can take up after their undergraduate degree. ', 'This webinar was really helpful for those who are worried about their future after Engineering.', 'Prof. Uday Rote, Dean - Student Welfare', 'How many engineers are manufactured every year and what is the ratio of high paid engineers', 'Job demand for the respective field', 'What are the type of the job given to the engineers.', 'What can they do after completing the degree.', 'p1.png', 'p2.png', 'p3.png', 'p4.png', 'profilebuilding.png', NULL, NULL, NULL),
(188, 'Future technology for IT Industry', 'Institution of Engineers (IEI)', '2021-05-16', '6:00 PM', 'Online', 'Students', 54, 0, 'To guide the student on Future Technology of IT Industry and help them to achieve the goals in that field.\r\nTo develop personal skills, qualities, and mind-set to lead and manage a new, growth-oriented venture.\r\n', 'Abdulla Sharif', 'The session was very informative where in there were total. 41 attendee attending the session. Maximum number of participants were from EXTC & IT Department. ', 'students learn about Future Technology of IT Industry.', 'PARTH BHANUSHALI  \r\n TE-EXTC', '', '', '', '', 'IMG-20210517-WA0029.jpg', 'IMG-20210517-WA0028.jpg', 'IMG-20210517-WA0027.jpg', 'IMG-20210517-WA0031.jpg', 'IMG-20210515-WA0031.jpg', NULL, NULL, NULL),
(179, 'Awareness Program on National Innovation & Startup Policy  ', 'National Innovation and Start up Policy(NISP)', '2021-05-12', '5:00 PM', 'Online', '', 108, 0, 'To Create awareness of Startup & Innovation policy at Insititute level among the students and fauclties', 'Dr.Dhananjay Kalbande ', 'NISP Policty Discussion ', 'Faculites and Sutdetn understood policy ', 'Prof.Hariram Chavan,Prof.Sandya Kadam,Prof.Prashant Sawant', '', '', '', '', 'nisp1.PNG', 'nisp2.PNG', '', '', 'FInal NISP.pptx (1).jpg', NULL, NULL, NULL),
(184, 'Learning Python for Raspberry-PI', 'Department of Electronics and Telecommunication Engineering', '2021-05-16', '1:00 PM', 'Online', 'STUDENTS OF KJSIEIT', 48, 0, '1) To make students aware about various verticals (health and Agriculture mainly) and Horizontals\r\n2) To prepare for project viva examination\r\n3) To Train on problem solving using python on Raspberry\r\n', 'Mr. Utkarsh Tiwari, Prof. Prashant Upadhyay', 'In first 30 minute session by Prof. Prashant Upadhyay,  students about informed about various verticals (health and Agriculture mainly) and Horizontals, and given a tips about Project viva preparation.\r\nin Second session by Mr. Utkarsh Tiwari, students were trained on problem solving by Python on an online plateform \"Riplet\".', 'After attending this workshop\r\nAble to design algorithm for particular problem.\r\nAble to implement Algorithm on computer system.', 'Prof. Prashant Upadhyay', 'Post Event Group Photograph', 'Algorithm using Flow chart', '', '', 'group_pic.png', 'problem_solving.png', '', '', '184 (1).jpg', NULL, NULL, NULL),
