(91, 'Expert talk on Supercapacitor :Basic to Advance Application', 'Indian Society for Technical Education (ISTE)', '2021-04-02', '3:30 PM', 'Online', '', 120, 0, 'The guest lecture was aimed to impart knowledge on the various usages of\r\nsupercapacitors. It attempted to elaborate the working of a supercapacitor that is used for\r\nenergy storage with different current cycles with energy storage properties.', 'Prof.B R Sankapal,110, Ph D students: Completed-10; VNIT-03, NMU Jalgaon-07, VNIT-Working -02, Project Funding: TOTAL: 07 Rs. 212.34 Lakhs. As HoD, successful to apply,and get sanction of FIST(DST): 2.47 Crores for Physics Department. He has been working as\r\nManagement Council Member-Kendriya Vidyalaya Vayusena Nagar, NAGPUR- as EminentEducationist (VMC Member), Government College of Engineering, JALGAON- BoS(Physics) Member &amp; has been a Reviewer to more than 40 International Journals. He has also\r\nWorked as Expert for Academic Audit for Government Engineering colleges, an ExpertCommittee Member Invited by AICTE to visit towards sanction of engineering and technology in engineering colleges', 'Dr. Sankapal commenced the expert talk by providing interdisciplinary domains\r\n&amp; its applications where supercapacitors are used. He provided parameters of supercapacitors\r\nin comparison to batterycharge, discharge efficiency, cycle energy, power etc. Flexible\r\nenergy storage and role of hybrid supercapacitor. He further elaborated on its material,\r\ndimension &amp; properties specification of supercapacitor. Cyclic voltammetry dynamics, cost,\r\nmethod, availability &amp; domestic usage, surface architecture, study of electrodes,\r\ndisadvantages of liquid state device, schematics of device fabrication in supercapacitors. Dr.\r\nsankapal shared his personal academic achievements for being instrumental in creating a\r\nglow-panel for VNIT, Nagpur.', 'The guest lecture imparted vital information of workings of supercapacitorsbasic to advanced. It equipped the first-year students to grasp the fundamental concepts of the topic in the domain of physics.', '', '', '', '', '', '', '', '', '', '', NULL, NULL, NULL),
(181, 'with Successful Start-up founders', 'Institution\'s Innovation Council (IIC)', '2021-04-25', '10:00 AM', 'Online', 'All Faculty and students', 92, 0, 'To guide the new innovation based startups and provide detailed mentoring for grasp of commercialisation of technology developed by new entrepreneurs.', 'Mr. Ravi Jaiswal,\r\nCo - founder - SKYLO', 'As per the guidelines provided by MoE\'s Innovation Cell (MIC), India, the mentoring session with Successful Start-up founders with Co - founder SKYLO Mr. Ravi Jaiswal  was organized by K. J. Somaiya Institute of Engineering & Information Technology - Institutions Innovation Council (KJSIEIT - IIC).\r\n\r\nThe session has given insights about the different factors/issues considered while developing a new venture. \r\n\r\n \r\n', 'It offered a detailed guidance by successful start-up founders on the various issues to budding entrepreneurs for succeeding in start-up ventures.', 'Mr. Martand Zha\r\nMember, KJSIEIT - IIC.\r\n\r\nDr. Radhika Kotecha\r\nConvener - KJSIEIT IIC\r\n\r\nDr. Suresh Ukarande\r\nPrincipal - KJSIEIT IIC', 'Glimpse - 1 of the Event', 'Glimpse - 2 of the Event', '', '', '5_1.jpg', '5_2.jpg', '1.jpg', '8.jpg', '5.jpeg', NULL, NULL, NULL),
(197, 'Panel Discussion on Innovation and Start-up Ecosystem for Business Ventures ', 'Institution\'s Innovation Council (IIC) & Alumni Committee', '2021-05-29', '12:30 PM', 'Online', 'KJSIEIT Students ', 111, 0, '	 To enhance the students\' understanding on the importance of being \'job-providers\' \r\n	To motivate young minds to venture into the entrepreneurial abilities resulting in wealth creation & new markets.\r\n', 'The invited panelists for the panel discussion were (1) Mr. Rushil Chaturvedi, Risk and Technology Consultant, KPMG, Mumbai (2009-2013) Alumni, EXTC Dept, (2) Mr. Utkarsh Dhawan, Platform Team lead at Exportify Technologies (2017-2018) Alumni, Computer Engineering Dept, (3) Mr. Bharat Mishra, Co-founder & Partner, Stratagem Paramount (2012-2013) Alumni, ETRX Dept, (4) Mr. Dilip Singh, Goraiya Engineering Services, Mumbai (2017-2018) Alumni, IT Dept', 'The Panel Discussion was instrumental in enhancing the knowledge on the trending factors in the market economy. The panellists provided a realistic view on the pivotal factorsfunding agencies, government policies, exposure & updates needed to sustain in the competitive market. The panellists also offered a meticulous insight on the crucial role of having a right mentor by shedding light on their personal inspirational stories. The discussion also steered along the evolving concept of successoften defined by failures in the experimental business plans. There was a generation of ideas so as the potential entrepreneurs were able to convert brilliant business plans into a success venture. In addition, the importance of great team work for a successful business venture was emphasized with the individual skill-sets as prerequisites to enhance prospects to convert a business proposal into a successful innovative entrepreneurial venture. ', '	The panel discussion facilitated an open dialogue between the panellists and the audience with a gained awareness on the market trends with prospective ventures\r\n	It equipped the students with practical tips of innovation & creativity to overcome the competitive threats in the market so as to set emerge as a successful entrepreneur \r\n', 'The event was organized by Dr. Radhika Kotecha & Dr. Vrushali Deole in addition to the Alumni coordinatorsProf. Shubhada Labde (Comp Dept), Prof. Reena Lokare (IT Dept), Prof. Sarika Mane (ETRX Dept) & Prof. Pradnya Kamble (EXTC Dept). Miss. Delzeen Macchi, SE Compt Dept & Miss Gitika Jha, TE, IT Dept. were student coordinators & moderators for the event. ', '', '', '', '', '', '', '', '', 'Wallpaper Panel Discussion 29 May 2021 (1).jpg', NULL, NULL, NULL),
(199, 'Changing  Stereotypical Gender Roles', 'Internal Quality Assurance Cell & Basic Sciences & Humanities Department', '2021-05-28', '4:00 PM', 'Online', 'KJSIEIT Students  & Faculties', 255, 0, '	To create an awareness on \'gender diversity\' that offers a new hope for the configuration of new gender roles in the realistic situation.   \r\n\r\n	To demonstrate departure of stereotypical gender roles as represented in mass media with an emphasis on gender equality.\r\n', 'Presenter: Dr. Vrushali Deole (Faculty: BS&H Dept.)  \r\nBrief Profile: Dr. Vrushali Deole holds a PhD from Mumbai University, Dept. of English in 2017, the PhD Thesis Gender Metamorphosis & Sexual Transformation in the Works of Devdutt Pattanaik. She has been in KJSIEIT since 2005 till date, teaching subjects Communication Skills, Business Communication & Ethics, Human Resource Management etc. In the research domain she has presented papers at International Conferences at Ireland, UK, Austria, Turkey, Munich etc. \r\n', 'The expert talk commenced with Prof. Vivek Mane who briefly introduced the speaker followed by Dr. Harsha Mishras addressed who stressed on the need to create an awareness in todays youth to embrace gender diversity. The speakerDr. Vrushali Deole provided vibrant examples from ancient Indian myths, scriptures by citing examples of gender-queer gods, androgynous forms of deitiesLord Ganesha, Lord Narsimha, Lord Shivas Ardhanarishwar form etc. The first segment of her presentation encompassed the suppressed feminine characters in Indian myths while correlating it to the contemporary scenario. The latter part of the presentation revealed instances of gender metamorphosis and sexual transformation of Indian Gods. The ancient Indian scriptural past was corelated with the present plight of the non-heteronormative gendersthe third gender, the transgenders, transexual, transvestite individuals in Indian set-up. The seminar was concluded with vote of thanks and question and answer session.', '	The expert talk enabled the students to gain a detailed insight into the rich ancient Indian resources that had evidences of queer gender\r\n	By discussion of various mythical themes, the dialogue created compassion towards the all-gender permutations, thereby raising the vision for a greater acceptance of gender diversity.\r\n', 'The event was organized by Prof. Vivek ManeIQAC faculty member BSH department, Prof. Vrinda UllasIQAC Coordinator, and Dr. Harsha MishraHoDBS&H Department. \r\n \r\n', '', '', '', '', '', '', '', '', 'Wallpaper Gender Roles Banner_00001.jpg', NULL, NULL, NULL),
(205, '\'Pathway to Germany\'', 'Student Council', '2021-05-29', '5:00 PM', '', 'Students of various departments and institutes who want help to prepare for their Post Graduation in Germany.', 86, 0, 'To be helpful for those who are worried about their future after Engineering and want to work or study in Germany.', 'Mr. Privesh A. Chauhan, Founder of IndoGerman Education', 'The speaker explained about the study and work environment in Germany and addressed the various points students wanted to know about. He also explained how one could apply in Germany, what are the challenges faced to go to Germany, what are the prerequisites for going to Germany and many such points.', 'This webinar cleared a lot of doubts students had about going to Germany for that post-graduate studies or jobs. ', 'Prof. Uday Rote, Dean - Student Welfare', 'The speaker is explaining about What IndoGerman is and how it will help one go to Germany', 'The speaker is explaining about what does it cost in various cities for doing masters', 'The speaker is showing a sample Statement of Purpose', '', 'germany1.png', 'germany2.png', 'germany3.png', '', 'pathwaytogermany.jpg', NULL, NULL, NULL),
(196, 'Job Fair (Online mode)', 'Institute of Electrical and Electronics Engineers (IEEE)', '2021-05-21', '11:45 AM', 'Online', 'Job seekers across Mumbai, Maharashtra', 90, 318, '1. To make the common platform available to the employers and the job seekers to find appropriate candidate and the dream jobs respectively.\r\n2. To help our unplaced students to get a better job opportunity.', 'Ms. C Kubal( Assistant Commissioner) District Skill Development, Employment & Entrepreneurship Guidance Center, Mumbai City', 'Online Job Fair Mumbai City 21/05/2021 to 25/05/2021\r\nTotal 7 employers \r\n1. ICICI Bank\r\n2. Mazgondock ship builders ltd\r\n3. Upgrade EDUCATION Pvt. Ltd.\r\n4. Freight wings Pvt. Ltd.\r\n5. Krib india Electrol Industries\r\n6. Global Hospital\r\n7. LIC \r\nfloated  their 384 vacancies for the job seekers of various streams and technology. \r\nTotal 408 applicants applied for various mentioned above company, out of which around 90 applicants were from our college and around 318 were external applicants.\r\nAs per the information received from the companies around 60 candidates are short listed.\r\nExact information about the recruiters will be received shortly from the respective companies.', ' Good job opportunities were made available to the job seekers. ', '1. Prof. Sandeep Mishra\r\n2. Prof. Pranali Pradeep Hatode', 'Government of Maharashtra registration Portal', '', '', '', 'IMG_6886.PNG', '', '', '', 'ba2d77c9-23ed-4f06-b352-eda48cfd5c78.JPG', NULL, NULL, NULL),
(195, 'COEPS CELL 15 th Summer internship with Central Railway', 'COEPS Cell', '2021-05-27', '3:50PM', 'Online', '37 FE STUDENTS FROM ALL BRANCHES ', 37, 0, '1) To introduce about major section of Central Railway from engineering perspective.\r\n2) To give hands on experience on AWS ,Pentagram, motor coach .\r\n3) To develop a mind state of FE students to see the real time problem in Indian railway by applying their engineering knowledge.  ', '  All six days speaker profile \r\n\r\n\r\n1) Mr. Keyur Shinde :SIMENS ENGINEER \r\n2)Mr. VIJAY YAMKAR  BT ENGINEER CR\r\n3)Mr. Deepak Bedoya SSE(CE)\r\n4)Mrs. Purvi Agarwal ,  BT ENGINEER CR\r\n5)Mr. Pawan Kumar Dubey   BT ENGINEER CR\r\n6) Mr. Deepak Kumar BT ENGINEER CR', ' After this six days online training program ,\r\n\r\n1)Online exam will be conducted in order to check the whether the students  have understood whatever studied in the internship  and gain  knowledge of all technical session of Indian railway.\r\n2) Topper student will be selected for real time project with Indian railway.\r\n3)After every session student\'s attendance is evaluated by the feedback form and it is reflected that all the students had gained knowledge from each session.\r\n\r\n   ', 'After this internship ,\r\n1)Students have gain the knowledge about all the major sections of Indian railway  .\r\n2)Students are able to think about real time project /case study by applying their engineering knowledge  to solve the basic problem in Indian railway  .\r\n3)Interns realize the effort taken by technical Indian railway staff  and take an oath to take care of public property.\r\n4)Interns are willing  to work with multidisciplinary  real time project by applying AI and power electronics knowledge .', '1) Mrs. Sandhya Deshpande COEPS CELL convener  ', '1st Day presentation', '2nd Day presentation', '3rd Day presentation', '3rd Day presentation', 'WhatsApp Image 2021-06-06 at 3.41.38 PM.jpeg', 'WhatsApp Image 2021-06-06 at 3.43.18 PM.jpeg', 'WhatsApp Image 2021-06-06 at 3.43.49 PM.jpeg', 'WhatsApp Image 2021-06-06 at 3.49.29 PM.jpeg', 'banner coeps 15th intetnship (2).jpg', NULL, NULL, NULL),
(218, 'An Inspirational Talk on the occasion of Shiv Swaraj Din on Chhatrapati Shri. Shivaji Maharaj', 'Department of Basic Science and Humanities in association with the Student Council', '2021-06-06', '4:00 PM', 'Online', 'All Indian citizens', 125, 0, '- To motivate the patriotic spirit of freedom in modern times with glorious examples of Indias Greatest KingChhatrapati Shri. Shivaji Maharaj was a judicious ruler.\r\n- To emphasize on virtuous qualities of the King by a mindful approach on thehistorical aspects of the rich ancient past of Maharashtra.', 'Shri Nikhil Sabnis', 'The event commenced with a welcome note by Mrs. Gauri GothivrekarLibrarian, KJSIEIT. PrincipalDr. Suresh Ukarande emphasized the significance of the celebration of Shiv Rajyabhishek Din being celebrated to mark the 348th Coronation Day of Chhatrapati Shivaji Maharaj. The event as per the directives of the University of Mumbai was aimed to infuse a patriotic spirit with pride of freedom gained while fighting against the foreign forces in the state of Maharashtra. He provided an inspiring instance of the conquest of Torna fort with its historical significance as it was the first fort captured byShivajiMaharaj in 1646, at the young age of16. Dr. Ukarande also cited the Vietnam- America war that was largely inspired by the Guerrilla tactics deployed by Shivaji Maharaj in primitive times, which resulted in the great win of the Vietnamese troops despite it being a smaller nation. He appealed to the youth to imbibe values of bravery, obedience, faith, strategist policy, with judicious implementation while cherishing the rich historic past of one of the greatest rulers of Maharashtra. The presenter Shri. Nikhil Sabniscommenced his talk on a commemorative note of historical precedents. Through the inspirational episodes in the life of Shivaji Maharaj, he adapted the technique of correlation of the great rulers skillsShrewd Diplomat, Brave Warrior, an Obedient Disciple, Military Strategist, an Insightful Management Guru. The virtuous qualities, he urged the youth, with due relevance must be applied in modern times. 2 Highlighting the exemplary qualities of the great ruler, he counseled the youth for the acquisition ofFocus, Data Collection, Continuous Development, Involve People & Micro Detailing. The characteristic features of the great King with historic episodes of the opponent invadersAfzal Khan, Shaista Khan, Fateh Khan, etc who were brilliantly defeated with aDetailed Research, Unbiased Analysis, Confidentiality on his Ministers, Self- introspection with Continuous Improvement, Instruction-Follow-up & Work -execution, Implementation of Feedback, etc. were the strikingly inspirational qualities of Shivaji Maharaj that were shared by the speaker in the motivational session. The event concluded with a thank you note by Mrs. Gauri Gothivrekar; with a national anthem. The participants were provided with e-certificates post the submission of feedback formality of the event.', '- The participants\' level of awareness was raised with historical episodes of the glorious attributes of Chhatrapati Shri. Shivaji Maharaj was a judicious ruler.\r\n- It inspired the participants to imbibe qualities of patriotism while upholding the ethical values in society.', ' 1. Prof. Uday Rote \r\n2. Dr. Vrushali Deole', '', '', '', '', 'day1.png', 'day2.png', 'day3.png', 'day4.png', 'shivdin.png', NULL, NULL, NULL),
(209, 'Slogan Making Competition (Extempore)', 'Department of Basic Science and Humanities', '2021-06-05', '10:00 AM', 'Online', 'FE Students', 0, 0, 'Objectives:\r\n	To provide an impetus for showcasing the creative linguistic abilities of the students \r\n	To enhance the pre-requisite for managerial & marketing skills on the employability parameter.\r\n', 'Ms. Shivani Shivshankar: Telus, Ontario, Canada & Alumni EXTC Dept, 2017-2018 batch pass out, KJSIEIT.', 'Key Points: In the context of the COVID-19 pandemic on rise, the need of the hour is universal adoption of safety measures. As prevention is better than cure, it is essential to strictly follow precautionary measures such as washing hands at frequent intervals, maintaining social distancing, wearing masks at public places all the time. However, it has been observed that there are still many individuals who are reluctant to follow the safety measures, thereby, not only putting themselves at risk, but also the society at large. Three Best Winners & participants were rewarded with an E-Certificate \r\nWinners of Slogan Competition:\r\nSr. No	Name of the Participant	FE Branch	Prize Position\r\n1.		Vedant Ritesh Lakhera	EXTC 	1st Prize\r\n2	Chauhan Abdurrahman Altaf	IT	2nd Prize\r\n3	Himanshu Kishor Halbe	EXTC	2nd Prize\r\n4	Mansi Jalindar Gawade	IT	3rd Prize\r\n5	Aditya Purshottam Mandhania	EXTC	3rd Prize\r\n\r\nRegistration Link: https://forms.gle/T9KwsiBhaPXTwZJ47\r\n\r\n', 'Outcomes: \r\n	The Slogan Competition provided an impetus for showcasing the creative literary abilities that is a fundamental pre-requisite for managerial to marketing skills on the employability parameter.\r\n', 'Dr. Harsha Mishra\r\nDr. Vrushali Deole & Dr. Vaishali Ghadyalji', '', '', '', '', '', '', '', '', '', NULL, NULL, NULL),
(210, 'Will Artificial Intelligence (AI) take Away the Future Jobs?', 'The Department of Basic Science & Humanities ', '2021-06-05', '12:30 PM', 'Online', 'FE Students', 33, 0, '	To inculcate interpersonal skills & generate creative thinking \r\n	To create awareness on the topic & to seek answers and solutions of the topic in discussion \r\n	To enhance analytical abilities on a particular given topic with democratic approach\r\n', 'Ms. Shivani Shivshankar (Alumni of EXTC 2017-2018 pass out) Developer Telus Inc., Ontario, Canada was  the invited Judge for the event. ', 'Key Points: The event resulted in generation of innovative ideas, the crucial role of professional discussion techniques for engineering students so as to enhance their career prospects. The judge provided a detailed analytical feedback the dos & donts as contributory parameters in the direction of the placements. The winners & participants were issued an e-certificate post the successful conduction of the event. ', 'Outcomes: The Group Discussion Event enriched the realms of critical thinking, communication articulation, general awareness on recent technical trends in the domain of AI.  \r\nRegistration Link: \r\nhttps://forms.gle/LKGGpKm1tg8AJ4jM7\r\n', 'Dr. Harsha Mishra,\r\nDr. Vrushali Deole & Dr. Vaishali Ghadyalji', '', '', '', '', '', '', '', '', '', NULL, NULL, NULL),
(223, '\'Opportunities in India & Abroad after Graduation\'', 'Student Council', '2021-06-12', '5:00 PM', '', 'Students across the nation', 80, 0, 'This webinar will be really helpful for those who are confused about their future after they complete their Graduation. Various prospects like profile building, education loans, Masters vs MBA, etc. will be discussed.', 'Mr. Vinni Shah, Head Counselor at Aara Consultancy.', 'The speaker discussed how one could apply for their Masters in other countries, what are the challenges faced to go to major universities in India and abroad, what are the prerequisite for going to major universities.', 'The attendees had their doubts cleared regarding the path to take for their future. ', 'Prof. Uday Rote - Dean, Student Welfare', 'What is Aara Consultancy and how it will help us to go major universities. ', 'What are the cost of different cities for doing the masters abroad', 'What are the problems faced?', '', 's1.png', 's2.png', 's3.png', '', 'webinar.png', NULL, NULL, NULL),
(213, 'Guidance for psycho-social counselling and helper skills ', 'Department of Lifelong Learning and Extension (DLLE)', '2021-06-11', '2:30 PM', 'Online', 'All faculty members and students', 30, 0, '1. To improve Emotional Well-being of each individual in the society during Covid pandemic. \r\n\r\n2. To help the Community at large to overcome a wide range implication of decreased emotional well-being resulted in concerns such as stress, depression, and anxiety.', 'Manisha Karape', 'Ms. Manisha Karape started with discussion of 5 main points of workshop one by one as:\r\nTeam 1 - Hospital Management Team i. Sharing the information of available beds/Ventilators/ICU ii. Covid Vaccine Awareness/Information/Updates iii. Crowd Management at Covid Vaccine Center\r\n\r\nTeam 2- Non  Hospital Management Team i. Sharing the information of NGOs Food distribution to Covid Patients ii. Sharing the information of Covid Helpline numbers\r\n\r\nTeam 3  Family Related Team Giving emotional support to the Covid effected team\r\n\r\nTeam 4 - Sharing the information of Medical essentials i. Availability of Oxygen Concentrators, Blood Plasma ii. Availability of Remidesivir Injection and other drugs iii. Availability of Pulse oxymeter\r\n\r\nTeam 5- Communicating with the Covid Patient i. Skill of Empathy ii. Alternate frame work of reference iii. Giving Moral support to develop confidence to recover him quickly iv. Awareness on the importance and benefit of Breathing Exercises\r\n ', 'Interest of students in a team is improved in Counselling the community people ', 'Dr. Sandhya Kadam', 'Workshop by Ms. Manisha Karape to help people during covid-19', 'Each One & Reach One by Ms. Manisha Karape during workshop by Ms. manisha Karape to help people during Covid-19', 'Team 1 details during workshop by Ms. Manisha Karape ', 'Team 2 details during workshop by Ms. Manisha Karape ', 'Workshop by Ms. Manisha Karape to help people during Covid-19.jpg', 'Each One & Reach One during Workshop by Ms. Manisha Karape.jpg', 'Team1 during workshop by Ms. Karape.jpg', 'Team 2 details during workshop by Ms. Karape.jpg', '213.jpg', NULL, NULL, NULL),
(212, 'Environment Management and Sustainable Development', 'Green Club', '2021-06-05', '9:00 AM', 'Online', 'All faculty members and students', 10, 0, '1. The competition will help to generate ideas to develop environment towards sustainability.\r\n2. It will help to improve presentation skills', '', 'Green Club and DLLE(Department of Lifelong Learning and Extension) of  K J Somaiya Institute of Engineering and Information Technology, Sion Mumbai-22 are organizing e_Poster Making Competition on \"Environment Management and Sustainable Development\", for all students and staff members on the occasion of  \" World Environment Day\", June 5, 2021. The participant will be getting an E-certificate on successful submission of e_Poster at greenclub.tech@somaiya.edu. \r\n\r\nGuidelines for making the e_Poster for the competition are as below:\r\n\r\n1.       Participation should be in a group (2/3).\r\n\r\n2.       Poster should be prepared in English language. Any topic/subtopic in line with \"Environment Management and            Sustainable Development\" can be chosen for the competition i.e. Global warming, Biodiversity etc. \r\n\r\n3.       Size in Pixels: 1080X1080\r\n\r\n4.       Identity should not be revealed in the poster. Posters will be evaluated by a Panel of Evaluators.\r\n\r\n5.      The format is attached herewith for your reference.\r\n\r\n6.     Deadline for submission of e_Poster at greenclub.tech@somaiya.edu : 15th June 2021.', 'The Participants interested have improved presentation skills at digital platform which incorporated with many useful ideas.', 'Dr. Sandhya Kadam', 'e_Poster Competition', 'e_Poster Competition', '', '', 'World Environment Day.jpg', 'Sustainable development.jpg', '', '', '212.jpg', NULL, NULL, NULL),
(211, 'COEPS CELL online training program', 'COEPS Cell', '2021-06-14', '3:40 PM', 'Online', 'SE TO TE ALL BRANCHES STUDENTS', 79, 4, '1) To introduce about major section of Central Railway from engineering perspective.\r\n2) To give hands on experience on AWS ,Pentagram, motor coach .AC train ,transformer \r\n3) To develop a mind state of SE and TE  students to see the real time problem in Indian railway by applying their\r\nengineering knowledge. \r\n', '1 )Shri Ajinkya Tambe   BT Engr.\r\n2)Shri vishaw Buran     BT CLA\r\n3)Shri Abhijeet kumer  Siemens Engr.\r\n4) shri Keyur shinde Siemens Engr.\r\n5)shri Nilesh Lomate SSE(Elect)\r\n6) Mrs.Puri Agrawal SSE (AWS)\r\n7)Shri Pawankumer Dube SSE (BE)CLA\r\n8) Shri Atulkumer SSE(TM)CLA\r\n9)Mrs.Deeak bediya SSE(CE) CLA\r\n\r\n\r\n(* SSE :Senior  sectional engineer )  all expert are from central railway Mumbai', 'After this six days online training program ,\r\n1)Online exam will be conducted in order to check the whether the students have understood whatever they studied in training period \r\nin the internship and gain knowledge of all technical session of Indian railway.\r\n2) Topper student will be selected for real time project with Indian railway.\r\n3)After every session student\'s attendance is evaluated by the feedback form and it is reflected that all the students have gained knowledge from each session.\r\n4) For each session internal mentor was present with students to maintain the discipline in online mode training as students count was very high. \r\n5) In group of 10 to 12 students will prepared one report of internship that is to be submitted to CR and COEPS CELL from which they can  learn how to work in a team and how to maintain the documents.', 'After this internship ,\r\n1)Students have gain the knowledge about all the major sections of Indian railway .\r\n2)Students are able to think about real time project /case study by applying their engineering knowledge to solve the basic problem in \r\nIndian railway .\r\n3)Interns realized the effort taken by technical Indian railway staff and take an oath to take care of public property.\r\n4)Interns are willing to work with multidisciplinary real time project by applying AI and power electronics\r\nknowledge .', 'Mrs.sandhya Deshpande COEPS cell Convener, \r\nA.P.EXTC dept.\r\nKJSIEIT,sion,Mumbai,22 ', '1st day Photograph ', '2nd day persentation', '3rd  day presentation', '3rd  day presentation', 'Screenshot_2021-06-18-17-19-31-865_us.zoom.videomeetings.jpg', 'Screenshot_2021-06-19-16-35-26-394_us.zoom.videomeetings.jpg', 'Screenshot_2021-06-18-16-03-20-253_us.zoom.videomeetings.jpg', 'Screenshot_2021-06-18-17-19-31-865_us.zoom.videomeetings.jpg', 'Coeps cell 16th intwrnship banner (1).jpg', NULL, NULL, NULL);
