(236, 'Reading Skills-a Career Game Changer, Organized on the Occasion of National Reading Day on 19th June, 2021 ', 'The Department of Library', '2021-06-19', '10:00 AM', 'Online', 'FE Students', 196, 0, '	To reinforce linguistic abilities with a focus on career enhancement \r\n	To inculcate the critical thinking for academic environment \r\n	To emphasize on types of Reading skills: skimming, scanning, predicting, & comprehension\r\n', 'Dr. Vrushali Deole, Faculty, BSH', 'Dr. Vrushali Deole divided presentation into two pedagogical sectionsthe first being the crux on theoretical paradigms of Reading as one of the foremost fundamental skill & the latter on the inspirational global literature. The various of book genresadventure, fantasy, fiction etc.  were discussed. In addition, blocks to effective reading & guidance on inculcating reading skills for enhancing placement situations were recommended to the students. Also, few of the inspirational poems, novels, plays were briefly presented. ', '	The FE students gained an insight into the types, significance of Reading for placement situations.\r\n	The learners acquired view on the need for harnessing of Reading as a practice for career enhancement  \r\nThe event concluded with a thank you note by Mrs. Gauri Gothivrekar. The participants were provided with an e-certificate post the completion of formalities of the session. \r\n', 'Mrs. Gauri Gothivrekar', '', '', '', '', '', '', '', '', 'Wallpaper Reader\'s Day on 19th June, 2021.jpg', NULL, NULL, NULL),
(238, '\'Abroad Studies\' ', 'Student Council', '2021-06-22', '6:00 PM', '', 'students of all years and all branches of the institute', 79, 0, 'This webinar will be really helpful for those who are confused about their Post Graduation Abroad and get insights on how to prepare for entrance exams.', 'Prof. K.P Singh, Head Counselor at IMFS.\r\nProf. K.P. Singh is ubiquitous with foreign education across the country. Prof. Singh serves as the head counselor and chief verbal faculty at IMFS (The Institute of Management and Foreign Studies) and is also the visionary responsible for the growth of this company as both its founder and CEO.', 'The speaker discussed the current situation for studying abroad, the various factors considered for MS, how one can apply for future studies abroad, and the challenges faced to go abroad.', 'The students who want to pursue their MS abroad were benefitted from this webinar ', 'Prof. Uday Rote, Dean - Student Welfare', 'How many jobs available and in which country and what will be the minimum salary after doing Masters', 'The current situation in the US for studying as an international student', '', '', 'WhatsApp Image 2021-06-22 at 6.26.24 PM.jpeg', 'WhatsApp Image 2021-06-22 at 6.33.53 PM.jpeg', '', '', 'kp5.png', NULL, NULL, NULL),
(237, 'Sunburn Campus KJSIEIT', 'Student Council', '2021-06-19', '8:00 PM', 'Online', 'Students from all departments and all years from various colleges', 120, 71, 'To give participants a break from their day-to-day activities, organizing a fun & entertaining night. To create a hype about our cultural & sports fest.', 'DJ BASSHUNK', 'The event was organized by the Students\' Council to reveal the theme of this year\'s cultural fest Surge 2021 and sports fest, Score 2021. The event began with a performance by renowned EDM DJ Basshunk as people had fun. This was followed by revealing the themes for Surge 2021 and Score 2021.', 'Theme reveal and a stage for participants to socialize and come together to enjoy and have fun.', 'Prof. Uday Rote, Dean - Student Welfare', 'DJ Basshunk performing at SUNBURN KJSIEIT', 'DJ Basshunk performing at SUNBURN KJSIEIT', '', '', 'pic1.jpeg', 'pic2.jpeg', '', '', 'basshunk.jpeg', NULL, NULL, NULL),
(198, 'Arduino workshop', 'Institute of Electrical and Electronics Engineers (IEEE)', '2021-06-12', '5:00 PM', 'Online', '9th, 10th & 11th Standard Students of BMC High School Chambur, Mumbai.', 0, 30, 'To kindle awareness and motivate students about the Arduino technology and its applications in real life, and also inculcate their interest in engineering field. ', 'Speaker: Pratik Gangapurwala\r\nSpeaker: Siddharth Sharma\r\nSpeaker: Tejas Pagare\r\nSpeaker: Aditya Wagh', 'Day 1:\r\nSpeaker: Pratik Gangapurwala\r\nContent covered :\r\n\r\n 1.What are microcontrollers and microprocessors?\r\n2. Difference between them\r\n3. What is Arduino \r\n4. Specifications of Arduino \r\n5. What is digital signal and what is analog signal + their simulations\r\n6. PWM + its simulation\r\n7. How to choose a microcontroller.\r\n8.How to choose a Arduino board( similar to choosing microcontroller\r\nDay 2:\r\nSpeaker: Siddharth Sharma\r\nContents:\r\nIntroduction to programming\r\nIntroduction to C Language\r\nC compiler and editor\r\nVariables, operators and statements in C\r\nIntroduction to Arduino IDE\r\nWriting a program for making the LED blink.\r\nIntroduction to TinkerCAD\r\nSimulation using TinkerCAD\r\nDay 3:\r\nSpeaker: Tejas Pagare\r\nContents:\r\n What are LED?\r\n LED working and circuit Symbol\r\n 7 segment\r\n Working of 7 segment\r\n Seven segment interfacing\r\n What are LCD\r\n Polarization\r\n Colour\r\n LCD Display interfacing\r\n Fun Simulation and Program Display\r\n\r\nDay 4:\r\nSpeaker: Aditya Wagh\r\nContents: \r\nProject Demonstration\r\nAnalysis\r\nErrors & troubleshooting\r\nApplication\r\n\r\n', 'The interest of the students to perceive the technical education and be able to understand and build small working models using Arduino. ', 'Prof. Sandeep Mishra \r\ncounselor IEEE (EXTC)\r\nProf. Pranali Hatode\r\nCoordinator IEEE (EXTC)', 'Arduino Pics 1', 'Arduino event pics 2', 'Arduino pics 3', 'Arduino pics 3', 'Arduino Pic 2.jpg', 'Arduino pic3.jpg', 'Arduino pic3.jpg', 'Arduino pic4.jpg', 'Arduino Banner 1.jpg', NULL, NULL, NULL),
(231, 'Yoga and Fitness ', 'National Service Scheme (NSS)', '2021-06-21', '4:00 PM', 'Online', 'Students and Faculty of KJSIEIT, All NSS units', 14, 41, '1. Spreading awareness about yoga and celebrating International Yoga Day.\r\n2. Learning the importance of yoga and teaching benefits of different yoga asanas. ', 'Ms. Komal Kakkar : She has been a staunch practitioner of yoga and meditation for 7 years. Apart from being a fitness aficionado, she has also been the underdeputy secretary of the ARSD Youth Conclave18.', 'She explained to the students and volunteers the different yoga asanas to maintain a healthy life. She taught and demonstrated different asanas to  help students cope with stress management in this Covid-19 pandemic. The session ended with relaxing breathing exercises like kapalbhati and bhastrika . The session ended with a query session where the doubts of the participants were properly cleared by the speaker.', 'The event ended on a high note with the participants gaining expert knowledge about the importance of yoga and benefits of different yoga asanas to lead a fit and healthy life .', '1. Prof. Pankaj Deshmukh', 'Speaker of the event', 'Speaker demonstrating yoga asanas', 'Participants performing yoga asanas', 'Participants performing yoga asanas', 'WhatsApp Image 2021-06-21 at 4.56.47 PM.jpeg', 'WhatsApp Image 2021-06-21 at 4.56.46 PM (1).jpeg', 'WhatsApp Image 2021-06-21 at 4.56.39 PM.jpeg', 'WhatsApp Image 2021-06-21 at 4.56.45 PM.jpeg', 'day2.jpeg', NULL, NULL, NULL),
(230, 'Yoga and Fitness ', 'National Service Scheme (NSS)', '2021-06-20', '5:00 PM', 'Online', 'Students and Faculty of KJSIEIT, All NSS units', 14, 41, '1. Spreading awareness about yoga and celebrating International Yoga Day.\r\n2. Learning the importance of yoga and teaching benefits of different yoga asanas. \r\n', 'Dr. Priyanka Joshi : She is a physiotherapist by profession and a member of Indian Academy of Fitness. She is a certified yoga, pilates and kettlebell trainer. She also holds certification in post natal and antenatal fitness and is also a cancer fitness expert.', 'She explained to the students and volunteers the importance of practicing yoga to maintain a healthy life. She taught different exercises to help students cope with stress management in this Covid-19 pandemic. The session ended with a query session where the doubts of the participants were properly cleared by the speaker.', 'The event ended on a high note with the participants gaining expert knowledge about the importance of yoga and benefits of different yoga asanas to lead a fit and healthy life.', '1. Prof. Pankaj Deshmukh', 'Speaker of the event', 'Speaker demonstrating yoga asanas', 'Participants performing yoga asanas', 'Participants asking doubts in query session', 'IMG-20210621-WA0005.jpg', 'IMG-20210621-WA0014.jpg', 'IMG-20210621-WA0011.jpg', 'Screenshot (68).png', 'day1.jpeg', NULL, NULL, NULL),
(225, 'workshop  on Arduino', 'Institution of Engineers (IEI)', '2021-06-18', '3:00 PM', 'Online', 'Students', 60, 0, 'To aware the student about arduino and interfacing.', 'Mr.Deep maru', 'The session was very informative where in there were total,30 attendees attended the session. Maximum number of participants were from EXTC&IT department.', 'It should be learning outcomes for students. After attending the 3days workshop of Arduino, students will be performed the assembling of different component with Arduino. The students learn how to program Arduino using software. The students will get basic knowledge of different Arduino boards, types of sensors and motors. It should be beneficial to performdifferent ideas based on Arduino virtually using the tinkercad websites.', 'Martand jha from Department of Electronics and Telecommunication Engineering.', '', '', '', '', 'a1.png', 'a2.png', 'a3.png', 'a4.png', 'IMG-20210615-WA0023.jpg', NULL, NULL, NULL),
(221, 'Webinar on Cyber Security- A Road Map to Career Opportunities and Challenges ', 'Department of Electronics and Telecommunication Engineering and Alumni Committee', '2021-06-12', '11:30 AM', 'Online', 'Students of KJSIEIT sion', 105, 10, '\r\n Students will be able to understand the basics of Cyber Security.\r\n Students will be able to understand NTTE services related to Cyber Security.\r\n Students will be able to know career opportunities in the domain of Cyber Security', '\r\nMr. Srinivas Prasad (EXTC Alumnus 2006-07 Pass out). Cyber security specialist at NetMagic\r\nSolutions (An NTT Communications Company). Practice Head Security Services\r\nNetmagic Solutions (An NTT Communications Company)\r\nDates Employed April 2018  Present\r\nEmployment Duration3 years 2 months\r\nNetmagic Solutions (An NTT Communications Company)\r\nTotal Duration 9 years 9 months\r\nAGM Service Operations\r\nDates Employed Apr 2014  Mar 2017\r\nEmployment Duration3 years\r\nLocation Mumbai Area, India\r\nSenior Manager\r\nDates Employed April 2012  Mar 2014\r\nEmployment Duration2 years\r\nLocation Mumbai, Maharashtra, India\r\nAssistant Manager\r\nDates Employed Apr 2010  Mar 2012\r\nEmployment Duration2 years\r\nLocation Mumbai, Maharashtra, India\r\nDesign, configure and maintain Network/System/Application level security systems.\r\n Lead the analysis of new/existing infrastructure architectures, specify long term direction,\r\nand ensure engineering platforms meet reliability expectations throughout the process.\r\n Analyse security incidents by carrying out detailed investigations, as well as liaise with\r\ncustomers on incident analysis and recovery.\r\n Conduct network, system and web-focused vulnerability scans.\r\n Carry out risk review surveys to recognize security needs.\r\n Review threat and attack trends, develop mitigation and awareness strategies.\r\n Supervise security logs and reports.\r\n Strengthening the IT infrastructure through implementing new technologies.\r\n Assist in internal audits in terms of policy compliance.\r\nSenior Engineer Service Operations\r\nDates Employed Jul 2007  Jun 2010\r\nEmployment Duration 3 years\r\n Installation, configuration and performance tuning of OS (Multiple Linux flavors) including\r\nsetting up of hardware/software RAID as per clients requirement. Administration of\r\nautomated installation servers using Cobbler/Kickstart.\r\n Installation, configuration and performance tuning of LAMP stack.\r\n Authoritative BIND administration.\r\n Administration of email solutions using Qmail, Postfix, MailScanner, Qmail-scanner,\r\nuvscan, clamAV, courier-imap, Horde, Open LDAP, Mailman.\r\n Supporting virtualization technologies like XEN, VmWare, KVM.\r\n Performance and health monitoring using tools like Munin and Nagios.\r\n BASH scripting to automate routine tasks.', ' Mr. Srinivas Prasad commenced the session with diversified approaches in the\r\nfield of Cyber Security. His presentation encompassed the detailed aspects of cyber\r\nsecurityConfidentiality, Integrity & Availability. Few cyber security key wordsBotnet,\r\nZombie Computer, Social Engineering, Phishing Attacks, Ransomware, Malware & Hacking.\r\nHe presented the major threats in the world of cybernetics with crucial parameters\r\nCybersecurity Data Breach, Cybersecurity Job Statistics. He guided the students with the\r\nprospects in the domain of Cyber Security. In addition, Mr. Srinivas agreed upon to provide 10\r\ninternships to the in-house students. ', ' Increased awareness on the global security threats with infringement of cyber security,\r\nfraudulent cases\r\n Vast avenues in the domain of cyber security with wide range of career options\r\nThere was a question-and-answer session at the end. The participants were provided with an\r\nE-certificate post the feedback formalities. ', 'Mrs. Pradnya Kamble\r\nAssistant Professor, EXTC', '', '', '', '', 'banner.PNG', 'cyber.PNG', '', '', 'banner.PNG', NULL, NULL, NULL),
(233, ' 7th online workshop on App development using MIT App Inventor in collaboration with NSC', 'The KJSIEIT\'s COEPS CELL ', '2021-06-30', '2:00 PM', 'Online', 'SE EXTX STUDENTS FROM KJSIET, two students from Vivekananda Education Society of Information Technology, one students from Padmabhushan Vasantdada Patil pratishthans college of Engineering, one students from RAIT,Nerul,navi Mumbai.', 11, 4, 'Objective of this work shop are , students are able to do..\r\n1)How to use MIT app inventor and how it works in frontend as well as backend.\r\n2) Learnt about the basics and how to code the blocks in app development using  MIT App Inventor \r\n3) Able to develop new project for any new game. ', '1)Waman Sathe\r\nDesignation: Technical Officer at Nehru Science Centre, Mumbai\r\nJoined NSC in 1988. Has 32 years of experience of teaching computer software to school and college students, teachers, senior citizens etc. Engaged in developing content based multimedia software for NSC Galleries\r\n\r\n2) Mr. Ranjith Ameen\r\nDesignation: Technical Assistant at Nehru Science Centre, Mumbai\r\nExpert in Developing software using C# and Unity. Has 6 years experience of teaching software & robotics to students. Engaged in developing content based multimedia software for NSC Galleries.\r\n', '\r\n\r\nAfter this COEPS CELL online workshop students are \r\n1.After this workshop students are able to develop any game app.\r\n2From these 15 students ,3-4  students will get a chance of real time project which will be provided by Nehru Science Center \r\n3 .Demonstrate knowledge and understanding of the engineering and management principles and apply these to ones own work, as a member and leader in a team, to manage projects and in multidisciplinary environments\r\n\r\n\r\n\r\n', '1.Students were able to make 4 projects and were able to utilized MIT App Inventor. \r\n2.They can make any project which can be assist embedded in NSC show exhibition.\r\n3.Communicate effectively on complex engineering activities with the engineering community and with society at large, such as, being able to comprehend and write effective reports and design documentation, make effective presentations, and give and receive clear instructions.\r\n', ' Mrs. Sandhya Deshpande \r\nCOEPS cell ,convener A.P. EXTC Departments\r\nKJSIET, Sion, Mumbai\r\n', '1st project', '1st project Code', '2nd day project', '2nd day project', 'WhatsApp Image 2021-07-02 at 4.13.29 PM.jpeg', 'WhatsApp Image 2021-07-02 at 4.13.43 PM.jpeg', 'WhatsApp Image 2021-07-02 at 4.13.58 PM.jpeg', 'WhatsApp Image 2021-07-02 at 4.14.07 PM.jpeg', 'banner coeps cell app develpoment _nsc (2).jpg', NULL, NULL, NULL),
(246, ' Rheumatic Diseases In Young Adults', 'National Service Scheme (NSS)', '2021-07-01', '7:00 PM', 'Online', 'Students and Faculty of KJSIEIT, All NSS units', 16, 109, '1. Spreading awareness about autoimmune diseases\r\n2. Learning about common diseases of joints (arthritis) in young adults \r\n3. Discussing common precautions advised for good musculoskeletal health \r\n', 'Dr. Sushant Shinde MD, Medicine (AIIMS). He has EULAR Certification in Rheumatology. He is a consultant physician, a medical educator, the  Director of Quest Medical Academy  and trustee of Ramvardayini Health Foundation.', 'He explained to the students and volunteers what autoimmune diseases mean and what causes them. He explained about different rheumatic diseases like SLE, rheumatoid arthritis and ankylosing spondylitis. He explained the symptoms of these diseases and why these diseases caused irreparable damage if left unnoticed. He gave an overview of treatments for rheumatic diseases. The session ended with a query session where the doubts of the participants were properly cleared by the speaker.\r\n', 'The event ended on a high note with the participants gaining expert knowledge about the different rheumatic diseases in young adults and the precautions for maintaining good musculoskeletal health', 'Prof. Pankaj Deshmukh', 'Speaker explaining different auto immune diseases', 'Speaker explaining different auto immune diseases', 'Speaker explaining different auto immune diseases', 'Speaker clearing doubts of participants', 'Screenshot_20210701-192445.jpg', 'Screenshot_20210701-193122.jpg', 'Screenshot_20210701-193736.jpg', 'Screenshot_20210701-191835.jpg', 'IMG-20210627-WA0002.jpg', NULL, NULL, NULL),
(217, ' Internship on Web Development Bootcamp & Project Development', 'Institute of Electrical and Electronics Engineers (IEEE)', '2021-06-21', '6:00 PM', 'Online', '2nd & 3rd year students of all engineering discipline', 100, 156, 'To kindle awareness and motivation about the in-depth knowledge of web development amongst the students.', 'Mr. Darshan Mahajan,\r\nEx marketing admin IEEE KJSIEIT\r\nMr. Jash Sanghavi\r\nEx Chairperson IEEE KJSIEIT\r\nMr. Saurin Shah\r\nEx Vice cahirperson IEEE KJSIEIT', 'Web Development Internship\r\nDay1:  HTML: Basics of HTML , Idea of how to use and download Visual studio code\r\nDay 2: CSS : Revision of HTML ,How to make a new file in virtual studio and how to assign folder to it and assign CSS to it.\r\nDay 3: Bootstrap: What is Bootstrap, why to use Bootstrap, Explained what bootstrap template is which we will be making on the 4th day and explained the code.\r\nDay 4: Bootstrap: Bootstrap template hardcoding with the students and solving the doubts which they had regarding it.\r\nDay 5: MySQL:  What are Databases, Basic MySQL commands, xamp installation and configuration \r\nDay 6: PHP: What is php in detail , coded the project(CRUDE Application) and explained it briefly\r\nDay 7: Doubt Solving: Doubts were solved on the groups itself  \r\n', 'Students will be able to \r\n1.Understand the basics of HTML, MySQL & PHP.\r\n2. Develop the web applications.', 'Prof. Sandeep Mishra\r\nIEEE Counselor\r\nProf. Pranali Hatode\r\nIEEE Coordinator', 'Web Development Pics 1', 'Web Development Pics 2', 'Web Development Pics 3', 'Web Development Pics 4', 'Web Development Pic 2.jpg', 'Web Development Pic 3.jpg', 'Web Development Pic 4.jpg', 'Web Development Pic 5.jpg', 'Web evelopment Banner.jpg', NULL, NULL, NULL),
(235, 'Fullstack Development ', 'Industry & Institute Interaction Cell', '2021-06-29', '2:30 PM', 'Online', 'Students', 23, 0, 'To discuss FullStack Development', 'Mr. Vijay Ganesh, Director, Coderpyx Private Limited', 'Web Development', 'Students will be able to understand the FullStack Development.\r\nStudents will be able to know Career opportunities in Fullstack Development.\r\n', 'Dr. Vaishali Wadhe', 'Mr. Vijay Ganesh, Director, Coderpyx Private Limited guiding the participants', 'Mr. Vijay Ganesh, Director, Coderpyx Private Limited discussing about Building Blocks of FullStack Development', '', '', 'Photo-1.jpg', 'Photo-2.jpg', '', '', 'Slide1.JPG', NULL, NULL, NULL),
(243, 'A Quiz Competition - Quiz Master GoGo', 'Computer Society of India (CSI)', '2021-06-27', '4:00 PM', 'Online', 'Students from all years, departments and institutes, who wish to gain and test their knowledge of past and current events of the world.', 59, 8, '1. To improve the cognitive abilities of the students.\r\n2. To improve the time management skills of the participants by providing them a timed environment.\r\n3. To underline the importance of current affairs and inform the students about the advancements in technology.\r\n4. To interact with the first-year students and get them more involved in the co-curricular activities and the idea of technical committees.', '', 'The Computer Society of India, KJSIEIT Chapter of K. J. Somaiya Institute of Engineering and Information Technology (KJSIEIT), Sion, Mumbai had organized an interactive quiz competition named \"Quiz Master GOGO\" for all the students of various departments and institutes. The event was conducted on Zoom Meetings and the quiz was played on the quizizz.com platform. \r\nThe event began with a brief explanation of the flow and rules. The quiz was divided into 5 themes, namely, Technical, Pop Culture, Sports, GK and Current Events and Mystery, with 10 questions per theme. A new quizizz.com link was shared for each respective theme, after the completion of the previous round. The participants were given 45 seconds per question and their scores were calculated on basis of not only the correct answer, but also the fastest one. Throughout the events interaction was maintained with the participants.\r\nAfter the completion of all the rounds, scores were tallied and top 3 winners were announced and hence the event was concluded with a vote of congratulation and sharing of the feedback form.\r\n', 'Through the event, participants were able to test their knowledge on various different topics and fields. The event enabled all the participants to gain interesting information through means of the questions they found difficult. Hence overall, it increased the quick-thinking ability and knowledge set of the participants.', 'Prof. Uday Rote, Convener - CSI', 'Picture of the Participants solving the quiz questions', 'Picture of the Participants solving the quiz questions', 'Picture of the Top 3 winners of the Quiz ', '', 'pic11.jpg', 'pic12.jpg', 'pic13.jpg', '', 'banner.jpeg', NULL, NULL, NULL),
(249, 'Robotics: Implementation through ROS', 'E-yantra', '2021-07-04', '4:01 PM', 'Online', 'STUDENTS OF KJSIEIT', 9, 0, '1) To train students to design and develop robots for various application\r\n2) To give exposure in technical writing\r\n', 'Rohit Mehta,  Programning Lead, Robocon team', 'Mr. Rohit Mehta has explained steps involved in simulating a Bot in Gajebo and ROS environment. He has discussed a technical paper on ROS based Bot, Authored by him.', 'Students will be able to \r\nExplain steps involved in Simulating a Robot\r\n', 'Mr. Prashant Upadhyay', 'Presentation Slides', 'Presentation slides', '', '', 'pic1.jpg', 'pic2.jpg', '', '', '249.jpg', NULL, NULL, NULL),
(253, 'COEPS cell 8th Online workshop on App development using MIT inventor', 'COEPS Cell', '2021-07-07', '1:50 PM', 'Online', 'FE to BE all branches student from our college and others engg college  students.', 10, 9, '1) How to use MIT app inventor and how it works in frontend as well as backend.\r\n2) Learnt about the basics and how to code the blocks in app development using MIT App Inventor\r\n3) Able to develop new project for any new game.\r\n4) To implement ABL (activity based learning)', 'NSC trained interns \r\n\r\n1) Mr. Chinmay Bohle (SE EXTC B div   KJSIEIT,SIon)\r\n2) Mr. Mohit Singh Adhikari (BE EXTC,VESIT,CHEMBUR)\r\n', '\r\n\r\nCOEPS CELL conducts one workshop on 30th June and 1st July in affiliation with NSC ,and prepared to 15 understudies .as this workshop was paid workshop numerous of understudies miss out the reputation to regathers the workshop, so COEPS cell has taken imitative to conduct the same workshop to the understudies without enlistment expenses as free of cost. and all through Mumbai college we got 60 reg. from all over Mumbai and exterior Mumbai colleges and real 20 understudies gone to workshop and speaker for this occasion was from understudies from NSC prepared assistants in7th online workshop which was held on 30th June and 1st july,2021, In this way we effectively conducted ABL(activity based learning)\r\n\r\n\r\n ', '1) How to use MIT app inventor and how it works in frontend as well as backend.\r\n2) Learnt about the basics and how to code the blocks in app development using MIT App Inventor\r\n3) Able to develop new project for any new game.\r\n4)\"One time teaching is two time learning \"Is demonstrated by two students who was trains  in COEPS CELL 7th WORKSHOP which teach student to learn through ABL (Activity Based Learning)', ' Mrs. Sandhya Sandeep Deshpande\r\n COEPS CELL Convener\r\nA.P.EXTC DEPT.KJSIEIT,SION,MUMBAI,22', 'APP DEVELOPMENT FIRST DAY ', 'APP DEVELPOMENT CODING EXPLAIN BY SPEAKER ', 'APP DEVELOPMENT 2ND DAY SPEAKER ', 'APP DEVELOPMENT 2nd DAY SPEAKER ', 'app development _workshop_day1_coding of project .jpg', 'app development _workshop_day1_coding of project .jpg', 'app development _speaker _Mohitsingh Adhikari_VESIT.jpg', 'app develpoment _speaker _Chinamay Bhole.jpg', 'coeps 8th online workshop banner.jpg', NULL, NULL, NULL),
(286, 'To Incubation Unit/Patent Facilitation Centre/Technology Transfer Centre/ Co- working spaces', 'K J Somaiya Institute of Engineering and Information Technology - Institutions Innovation Council', '2021-03-27', '1:00 PM', 'Offline ', 'Students of the Institute', 56, 0, 'Visit was conducted in 4 batches 14 students to Riidl Incubation Unit for motivation and guidance to the aspiring entrepreneurs.', '', 'As per the guidelines provided by MoE\'s Innovation Cell (MIC), India, the field visit to  Incubation Unit/Patent Facilitation Centre/Technology Transfer Centre/ Co- working spaces with Head of Department of Information Technology Dr. Radhika Kotecha was organized by K. J. Somaiya Institute of Engineering & Information Technology - Institutions Innovation Council (KJSIEIT - IIC). \r\n\r\nThe visit has given different views and guidance about start up to the students who are willing to become entrepreneurs. \r\n\r\n\r\n', 'The event facilitated the process of igniting and discussing innovative start-up ideas and guidance for aspiring entrepreneurs.', 'Dr. Radhika Kotecha,\r\nHead - Department of Information Technology\r\n\r\nDr. Radhika Kotecha,\r\nConvener - KJSIEIT IIC\r\n\r\nDr. Suresh Ukarande,\r\nPrincipal - KJSIEIT IIC\r\n\r\n\r\n', 'Glimpse - 1 of the Event', 'Glimpse - 2 of the Event', '', '', '10_1.jpg', '10_2.jpg', '', '', '10_Banner.JPG', NULL, NULL, NULL),
(275, 'Valorant', 'Student Council', '2021-07-08', '11:00 AM', 'Online', 'Students', 70, 0, 'To enhance the teamwork, leadership qualities, sportsmanship, organizing skills for future job situations', '', 'Conducted online.\r\nMode of Conduction: Zoom & YouTube \r\nYou Tube Link: https://www.youtube.com/channel/UCkXnJlsYqjO5Op8bRy6fAnA \r\n\r\n', 'Through this event students explored the application of cognitive strategies such as goal setting,  positive self-talk and teambuilding.', 'The event was coordinated by Prof. Sanjiv Badhe - Sports Coordinator, Master Sarthak Bhosle - Sports Secretary, Master Rahul Akhade, Master Anurag Sing, Master Varad Sawant, Master Manav Gupta, Miss Drishti Jobanputra, Master Yash Panchal, Master Jimit Parmar, Master Jay Munjapara, Master Akshat Limbachiya, Master Dhruv Parikh, Miss Manasvi Sabnis, Master Bhavit Shah along with all student council members.', 'Banner', 'Screenshot', 'Screenshot', '', 'banner.jpg', 'valorant1.jpg', 'valorant2.jpg', '', '', NULL, NULL, NULL),
