(281, 'Chess', 'Student Council', '2021-07-08', '7:00 PM', 'Online', 'Students', 41, 0, 'To enhance the teamwork, leadership qualities, sportsmanship, organizing skills for future job situations\r\n', '', 'Conducted online.\r\nMode of Conduction: Zoom & YouTube\r\nYou Tube Link: https://www.youtube.com/channel/UCkXnJlsYqjO5Op8bRy6fAnA', 'Through this event students explored the application of cognitive strategies such as goal setting, positive\r\nself-talk and teambuilding.', 'The event was coordinated by Prof. Sanjiv Badhe - Sports Coordinator, Master Sarthak Bhosle - Sports\r\nSecretary, Master Rahul Akhade, Master Anurag Sing, Master Varad Sawant, Master Manav Gupta, Miss\r\nDrishti Jobanputra, Master Yash Panchal, Master Jimit Parmar, Master Jay Munjapara, Master Akshat\r\nLimbachiya, Master Dhruv Parikh, Miss Manasvi Sabnis, Master Bhavit Shah along with all student council\r\nmembers.', 'Chess Competition Screenshot', 'Chess Competition Screenshot', '', '', 'chess1.jpg', 'chess2.jpg', '', '', 'banner.jpg', NULL, NULL, NULL),
(272, 'SURGE - Fashion Show', 'Student Council', '2021-07-11', '5:30 PM', '', 'Students across the nation', 0, 60, '1. For participants to gain confidence & express themselves through this art format\r\n', 'Miss Juhi Bhatt, an Indian actress who predominantly acted in movies in the Hindi language.\r\nMiss Sonal Agrawal, an internet personality \r\n', '1. The judges were introduced.\r\n2. The event began by displaying the pre-recorded fashion show of each college.\r\n3. The judges and participants talked about their performance\r\n4. The vote of thanks was given by the event heads.\r\n', 'We had a really glamorous and successful event where talent was displayed and appreciated by our judges and audience.  ', 'Prof. Uday Rote, Dean - Student Welfare', 'Performance by VIT - Team Omega', 'Sonal Agrawal', 'Juhi Bhatt', '', 'fs1.jpg', 'fs2.jpg', 'fs3.jpg', '', 'fs.jpg', NULL, NULL, NULL),
(271, 'SURGE - Musical Housie', 'Student Council', '2021-07-11', '3:00 PM', '', 'Students of KJSIEIT ', 67, 0, 'To make a fun event for KJSIEIT students to interact with each other', '', '1. On filling the form, the participants will get a whatsapp group link at the end of the form. The participants are supposed to join the group, where they will be updated about the event.\r\n2. The participants will be provided with housie tickets in pdf format in the whatsapp group, a day before the event. Every housie ticket will have the name of the respective participant above it. The participants will have to find their ticket in the pdf and make a copy of it or can take the screenshot of their respective ticket.\r\n3. Before starting the event, once all the participants have joined the zoom meeting, the song list will be shared with the participants. The song list will have the song number and the song name.\r\n4. The event will start with the first shuffled song playing. The participants will listen to the song, guess/understand the song name, find the song name in the given list, check the respective song number, and check if the number is present in their ticket. If yes, they are supposed to cut the number in their ticket.\r\n5. Total 90 songs will be played, each for 20-25 seconds and 10 secs will be given after every song as a buffer time to guess it.\r\n6. As soon as a participant wins a prize, he will just unmute and tell which prize he is claiming. The participant doesnt need to cross check, cross checking will be done by the team members.\r\n', 'All the participants had great fun playing and interacting during the event. ', 'Prof. Uday Rote, Dean - Student Welfare', '', '', '', '', 'mh1.jpg', 'mh2.jpg', 'mh3.jpg', '', 'mh.jpg', NULL, NULL, NULL),
(270, 'SURGE - Mr. Ms. KJSIEIT (Spotlight)', 'Student Council', '2021-07-11', '1:00 PM', 'Online', 'Students of KJSIEIT ', 25, 100, 'Spotlight was a personality event, our talented participants were judged on the basis of how bright their personality shines as compared to others. ', '', 'Introduction: They had to choose a tagline from any movie or series which suited them best along with the general intro. Also they were asked to add how did they interpret the theme of SURGE that is Khwaab - The transcend reality\r\nIntroduction should not go for more than 2 mins.\r\n\r\nTalent round: Pre recorded videos were taken by the participants and were streamed.\r\n\r\nQNA round: there was elimination after talent round, participants which headed towards this rounds were to be answer the Questions by judges', 'Participants were able to come up with their talents and presented themselves well.', 'Prof. Uday Rote, Dean - Student Welfare', '', '', '', '', 'sl1.jpg', 'sl2.jpg', 'sl3.jpg', 'sl4.jpg', 'sl.jpg', NULL, NULL, NULL),
(269, 'SURGE - Pop Quiz', 'Student Council', '2021-07-11', '11:00 AM', 'Online', 'Students of KJSIEIT ', 50, 0, 'A fun departmental level event for all quiz enthusiasts of the college. \r\nIt will test the cognitive ability and problem-solving ability of the students.\r\nWill help in improving time management skills of the participants.\r\nTo highlight the importance of current affairs, general knowledge and inform the students about the advancements in technology.\r\nInstilling the virtue of team work within the participants.\r\n', '', '2 teams from COMPS, IT, EXTC and AI-DS each registered for the event.\r\nTeams were told to choose names for themselves to make the event fun.\r\nA clear understanding of the rules and flow of the event was given to the participants prior to the event.\r\nThe concept of lifelines was introduced to the participants to give the event an unconventional twist.\r\nThe questions were displayed on the screen with the help of a PowerPoint Presentation.\r\nThe answers to questions in Round 1 were given in the chat box.\r\n4 teams out of 8 advanced to Round 2 on the basis of scores.\r\nThe answers to questions in Round 2 were given verbally by the team leader.\r\n', 'The event was successful in meeting the objectives.\r\nThe participants enjoyed the event and the Team Smarticles from the Computer Engineering Department were declared winners of the event.\r\n', 'Prof. Uday Rote, Dean - Student Welfare', '', '', '', '', 'pq1.jpg', 'pq2.jpg', 'pq3.jpg', 'pq4.jpg', '', NULL, NULL, NULL),
(268, 'SURGE - Inter Dance', 'Student Council', '2021-07-10', '7:00 PM', '', 'Students across the nation', 0, 100, 'Indian dancers showcase their talent in a series of rounds and are assessed by a panel of judges. The judges decide who stays and who is eliminated.', 'Ms. Anupriya Goenka\r\nMs. Manya Singh\r\n', '1. On the event day, a zoom meeting will be created which will also be streamed on YouTube. \r\n2. Only the leader of each group will be allowed to enter the Zoom Meeting, other participants can watch on YouTube. \r\n3. The event will be started by giving a brief introduction about the event. \r\n4. After the start of the event each group performance will be streamed simultaneously and judges can share some views between each performance. \r\n5. After streaming all the performances, some time will be given to judges and the winners will be declared at the end of the meeting.', 'The performances were jaw dropping, the judges enjoyed it and the event commenced on a high note. ', 'Prof. Uday Rote, Dean - Student Welfare', '', '', '', '', 'id1.jpg', 'id2.jpg', 'id3.jpg', 'id4.jpg', 'id.jpg', NULL, NULL, NULL),
(252, 'SURGE - Events: Inauguration, Scavenger Hunt, Antakshari, Open Mic, Inspirational Q&A Session - Beyond all limits, Departmental Debate, Talent Hunt, Somaiya Unplugged, Short Film Making, Inter Dance, Departmental Pop Quiz, Mr. Ms. KJSIEIT, Musical Housie, Fashion Show, Panel Talks, Photo Hunt, Meme Battle, Bull Run', 'Student Council', '2021-07-09', '11:30 AM', 'Online', 'Students & Faculties across the nation', 1000, 9000, '1. The Surge festival aims to provide a rejuvenating platform to showcase the latent talents\r\namong the students in the direction of holistic growth.\r\n2. The participation in festival events is aimed to enhance team work, leadership qualities\r\nfor future job situations.', '', 'At the onset, following the campus prayer, as a part of nostalgic campus tour, the revisiting surge 2020\r\nmemories by showcasing the Surge-after video of March 2020 fest was plugged in. Prof. Uday Rote,\r\nDean, Student welfare, was invited who briefed on the surge outline. Vice-Principal Dr. Sunita Patil\r\nguided the audience with inspirational situations & realistic goals pertaining to the pandemic situation\r\nas well as stressed on the holistic development. Principal Dr. Suresh Ukarande motivated the audience\r\nby quoting from APJ Abul Kalams iconic verse Dream Is Not That Which You See While Sleeping It\r\nIs Something That Does Not Let Your Sleep. He inspired the youth to strike a fine-balance of\r\nacademics and cocurricular so as to emerge as a successful personality.\r\nSaluting the gallant spirit, a tailor-made video made by Students Council of Lieutenant Colonel Mr.\r\nMajor Kumar Sinha was showcased. The video snippet captivated the quintessence spirit of his fiery\r\narmy spirit to have led intense counter-terrorism battles in Kashmir. For this bravery, he was conferred\r\nwith the coveted Sena Medal gallantry award for killing six terrorists in multiple operations.\r\nThe Chief Guest Lieutenant Colonel Mr. Major Kumar Sinha commenced his presentation with\r\nrelevant message centred on the theme of the festivalKhwabmultiple dreams dimensions. His\r\nzealous interaction encompassed a strong appeal to the youth as a fraternity of science & technology,\r\nrather than be in self-dipped in ones selfish dreams, one must march like a warrior in battlefield to\r\ndestroy the evils affecting the Indian society. Through his fiery persona, he commanded to join forces\r\nin collective consciousness in common to dream of India as an ideal nation!\r\nThe official unveiling of the Surge 2021 & its theme was executed at the hands of the chief guest,\r\ndignitaries & the student team. There were presentations by Miss. Gitika JhaGeneral Secretary,\r\nMaster Rayees ShaikhCultural Secretary, Master Sarthak BhosleSports Secretary, Prof. Sanjiv\r\nBadheSports Secretary & Dr. Sandhya KadamCultural Coordinator. Miss Sharvari Kulkarni\r\nproposed vote of thanks. The event concluded with national anthem.\r\nThe Students Council had organized various events during SURGE- 2021 for the students as\r\nfollows-\r\n Bull Run: Event related to simulated stock trading , a full day was given to buy and sell\r\nstocks, the person with the most profit at the end of the day won.\r\n Fashion Show: A Virtual Fashion Show among teams of different colleges.\r\n Inter Dance: College Dance Teams all across India showcased their talent in a series of\r\nrounds and were assessed by a panel of judges. The judges decided who stayed and who\r\nwas eliminated.\r\n Meme Battle: Let\'s put your most eye-wateringly hilarious memes against each other.\r\nThe funniest one in the room takes it all! Let the meme battle begin!\r\n Open Mic: An opportunity to speak your heart out in the form of any art and move the\r\nhearts of our audience!\r\n Photo Hunt: A Theme-Based photography competition where participants were given a\r\ntime frame to come up with the most captivating picture they can take.\r\n Scavenger Hunt: Put on the overcoat and smoke the pipe cause you\'re about to play\r\nSherlock Holmes. One hint will lead to another and at the end point will be grand prize.\r\n Somaiya Unplugged: Musical Bands from different colleges competed against each other\r\nand were assessed by a panel of judges. The judges decided who stayed and who was\r\neliminated.\r\n Talent Hunt: Performers from across India present unique acts before celebrity judges\r\nand a nationwide audience in order to advance in the competition and win a huge prize!', 'It gives students a break from their academic routine and a chance to showcase their skills\r\nand talents and can enjoy fun events.\r\nIt helped students to know their colleagues a little better and to have a chance to interact\r\nwith their seniors and renowned celebrities in a bid to get over their social anxiety if any.', 'Prof. Uday Rote, Dean - Student Welfare', '', '', '', '', 's1.jpeg', 's2.jpeg', 'id4.jpg', 'mh1.jpg', 'surge banner (2).jpg', NULL, NULL, NULL),
(259, 'SURGE - Inauguration', 'Student Council', '2021-07-09', '11:30 AM', 'Online', 'Students, Parents & Faculties across the nation', 180, 1000, 'The Surge festival aims to provide a rejuvenating platform to showcase the latent talents\r\namong the students in the direction of holistic growth.\r\nThe participation in festival events is aimed to enhance the teamwork, leadership\r\nqualities for future job situations.', 'Lt Col Manoj Kumar Sinha', 'At the onset, following the campus prayer, as a part of nostalgic campus tour, the\r\nrevisiting surge 2020 memories by showcasing the Surge-after video of March 2020 fest was\r\nplugged in. Prof. Uday Rote, Dean, Student welfare, was invited who briefed on the surge\r\noutline. Vice-Principal Dr. Sunita Patil guided the audience with inspirational situations &\r\nrealistic goals pertaining to the pandemic situation as well as stressed on the holistic\r\ndevelopment. Principal Dr. Suresh Ukarande motivated the audience by quoting from APJ\r\nAbul Kalams iconic verse Dream Is Not That Which You See While Sleeping It Is Something\r\nThat Does Not Let Your Sleep. He inspired the youth to strike a fine-balance of academics\r\nand cocurricular so as to emerge as a successful personality.\r\n\r\nSaluting the gallant spirit, a tailor-made video made by Students Council of Lieutenant\r\nColonel Mr. Major Kumar Sinha was showcased. The video snippet captivated the\r\nquintessence spirit of his fiery army spirit to have led intense counter-terrorism battles in\r\nKashmir. For this bravery, he was conferred with the coveted Sena Medal gallantry award\r\nfor killing six terrorists in multiple operations.\r\nThe Chief Guest Lieutenant Colonel Mr. Major Kumar Sinha commenced his presentation\r\nwith relevant message centred on the theme of the festivalKhwabmultiple dreams\r\ndimensions. His zealous interaction encompassed a strong appeal to the youth as a fraternity\r\nof science & technology, rather than be in self-dipped in ones selfish dreams, one must march\r\nlike a warrior in battlefield to destroy the evils affecting the Indian society. Through his fiery\r\npersona, he commanded to join forces in collective consciousness in common to dream of India\r\nas an ideal nation!\r\nThe official unveiling of the Surge 2021 & its theme was executed at the hands of the chief\r\nguest, dignitaries & the student team. There were presentations by Miss. Gitika JhaGeneral\r\nSecretary, Master Rayees ShaikhCultural Secretary, Master Sarthak BhosleSports\r\nSecretary, Prof. Sanjiv BadheSports Secretary & Dr. Sandhya KadamCultural\r\nCoordinator. Miss Sharvari Kulkarni proposed vote of thanks. The event concluded with\r\nnational anthem.', 'The ceremonial speeches resulted in inculcation of patriotic values amongst the youth\r\nIt offered a learning platform to listen to the army veterans ethical views to be adopted\r\nas Indian citizens.', 'Prof. Uday Rote, Dean - Student Welfare', '', '', '', '', 'in1.jpeg', 'in2.jpeg', 'in3.jpeg', 'in4.jpeg', 'IMG_2524 (1).jpg', NULL, NULL, NULL),
(260, 'SURGE - Scavenger Hunt', 'Student Council', '2021-07-09', '2:00 PM', '', 'Students across the nation', 25, 6, 'To bring a fun event to college students during pandemic.\r\nTo create a sense of competition amongst peers.\r\n', '', 'Scavenger Hunt is a game where the participants are given clues to some household items. They have to crack the clues and send the picture of that particular item. The participants were marked partially on a first-come-first-serve basis. There were 15 clues given to the participants. After 15 clues, three participants with the highest scores were declared the winner, runner up, and 2nd runner up respectively. \r\n', 'It was an interactive event. Participants had a great time solving the clues and gave a tough competition to each other.  ', 'Prof. Uday Rote, Dean - Student Welfare', '', '', '', '', 'sh1.jpeg', 'sh2.jpeg', 'sh3.jpeg', '', 'sh.jpg', NULL, NULL, NULL),
(262, 'SURGE - Open Mic', 'Student Council', '2021-07-09', '3:30 PM', 'Online', 'Students across the nation', 100, 1000, 'To bring a fun event to college students during pandemic.\r\nTo create a friendly sense of competition amongst peers.\r\n', '', 'Open mic is an event where the participants are given a chance to perform their talents like poetry, creative writing, mimicry, stand up and many more. They will be allotted 3-5 minutes for their performance. The participants were marked on their confidence and the way they deliver their content. Three participants with highest scores were declared the winner, runner up and 2nd runner up respectively. ', 'It was an interactive event. Participants had a great time in performing and gave a tough competition to each other. ', 'Prof. Uday Rote, Dean - Student Welfare', '', '', '', '', 'om1.jpeg', 'om2.jpeg', 'om3.jpeg', '', 'om.jpg', NULL, NULL, NULL);
