(263, 'SURGE - Departmental Debate', 'Student Council', '2021-07-07', '10:00 AM', 'Online', 'Students of KJSIEIT ', 50, 0, 'To kindle discussions between teams from various departments, on topics which are provided on the spot.', '', 'Allocation of topic and declaration of the team arguing for the topic and against the topic.\r\nPreparation of Points (Duration: 5 mins).\r\nCommencement of the debate (Duration: 12 mins).\r\nComments from the judges and declaration of results (Duration: 3 mins).\r\nThe round ends.\r\n', 'Discussion between opposing ideologies lead to a great learning experience for all the participants. The importance of civil discussion was realized.', 'Prof. Uday Rote, Dean - Student Welfare', '', '', '', '', 'dd1.jpeg', 'dd2.jpeg', 'dd3.jpeg', 'dd4.jpeg', 'dd.jpg', NULL, NULL, NULL),
(264, 'SURGE - Talent Hunt', 'Student Council', '2021-07-10', '12:00 PM', '', 'Students across the nation', 10, 70, 'To organize a fun event for the students during the pandemic.\r\nAllow the students to showcase their unique talents and hone them.\r\nTo create a healthy and positive competitive environment among the students.\r\nTo inspire genuine talents and help build confidence among students of all categories and talents.\r\n', '', '1. Registration and video submittence must be completed by midnight, 6th July, 2021. \r\n2. The films have to be shared as a drive link on the following emails: karan.hs@somaiya.edu and manasvi.sabnis@somaiya.edu \r\n \r\n3. Video must be between 1 minute and 3 minutes in length.\r\n \r\n4. Your entry will not be accepted if:\r\nThe act is not within the required duration requirements.\r\nThe act is found to be unoriginal.\r\nThe act contains any defamatory or obscene material.\r\n 5. The films will be screened during the time of the event, that is 11 :00 AM onwards on the 10th of July, 2021, on youtube for the audience to view.\r\n \r\n 6. The participants will be required to give a short introduction (about a minute) about themselves and their act before it screens.\r\n \r\n 7. The Acts will be judged on originality, creativity, stage presence, aesthetic appeal, technical ability, appropriateness, poise and entertainment value as well as the overall personality and the talent of the contestant to reach an audience.\r\n \r\n8. Any participant disrupting the flow of the event will be disqualified.\r\n9. In case of any discrepancies, the decision of the event heads will be final.\r\n', 'It was an interactive event. Participants had a great time and it was overall a fun but at the same time a very competitive event. ', 'Prof. Uday Rote, Dean - Student Welfare', '', '', '', '', 'th1.jpg', 'th2.jpg', 'th3.jpg', '', 'th.jpg', NULL, NULL, NULL),
(266, 'SURGE - Somaiya Unplugged', 'Student Council', '2021-07-10', '4:00 PM', 'Online', 'Students across the nation', 50, 150, 'Musical Bands from different Colleges will compete against Musical Bands from different Colleges will compete against each other.', '', 'Registration through google form(with video).\r\nA whatsapp group will be created of all the band leaders after the registrations are closed.\r\nIntroduction of the event.\r\nOnly the band leader can join Zoom using the Bands name.\r\nThe submitted videos will be played on Zoom and streamed on youtube live.\r\nJudges will score according to the marking scheme given below.\r\nWinners will be announced at the end.\r\nConcluding the event.\r\n', 'Bands from various colleges submitted their performance videos for the contest. All of them competed for top three places that were decided by the judges based on certain judging criteria.', 'Prof. Uday Rote, Dean - Student Welfare', '', '', '', '', 'su1.jpg', 'su2.jpg', 'su3.jpg', 'su4.jpg', 'su.jpg', NULL, NULL, NULL),
(234, 'Building Start-Up Ecosystems', 'National Innovation and Start up Policy(NISP)', '2021-07-01', '2:30 PM', 'Online', 'Student', 530, 0, 'To provide a platform for speedy commercialisation of technology developed by new entrepreneurs.\r\nTo build a vibrant startup ecosystem, by establishing a network between academia, financial institutions, industries, and other institutes.', 'Dr. Radha Iyer, Chairperson Innovation & Entrepreneurship Cell, Riidl, Ms. Hetal Doshi, Head-ECell,  Mr. Sagar Thareja, Director, Futurepreneur Hub LLP,  Riidl, Mr. Raj Dhirwani, Innovation Catalyst, Riidl, Mr. Moiz Choolawala, SEBI Regd. Investment Advisor, M/S. Plansmart Financial Consultants.', 'Idea Generation, Funding Option, DIgital Marketing & Revenue Generation for Startup, Government Scheme for startup', 'Students will learn about the basic principles of entrepreneurship and general approaches to planning and designing business models. This will be followed by a selection of entrepreneurial ideas and a discussion of individual ideas as opportunities. The focus will be on grasping the basic methods, tools and constructs needed in order to verify business ideas and, based on market confirmations, identify them as business opportunities.\r\nAble to convert Ideas into products.', 'Dr.Vaishali Wadhe\r\nDr.Manisha Chahal', 'Day 1: Inauguration ', 'Day 1: Session 1', 'Day 2: Idea Generation ', 'Day 3: Funding Planning', '3.jpg', '4.jpg', '123.jpg', 'Capture444.jpg', 'Final Imah.jpg', NULL, NULL, NULL),
(261, 'SURGE - Antakshari', 'Student Council', '2021-07-09', '2:30 PM', '', 'Faculty and Management from all departments and all years from college.', 4, 0, 'To make a fun event for faculty members to destress and bond with each other', '', 'The event was organised by the Students\' Council to relieve the professors from their stressful and busy life for a fun session of music and dance. It eased them out and helped the students to know their teachers in a much better way.', 'a stage for students and teachers to socialize and come together to enjoy and have fun.  ', 'Prof. Uday Rote, Dean - Student Welfare', '', '', '', '', '1626413393604.jpg', '1626413393588.jpg', '1626413393612.jpg', '1626413393596.jpg', '1626413393619.jpg', NULL, NULL, NULL),
(273, 'SURGE - Panel Talks', 'Student Council', '2021-07-11', '7:00 PM', 'Online', 'Students & Faculties across the nation', 400, 1000, 'To provide a stage for participants to socialize and come together to enjoy and have fun.', '1. Shivankit Singh Parihar  He is an actor and a writer working with TVF for their online series. He was one of the main stars of their latest hit series  Aspirants.\r\n2.	Badri Chavan  He is an actor and a YouTube personality working with TVF who is a former IITian. \r\n3.	Jasmeet Singh Bhatia - He is an actor, a writer and an engineering graduate, who worked in Infosys post-graduation before transitioning into screenplay writing and acting, currently working with TVF.', 'The event was organized by the Students\' Council as a closing event of this year\'s cultural fest Surge 2021. The event was a fun talk session with the people mentioned above hosted by students Sarthak Bhosle and Rahul Akhade. They talked about opportunities as an artist post engineering and how it helped them become an all-round individual. This was followed by a rapid-fire session and a QnA by the attending audience. ', 'Provided a stage for participants to socialize and come together to enjoy and have fun.', 'Prof. Uday Rote, Dean - Student Welfare', '', '', '', '', '1626413696152.jpg', '1626413696175.jpg', '1626413696168.jpg', '1626413696160.jpg', 'IMG_20210716_110559.jpg', NULL, NULL, NULL),
(282, 'Health is Everything', 'National Service Scheme (NSS)', '2021-07-12', '4:00 PM', 'Online', 'Students and Faculty of KJSIEIT, All NSS units', 55, 65, 'To create awareness on how to lead a happy and healthy life.', 'Neeki Singh . She has an experience of 6 years in IT Industry (TCS, India) and ABN Amro Bank (Amsterdam) and switched to fitness industry just to educate people', 'She explain about the human anatomy and immune system . She also told the participants about how to strengthen immune system by vedic way. She gave tips/ tricks to be healthy and happy in day to day life .She gave mind power tips to have a calm and peaceful lifestyle.', 'The event ended on a high note with the participants gaining expert knowledge about how to live a healthy lifestyle and its importance in their lives.', 'Prof. Pankaj Deshmukh', 'Speaker of the event', 'Speaker explaining about healthy lifestyle', 'Speaker explaining about breathing', 'Participants asking doubts in query session', 'Screenshot (111).jpg', 'img2.jpeg', 'img3.jpeg', 'img1.jpeg', 'poster.jpeg', NULL, NULL, NULL),
(285, 'Health is Everything', 'National Service Scheme (NSS)', '2021-07-13', '4:00 PM', 'Online', 'Students and Faculty of KJSIEIT, All NSS units', 55, 65, 'To create awareness on how to lead a happy and healthy life.', 'Neeki Singh . She has an experience of 6 years in IT Industry (TCS, India) and ABN Amro Bank (Amsterdam).and switched to fitness industry just to educate people.', 'She taught the participants yoga asanas and pranayama to strengthen respiratory system. She also conducted meditation session to calm the mind.', 'The event ended on a high note with the participants gaining expert knowledge about the importance of different yoga asanas and meditation in maintaining healthy lifestyles. ', 'Prof. Pankaj Deshmukh', 'Speaker demonstrating yoga asanas', 'Speaker demonstrating yoga asanas', 'Speaker demonstrating yoga asanas', 'Participants asking doubts in query session', 'Screenshot (120).jpg', 'Screenshot (119).jpg', 'Screenshot (121).jpg', 'Screenshot (117).jpg', 'poster.jpeg', NULL, NULL, NULL),
(288, 'Life as a NCC Cadet', 'National Service Scheme (NSS)', '2021-07-20', '5:00 PM', 'Online', '', 49, 72, 'To create awareness on the life of NCC candidates and the path to become an NCC cadet.', 'Ritik Pandey. He is a JUO and NCC cadet. He is designated JUO ADAM Rank. He is a 2nd Year Student at Guru Nanak College and Somaiya College.', 'He explained why join the Indian Army. He also explained why should you choose NCC and its benefits in civil services and private sector.\r\nHe also explained Code of Conduct Required by an NCC candidate. He shared his experience and motivation for joining NCC. He also shared some of the stories which he experienced at NCC which helped shape his personality.', 'The event ended on a high note with the participants gaining expert knowledge about the path to becoming a NCC cadet and its benefits and its importance for shaping one\'s personality and discipline.', 'Prof. Pankaj Deshmukh', 'Speaker of the event', 'Speaker explaining about NCC and its criteria', 'Speaker talking about his experience at NCC', 'Participants asking doubts in query session', '3.jpeg', '1.jpeg', '4.jpg', '2.jpeg', 'pos.jpeg', NULL, NULL, NULL),
(290, 'Kargil Vijay Diwas', 'National Service Scheme (NSS)', '2021-07-26', '5:00 PM', 'Online', 'Students and Faculty of KJSIEIT, All NSS units', 37, 102, 'To recall the Heroic Efforts of our Army & to know the Valour of Army', 'Speaker: Tanuja Kabre\r\n- Physics Graduate from Ruia College\r\n- Served in the Army as an Adjutant, Retired as a Captain\r\n- Contributed in Flood relief operations in the North East.\r\n- Managed security of South Africa Cricket Team\r\n- Founder of Fauji ki Pathshala and Co-founder of Valour ', 'The speaker shared couple of stories of Kargil war heroes who gave their lives for their country. She explained what it meant to be a leader . She explained how discipline was important in the army . She also shared her personal experience and invaluable teachings from the Indian Army. She also explained different ways to join the armed forces and the procedure and prerequisites required . The event ended with a query session in which the doubts of the participants were cleared by the speaker.', 'The event ended with the participants learning about the proud history and sacrifices of the Kargil War. The participants also learnt about leadership and how to join the armed forces to serve our country.', 'Prof. Pankaj Deshmukh', 'Speaker of the event', 'Speaker sharing a story honouring brave Indian soldiers in Kargil War', 'Speaker talking about her experience in Indian Army', 'Participants asking doubts in query session', 'IMG-20210726-WA0008.jpg', 'Screenshot_20210726-172011.jpg', 'IMG-20210726-WA0006.jpg', 'IMG-20210726-WA0005.jpg', 'IMG-20210726-WA0009.jpg', NULL, NULL, NULL),
(300, 'Workshop on Prototype/Process Design and Development - Prototyping', 'Industry & Institute Interaction Cell', '2021-07-26', '7:30 PM', 'Online', 'LY, TY Students, Faculty', 50, 0, '1. To provide a brief idea of prototype and prototyping and about its importance in the manufacturing industry and other sectors.\r\n2. To introduce the concept of ideation and conversion of idea into a prototype.', 'Mr. Nikhil Pawar, Founder, Mindscript Technologies, Thane', 'This event was to introduce the concept of ideation and conversion of idea into prototype. The Speaker has shared a brief insight related to how idea can be transformed into prototype, types of prototype etc.', '1. The role and importance of prototyping in real-time.\r\n2. Learners get the idea about prototyping strategies that can provide a holistic overview of strategic decision-making and the selection and application of specific prototyping technologies.', 'Mr. Harsh Namdev Bhor, Assistant Professor, Department of Information Technology.', '', '', '', '', 'IIC Layout of Banner.jpg', 'WhatsApp Image 2021-07-26 at 20.30.05 (1).jpeg', 'WhatsApp Image 2021-07-26 at 20.30.05.jpeg', 'WhatsApp Image 2021-07-26 at 20.30.04.jpeg', 'IIC Layout of Banner.jpg', NULL, NULL, NULL),
(292, '\"Accelerators/Incubation-opportunitiesfor the students and faculties-early-stage Entrepreneurs', 'Institution\'s Innovation Council (IIC) in association with Department of Electronics and Telecommunication Engineering and IEI KJSIEIT', '2021-07-25', '10:00 AM', 'Online', 'Students &Faculties', 41, 0, 'To guide on identifying and developing innovation and entrepreneurial opportunities with economic and social impact\r\nTo develop personal skills, qualities, and mind-set to lead and manage a new, growth-oriented venture\r\nTo reflect on an entrepreneurial journey, examine experiences, and motivate entrepreneurship as a career\r\n', 'Mr Ravi Jaiswal(Co-founder of SKYLO)', 'The session was very informative where in there were total 41attendee attending the session. Maximum number of participants were from EXTCand IT department.', 'The speaker gave focus on developing innovation and entrepreneurial opportunities. He created mind-set to lead and manage a Startups. Described about his entrepreneurial journey and motivated entrepreneurship as a career in minds of the Attendees. He also gave us the information about the challenges he faced during his entrepreneurial journey.  ', '', '', '', '', '', 'IMG-20210725-WA0004.jpg', 'IMG-20210725-WA0006.jpg', 'IMG-20210727-WA0017.jpg', 'IMG-20210727-WA0018.jpg', 'IMG-20210723-WA0021.jpg', NULL, NULL, NULL),
(296, 'Building an Innovation / Product Fit for Market', 'Institution\'s Innovation Council (IIC)', '2021-07-27', '3:00 PM', 'Online', 'Faculty and students', 35, 10, '1) To create awareness about the importance of Innovation.\r\n2) To guide the students in the journey from lab to market', 'Dr. Santosh Gejage, Founder, Director, Novetra Laboratories Pvt. Ltd.', 'The event started at 3 pm. Shashwati Singh introduced the speaker in short. Dr. Santosh started with the presentation. He emphasized on the requirements of the market. He stressed to cater to the needs of the customer and try to find an innovative solution for the same. ', '1) The students learnt about constantly trying out new things and to continuously keep on experimenting.\r\n2) The students also learnt about paying attention to details.', 'Prof. Sejal Shah, Assistant Professor, Artificial Intelligence & Data Science (ETRX)', 'At the start of the event', 'While introducing the speaker.', 'During the presentation', 'End of the event.', 'ss1.jpg', 'ss2.jpg', 'ss3.jpg', 'ss4.jpg', '0001.jpg', NULL, NULL, NULL),
(309, 'Why IP is important in academia', 'MoE\'s Innovation Cell - Coordinated by KJSIEIT - Institution\'s Innovation Council', '2021-04-22', '3:00 PM', 'Online', 'Students and Faculties of the Institute', 775, 0, 'To explain the importance of IP in academia for faculties and students.', 'Dr. Abhay Jere, Chief Innovation Officer, MoEs Innovation Cell and \r\nDr. Mohit Gambhir, Innovation Director, MoEs Innovation Cell', 'As part of the IIC program, MIC, Members of IIC - K. J. Somaiya Institute of Engineering and Information Technology as well numerous students and staff from various departments of KJSIEIT attended the MIC-driven activity - a Session on Why IP is important in academia? on April, 26, 2021. \r\n\r\nDr. Abhay Jere shared the efforts made by the entire IIC team in making the program a great success since its inception. He noted that this was only the beginning and that there was still much to do as the new biological system was affected. He also explained how programs like KAPILA have inspired his tendency to fill IP. Not only that, but he explained how we can turn an idea into a resource by making good use of the IP environment that needs to be built successfully.\r\n\r\nDr. Mohit discussed the role of Professor at the college or university level outside the classroom. He emphasized that as a teacher one should not only focus on data collection and research but also make an effort to trade ideas for startups. He explained that IPT is an effective means of disseminating information. Effective IP management and research integration with IP and IP Audits are some of the key areas of focus.', 'Attendees understood how IP adds value to academics and were motivated for filing patents and copyrights.', 'Dr. Radhika Kotecha\r\nConvener - KJSIEIT IIC\r\n', 'Glimpse - 1 of the Event', 'Glimpse - 2 of the Event', '', '', 'IP1.jpg', 'IP2.jpg', '', '', 'IP Banner.jpg', ' Motivational Session', NULL, NULL),
(310, 'Prototype/Process Design and Development - Prototyping', 'K. J. Somaiya Institute of Engineering & Information Technology - Institutions Innovation Council (KJSIEIT - IIC)', '2021-05-15', '7:30 PM', 'Online Mode', 'Students and Faculties of the Institute', 142, 0, 'To nurture innovative ideas and impart knowledge of designing and developing suitable prototypes.', 'Mr. Nikhil Pawar,\r\nFounder - Minscript Technologies, Mumbai', 'As per the guidelines provided by MoE\'s Innovation Cell (MIC), India, the Workshop on Prototype/Process Design and Development - Prototyping with Mr. Nikhil Pawar, Founder, Minscript Technologies, Mumbai was organized by K. J. Somaiya Institute of Engineering & Information Technology - Institutions Innovation Council (KJSIEIT - IIC).\r\n\r\nThe workshop was attended by students and faculty members of all departments of the institute.\r\n\r\nThis workshop has given different strategies about prototype development to all participants from their innovative ideas.\r\n\r\nOverall, the workshop resulted in a superior understanding about Prototype/Process Design and Development - Prototyping.', 'Attendees got the idea about prototyping strategies and learned developing prototypes from their innovative ideas.', 'Mr. Harsh Bhor, \r\nMember - KJSIEIT IIC\r\n\r\nDr. Radhika Kotecha, \r\nConvener - KJSIEIT IIC\r\n\r\nDr. Suresh Ukarande, \r\nPrincipal - KJSIEIT IIC\r\n', 'Glimpse - 1 of the Event', 'Glimpse - 2 of the Event', '', '', '1.jpg', '2.jpg', '', '', 'Banner.jpeg', NULL, NULL, NULL),
(311, ' Successful Start-up founders', 'K J Somaiya Institute of Engineering and Information Technology - Institutions Innovation Council', '2021-04-25', '10:00 AM', 'Online Mode', 'Students and Faculties ', 92, 0, 'To guide the new innovation based startups and provide detailed mentoring for grasp of commercialization of technology developed by new entrepreneurs.', 'Mr. Ravi Jaiswal,\r\nCo-founder - SKYLO', 'As per the guidelines provided by MoE\'s Innovation Cell (MIC), India, the mentoring session with Successful Start-up founders with CO-founder - SKYLO Mr. Ravi Jaiswal was organized by K. J. Somaiya Institute of Engineering & Information Technology - Institution Innovation Council (KJSIEIT - IIC).\r\n\r\nThe session has given insights about factors related for succeeding in start ups.   \r\n\r\nOverall, the session has given guidance about how to become successful entrepreneurs in present era. \r\n\r\n', 'It offered a detailed guidance by successful start-up founders on the various issues to budding entrepreneurs for succeeding in start-up ventures.', 'Mr. Martand Zha\r\nMember, KJSIEIT - IIC.\r\n\r\nDr. Radhika Kotecha\r\nConvener - KJSIEIT IIC\r\n\r\nDr. Suresh Ukarande\r\nPrincipal - KJSIEIT IIC\r\n', 'Glimpse - 1 of the Event', 'Glimpse - 2 of event', '', '', '5_1.jpg', '5_2.jpg', '', '', '5.jpeg', NULL, NULL, NULL),
(315, 'Innovators through Innovation Ambassadors', 'K. J. Somaiya Institute of Engineering & Information Technology - Institutions Innovation Council (KJSIEIT - IIC).', '2021-03-20', '4:00 PM', 'Online', 'Students and Faculties of the Institute', 117, 0, 'To guide on identifying entrepreneurial opportunities and nurture innovative ideas to reach high TRL.', 'Innovation Ambassadors - \r\nDr. Radhika Kotecha, \r\nProf. Swati Shinde, \r\nDr. Vaishali Gaikwad, \r\nDr. Mansing Rathod, \r\nProf. Devanand Bathe,\r\nProf. Harsh Bhor, \r\nMr. Vivek Mane', 'As per the guidelines provided by MoE\'s Innovation Cell (MIC), India, the Mentoring Session on Innovators through Innovation Ambassadors with Dr. Radhika Kotecha, Prof. Swati Shinde, Dr. Vaishali Gaikwad, Dr. Mansing Rathod, Prof. Devanand Bathe, Prof. Harsh Bhor, Mr. Vivek Mane, was organized by K. J. Somaiya Institute of Engineering & Information Technology - Institutions Innovation Council (KJSIEIT - IIC).\r\nThe session was attended by students and faculty members of all departments of the institute.\r\nThis session has helped innovators to nurture innovative ideas and could overcome the obstacles in development of start-up plan.\r\n', 'Mentoring by Innovation Ambassadors helped innovators could overcome the obstacles and advance their prototype development and start-up plan.', 'Mrs. Sejal Shah / Mr. Martand Jha / Ms. Rupali Satpute / Mrs. Minal Sonkar / Mr. Harsh Bhor\r\nMember - KJSIEIT IIC\r\n\r\nDr. Radhika Kotecha\r\nConvener - KJSIEIT IIC\r\n\r\nDr. Suresh Ukarande\r\nPrincipal - KJSIEIT IIC\r\n', 'Glimpse - 1 of the Event', 'Glimpse - 2 of the Event', '', '', '2-1.jpg', '2.jpg', '', '', 'Banner.jpg', NULL, NULL, NULL),
(314, 'for all students & faculties of Institute by Innovation Ambassadors', 'K J Somaiya Institute of Engineering and Information Technology - Institutions Innovation Council', '2021-03-06', '1:00 PM', 'Online Mode', 'Students and Faculties of Institute', 121, 0, 'To orient participants on Prototype, Design, Process Development for Business Model/Process/Services.', 'Dr. Radhika Kotecha,\r\nConvener, KJSIEIT - IIC\r\n\r\nMrs. Swati Shinde,\r\nMember, KJSIEIT - IIC\r\n\r\nDr. Vaishali Gaikwad,\r\nMember, KJSIEIT - IIC\r\n\r\nDr. Mansing Rathod,\r\nMember, KJSIEIT - IIC\r\n\r\nMr. Devanande Bathe,\r\nMember, KJSIEIT - IIC\r\n\r\nMr. Harsh Bhor,\r\nMember, KJSIEIT - IIC\r\n\r\nMr. Vivek Mane\r\nMember, KJSIEIT - IIC', 'As per the guidelines provided by MoE\'s Innovation Cell (MIC), India, the Orientation session with for all students & faculties of Institute by with convener of KJSIEIT - IIC Dr. Radhika Kotecha and members of IIC Dr. Vaishali Gaikwad, Dr. Mansing Rathod, Mrs. Swati Shinde, Mr. Harsh Bhor, Mr. Devanand Bathe, Mr. Vivek Mane  was organized by K. J. Somaiya Institute of Engineering & Information Technology - Institutions Innovation Council (KJSIEIT - IIC).\r\n\r\nThe participants has got insights about the contents such as prototypes, business development and process development happening under IIC.  ', 'Motivate young minds to venture into the entrepreneurial abilities resulting in wealth creation & new markets.', 'Dr. Radhika Kotecha,\r\nConvener, KJSIEIT - IIC\r\n\r\nMrs. Swati Shinde,\r\nMember, KJSIEIT - IIC\r\n\r\nDr. Vaishali Gaikwad,\r\nMember, KJSIEIT - IIC\r\n\r\nDr. Mansing Rathod,\r\nMember, KJSIEIT - IIC\r\n\r\nMr. Devanande Bathe,\r\nMember, KJSIEIT - IIC\r\n\r\nMr. Harsh Bhor,\r\nMember, KJSIEIT - IIC\r\n\r\nMr. Vivek Mane\r\nMember, KJSIEIT - IIC\r\n\r\nDr. Surech Ukarande,\r\nPrincipal, KJSIEIT - IIC', 'Glimpse - 1 of the Event', 'Glimpse - 2 of the Event', '', '', '3_1.jpg', '3_2.jpg', '', '', 'Banner.jpg', NULL, NULL, NULL),
(313, 'From Your PhD or Masters Thesis to a Start-up', 'MoE\'s Innovation Cell, and underneath Institution\'s Innovation Council', '2021-04-23', '11:00 AM', 'Online', 'Students and Faculties of the Institute', 548, 0, 'To explain the way of converting Masters or Ph.D. project work into a startup.', 'Dr. Anand Deshpande, Founder and CMD, Persistent Systems', 'Dr. Anand Deshpande began with his speech on an encouraging incident that occurred during the interview. Echoing the elephant\'s example, he said research and teaching were the only way after receiving a Ph.D. but he highlighted the business skills one should have in academic research while studying. He described Lean\'s initial process by giving an example of Toyota Production. He also explained how Lean start helps. Further, Dr. Deshpande described the Minimum Viable Product (MVP) and the two questions he had during the MVP study. Taking notes on Business Model Generation by Alex Osterwalder, Dr. Deshpande highlighted the price range by giving an example of a restaurant. He also described the business rating making an example of Airbnb and highlighted the 9 different areas needed for the price tag. Clayton Christiansen\'s process \"Work to be Done\" was described citing Milkshake\'s example. During the Trango Tower tour, it was explained how the role of group members played a role. He said those machines contribute to the success of the business. Speaking about the Cash generation Dr. Deshpande, shared in the book by Ram Charan and Ashok Korwar, in which he emphasizes the 4 critical aspects of business. The main idea of the business is given to focus during the discussion. Financial accounting is described in the introduction. Described with a business matrix. Dr Deshpande presented the cash flow chart.\r\n\r\nEight of Korwar\'s financial teachings were also highlighted in this presentation. The concept of hot costs was also explained.', 'Faculties and student participants could identify a scope of converting their research into a start-up, along with benefits and challenges in it.  ', 'Dr. Radhika Kotecha\r\nConvener - KJSIEIT IIC', 'Glimpse - 1 of the Event', 'Glimpse - 2 of the Event', '', '', 'PhD to Startup1.jpg', 'PhD to Startup2.jpg', '', '', 'PhdBanner.jpg', 'Talk', NULL, NULL),
(312, 'Why IP is Important in Academia', 'MoE\'s Innovation Cell, and underneath Institution\'s Innovation Council', '2021-04-22', '3:00 PM', '', 'Students and Faculties of the Institute', 775, 0, 'To explain the importance of IP in academia for faculties and students.', 'Dr. Abhay Jere, Chief Innovation Officer, MoEs Innovation Cell and \r\nDr. Mohit Gambhir, Innovation Director, MoEs Innovation Cell.\r\n', 'As part of the IIC program, MIC, Members of IIC - K. J. Somaiya Institute of Engineering and Information Technology as well numerous students and staff from various departments of KJSIEIT attended the MIC-driven activity - a Session on Why IP is important in academia? on April, 26, 2021. Dr. Abhay Jere shared the efforts made by the entire IIC team in making the program a great success since its inception. He noted that this was only the beginning and that there was still much to do as the new biological system was affected. He also explained how programs like KAPILA have inspired his tendency to fill IP. Not only that, but he explained how we can turn an idea into a resource by making good use of the IP environment that needs to be built successfully. Dr. Mohit discussed the role of Professor at the college or university level outside the classroom. He emphasized that as a teacher one should not only focus on data collection and research but also make an effort to trade ideas for startups. He explained that IPT is an effective means of disseminating information. Effective IP management and research integration with IP and IP Audits are some of the key areas of focus.', 'Attendees understood how IP adds value to academics and were motivated for filing patents, copyrights, etc.   ', 'Dr. Radhika Kotecha, Convener - KJSIEIT IIC\r\n', 'Glimpse - 1 of the Event', '', 'Glimpse - 3 of the Event', '', 'IP1.jpg', 'IP2.jpg', 'IP for Academia.jpg', '', 'IP Banner.jpg', 'Motivational Session', NULL, NULL),
(302, 'Lean Start-up and Minimum Viable product/Business', 'Institution\'s Innovation Council (IIC)', '2021-07-29', '6:00 PM', 'Online', 'Faculties and students', 31, 39, 'To impart knowledge on lean start-up and how it develops the smallest form of the product (MVP) that allows entrepreneurs to introduce it to potential customers for feedback.', 'Mr.Bharat Ojha (Digital Product Manager, GEA NL BV and Founder member of Prismatix Consultancy)', 'As per the guidelines provided by MoE\'s Innovation Cell (MIC), India, the Workshop on Lean Start-up and Minimum Viable Product/Business with Digital Product Manager, GEA NL BV and Founder member of Prismatix Consultancy, Mr. Bharat Ojha was organized by K. J. Somaiya Institute of Engineering & Information Technology - Institutions Innovation Council (KJSIEIT - IIC).\r\nThe workshop provided ideas about starting new lean start-up and participants also got an information on how lean start-up identifies a problem and develops minimum viable product.\r\n', 'All the participants got an idea on what is lean start-up and came to know how it identifies a problem to develop minimum viable product(MVP).', 'Event Coordinator(s):\r\nMrs. Minal Sonkar,\r\nMember, KJSIEIT - IIC\r\n\r\nDr. Radhika Kotecha,\r\nConvener - KJSIEIT IIC\r\n\r\nDr. Suresh Ukarande,\r\nPrincipal - KJSIEIT IIC', 'Glimpse-1 of the Event', 'Glimpse-2 of the Event', 'Glimpse-3 of the Event', 'Glimpse-3 of the Event', 'Glimpse-1 of the Event.jpg', 'Glimpse-2 of the Event .jpg', 'Glimpse-3 of the Event.jpg', 'Glimpse-4 of the Event.jpg', 'IIC_Banner Lean Start-up & Minimum Viable Product Business.jpg', NULL, NULL, NULL),
(301, 'Prototype validation: Converting prototype into startup', 'Institution\'s Innovation Council (IIC)', '2021-07-29', '4:00 PM', 'Online', 'All Faculty and students', 40, 0, 'To create awareness among participants about prototype validation. To motivate participants for converting prototype into a start-up.', 'Mr. Dhaval Dattani', 'Student coordinator Miss. Siddhi Solanki commenced the program. Prof. Rupali Satpute introduce the speaker Mr. Dhaval Dattani as alumina student of EXTC dept of 2010-11 batch pass out and now handling his own business. Then speaker enlighted participants with his broad knowledge on Prototpe validation. Session was very interactive. Further student coordinator Mr Yash Khatri proposed vote of thanks.', 'Awareness created among participants about prototype validation. Participants motivated for converting prototype into a start-up.', 'Prof. Rupali V Satpute, Assistant Professor, department of EXTC', '', '', '', '', 'Speaker photo with first slide.jpeg', 'Speaker while presenting topic.jpg', 'Speaker while presenting topic 2.jpg', 'Students snapshot 1.jpeg', 'Banner 29_7_2021.jpeg', NULL, NULL, NULL),
(24, 'Embedded Systems: Industry perspective', 'Department of Electronics and Telecommunication Engineering', '2021-03-18', '9:50 AM', 'online', 'STUDENTS OF KJSIEIT', 122, 0, 'To introduce Embedded System, Boot process and advance processor ', 'Mr. Sagar Patil', 'In This Event, Students learned features and application of Micro controller and SOC. This guest lecture will enable computer student to take up embedded system subjects as elective.', '  apply their knowledge of microcontroller/soc to build innovative technical solution for Relevant problem\r\n\r\n  ', 'Mr. Prashant Upadhyay', 'Presentation Slides', '', '', '', '2_image_boot.jpg', '', '', '', '1_banner.jpg', NULL, NULL, NULL),
(305, 'Initiatives of MoE\'s Innovation Cell', 'Institution\'s Innovation Council (IIC)', '2021-07-27', '12:30 PM', 'Online', 'EXTC department staff and students', 184, 0, 'To aware students and staff about initiatives of MoE\'s Innovation cell ', 'Innovative Ambassador \r\nDr. Radhika Kotecha, HOD IT Dept. KJSIEIT\r\nMrs. Swati Shinde,  EXTC Dept. KJSIEIT\r\nMr. Devanand Bathe, ETRX Dept., KJSIEIT\r\nDr. Vaishali Gaikwad, IT Dept. KJSIEIT\r\nDr. Mansing Rathod, IT Dept. KJSIEIT\r\nMr. Harsh Bhor, IT Dept. KJSIEIT ', 'This orientation program is conducted to create awareness amongst students and faculty of EXTC department about following initiatives of MOE\'s innovation cell. \r\nInitiatives of MoEs Innovation Cell,\r\nInstitutions Innovation Council \r\nThrust Areas,\r\nKAPILA, \r\nMentoring by Innovation Ambassadors\r\nVarious Hackathons by MIC\r\nYukti\r\nNISP\r\n', 'To encourage our students to work on new ideas and innovation in association with Innovation cell of MoE.', 'Ms. Swati Hemant Shinde, Assistant Professor, EXTC Department.', 'Orientation On Initiatives of MOE\'s innovation cell ', 'Participants', '', '', 'I2.jpg', 'I1.jpg', 'Image 1.JPG', '', '', NULL, NULL, NULL),
(289, 'Importance of Machine Learning and Deep Learning', 'Department of Information Technology', '2021-07-27', '4:00 PM', 'Online', 'KJSITIT Students', 45, 0, '	To understand the basic concepts in Machine learning and Pattern Recognition.\r\n	To understand and apply state-of-the-art algorithms used in machine learning to detect and characterize patterns in real-world data.\r\n	To understand the complexity of machine learning algorithms in practical problems.\r\n	To understand advanced concepts in Deep Learning.\r\n', 'Name: Manish Kumar Singh\r\nTitle	: Head,Institutional Collaboration\r\nContact No: 	09717870232\r\n', 'Machine learning practices with a set of algorithms to analyse and interpret data, learn from it, and based on those learnings, makes the best possible decisions. In the case of deep learning, the system depends upon layers of artificial neural networks. The in-depth study of deep learning and machine learning with its applications are discussed. ', '	The attendees were able to understand the basic concepts in Machine learning and Deep Learning.\r\n	Learners were able to apply state-of-the-art algorithms used in machine learning to detect and characterize patterns in real-world data and understand the complexity of machine learning algorithms in practical problems.\r\n', 'Student Coordinators:\r\nDharita Desai: 9769107491\r\nSourav Kumar: 9326675190\r\n\r\nFaculty Co-ordinator:\r\nDr. Hariram Chavan, Professor Dept of IT', 'Speaker-NishantSingh', 'Beginning-of-Webinar', 'Student-Participants', 'Glimpses-of-Webinar', '1. Speaker-Nishant Singh.jpg', '2. WebinarBegining.jpg', '3. AllParticipants.jpg', '4. MLDLWebinar.jpg', 'Webinar.jpeg', NULL, NULL, NULL),
(295, 'NDLI Club Awareness and Training session', 'Library', '2021-07-24', '10:00 AM', 'Online', 'Faculty, staff and TE, BE students', 79, 0, '	To explain objectives of National digital library of India (NDLI Club)\r\n	To inculcate the importance of  NDLI Club \r\n	To explain the processes of NDLI, NDLI Club Registrations \r\n', 'Mrs.Gauri Gothivrekar, Librarian, KJSIEIT', 'Mrs. Gauri Gothivrekar explained the features of NDLI, NDLI Club . The process of the registrations was explained by live demo of the same. Questions were asked by participants which were answered by speaker.', '	The participants gained an insight into the types, significance of NDLI\r\n', 'Mrs. Gauri Gothivrekar, Librarian', 'Resource person', 'Mrs.Gauri Explaining NDLI', 'Narrating NDLI', 'Narrating NDLI', 'NDLI 24072021 03.jpg', 'NDLI 24072021 08.jpg', 'NDLI 24072021 04.jpg', 'NDLI 24072021 07.jpg', 'NDLI banner 24th July 2021.jpg', NULL, NULL, NULL),
(307, 'Initiatives by MoEs Innovation Cell', 'Department of Electronics Engineering ', '2021-07-28', '5:00 PM', 'Online', 'Faculties, TY and LY Students of Electronics Engineering Department', 28, 0, 'To create awareness TY and LY Students and Faculties about various initiatives on Ministry of Education\'s Innovation Cell.\r\nTo motivate students to utilize facilities offered by MoE\'s Innovation Cell in field of start up, IPR. ', 'Innovation Ambassadors- Dr. Radhika Kotecha, Mrs. Swati Shinde, Dr. Vaishali Gaikwad, Mr. Harsh Bhor, Mr. Devanand Bathe', 'This program under series of orientation programs conducted for all departments, was conducted in Electronics Engineering Department on 28/07/2021 at 5.00 PM. It was conducted in online mode on MS-TEAMS. Innovation Ambassadors representing each department, commonly conducted this program for TY and LY students as target audience. Total 28 participants had actively participated this program.', 'Students found this program very much useful to enhance their entrepreneurial  skills. Students came to about various national-international level competitions in terms of idea innovation. ', 'Prof. Devanand K. Bathe, Assistant Professor, Electronics Engineering Department', 'Post Event Group Photo', '', '', '', 'P4.jpg', 'P2.jpg', 'P3.jpg', 'P1.jpg', 'Banner.jpg', NULL, NULL, NULL),
(316, 'Ved and Vigyan', 'National Service Scheme (NSS)', '2021-08-03', '4:00 PM', 'Online', 'Students and Faculty of KJSIEIT, All NSS units', 40, 40, '1.To enable the students to know about beautiful language.                              \r\n2.To interpret ancient texts of India, originally composed in Sanskrit, have a rich heritage of mathematical and scientific knowledge and make the present generation aware of this.             \r\n3.To make people aware of this ancient knowledge in Sanskrit itself\r\n', ' Mrs. Aditi Madhavan has graduated and post graduated in Sanskrit from University of Mumbai along with B.Ed in Sanskrit and geography from University of Mumbai.  She also did M.phil in Sanskrit from University of Mumbai. \r\n', 'Speaker of the webinar Mrs Aditi Madhavan explained why learning Sanskrit language is important in order to change their lives. She shared her experience about how Sanskrit language helped her in learning ancient knowledge as  Ancient texts of India, originally composed in Sanskrit, have a rich heritage of mathematical and scientific knowledge and the present generation is unaware of this .She also gave some important tips to start learning this beautiful language and easily falling in love with it.', 'The event ended on a high note with the participants learning about the importance of ancient knowledge in Sanskrit language and simple ways to learn one of the most beautiful language and its importance.\r\n', 'Prof.Pankaj Deshmukh', 'Speaker of the event', 'Speaker explaining ancient Sanskrit texts', 'Participants asking questions to the speaker', 'Participants attending the event', 'IMG-20210803-WA0044.jpg', 'IMG-20210803-WA0043.jpg', 'IMG-20210803-WA0045.jpg', 'Screenshot_20210803-163521.jpg', 'IMG-20210803-WA0038.jpg', NULL, NULL, NULL),
(194, 'Being an Autonomous Institute: Roles, Responsibilities and Action Plan - Session 1 and 2', 'Academic Committee', '2021-05-14', '2:00 PM', 'Online', '', 150, 0, '	To train KJSIEIT faculty & staff for the roles, responsibilities & to have an action plan for implementation of the Autonomy.\r\n	To emphasize & execute academic exposure, continuous assessment, NBA & accreditation as a progressive endeavour KJSIEIT.\r\n', 'Dr. Suresh Ukarande, Principal and Dr. Sunita Patil, Vice-Principal', 'Dr. Suresh Ukarande commenced the session by providing a timeline in the capacity of Dean of Faculty of Science & Technology at Mumbai University (MU). He provided a review of the syllabus system since AY 1986 with progressive reforms in the engineering curriculum with revisionary academic cycles. He urged the participants to develop an intellectual climate to maintain an ideal autonomous system. An outline on rules of autonomous collegesnew courses, nomenclature prescribed by UGC, AICTE, conditions of autonomous system were highlighted.\r\nDr. Ukarande presented a 2019 published- survey that points 2% colleges in India as autonomous. Significant aspects ondesigning new courses, designing syllabus for degree courses, regulating bodies for governance of autonomous institute & role of supportive bodies etc were crucial points in the direction of maintain the quality of autonomy. The action plan for KJSIEIT, exam marking scheme, syllabus contents, credit system to follow the 80%-20% adherence to MU syllabus were important aspects in presentation. \r\nIn addition, redundancy of syllabus, weightage of syllabus with appropriate discussions & deliberation with external experts, academic focus creating a strong engineering focus, integration of BSH with technologies, honours, majors, minor degree, mapping of 12 Graduate Attributes, implementation of National Education Policy (NEP) guidelines, focused exposure for learners, Continuous Assessment System, strengthening  of IQAC, adhering to the NBA, NAAC mandates under autonomy. He emphasized on the role of KJSIEIT-leadership strategy under autonomy so as to align with the vision of Shri. Samir Somaiya, ChairmanSomaiya Trust; to chalk out a strategic growth plan in the near future with defined outcomes.\r\nIn the last segment of presentation, there was a guidance provided on having a trained manpower. The core engineering faculty to be trained extensively for Machine Learning, Data Science, Artificial Intelligence with application in curriculum. Dr. Ukarande urged the faculty to create a collaborative research, to establish KJSIEIT as an international centre of knowledge exchange etc. There was a road-map with short term and long-term goals with contribution of Alumni, R&D cell, Professional Bodies with an aim for KJSIEIT to emerge as a benchmark of quality & excellence.\r\nDr. Sunita Patil provided an all-inclusive presentation with detailed guidelines  onImplementation of autonomy outline, autonomy syllabus scheme, courses in effect & acronyms, weightageinternal and end semester. She also guided on the vital weightages on theory, practical, tutorial, course codesdefinition & acronym. The training module emphasized on the role of unique selling productthe USP or the Exposure Courses the Skill, Activity & Technology (SAT) that will be implemented with credits in BS&H Dept. Dr. Sunita Patil also provided guidance on the course code with denotations, course breakup as per AICTE mandates, the course category, weightage, distribution of courses and semesters. A detailed guideline on project details, exposure courses, course category distribution with total number of courses from FE to BE level with project courses, laboratories under autonomous scheme, arrangement of courses in credit & examination scheme.  There was a strategic presentation on the evaluation & marking scheme patternthe learners centric approach with 60% (End semester) & 40% (Internal Assessment) credit system. A systematic categorization of the Program Structure across various branches with credit/examination scheme with guidelines was provided. In addition, introduction of cutting-edge subjects will be introduced such as Intellectual Property Rights, Patents etc will comprise the professional elective subjects in final year.  In summary, Dr. Sunita Patil instructed to commence with the execution of the autonomy process with the dates specified as15th June-6th July, 2021 with responsibilities & subsequent implementations by the academic committee members. ', '	KJSIEIT faculty & staff gained a detailed guidance to be able to implement autonomous curriculum by implementing the relevant technologies.\r\n	As its unique selling point, the learners will be able to seamlessly incorporate an interdisciplinary approachSkill, Activity, Technology (SAT) to equip with proficient technical and management relevant skill-sets\r\n', '', '', '', '', '', '', '', '', '', '', NULL, NULL, NULL),
(203, 'Examination Reforms', 'Academic Committee', '2021-05-22', '4:00 PM', 'Online', '', 150, 0, 'The objective of this session was to inform the Faculty and Staff about the conduct of examinations and notification of results with all reforms in the processes examination and evaluation under autonomy.', 'Dr.Vaishali Ghadyalgi', 'This session was based on the Exam Manual of KJSIEIT which is prepared by Dr. Vaishali K. Ghadyalji (COE) and Dr. Shaheen Pathan (ACOE) by putting rigorous efforts for more than a month under the able guidance of Dr. Suresh Ukarande, Principal and Dr. Sunita Patil, Vice-principal KJSIEIT and by taking references from the University of Mumbai Statues, Guidelines and Ordinances along with the manuals of some other reputed Autonomous colleges. The Exam Cell support staff Mr. Deepak Rawat, Mrs. Geeta Gurav and Mrs. Hema Gawand also assisted by providing the ready references as and when required. An additional  Manual called KJSIEIT Exam Guidelines for Students under Autonomy is drafted with suitable Appendices.\r\n\r\nThe session included the following major points related to the Exam Reforms such as the  Objectives and Preamble of Exam Cell, Examination & Evaluation Committee (EEC) & Departmental Examination & Evaluation Committee (DEEC), Roles and Responsibilities of EEC & DEEC, Roles and Responsibilities of COE, Evaluation and Marking Scheme Pattern, Guidelines for Continuous Assessment (CA), Guidelines for Conduction of Test 1 & Test 2, Procedure for preparing KJSIEIT  Examination /Paper Setters Panel, Pre-examination Preparation, Guidelines for Conduction/Assessment of End Semester Examination, Handling of Unfair Means, Preparation of Results (RMAC), Grading of Performance for UG/PG Examination, Conduction of Open Day, Handling of Students Applications and Grievances related to Grade Card, Re-examination (B. Tech. Sem VIII, M. Tech Sem II), Preservation of Answer Books and some Appendices added at the end.\r\n\r\n', 'The session proved to be very informative for the Faculty and Staff to be acquainted with the reforms in the processes examination and evaluation under autonomy.', 'Dr.Namrata Ansari\r\nProfessor EXTC\r\nDean Academics-KJSIEIT,Sion\r\n', '', '', '', '', '', '', '', '', '', NULL, NULL, NULL);
