(215, 'Being an Autonomous Institute: Roles, Responsibilities and Action Plan', 'Academic Committee', '2021-06-04', '4:00 PM', 'Online', '', 150, 0, '	COVID-19 presents a real challenge and a real responsibility.\r\n	A changing education imperative \r\n', 'Dr. RadhaKrishnan Pillai ', 'Dr. Namrata Ansari commenced the session with a welcome note, followed by Dr. Sunita Patil who read the accomplished profile of. Dr. Radhakrishnan Pillaian Alumni of Somaiya Vidyavihar & Author, Teacher of 17 books on Chanakya Series: that have been the Best Seller Books on Corporate Management. Dr. Suresh Ukarande shared relevant anecdotes with the realistic scenario of virtual platforms with technological implications during the Pandemic times.  In the same direction V. N. Rajasekharan Pillai is the Vice-Chancellor of Somaiya Vidyavihar University and Provost of Somaiya Vidyavihar provided an allusion of his personal interaction with Dr. Radhakrishnan Pillai who had authored 10 bestselling books that hold a great relevance in todays corporate world & is a major guiding principle for the entrepreneurs & leaders alike. \r\nThe expert speaker Dr. Radhakrishnan Pillai provided the audience with the rich ancient past of Indialand of Guru-Shishya Parampara as well as the role of great Rishis to mould the students future into various skill-sets.  By narrating enriching insights of the glorious past of 5th century empire of Chandragupta Maurya dynasty, he narrated on the crucial role of Chanakya who has written treatise vizKautilya Arthshastra (6000 Sutras) & Chanakyaniti that has survived the test of time. He also provided anecdotes of the Great Emperor Alexander who was defeated in India & of infamous Nanda King who led his subjects with wrong precepts with famous quote by Chanakya, Empty Seat is More Dangerous that resulted in a teachers valiant efforts in creation of a just King named Chandragupta Maurya. The glories and able leadership of the Mauryan dynasty till today is upheld foreminent leadership, the Chanakyaniti that is build on ethics, with accurate documentation works in Siddhantas its teachings that are comprehensive trend-setters for leaders worldwide.  \r\nBy corelating Chanakyas teaching in the Post Covid Era, the presenter juxtaposed the current challengesthe Educational System vs the Examination System, the Employment vs Wealth Creators, Mass Education vs Customization, the Online vs the physical Education & Brain Drain vs Brain Gain.  He implored the teachers to transform the challenges into opportunities while offering strategies-Polymath i.e catering to multidisciplinary careers, the role of National Educational Policy that is multipronged, Entrepreneurial Education, Collaboration over Competition. etc thereby raising the benchmark of Indian education with a synergetic approach. Towards the concluding remark, Dr. Radhakrishnan Pillai urged that Youth are not useless, they are used less & hence there is need to indulge in a meaningful Samvad to empower todays youth with responsibilities that caters to multifaceted roles-assignation ofpractical opportunities, strategist, innovator & researcher. \r\nThere was a question-and-answer session followed by a thank you note by Dr. Namrata Ansari. The participants were issued with an E-Certificate post the event. \r\n', '	The participants gained detailed guidance to be able to apply the strategic blend of ancient Indian wisdom of Chanakyas Teachings to Modern Educational curriculum. \r\n	The National Educational Policy (NEP) will be seen as a potential revolutionary force to transform the dynamics of educational with Polymathmultidisciplinary careers in near future.\r\n', 'Dr. Namrata Ansari', '', '', '', '', '', '', '', '', '', NULL, NULL, NULL),
(219, 'Being an Autonomous Institute: Roles, Responsibilities and Action Plan', 'Academic Committee', '2021-06-07', '4:00 PM', 'Online', '', 150, 0, '	To train KJSIEIT faculty & staff for the roles, responsibilities & to have an action plan for implementation of the Autonomy.\r\n	To emphasize & execute academic exposure, continuous assessment, NBA & accreditation as a progressive endeavour KJSIEIT.\r\n', 'Dr Harsha Mishra and Mrs.Vrinda Ulhas', 'Dr. Harsha Mishra, HoD of BS&H dept. provided a brief overview on the introduction of First Year Curriculum. She apprised the participants onExamination Scheme, Student Induction Program, Content Covered & Overall Structure of the FE Curriculum. In addition, the weightage of marks with credit system was discussed. Dr. Harsha also guided on interdisciplinary approachSkill, Activity, Technology (SAT) courses, its implementation at the FE level in the autonomous curriculum. The rationale to introduce the SAT courses was to equip with proficient technical and management relevant skill-sets.\r\nDr. Harsha presented a strategic FE Curriculum planweightage of syllabus in Sem I & II, category(attributes), range of courses that will be offered etc. \r\n', '	KJSIEIT faculty & staff gained a detailed insight to be able to implement autonomous curriculum by implementing the FE curriculum with relevant technologies.\r\n	The BS&H Dept will be able to seamlessly incorporate an interdisciplinary approachSkill, Activity, Technology (SAT) to equip with proficient technical, activity & management relevant skill-sets to the FE students. \r\n', 'Dr. Namrata Ansari', '', '', '', '', '', '', '', '', '', NULL, NULL, NULL),
(306, 'ORIENTATION TO STUDENTS / FACULTIES ON INITIATIVES OF  MINISTRY OF EDUCATION\'S INNOVATION CELL', 'Institution\'s Innovation Council (IIC)', '2021-07-29', '2:30 PM', '', 'Students of Computer Engineering Department', 120, 0, 'To give awareness about the initiatives taken by innovation cell.', 'Dr. Radhika Kotecha, Dr. Vaishali Gaikwad, Prof. Devanand Bathe, Prof. Harsh Bhor, Prof. Swati Shinde and Mr. Vivek Mane', 'Initiatives of MoE\'s Innovation Cell\r\nInstitution\'s Innovation Council\r\nThrust Areas \r\nKAPILA\r\nMentoring by Innovation Ambassadors\r\nVarious Hackathons by MIC\r\nYukti\r\nNISP\r\n', ' Students are received the information about different initiatives taken by Ministry of Education\'s Innovation Cell.    ', 'Dr. Vaishali Gaikwad, Assistant Professor, Information Technology Department', 'Introduction', 'Offerings by IIC', 'Initiatives taken by IIC', 'Participants', 'Start with introduction.jpg', 'Offering by Institutions.jpg', 'Initiatives taken by IIC.jpg', 'Participants.jpeg', 'Banner.jpg', NULL, NULL, NULL),
(308, 'Electronics Beyond Campus! A brief on life after degree', 'Department of Electronics Engineering ', '2021-07-31', '10:00 AM', 'Online', 'Students and faculty of Electronics and EXTC department', 64, 0, '1. To provide an overview of job roles required\r\n2. To provide an overview of how to develop skills to stay relevant\r\n3. To provide an overview of future prospects after BE Electronics', 'Mr Gaurav Mishra, Sr. Engineer R&D , Advance Engineering Group, TVS Motor Co\r\n\r\nMr. Gaurav is an alumni of KJSIEIT. He was a resourceful and active student, who took part \r\nin projects and cocurricular activities. Gaurav held the post of chief technical officer of IETE \r\nstudent chapter in 2015-2016. He was president of IETE in the following Year. His team was \r\na quarter finalist of Texas instruments innovation contest and a finalist of the ARM India \r\ninnovation contest. His team earned a special mention in the finals of ARM India innovation \r\ncontest and this also resulted in his being selected as a trainee in TVS Motor Co. He is now \r\npoised to join as Assistant Manager, Systems Engineering in Bosch Mobility Solutions', 'The seminar was very informative and the need of the hour. Electronics Engineers are scared \r\nof losing out in the job market to engineers from the computer and IT stream. The current \r\nboom in the AI and DS segments have only accentuated their fears. This seminar served the \r\npurpose of allaying their fears and addressed pointers on how to stay relevant and be \r\nsuccessful. Gaurav stressed the point that grades are important to get into companies, though \r\nthey may not be important on the job. He touched on the importance of learning by doing, \r\nthe importance of participating in competitions, doing projects, having profiles on \r\nhackster.io, LinkedIn, GitHub etc. The different resources which will aid their journey like \r\nGitHub, hackster.io, element -14 , our very own Somaiya library was elaborated. The \r\nimportance of networking and how to search and identify for people, jobs and domains in \r\ntheir fields of interest in LinkedIn etc was briefed. His seminar also touched upon \r\ncertification and standards and good courses to brush up skills. He also emphasised on the \r\nneed to be a specialist in addition to being a jack of all trades. The seminar was vey \r\ninformative and appreciated by all participants.', 'The students were made aware of\r\n1. How to develop skills and stay relevant in 2021. ( contests, courses, design challenges \r\nand project portals)\r\n2. Latest trends in embedded systems development ( development cycles, technologies)\r\n3. Overview of job roles and skills required \r\n4.Future prospects after bachelors in electronics engineering ( masters degree, \r\ncertifications, jobs , research, development, startup)\r\n', 'Mrs. Vrinda Ullas/ Department of Electronics Engineering ', 'screen shot', 'Screenshot', 'Participants', 'Participants', '6.jpeg', 'meeting1.jpeg', '8.jpeg', '11.jpeg', 'IIC Layout of Banner.jpeg', NULL, NULL, NULL),
(324, 'Demo', 'Demo', '2021-08-31', '10:10', 'Online', '', 0, 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, NULL),
(317, 'Evolution of Mobile Engineering Over the Last Decade and Innovations in DevOps', 'Institution of Electronics and Telecommunication Engineers (IETE)', '2021-08-05', '4:30 PM', 'Online', '', 70, 0, '1.	To provide students with a thorough knowledge of Mobile Engineering that will help them gain mobile application development skills.\r\n2.     To train students to be Industry-ready and capable of working effectively in the field of Mobile Engineering.\r\n3      To provide students thorough knowledge of Developer Operations and make them Industry-ready for the same\r\n', 'Mr. Omkar Pimple, Founder & Managing Director of CEREBRANIUM ', 'A seminar titled Evolution of Mobile Engineering over the last Decade & Innovations in DevOps was conducted on Thursday, 5th August 2021 at the K. J. Somaiya Institute of Engineering and Information Technology, Sion. The seminar was organized by IETE-KJSIEIT in collaboration with Cerebranium. It was aimed for all students who aspire to understand and get along with the trends in the mobile industry. The seminar was attended by an audience of 65 students.\r\n\r\nThe seminar commenced with a short welcome speech by Zil Jani to introduce the speaker of the seminar, Omkar Pimple. Mr. Omkar Pimple then took over and gave a brief description about the company Cerebranium which was founded by him and highlighted its works. He advanced to the main subject of the seminar and explained the evolution of mobile engineering and mobile technology. Starting with bluetooth, he went on to justify the growth of mobiles in terms of GPS, WiFi and much more. Further he tapped into the world of Augmented Reality and Virtual Reality and unfolded its applications. Next he pointed out the key challenges in Digital Education and told students how he envisions to scale through these challenges and make Digital Education possible in a real sense. Finally the seminar was concluded by glorifying the vision of Cerebranium and the speaker proposed to offer internships to students in various fields in his company Cerebranium. The seminar was thus ended by a vote of thanks given by Mufaddal Miyajiwala.\r\n', 'Students learned about the transformation of the mobile industry and the coming possibilities of innovations in the same. They also understood the amplitude of industry that can be used to escalate education.', '1.Medha Asurlekar, Convener IETE-ISF\r\n2. Prince Gada ,LY Student  IETE-ISF \r\n3. Muffaddal Miyajiwala LY Student  IETE-ISF', 'Speaker, Omkar Pimple introducing himself', 'Speaker introducing his company, Cerebranium', 'Speaker explaining evolution of technology in mobile industry', 'Explaining Key challenges in digital education', 'cerebss3.jpeg', 'cerebss5.jpeg', 'cerebss2.jpeg', '', 'WhatsApp Image 2021-08-01 at 00.32.20.jpeg', NULL, NULL, NULL),
