(303, 'Initiatives of MoE\'s Innovation Cell', 'Institution\'s Innovation Council (IIC)', '2021-05-08', '4:30 PM', 'Online', 'Faculties and Students from the Institute', 192, 0, 'To create awareness about start-ups and the related ecosystems.', 'Innovation Ambassadors - Dr. Radhika Kotecha, Prof. Swati Shinde, Dr. Vaishali Gaikwad, Dr. Mansing Rathod, Prof. Devanand Bathe, Prof. Harsh Bhor, Mr. Vivek Mane', 'As per the guidelines by MoE\'s Innovation Cell (MIC), an Orientation Session for all students and faculties of the institute by Innovation Ambassadors was organized by K. J. Somaiya Institute of Engineering and Information Technology - Institutions Innovation Council (KJSIEIT - IIC). \r\n\r\nThe Innovation Ambassadors highlighted various offerings by MIC for promoting innovation and start-ups. \r\n\r\nThe major focus was on the KAPILA program, Yukti 2.0 portal, Hackathons like Smart India Hackathon, Toycathon, etc., Innovation Ambassador Training Program, National Innovation Contest, National Innovation, and Start-up Policy, etc. With details about each of the offerings, the session opened avenues for participation by students and faculties\"', 'The participants got an idea about the events happening under IIC and offerings by IIC to aspirants for establishing start-ups, participating in competitions, filing patents, etc.', 'Dr. Radhika Kotecha,\r\nConvener - Institution\'s Innovation Council (IIC)', 'Screenshot of Event', 'Group Picture of Participants', '', '', 'Image1.jpg', 'Image2.jpg', '', '', 'Banner Image.jpg', NULL, NULL, NULL),
