(294, 'Angel Investment/VC Funding Opportunity for Early Stage Entrepreneurs', 'Institution\'s Innovation Council (IIC)', '2021-07-28', '4:00 PM', '', '', 176, 0, 'To explain the initial requirements that are needed for Early Stage Entrepreneurs to attract Angel Investors and Venture Capital Funding.', 'Mr. Deepak Pandit, Chair Professor - Innovation & Entrepreneurship, Institute of Innovation and Entrepreneurship, School of Management, BML Munjal University (BMU)', 'The talk was delivered by Dr. Deepak, who is a highly accomplished educator and business professional with a substantial background in academic research, international business expertise, and entrepreneurial ventures. He is a resolute educator with academic vigor, adept in motivating and engaging students with practical experience while fostering student literacy and achievement. Dr. Deepak is skilled at leveraging research expertise in technological innovation, disruptive innovation, resource-based view, dynamic capabilities, entrepreneurship education and intention, research paradigms, and methodological fit. His teaching proficiencies include strategic management, managing technology and innovation, entrepreneurship and new venture development, and qualitative research methods. His executive Training expertise includes Disruptive Innovation, Business Model Innovation, Corporate Entrepreneurship, Strategic Change Management, Ideation, and Growth strategies for start-ups.\r\n\r\nIn this session the speaker, Dr. Deepak Pandit spoke about the various stages of a startup. He explained to the students, the meaning of the early-stage startups from an investor\'s perspective and until when a startup is an early-stage startup. Dr. Deepak informed us about the various forms of fundings like bootstrapped, friends and family funding, angel investment, crowdfunding, seed funding, various forms of VC investments, and IPO funding. He clarified many misconceptions that the participants had between angel investment and seed funding. Dr. Deepak also made the students aware of the various difficulties that we college students and early-stage entrepreneurs can face while raising our first round of investment. He talked about the key differences between the international investment market and the Indian Investment market. ', 'The attendees gained an understanding of Angel Investment and VC Funding and shall discuss the steps that Entrepreneurs must take at an early stage to finance their startups. The participants also learned the right manner to approach an investor in this session. Overall the session was quite informative and interactive, it was appreciated by all the participants.  ', 'Dr. Radhika Kotecha\r\nHead - Department of Information Technology\r\nConvener - Institution\'s Innovation Council (IIC)', 'Screenshot of the Event', 'Group Picture of Participants', '', '', '1.jpg', '2.jpg', '', '', 'Banner.jpg', NULL, NULL, NULL),
