(319, 'Building curriculum vitae for successful career\'', 'Department of Computer Engineering', '2021-08-06', '6:00 PM', 'Online', '', 40, 0, 'How to  build a powerful curriculum vitae for successful placement and importance of real time projects in the curriculum vitae\r\n', 'Mr.Surajit Karmakar,Software Engineer-III, Samsung Semiconductor India R&D, Bengaluru ', 'A Curriculum Vitae is a document commonly used in the hiring process. It includes information about your background and qualifications and should communicate the most important, relevant information to employers in a clear, easy-to-read format. The goal is to quickly communicate why the candidate is uniquely qualified for the position based on his skills and experiences. To create a CV that will get noticed by employers, we can follow a few simple steps and best practices. The main goal to keep in mind is to make resume relevant and readable.', 'Students understood  how to write CV and what  points should mentioned in the CV.', 'Mrs.Shubhada Sachin Labde\r\nMrs.Nisha Amey Vanjari', '', '', '', '', 'first_photo.jpg', '2nd_photo.jpg', '3rd _ph.jpg', '4th_ph.jpg', 'CV_buiding_Poster.jpg', NULL, NULL, NULL),
(214, '\"Being an Autonomous Institute: Roles, Responsibilities and Action Plan\"', 'Academic Committee', '2021-06-04', '2:00 PM', 'Online', 'faculties and staff', 150, 0, '	To train KJSIEIT faculty & staff for the roles, responsibilities & to have an action plan for implementation of the Autonomy under EXTC program.\r\n	To emphasize & execute academic exposure, continuous assessment, NBA & accreditation as a progressive endeavour KJSIEIT.\r\n', 'Dr Jayshree Khanapuri ,Dr.Milind Nemade , Dr.Hariram Chavan', 'Dr. Jayashree Khanapuri, HoD of EXTC dept. provided a brief overview on the introduction of B.Tech (EXTC) programme curriculum. She apprised the participants onCourse curriculum, Examination Scheme, Electives offered in the third and final year, Content Covered & Overall Structure of the EXTC Curriculum. In addition, the weightage of marks with credit system was discussed. Dr. Jayashree also briefed on interdisciplinary approachSkill, Activity, Technology (SAT) courses, its implementation at the program level in the autonomous curriculum. The rationale to introduce the SAT courses was to equip with proficient technical and management relevant skill-sets.', '	KJSIEIT faculty & staff gained a detailed insight to be able to implement autonomous curriculum by implementing the EXTC curriculum with relevant new technological courses as per the current industrial requirements.\r\n	The EXTC Department will be able to seamlessly incorporate an interdisciplinary approachSkill, Activity, Technology (SAT) to equip with proficient technical, activity & management relevant skill-sets to all the students under the B.Tech (EXTC) program. \r\n', 'Dr Namrata Ansari\r\nDean Academics', '', '', '', '', '', '', '', '', '', NULL, NULL, NULL),
(162, 'GD on ETHICS FOR INNOVATORS', 'Department of Information Technology in association with CSI', '2021-05-03', '3:00 PM', 'Online', 'Students of IT department KJSIEIT ', 13, 0, 'To enable students to apply ethical principles and commit to professional ethics and responsibilities and follow the norms of the engineering practice.', '', 'Role of Ethics in Responsible Innovation\r\nThe meaning of ethical behaviour in IT innovation was discussed and the lack thereof were stated by many students, especially in relation to copyright of material from sources like GitHub for personal and commercial use. Whereas, some argued that such is the price to pay for the evolvement of the IT industry through learning from materials made by fellow innovators.\r\n\r\nPossible problems due to unethical practices in Innovation\r\nPoints like copyright issues and possible loss of acknowledgment to the original innovators were brought up while some opposed with the opinion that as long as there isn\'t a physical or monetary harm to the original developer, the rest is a small price to pay for accomplishment of a larger goal.', ' Students were able to apply ethical principles and commit to professional ethics and responsibilities and follow the norms of the engineering practice.', 'Dr. Radhika Kotecha, HOD IT Department\r\nProf. Uday Rote, Dean - Student Welfare', '', '', '', '', '1.jpg', '22.jpg', '33.jpg', '', 'SE GD.jpg', NULL, NULL, NULL),
(160, 'Need for Sustainable Innovations', 'Department of Information Technology in association with CSI', '2021-05-04', '4:00 PM', 'Online', 'Students of IT department KJSIEIT ', 58, 0, '1. To demonstrate the knowledge of project design, and understand the need of sustainable Innovations.\r\n2. Students will be able to understand the impact of the professional engineering solutions in societal and environmental contexts and Impact of Innovations on Environment.\r\n3. To motivate students for the Eco-friendly Innovations.', '', 'Why Sustainable Innovation?\r\nSustainability means using the resources without stopping the future generation from using them. According to study, global population in some time will be 9 billion. Hence, we need to use our resources smartly. Example given of Karnataka related to sustainable innovation of water related project.\r\n\r\nPrinciples of sustainability\r\nMaximize degrees of self-realization, ensure diversity is maintained, entropy is not declined. Preservation of earth is necessary. Do not over exploit the resources of nature.\r\n\r\nEconomy of Sustainable Innovation\r\nGovernment policies can improve sustainable innovation (SI). Production of more environment friendly products. SI is destructive. SI is collaborative. SI changes corporate value. Case studies of SI: e-waste programs and recyclable products.\r\n\r\nWhy Sustainable development requires societal development\r\nConcept of societal innovation and its impact on society. How sustainable development and societal development are related.', ' Students were able to understand the impact of the professional engineering solutions in societal and environmental contexts and Impact of Innovations on Environment.', 'Prof. Uday Rote, Dean - Student Welfare', '', '', '', '', '44.jpg', '55.jpg', '66.jpg', '', 'TE GD.jpg', NULL, NULL, NULL),
(161, 'Impact of Innovations on Environment (Motivation for Eco-friendly Innovations)', 'Department of Information Technology in association with CSI', '2021-05-05', '3:00 PM', 'Online', 'Students of IT department KJSIEIT ', 7, 0, 'Students will be able to apply ethical principles and commit to professional ethics and responsibilities and follow the norms of the engineering practice.', '', 'Relationship between eco-innovations and the impact on business performance in Contemporary World\r\nRaising awareness about eco-friendly innovations, sustainable development of electronic vehicles, creating less toxic products, reduce resources for production, eco hackathons, plant based food products', 'Students understood professionalism, various ethical principles and how to follow the norms of engineering practice.', 'Prof. Uday Rote, Dean - Student Welfare', '', '', '', '', '77.jpg', '88.jpg', '', '', 'BE GD.jpg', NULL, NULL, NULL),
