(318, 'COEPS cell 9th one day   free workshop on ', 'COEPS Cell  in association with  Dinosys InfoTech and  EXTC  department', '2021-08-09', '5:00 PM', '', 'All engg. college students from Mumbai and outside Mumbai ', 45, 45, 'Awareness on the Cyber Crimes in Trend \r\nUnderstanding of tactics used by Criminals in Cyber Crime\r\n  Practical Hands on Learning \r\n Advance methodologies for investigation \r\nTo provide a deep understanding of OSINT. \r\nProviding clarity upon Chain of Action and Evidence Handling.\r\n', 'Mr Atual Kulkarni ,IPS officer, Maharashtra police, cyber crime  cell  \r\nMr. Govind Ray :chairperson of Dinosys InfoTech \r\n', 'Awareness on the Cyber Crimes in Tern\r\nUnderstanding of tactics used by Criminals in Cyber Crime\r\n  Practical Hands on Learning \r\n Advance methodologies for investigation \r\nTo provide a deep understanding of OSINT. \r\nProviding clarity upon Chain of Action and Evidence Handling.\r\n', ' Student got aware about cyber crime and learn about ethical hacking importance .\r\nStudents got chance to work with Maharashtra cyber cell to solve real time case investigation for cyber crime .     ', 'Mrs. Sandhya Deshpande \r\n(COEPS convener )\r\nA.P. Extc Department.\r\nKJSIEIT<Mumbai.\r\n', 'Speaker start the session ', 'students  attendance', 'importance of cyber security in digital india', 'IPS officer Mr.Atual kulkarni', 'Govind Ray Explaining etical hacking .jpg', 'students attdeance_9th aug.2021 .jpg', 'impoetance of cyber security in digital india.png', 'IPS OFFICER Mr. ATUAL KULKARNI guiding to students.jpg', 'POSTER (1) (1).png', 'Maharashtra Cyber security cell', NULL, NULL),
(167, 'Seminar on Importance of Analysis for innovation', 'Department of Information Technology', '2021-05-08', '2:00 PM', 'Online mode', 'Students', 59, 0, '1. Identify importance of problem analysis \r\n2. Identify workable mode for problem analysis \r\n3. Apply multiple techniques of problem analysis in ascertainment of key causes \r\n4. Use problem analysis to increase effectiveness of managerial capacity \r\n', 'Mr. Mitesh Shah, Solution Architect, Vernost Marketing Solutions, Mumbai. itesh Shah', 'Enabling students in problem analysis, identify, formulate and review research literature, and analyze complex engineering problems would help them adapt easily when they join any IT organization tomorrow. Students have learned the process of understanding and defining the problem to be solved. Problem solving identifies solutions that conform to the needs and constraints of the problem. When these things are overlooked, we either have an incomplete or excessive solution. He has explained five steps process for problem Analysis that are Gain agreement on the problem definition, Understand the root causes  the problem behind the problem, Identify the stakeholders and the users, Define the solution system boundary  and Identify the constraints to be imposed on the solution. ', ' This seminar provided the concept about problem analysis, how to identify and formulate innovative problem statement. Five process steps for analyzing problem. He has more focused on analyze complex engineering problems and also explained 4 Ps (Place, Procedure, Policies and People) of project with examples. ', 'Dr. Mansing Rathod', 'Participant attendance image', 'Resource person image with slide', '', '', 'image4.png', 'image3.png', '', '', 'PO2 Seminar banner image.jpg', 'Problem analysis, Identify the stakeholders and Define the solution system', NULL, NULL),
(241, 'Awareness on Current Trends - IoT/VLSI/RF', 'Department of Electronics and Telecommunication Engineering', '2021-06-26', '10:30 AM', 'Online ', 'Undergraduate Students and Researchers', 96, 18, 'The key objective/ agenda of this program is \r\na)	Basic study of fundamentals of VLSI, RF and ML & IoT.\r\nb)	Various trends and opportunities in VLSI, RF and ML & IoT.\r\nc)	To increase placement opportunities in VLSI, RF and ML & IoT.\r\n', 'Mr Dhamdhara M S (Business Manager, Entuple Technologies, Bangalore)', 'The Program on Awareness on Current Trends - IoT/VLSI/RF commenced with the inauguration Ceremony at 10.30 AM with the invaluable presence of the dignitaries and faculty of KJSIEIT. Prof. Kiran R. Rathod, Coordinator of this event gave brief introduction about the key objective of the program and concluded the inaugural function with positive thought. Mr Dhamdhara M S, Business Manager, Entuple Technologies, Bangalore are invited as eminent speaker for this program. He explained about the importance of VLSI, RF and ML & IoT in his speech. Mr Dhamdhara M S focused on current technologies as well as how this technology driving the IoT/VLSI/RF industry. He also focused on opportunities available in this domain as well as focused on opportunities in future due to advancement in technology. Total 114 students as well as faculty attended this webinar out of that 96 participant from KJSIEIT and 18 participants from other institute and university. All the participants are very happy with the presentation. Finally, the certificate distribution has done through email and appreciate all participants, conveners, coordinators, supporting staff and with sincere gratitude to somaiya Institute for providing great opportunity to organize this event successfully.    ', ' After successful completion of Awareness on Current Trends - IoT/VLSI/RF students are able to-\r\n1. Explain the importance of IoT, VLSI, RF domain.\r\n2. To find opportunities in  IoT, VLSI, RF domain.\r\n', 'Prof. Kiran Ramesh Rathod, Assistant Professor, EXTC', 'Technologies Driving RF Domain - 5G', 'Technologies Driving RF Domain- Defense and strategic development', 'Technologies Driving RF Domain- security and surveillance, consumer electronics ', 'Applications of IoT', 'Pic1.jpg', 'pic2.jpg', 'pic3.jpg', 'pic4.jpg', 'banner.jpg', 'IoT, VLSI, RF and opportunities', NULL, NULL),
(240, 'Writing Effective Course Learning  Outcomes', 'Department of Information Technology', '2021-06-23', '4:00 PM', 'Online', 'Faculty of IT Department', 13, 0, 'To encourage participants to review :\r\nWhat are learning outcomes and why use them\r\nWhat are the aims and objectives of using learning outcomes\r\nPlan a course  using correctly formulated learning outcomes\r\n', 'Vrinda Ullas, IQAC Coordinator', 'The workshop covered basics of Blooms taxonomy. a model subject was discussed covering all nuances of writing outcomes. SART verbs were discussed and how it is imperative to decide on an assessment method while writing learning outcomes was demonstrated with examples. Finally all participants were asked to present the learning outcomes and assessment methods of a subject they would be teaching in the next semester. ', ' The faculty members:\r\n  Write course learning outcomes using Blooms Taxonomy\r\nParticipants will be able to identify assessment methods for their learning outcomes', '', 'action verbs', 'Screenshot', '', '', 'Flickr-4100721032.jpg', 'Capture.JPG', '', '', '240.jpg', 'Blooms Taxonomy, outcomes, assessment', NULL, NULL),
(325, 'International Youth Day', 'National Service Scheme (NSS)', '2021-08-12', '6:00 PM', 'Online', 'Students and Faculty of KJSIEIT, All NSS units', 50, 82, '1.To empower youth in their decision making\r\n2. Promote positive self-development \r\n3. Unlocking the latent potentials of our global youth\r\n', ' Mr Yash Tiwari is a 19-year-old International Youth Mentor, Mental Health awareness advocate and an award-winning author of 2 books.\r\nHe has also delivered talks on world renowned platforms like TEDx, Josh Talks, alongside giving sessions and workshops to global audiences on diverse topics of Social Interest.\r\n', 'The event commenced at 6:00pm. Speaker of the webinar, Mr Yash Tiwari began by explaining how the youth of the era had access to various platforms which can be used to our advantage. He later explained how students can use their strengths and potentials to attain success. Inspiring us with his wonderful words, he stated his thoughts on the importance of setting goals in life, academic or creative to inch closer to excellence. The session concluded with an interactive question and answer session where the speaker cleared any doubts the students had.', 'The event ended on a high note with the participants learning about how we can work on our flaws, use our strengths to our advantage and become better people and leaders of the future.\r\n', 'Prof. Pankaj Deshmukh', 'Introduction of the speaker for the session', 'Speaker explaining evolution of Youth over the years', 'Participants asking doubts in query session', 'Participants and speaker had a great QnA Session', 'IMG-20210812-WA0046.jpg', 'International Youth Day SS.jpg', 'IMG-20210812-WA0053.jpg', 'Screenshot_2021-08-12-18-07-01-64_2ef548bf47261a0f379d52645eb41568.jpg', 'fhdh.jpg', 'youth, stress, management', NULL, NULL),
