(185, 'How to select a Research Project and Deliver it Successfully through Paper or Presentation', 'Department of Electronics and Telecommunication Engineering', '2021-05-17', '9:00 AM', 'Online ', 'TE Students', 63, 0, 'To make students aware about the various academic projects and industry based project\r\nto help students select a good project and research topic', 'Mr. Jay Shah, EY, Texas(Alumnus ETRX)', 'The main goal behind including final year projects in the course curriculum is to encourage students to apply their theoretical knowledge to practical use. Working on final year projects allows students to couple their intellectual faculties with practical skills to solving real-world engineering and business problems. To help students sharpen their intellectual qualities like creative thinking, analytical abilities, teamwork, and communication skills.\r\n\r\nMr. Jay went ahead discussing the steps students can follow and note while selecting the topic\r\nDont Follow the Crowd  Explore Your Area of Interest, Identify a Real-Time Problem and Provide a Solution for it With Your Project\r\nRead Research Papers and Gather Quality Resources , Choose Your Project Team and Mentor Carefully, Plan Everything Prior to Avoid Any Hassle, Do Analyze the Project at Every Stage, Don\'t Take Project Documentation and Presentation Part For Granted.\r\n\r\nHe also mentioned the different skillset required were shared with the student like  Any one Programming Language \r\n Knowledge of Cloud , Networking  CCNA, Linux  Database SDLC  GitHub Account Business and Requirements Mindset\r\n\r\n\r\nThe session the continued with what can students do to beat the gloom in the market?\r\nBe proactive in reaching out to companies, write to as many firms with your CV, Look beyond the traditional avenues, explore the startup ecosystem for jobs,  additional skills in your subject of qualification, Learn a foreign language, Take up freelance assignments\r\nWrite a Research Paper, Explore remote work through websites that connect with prospective employers, Take up an internship.\r\n\r\nThe session concluded with a question answer round, It was an overall interactive event.\r\n\r\nWe are thankful to our Principal sir, Vice Principal Mam for the permission for the event . We are also thankful to our HOD mam for the constant support.\r\n\r\n', ' Identify your Goals, Vision  Objective , Strength and Weakness. Define each and Apply the same to select the project topic , write standard papers and build resume.\r\n', 'Prof. Rashmi Adatkar\r\nProf Rupali Kadu', 'Session Aim', 'Parameters to select paper', 'Trending list of projects', '', 'aim of session.JPG', 'how to select paper.JPG', 'trending project.JPG', '', 'Jay Shah.JPG', 'Projects, trending topics', NULL, NULL);
