(298, 'How to invest to achieve your financial goals ', 'Department of Electronics and Telecommunication Engineering', '2021-07-26', '4:00 PM', 'Online Mode', 'Teaching and Non Teaching Faculty', 69, 0, '1. To emphasize the importance of investments and savings among the faculty and staff.\r\n2. To train the faculty on important tips on how to invest wisely\r\n3. To make the faculty aware about different methods  on investments.\r\n', 'Mr. Nagarajan Murthy, ', 'Mr. Nagarajan Murthy  introduced about main requirements like, emotional, spiritual, social, family and financial requirement for the healthy life style. He then talked about the inflation and how the value of money reduces and how to calculate retirement funds. He said that for any individual the fund should be at least 16 times the last drawn  salary. Then he talked of compounding effect on money and suggested that one must start early in life to invest so that it does not become a Burdon at the later stages. Mr. Murthy suggested that instead of first spending and then saving the remaining amount, one must first save and use the remaining money for the expenditure. This ensures more saving. He shoed with examples that how a specific amount invested regularly will grow after 25 or 30 years and the value of compounding. He urged everyone to invest in equity, mutual funds and systematic investment plans. He also suggested that people should wait for longer periods to get good return on investments.', ' 1. The teaching and Non Teaching faculty understood about investing in an early age\r\n2. The participants learnt about the effect of inflation in the long run and how to grow the money through proper investing.\r\n3. Participants learnt the importance of investing in Equity, Mutual Funds and long term plans', '1. Prof. Vricha Chavan,  Assistant Professor, Department of Electroniccs and Communication\r\n2. Prof. Vrinda Ullas,  IQAC Coordinator\r\n3. Dr. Jayashree Khanapuri, HoD, department of Electronics and Telecommunication', 'Mr. Murthy Nagarajan Addressing the participants', 'College prayer playing', 'Investment details by Murthy Nagarajan', 'Towards the investment and conclusion', 'Zoom Meeting 26-07-2021 15_17_28.png', 'Zoom Meeting 26-07-2021 15_06_03.png', 'Zoom Meeting 26-07-2021 15_21_09.png', 'Zoom Meeting 26-07-2021 15_34_04.png', '247 (3).jpg', 'Early Saving, Equity, Mutual Funds, Compounding, Retirement fund, Long term plans', NULL, NULL),
(224, 'Mind Hack', 'Department of Electronics and Telecommunication Engineering', '2021-06-17', '12:00 PM', 'Online ', 'Students of TE and BE', 105, 0, 'To extend living a stress free living and peaceful mind', 'Mr.Avinash Tiku', 'Mind, an unexplored world for most of us. An entity which governs our entire life. Researchers say that a human mind gets thousands of thoughts every single minute. And every thought is the origin of a feeling. Many of us might have already heard that the mind as well has some definite patterns, for example; in the realm of the mind, whatever you resist will persist OR what you want to see, you see that only, etc. \r\n\r\nIn this Jet age the polluted environment, personal problems and work pressure take a toll on our mind and its patterns, and what remains is usually referred as STRESS. \r\n\r\nNeither at home nor at school are we taught how to deal with stress in healthy ways. Research suggests that proactive approaches to stress reduction, enhanced social connection, and service-based engagement with community can significantly enhance health, happiness and quality of life for students. \r\n\r\nWith this aim, The Art of Living Organization has come up with a holistic and integrated session, \"Mind HACKs\", designed so to provide practical tools - to achieve, and maintain our peace and calm of mind and yet be dynamic and proactive. The program will give a glimpse of what a happy state of mind can do. Besides, learning some practical techniques like meditation, the session takes the audience into a new set of experience by humor and wit. Automatically one feels light, energetic and enthusiastic to take on life!! \r\nThe session extended to attends to all levels of our physical existence - Mind, Intellect and Memory \r\nStress Relief Relieve anxiety and depression \r\nEnhance brain function Improve concentration and efficiency \r\nEnhance well-being, peace of mind \r\nHeighten awareness and bring clearer perception\r\n', ' Individuals will learn to be grateful and satisfied for what one have because true happiness is in enjoying the present.\r\n\r\nIndividual will learn that the lack of acceptance and satisfaction is generated from comparing things to the past or caring too much about your future, this will hinder you from living life to the fullest.', 'Prof. Rashmi Adatkar\r\nProf. Rupali Kadu\r\nProf. Amit Kukreja', '', '', '', '', '', '', '', '', 'Mind Hack - Banner.jpg', 'Peace , healthy living', NULL, NULL),
(17, 'Introduction to Industrial Internship: Entuple Technologies', 'Department of Electronics and Telecommunication Engineering', '2021-03-12', '11:00 AM', 'Online ', 'Undergraduate Students and Researchers', 112, 0, 'The key objective/ agenda of this program is \r\na)	Basic study of fundamentals of VLSI, RF and ML & IoT.\r\nb)	Various trends and opportunities in VLSI, RF and ML & IoT.\r\nc)	To increase placement opportunities in VLSI, RF and ML & IoT.\r\n', 'Mr Dhamdhara M S (Business Manager, Entuple Technologies, Bangalore)', 'The Program on Introduction to Industrial Internship: Entuple Technologies in association with KJSIEIT on IoT/VLSI/RF commenced with the inauguration Ceremony at 11.00 AM with the invaluable presence of the dignitaries and faculty of KJSIEIT. Prof. Kiran R. Rathod, Coordinator of this event gave brief introduction about the key objective of the program and concluded the inaugural function with positive thought. Mr Dhamdhara M S, Business Manager, Entuple Technologies, Bangalore are invited as eminent speaker for this program. He explained about the importance of VLSI, RF and ML & IoT in his speech. Mr Dhamdhara M S focused on current technologies as well as how this technology driving the IoT/VLSI/RF industry. He also focused on opportunities available in this domain as well as focused on opportunities in future due to advancement in technology. Total 112 students as well as faculty attended this webinar from KJSIEIT. All the participants are very happy with the presentation. Finally, the certificate distribution has done through email and appreciate all participants, conveners, coordinators, supporting staff and with sincere gratitude to somaiya Institute for providing great opportunity to organize this event successfully. ', ' After successful completion of Awareness on Current Trends - IoT/VLSI/RF students are able to-\r\n1. Explain the importance of IoT, VLSI, RF domain.\r\n2. To find opportunities in  IoT, VLSI, RF domain.\r\n', 'Prof. Kiran Ramesh Rathod, Assistant Professor, EXTC', 'No of students attended webinars', 'Quick overview ', 'Entuple online Intership program work flow', 'Job opportunities in RF, VLSI industry', 'Photo 1.jpg', 'Photo 2.jpg', 'Photo 3.jpg', 'Photo 4.jpg', 'Banner Mr. Dhamodhara 1.jpg', 'IoT, VLSI, RF and opportunities', NULL, NULL),
(328, 'Research, Innovation, and Rankings', 'MoE\'s Innovation Cell, and underneath Institution\'s Innovation Council', '2021-08-11', '10:30 AM', 'Online', 'Faculties, Staff, and Students of the Institute', 1187, 0, 'To create awareness about rankings and strengthen the culture of research and innovation.', 'Dr. K. Radhakrishnan, Former Secretary (Space) and Chairman, Standing IIT Council Committee\r\nProf. Govindan Rangarajan, Director, IISc, Bangalore \r\nDr. Umesh Shaligram, Director (R&D), Serum Institute of India \r\nMr. Deepak Bagla, MD & CEO, Invest India\r\nDr. Anita Gupta, Scientist -G, Adviser and Head-NSTEDB, Govt. of India\r\nMr. Yashraj Bharadwaj, Cofounder and CEO, Zenith Vipers and Idea Solutions \r\nProf. V. Ramgopal Rao, Director, IIT, Delhi, Ashwin Fernandes, Regional Director, QS \r\nProf. R. Raj, VC, O. P. Jindal Global University', 'Dr. Rajkumar Ranjan Singh, Hon\'ble Minister of State for Education and External Affairs, Govt. of India was the Chief Guest for the program while Prof. K. Vijay Raghavan, Principal Scientific Advisor, Govt. of India was the Guest of Honor. The speakers described how research and innovation are major factors when it comes to the ranking of universities and educational organizations. The speaker highlighted that the concept of interdisciplinary studies is critical, and collaborations, as well as joint research, are the future. The speakers also highlighted that innovation doesn\'t come from just within, it needs good industry tie-ups and societal support - and they appealed to all industries to support for the same. The speakers also highlighted that research and innovation are about improving scientific production, diversifying research programs, and considering the complexities of the real world. Various rankings, parameters assessed by ranking frameworks, ranking parameters, and how the rankings encourage institutes to strengthen the research and innovation ecosystem was discussed.', 'The discussion highlighted several opportunities, challenges, platforms, and avenues for research and innovation. The participants also learned about ranking parameters, and how the rankings encourage institutes to strengthen the research and innovation ecosystem.       ', 'Dr. Radhika Kotecha,\r\nHead - Department of Information Technology\r\nConvener - Institution\'s Innovation Council (IIC)\r\nInstitute\'s Nodal Officer - ARIIA & NIRF', 'Collage 1 of Event', 'Collage 2 of Event', '', '', 'Ranking1.jpg', 'Ranking2.jpg', '', '', 'NEP-2020-webinar-A4-Panel-Discussions (1).jpg', 'Innovation', NULL, NULL),
(337, 'Startup Success Story-1', 'Dr.  Hari Chavan, Convener, NISP & Dr. Radhika Kotecha, Convener, IIC', '2021-08-20', '16:00', 'Zoom', '', 0, 0, '1)  Staff and students learn about startup success.\r\n2) To motivate students and staff members for starting the startup.\r\n3) To pursue Startup Journey successfully.', 'https://www.linkedin.com/in/sachinkumbhoje', '', '', 'Dr. Sandhya Kadam, Assistant Professor, EXTC', '', '', '', '', '', '', '', '', '', 'Startup Success Story', NULL, NULL),
(340, 'Career Options and Opportunities for Electronics and E&C Graduates', 'Training and Placement Cell in association with Department of Electronics Engineering and Department of Electronics and Telecommunication Engineering', '2021-08-24', '14:00', '', 'students', 147, 0, '-To give an overview to the students on the opportunities in core Electronics field and the skills required\r\n- To give an overview of Product Development, Industry, Tools and different type of jobs\r\n- To give an overview of higher education in India and abroad\r\n- To give an overview on  short term/online training in Embedded System, DSP,VLSI,AI/ML, IoT etc\r\n\r\n', 'PROFILE \r\nRenjith.C.V, \r\nB1-102,Mahindra Antheia, \r\nNehru Nagar Road,Pimpri \r\nPune  411018 \r\nMobile - 9561653259 \r\nE-mail : renjithcv78@rediffmail.com\r\nEXPERIENCE SUMMARY \r\nWorking as Electrical Architect/Product Designer at Philips India LTD Pune since July 2012 \r\nWorked at Rayence,South Korea as Assistant Manager (Hardware Design ) for about 4 years \r\nWorked at Siemens Information Systems Ltd Bangalore and Randox etc \r\nOver 19 years of experience in end-to-end electronics product/hardware design and development \r\n DSP,FPGA,ASIC and Microcontroller based digital and mixed signal hardware design \r\n Experience in high speed board design with DDR2 memory, Gigabit Ethernet, PCI \r\nExpress,LVDS,Wifi and SATA \r\n Experience in Data acquisition circuit & analog front end design for Medical Imaging \r\n Experience in Power supply design for DSP/FPGA/MCU and analog circuits \r\n Experience in EMC compliant circuit design, testing and CE/FDA complaint product design \r\n Good knowledge on Signal and Image Processing. \r\n Experience in complete Hardware Development from requirement analysis, component \r\nselection, design, PCB layout verification, system testing and EMC testing. \r\n Experience in Regulatory testing and Reliability \r\nMajor Achievements/Projects \r\nDesigned and architected multiple medical products for global markets \r\n- Designed Architected X-Ray system \r\n- Designed and Architected Medical X-Ray detectors ( GigE and Wireless based ) \r\n- Designed Clinical Chemistry Analyzer \r\n- Designed Automotive Instrument clusters \r\n- Designed X-Ray Image Processor \r\n- Designed test jigs for consumer electronics product testing \r\nEDUCATIONAL QUALIFICATION \r\nMaster of Engineering (M.E) in VLSI and Embedded Systems with Distinction from RSCOE,Pune \r\n(Savitribai Phule Pune University,Pune) \r\nMaster of Technology (M.Tech) in Biomedical Engineering with Distinction from Manipal Institute \r\nof Technology (MAHE,Manipal) \r\nBachelor of Engineering (B.E) in Electronics and Communication Engineering with First Class \r\nfrom Sri Ramakrishna Engineering College,Coimbatore (Bharathiar University) \r\nTECHNICAL SKILLS \r\nLanguages : C, MATLAB,VHDL \r\nDSP : TMS320C645x, TMS320C62xx/67xx, TMS320C50, ADSP2185 \r\nFPGA : Xilinx Virtex-5, Spartan 6, Spartan 3/3E \r\nMicrocontrollers 32 bit : PowerPC MPC8536E,ARM920T,ARM7,NECV850,MB91360,PIC32 \r\n 16 bit : MB90F591,ST10F269/168, H8S2612/2638,MSP430 \r\n 8 bit : AVR ,PIC16F87x,MC9S08GT16, 8051 \r\nUSB Controllers : ISP1161, TUSB5052 \r\nMemory : DDR2 SDRAM, SDRAM, Flash (NAND and NOR) \r\nEDA Tools : Allegro, CR5000 System Designer, Cadstar, OrCad, Protel, PSpice, \r\nHyperlynx, Modelsim, Xilinx ISE, PADS Layout \r\nProtocols : Gigabit Ethernet, PCI Express, SATA, Cameralink, Optical Interface, \r\n : Zigbee, Bluetooth, WLAN, LVDS, CAN, USB, I2C, SPI, RS232 \r\nTesting Instruments : DSO, Logic Analyzer, Spectrum Analyzer, Emulator \r\nTrainings Attended \r\n Attended Advanced Product Quality , Design Robustness DfX, Reliability Practitioner, System \r\nArchitecture and Value Engineering trainings at Philips\r\n Attended Data Acquisition System Design and Power Supply Design training at Texas \r\nInstruments, Bangalore.\r\n Attended EMC workshop at SAMEER, Chennai. \r\n Attended PCB Design training at CETE, Hyderabad. \r\n Attended FPGA workshop at Xilinx,Seoul ( South Korea) \r\n Attended FPGA Design and TMS320C62xx/67xx DSP training at MS Ramaiah School of \r\nAdvanced Studies, Bangalore. \r\nAcademic Skills/Expertise \r\n Member Board of Studies and Department Advisory board in various Engineering \r\ncolleges \r\n Career and Project Guidance \r\n Curriculum/Syllabus Development for B.E/M.E \r\n Examiner for B.E and M.Tech projects \r\n Guest Lectures/Expert Talk on various topics in Electronics, Biomedical Engg, Project Selection \r\nand Career Guidance to Engineering (B.E/M.Tech) Students ( Delivered lecture to over 14000 \r\nstudents from over 190 Engineering colleges and IEEE SB across India)\r\n Experience in conducting FDP /Lecture in various topics in Electronics and Biomedical \r\nEngineering to Engineering College Professors \r\n Guidance on Higher Studies and Course Selection in India and Abroad', 'An Expert Talk  titled \"Career Options and Opportunities for Electronics and E&C Graduates\"  was conducted on Tuesday, 24th August 2021 at the K. J. Somaiya Institute of Engineering and Information Technology, Sion. The seminar was organized by Training & Placement cell  in association with Department of Electronics and Department of Electronics Engineering. It was aimed for all students who aspire to understand and get along with the jobs in the Electronics field. The Expert Talk was attended by an audience of 147 students.\r\n\r\nThe seminar commenced with a short welcome speech by Prof. Mandar Bivalkar to introduce the speaker of the seminar, Mr. Renjith C.V. .Mr. Renjith C.V. then took over and gave a brief description about the jobs available in Core field. He emphasized students to set their domain as per their interest and skills. Also it should be based on the long term career growth opportunities. He discussed various options available in Higher Studies and told students paper publications and projects done are two important aspects considered for higher study.\r\nAlong with this he discussed various Industry types and also explained product development flow. He gave tips for enhancing career prospectus. Emphasized to do more projects as only doing certification course will not help to find job.\r\nAfter the Question and Answer session ended with the vote of thanks .\r\n\r\n\r\n ', ' -Students got an  overview about the opportunities in core Electronics field and the skills required\r\n- Students got an overview of Product Development, Industry, Tools and different type of jobs\r\n- Students got an overview of higher education in India and abroad\r\n- Students got an overview on  short term/online training in Embedded System, DSP,VLSI,AI/ML, IoT etc   ', '1. Prof. Medha Asurlekar\r\n2. Prof. Mandar Bivalkar\r\n3. Prof. Rupali Kadu\r\n4. Prof. Rashmi Adatkar\r\n5. Prof. Amit Kukreja', 'Banner of the Expert Talk', 'Speaker explaining about  Planning of Career', 'Speaker explaining about the product flow', '', 'Capture1.PNG', 'Capture3.PNG', 'Capture2.PNG', '', 'Banner_career.PNG', ' Product Development, Industry, IOT, embedded system', NULL, NULL),
(326, 'Innovative Techniques  in Cyber Security and Defence', 'American Chemical Society (ACS)', '2021-07-14', '12:00 PM', 'Online', 'students', 60, 0, 'The aim of this event was:\r\n1. To Acquaint the students with basic practical knowledge of the\r\nbasic phenomenon/concepts of cyber security and protection\r\nagainst cyberattacks and data breaches\r\n2. To ensure that the students will be able to understand and explain\r\nthe various Protection for data and networks & Prevention of\r\nunauthorized user access.\r\n3. To ensure that the students will be able to Improve the recovery\r\ntime after a breach & Protection for end users and endpoint\r\ndevices.', 'Mr.Arpit Sharma ,Security Engineer at Accenture', 'A webinar on \"INNOVATIVE TECHNIQUES IN CYBER SECURITY &\r\nDEFENCE\" was organised by ACS Students Chapter along with\r\nDepartment of Basic Sciences and Humanities for all faculties & students\r\nof various departments and Institutes.\r\nCybersecurity is the protection of internet-connected systems such as\r\nhardware, software and data from cyber threats. The practice is used by\r\nindividuals and enterprises to protect against unauthorized access to data\r\ncentres and other computerized systems.\r\nA strong cybersecurity strategy can provide a good security posture\r\nagainst malicious attacks designed to access, alter, delete, destroy or\r\nextort an organization\'s or user\'s systems and sensitive data.\r\nCybersecurity is also instrumental in preventing attacks that aim to disable\r\nor disrupt a system\'s or device\'s operations', ' Students learn:\r\n1. What is Cyber Security and how to secure Data Breaches?\r\n2. Why is Cybersecurity important for Engineers and Different?\r\nTampering Techniques For systems and data stored within\r\nExploitation of resources\r\n3. Importance of Cyber Security in various Engineering domains such\r\nas Mechanical, Civil, Electronics and Computer Science.', 'Dr.Namrata Ansari and Dr.Shahin Pathan\r\nConvener and Coordinators-ACS', '', '', '', '', '', '', '', '', '', 'cyber security , defence', NULL, NULL),
(206, '\"Being an Autonomous Institute: Roles, Responsibilities and Action Plan\"', 'Academic Committee', '2021-05-29', '2:00 PM', 'Online', 'faculties and staff', 150, 0, '	To train KJSIEIT faculty & staff for the roles, responsibilities & to have an action plan for implementation of the Autonomy.\r\n	To emphasize & execute academic exposure, continuous assessment, NBA & accreditation as a progressive endeavour KJSIEIT.\r\n', 'Dr.Sarita Ambadekar , Dr Radhika Kotecha', 'K J Somaiya Institute of Engineering & Information Technology (KJSIEIT), Sion, a constituent college of Somaiya Vidyavihar has been conferred with Autonomous Status for a period of 10 years from the AY 2021-2022 to AY 2030-2031 (conferred in March 2021) as per provisions of Clause 3.13 and Clause 6.4 of UGC Regulations dated 12.02.2018.  The autonomous status has accorded KJSIEIT the academic freedom to float its own syllabus and customize it as per the cutting-edge global technical trends. With systematized efforts, KJSIEIT embarks on a vision to be competent & aim for employment-centric syllabus. \r\n\r\nOffering its services in producing top-quality engineers and innovators of tomorrow, KJSIEIT has been accredited the A Grade by NAAC along with NBA (National Board of Accreditation). Moreover, the institute has been recognised for its impeccable academic record as can be depicted through its numerous awards and recognitions. KJSIEIT is the 7th Engineering College affiliated to Mumbai University to be conferred with the autonomous status. \r\n', ' 	KJSIEIT faculty & staff gained a detailed insight to be able to implement autonomous curriculum by implementing the IT and COmp curriculum with relevant technologies.', 'Dr Namrata Ansari\r\nDean Academics', '', '', '', '', '', '', '', '', '', 'curriculum', NULL, NULL),
(342, 'Mastek Deep Blue project competition season-7 awareness program', 'Dr.Sarita Ambadekar ', '2021-09-06', '16:00', 'Online', '', 0, 0, 'To make students aware about the Deep Blue project competition to be organized by Mastek.', '', '', '', 'Prof.Minal Sonkar, Assistant Professor, Department of Computer Engineering\r\nProf.Pradnya Patil, Assistant Professor, Department of Computer Engineering', '', '', '', '', '', '', '', '', '', 'project competition', NULL, NULL),
(343, 'Awareness and registration of Mastek-Deep Blue Project competition season-7', 'Dr.Sarita Ambadekar ', '2021-09-06', '16:00', '', 'All students', 205, 0, '1. Awareness of this competition\r\n2. To know about various problem definitions.\r\n3. To begin registration by students group\r\n4. To increase maximum participation from KJSIEIT', 'Mr. Akhil Singhal\r\nProgram manager for Deep Blue, \r\nMastek Ltd', 'Event was conducted to provide detailed information of Deep Blue Project Competition season-7 by Mastek. Various aspects of Deep Blue project competition was presented by Mr.Akhil Singhal. Presentation broadly covered the importance project competition, structure of competition and the flow of competition.\r\nVarious problem definitions discussed with the students to make them aware and motivate to participate in this competition. At the end of the presentation all the queries of the students were resolved by Mr.Akhil Singhal.', '1. The students got relevant information about the Deep Blue Project Competition season-7.\r\n2. Students were motivated to participate in this competition. ', '1. Prof.Minal Sonkar, Assistant Professor, Department of Computer Engineering\r\n2. Prof.Pradnya Patil, Assistant Professor, Department of Computer Engineering', 'Opening of Event', 'Problem statements', 'Journey Progress', 'Group Picture', 'Image1.png', 'Image2.png', 'Image3.png', 'Image4.png', 'Deep Blue Event Banner.png', 'project, competition, problem definition', NULL, NULL),
