(345, 'Stay Fit and Sound', 'Shyamal Virnodkar', '2021-09-04', '07:30', '', 'Faculties and Students', 20, 1, '1. To learn various exercises and their significance on different body parts   \r\n2. To kindle awareness of performing exercises in an appropriate way', 'National Volleyball Player, M. Phil, PhD (Physically and mentally challenged children motor component development aspects, MA in Philosphy, PG diploma in fitness and nutrition, MA in educational communicaiton', 'The workshop was conducted from 7.30am to 9.00 am and covered following points:\r\n1. Stretching of full body\r\n2. Started with Neck exercises then shoulders exercices\r\n3. Upper body joints exercises\r\n4. Seven Suryanamaskar\r\n5. Lower body, back and abdomen exercises\r\n6. Face yoga\r\n7. Various types of Pranayam ', ' 1.Everyone in society will be more healthier physically in the COVID pandemic situation\r\n 2. Everyone will enrich with mind freshness  ', '1. Shyamal Virnodkar\r\n2. Nisha Vanjari\r\n3. Shubhada Labde\r\n4. Pradnya Patil', 'The workshop on \'Stay Fit and Sound\'', 'Participants in the workshop', 'Suryanamsakars', 'Upper Body Workout', 'FitandSound_Banner.png', 'FitandSound_All_Participants.png', 'FitandSound_Suryanamskar.png', 'FitandSound_WritstExercise.png', 'Stay_Fit_and_Sound_Banner.JPG', 'Fitness workout, Yoga, Full Body Stretching', NULL, NULL),
