(348, 'Holistic Development and Role of Education', 'Shyamal Virnodkar', '2021-08-27', '16:30', 'Online Mode', 'Citizens of the nation', 29, 0, 'To facilitate the development of a holistic perspective among students towards life and profession as well as towards happiness and prosperity', 'Assistant professor, AICTE volunteer for UHV workshops', 'The topics covered in the workshop are:\r\n1.	Holistic development of the human being\r\n2.	Role of education in the holistic development\r\n3.	Current perspective of happiness and prosperity\r\n4.	Human Consciousness\r\n5.	Right understanding\r\n6.	Relationship\r\n7.	Physical facilities \r\n\r\nThe speaker talked about continuous happiness and prosperity. He explains the role of education is is to facilitate the Development of Human being to live with Definite Human conduct. The unhappiness is more due to lack of fulfillment in relationship. Most of the time and effort is spent for physical facility. If we are living with all three (right understanding, relationship, and physical facility, in that priority order) then we are living with human consciousness.  Human being can be fulfilled (be happy and prosperous) on the basis of these three.\r\n', ' 1. Students will recognize the lack of understanding human values is the root cause of all problems. 2. They will start technical education with the study of human values which will create more solutions than the problems.', '1. Shyamal Virnodkar\r\n2. Mrunali Desai\r\n3. Kavita Bathe', 'The workshop on Holistic Development and Role of Education', 'Commencement of the workshop by Mr. Shrinidhi Gindi', 'Participants of the workshop', 'Interactive session on human values', 'Screenshot_1832.jpg', 'UHV_PIC1.jpg', 'Screenshot_1647pm_1.jpg', 'Screenshot_1807pm.jpg', 'UHV__Poster.jpg', 'Universal human values, happiness, prosperity, right understanding, relationship, and physical facilities', NULL, NULL),
(352, 'Innovative techniques of project cost estimation and benifits', 'Ms.Chitra Bhole', '2021-08-28', '09:00', 'Online', '', 0, 0, 'To explore the innovative project cost estmation techniques and its benifits.', '', '', '', '1.Prof.Chitra Bhole,Assistant Prof,Computer Engg Dept.\r\n2.Prof.Nisha Vanjari,Assistant Prof,Computer Engg Dept\r\n3.Prof.Shubhada Labade,Assistant Prof,Computer Engg Dept', '', '', '', '', '', '', '', '', '', 'Cost Estmation Techniques', NULL, NULL),
(353, 'Innovative techniques of project cost estimation and benifits', 'Ms.Chitra Bhole', '2021-08-28', '09:00', 'Online Mode', ' Students and Faculties', 78, 0, 'To explore the innovative  techniques of project cost estimation and benifits.\r\nTo predict the quantity, cost, and price of the resources required to complete a task within the project scope\r\n To determine the cost estimation of a project before actually do the work using modern techniques\r\n', 'Mr. Shidhhi Pota is an Alumnus of KJSIEIT from August 2012  May 2016, Computer Department. She has done MBA from Welinkar institute of Management, Work experience:  Ms.Siddhi worked as senior group leader at Lumina Datamatics Limited,Pvt Ltd. Mumbai\r\n', 'The Department of Computer Engineering organized a workshop on \"Innovative Techniques of Project Cost Estimation and Benefits\"on 28th Aug 2021.  Ms. Sidhhi Pota, an Alumnus of the Computer Department of 2016 was the expert Speaker. Ms.Shiddhi Pota is a senior group leader at Lumina Datamatics Limited,Pvt Ltd. Mumbai\r\nThe workshop was aimed to understand students how to estimate the budget of the project. Ms.Shiddhi provided in-depth insights on the budging of the project. She  has guided students about the project and its development phases. Project development phases involvement and its budget calculation in terms of development cost to product value in the market and its profit gain. \r\nThere were 78 registered participants for the event. Ms. Chitra Bhole,Ms.Nisha Vanjari & Ms.Shubhada Labde  were in the organizing team.\r\n', '1.The students understood how to estimate  the budget of the project. \r\n2.Third and final year  students able to estmate the budget of their project considering relevant parameters.', '1.Prof.Chitra Bhole,Assistant Professor,Comuter Engg Dept\r\n2.Prof.Nisha Vanjari,Assistant Professor,Comuter Engg Dept\r\n3.Prof.Shubhada Labade,Assistant Professor,Comuter Engg Dept', 'Explanation  by Speaker', 'Explanation  by Speaker', 'Explanation  by Speaker', 'Vote of Thanks', '1.jpg', '2.jpg', '3.jpg', '4.jpg', 'Workshop banner cost estimation.jpg', 'Cost Estimates, Budget Consistencies, Budget Monitoring', NULL, NULL),
