(293, 'KJSIEIT\'S COEPS CELL ', 'KJSIEIT\'s COEPS Cell', '2021-08-16', '5:00 PM', '', 'All stream engineering students from KJSIEIT and diffident colleges  ', 5, 7, '1) To aware about cyber crime in this digital aura \r\n2) After this workshop students will  able to take care of their personal sensitive information for induvial and family members  ', 'Mr. Govind Ray (CEO Dinosys InfoTech )', 'KJSIEITS COEPS cell of KJSIEIT, sion under the guidance of Mr Govind Raj (Cyber Security Consultant ) and Prof. Sandhya Deshpande organized a meeting on 16th August 2021 at 5pm on Google meet platform .Join the video meeting, click this link: http://meet.google.com/fhp-eoue-eay to welcome the newly recruited students and faculty and also to discuss the updates on Cyber Security. The meeting began with the introduction of new students, faculty and team members present. After that, Mr Govind Raj stressed on the importance of documentation. Prof. Sandhya Deshpande took the responsibility of maintaining the documentation .During the meeting! Sir, updated everyone on the progress of the cyber security. Mr Govind Raj reviewed the progress and offered alternatives to tackle the shortcomings also teaches about on social crimes.\r\nPROGRESS:  \r\n* Day-1: We learnt about the existing social media crimes around us. We\r\ndiscussed about the following :-\r\n-> Cyber Bullying\r\n-> Fake Accounts\r\n-> Phishing Links\r\n-> Custom Scams\r\n-> Sextortion Rackets\r\n-> Account takeover on IG\r\n-> Online stores on Social Media\r\n-> Adware Scams\r\n\r\n* Day-2: 91 CRPC Notice to Facebook Law Enforcement team, learnt how to\r\nwrite a letter to the Modal Officer of the ISP (Internet Service Provider),\r\nalso learnt about Internal Protocol Data Records (IPDR) in detail.\r\n\r\n* Day-3: Learnt how to get information from victims mobile number.\r\nSDR (Subscriber Data Record )i.e: name , Aadhar no, address .\r\nCAF (Customer Application Form ) i.e: Photograph .\r\nCDR (Call Data Record ) i.e: Incoming, outgoing, SMS, ISD, missed call .\r\n*Day-4: Practical done by using tools : Tweet beaver, TGSTAT, Twitter\r\nAdvance search, Tele Lago, locate family .', ' After this five day workshop students \r\n1)well know about the culture of Maharashtra cyber crime cell \r\n2) Aware about real time case study  in Maharashtra police cell.\r\n  ', '1) Mrs. Sandhya Sandeep  Deshpande \r\nA.P.(EXTC) \r\nCOEPS CELL Convener,\r\nKJSIEIT, SION, Mumbai,22\r\n', 'first day session conducted by Govind Ray', '2nd dat session', 'session of third day', '', 'first day.jpg .jpg', '2nd day.jpg', '3rd day.jpg', '', '11.PNG', 'Ethical hacking, Cyber security ', NULL, NULL),
(365, 'Teachers Day Celebration', 'NSS', '2021-09-05', '16:00', '', 'Faculty of KJSIEIT', 81, 0, 'The NSS unit of KJSIEIT in collaboration with Student Council actively organized the event Teacher\'s Day to celebrate the Teachers Day and to show their respect by thanking them on Teacher\'s Day. The event was dedicated to all the teachers and their hard work in this pandemic by managing their time and teaching students simultaneously..The event was organized by NSS KJSIEIT and Student Council members and planned various events to show our gratitude towards the Principal, Faculty and Staff members.', '-', 'The event commenced at 4pm. The event started with a prayer. Then one of the volunteers recited a poem dedicated to teachers. This was followed by a singing performance by a Student Council member to entertain the teachers. Then a fun activity called Musical Housie was conducted by NSS KJSIEIT in which the participation of teachers was very overwhelming.Then an interactive session was conducted by Student Council between teachers and students in which they could share their memories or experiences. A video was presented in which different volunteers gave a speech thanking all the teachers for their efforts. A speech thanking the students and teachers for their efforts was given by the principal of KJSIEIT, Dr. Suresh Ukarande. In the end, all students from NSS and Student Council turned on their cameras holding a placard wishing all teachers a happy Teachers Day.\r\n', 'The event ended on a high note with the students encouraged and motivated towards helping teachers and celebrated Teachers Day with quite successful performances from the students\r\n ', 'Prof. Pankaj Deshmukh', 'Musical Performance by Student Council member', 'Musical Housie Event by NSS KJSIEIT', 'Tribute Video to teachers by NSS KJSIEIT', 'Students from NSS KJSIEIT and Student Council wishing the principal and faculty of KJSIEIT a happy teachers\' day', 't4.jpeg', 't5.jpeg', 't3.jpeg', 't2.jpeg', 'poster.jpeg', 'Prayers and speeches for showing how much we value our dear teachers. , Musical Housie game which will be played completely online. , A final video thanking the teachers for all they do for us', NULL, NULL),
(360, 'UI/UX Tools for Innovative User Interface Design Development', 'The Information Technology Department in association with IET On Campus KJSIEIT and Mumbai LN.', '2021-09-04', '10:00', '', 'Industries person, Faculties & Students across the world', 118, 30, '    1. To learn what UX design tools are and discover essential UX/UI designs to build innovative digital experiences.\r\n    2. To bring out the creativity in each student  build innovative applications that are usable, effective and efficient for intended users.\r\n   ', 'Ms. Shraddha Upadhyaya, UI/UX Designer, Everestek Technosoft Solutions, Mumbai', 'Dr. Vaishali Gaikwad welcomed the participants, introduced the speaker to the audience and coordinated the workshop.\r\nThe expert trainer, Ms. Shraddha Upadhyaya started the session by explaining the concept of UI/UX design and its importance in the different real time projects.\r\nFurther, following tools were covered\r\na. Figma\r\nb. Adobe XD\r\nc. Different URLs for color pallets, fonts and templates\r\nThe workshop was followed by a Question-Answer session, facilitating the participants to get inputs from trainers on their queries related to the topic of the workshop. The trainer addressed the all questions and provided their valuable recommendations for the same to the participants.\r\n', '1. Students are able to engage in independent and life-long learning in the broadest context of technological change through UI/US design.\r\n2. Students are able to apply design system components or processes that meet the specified needs with appropriate consideration for the real time applications.\r\n3. Students are able to apply recent tools of UI/UX design in different required areas.   \r\n4. Ability to engage in independent and life-long learning in the broadest context of technological change through UI/UX design.\r\n ', 'Dr. Vaishali Gaikwad, IET Coordinator, Assistant Professor, Information Technology Department', 'Trainer\'s Presentation', 'Demonstration of Figma Tool', 'Demonstration of Adobe XD Tool', 'Workshop Participants', 'WhatsApp Image 2021-09-04 at 11.57.35 AM.jpeg', 'WhatsApp Image 2021-09-07 at 11.00.41 AM.jpeg', 'WhatsApp Image 2021-09-04 at 11.52.24 AM.jpeg', 'WhatsApp Image 2021-09-04 at 11.52.53 AM.jpeg', 'WhatsApp Image 2021-09-01 at 12.42.48 PM.jpeg', 'Figma, Adobe XD, Color Pallets, Templates', NULL, NULL),
(361, 'Further studies after Engineering', 'Students\' Council', '2021-08-31', '16:00', '', 'Students from all years, departments and institutes who wish to know about education opportunities abroad after graduation.', 99, 0, '1) An overview about the application process for securing admits in top universities.\r\n2) An interactive discussion for clearing doubts and myths regarding the examinations and counseling', 'Yash is a telecommunications engineer from D. J. Sanghvi, Mumbai, who went to Virginia Tech, USA for his MS in Industrial Engineering: Operations Research. Having been through the process himself, he understands the challenges faced by anyone trying to plan their further education abroad and all the parameters that should determine that decision. He has helped hundreds of students with their application processes over the years. His mentees have received admits from top universities of the world like Dartmouth College, Brown University, Cornell University, University of Pennsylvania, London School of Economics and Political Science, University of Melbourne, University of Toronto, the University of British Columbia and the National University of Singapore, among others. He is certified by UCLA as a Career Counselor and has entrepreneurial experience in the healthcare and construction industries.\r\n', 'The webinar was organized in collaboration with Inspirus Education, who provided the speaker of the webinar, Mr. Yash Patel. The webinar started off with a short summary of several options available for education after completing an engineering degree. The speaker further went on to state a few myth-breakers regarding education abroad. Guided details about how to go about choosing the right path for each individual was given and the process of application to universities was explained. The webinar also created a strong motivation among participants to start preparing for the same with a proper goal in mind. To end, questions asked by the participants were answered by the speaker, and hence the event was concluded.', ' The webinar was able to successfully break several myths revolving around getting further education in India or abroad after pursuing engineering. Participants were able to clearly understand in brief the process of applying to education abroad and the requirements for the same. Overall, the webinar helped participants gain insight in the broad field of education after graduation.    ', 'Uday Rote Department of IT \r\nPrashant Sawant Department Of IT ', 'Screenshot of the Presentation presented by the speaker', 'Screenshot of Participants in the Webinar', 'Screenshot of the speaker of the webinar, Mr. Yash Patel', '', 'ss11.jpeg', 'ss22.jpeg', 'ss3.jpeg', '', 'Inspirus Webinar 1.jpg', 'a webinar,  Further studies after Engineering', NULL, NULL),
(362, 'A webinar on \" Internet Of Things ', 'Prof. Sandeep Miashra & Prof. Pranali Hatode', '2021-08-28', '13:00', 'Online', '', 0, 0, 'To kindle awareness and motivation amongst students regarding IOT in students', 'Director at SmarDen Automation Pvt. Ltd. Member of industrial advisory board at amity university, greater Noida', '', '', 'Prof. Sandeep Mishra\r\nProf. Pranali Hatode', '', '', '', '', '', '', '', '', '', 'For any and everyone who is interested in IoT/Home Automation/Technology in general, this Webinar is a golden opportunity! You will get to ask us questions and we will explain how smarden.tech will cater to you in finishing your projects effortlessly!', NULL, NULL),
(363, 'Security Innovation : Web application security with OWASP TOP10 ', 'Kavita Bathe', '2021-09-15', '15:30', '', 'TY Students', 25, 0, 'To learn and implement security aspects of web application.', 'Mr.Harshil Majithia\r\nSenior technical program Manager,\r\nFynd.', 'Resource person have covered security aspects of Web application with OWASPS TOP 10. With reference to the industry standard for   \r\nfollowing topics are covered\r\n1.Broken Access Control\r\n2.Cryptographic failure\r\n3. Injection\r\n4.Insecure Design\r\n5.Security Misconfiguration\r\n6.Vulnerable and Outdated Components \r\n7.Identification and Authentication Failures\r\n8.Software and Data Integrity Failures\r\n9.Security Logging and Monitoring Failures\r\n10.Server-Side Request Forgery\r\n', '1. Students got clear understanding of importance of building secure web applications\r\n2.Students understood  how to build secure web applications.\r\n ', '1. Prof. Kavita Bathe , Assistant Professor, Department of Computer Engineering\r\n2. Prof. Shyamal Virnodkar , Assistant Professor, Department of Computer Engineering\r\n3. Prof. Mrunali Desai , Assistant Professor, Department of Computer Engineering', 'OWASP-TOP10', 'OWASP-TOP10', 'OWASP-TOP10', 'OWASP-TOP10', 'ExpertSession_1.png', 'ExpertSession_2.png', 'ExpertSession_3.png', 'ExpertSession_4.png', 'Security Innovation _ Web application security with OWASP TOP10  - Banner.jpg', 'Security', NULL, NULL),
(364, 'Virtual Industrial Visit-Audi Factory, Amul Industry', 'Sarika Mane', '2021-08-31', '10:00', 'Online Mode', 'LY- ETRX Students', 50, 0, '1) To create awareness in students regarding the various industrial environment.\r\n2) To update the students with the latest trends in the industry.\r\n3) To learn Implementation of IoT in industry\r\n', '-', 'virtual industrial visit to learn about industrial environments , different technologies used in industry and to raise awareness of the working environment in industry. ', ' After completion of the industrial visit students will be able to,\r\n1.	Understood the  various industrial environment \r\n2.	Familiar with latest trends in the industry\r\n3.	learn implementation of IoT in industry\r\n      ', '1. Sarika Mane, Assistant Professor - ETRX', 'Amul Industry', 'Amul Industry- Process', 'Audi Factory', 'Event Banner', '1-a.jpg', '2.jpg', '3.jpg', 'Virtual Industrial Visit-Audi Factory, Amul Industry - Banner (1).jpg', 'Virtual Industrial Visit-Audi Factory, Amul Industry - Banner (1).jpg', 'IoT, Process Industry, Robotics', NULL, NULL),
(322, 'Inauguration of CROWN', 'New Leap Initiative (NLI)', '2021-08-07', '3:00 PM', 'Online Mode', 'Students, Faculty and HAMs', 80, 30, 'The inauguration aimed to introduce and spread awareness regarding the activities of CROWN towards following objectives.\r\nWith a vision to further the cause of amateur radio, to spread knowledge and awareness for radio fundamentals, code and to hold classes for the same.\r\nTo further the exchange of information and cooperation between members, to promote radio knowledge, fraternalism, individual operation efficiency and to conduct club activities with the intent to advance the general interest and welfare of amateur radio in the community.\r\nRecognition and enhancement of the value of the amateur service to the public as a voluntary non-commercial communication service; particularly to provide emergency communication. Continuation and extension of an amateurs proven ability to contribute to the advancement of radio communication. \r\n', 'Renown HAMs', 'The inauguration was held on August 7, 2021 at 03:00 PM followed by workshop on demonstration of HF radio communication. The inauguration began with an introductory video of the college followed by the college prayer. It was attended by various HAMs from Mumbai including students from CROWN. 14 renowned HAMs across Mumbai attended program offline. The Chief Guest for the inauguration ceremony was Dr. Suresh K. Ukarande, Principal, KJSIEIT and Associate Dean, Faculty of Science & Technology, University of Mumbai.\r\n\r\nDr. Umesh Shinde, VU3CDI, President of CROWN introduced the club and addressed its progress thus far. General Secretary, Prof. C.S. Kulkarni, VU2CHD, explained the future vision of the club and the scope for students to learn and develop further. Vice-Principal Dr. Sunita Patil addressed the audience about KJSIEIT and various activities at our Institute. Respected Chief Guest Principal, Dr. Suresh K. Ukarande, conducted the inauguration speech followed by inauguration of CLUB. Mr. I. G. Venugopal VU2IVG & Mr. Cyril Alphanso VU2AY, well- respected senior HAMs offered their best wishes and guidance for the students.\r\n\r\nAfter a short break, the practical demonstration of HF Band Radio Operations was conducted by Prof. C.S. Kulkarni and KJSIEIT Students. The event was concluded by respected CROWN President, Dr. Umesh Shinde with vote of thanks, followed by the national anthem.\r\nThe inauguration was coordinated by Treasurer of Club, Mr. Devanand Bathe (UV3WXD), Mrs. Tilottama Dhake (VU3CDF), Mrs. Pradnya Kamble (VU3CDG) and Student members Jatin Bhosale, VU3FPK (BE Electronics), Rhythm Bhat, SWL (TE Computer), Pavan Jangam, SWL (TE EXTC) and Shubh Mistry, SWL (TE EXTC) \r\n\r\nThe event was streamed live on youtube and was attended by around 100 college students, teachers and other members of interest.\r\n', ' 1) Program introduces the students, faculties and HAMs to CROWN, Club for Radio Operations & Wireless Network. \r\n2) Amateur radio is a community of people that uses radio transmitters and receivers to communicate with other Amateur radio operators.\r\n3) The participants are made aware about the applications and rules to participate as a member of Ham Radio Community.\r\n4) Employ the concept of HF Radio Communication', 'Student Coordinators:  \r\nJatin Bhosale, VU3FPK (BE Electronics) - 7972720689\r\nRhythm Bhat, SWL (TE Computer)  9594964471\r\nPavan Jangam, SWL (TE EXTC)  9137399414\r\nShubh Mistry, SWL (TE EXTC) - 9867848239\r\nFaculty Coordinator:\r\nDr. Umesh Shinde (VU3CDI), President, CROWN\r\nMr. Devanand Bathe (UV3WXD), Treasurer, CROWN\r\n\r\nMrs. Tilottama Dhake (VU3CDF)\r\nCoordinator (EXTC),\r\nCROWN\r\nMrs. Pradnya Kamble (VU3CDG)\r\nCoordinator (EXTC)\r\nCROWN', 'HAMs VU2IVG, VU2DNI, VU2DCI, VU2UPX, VU2KWJ, VU3OSA, VU2CHD, VU3RHU, VU2AY, VU3CDI, VU2RIO, VU2KWI, VU3FPM', 'Demonstration of HF Radio Communication', '', '', 'group.jpg', 'Demonstration.jpg', '', '', 'Banner CROWN.jpg', 'HAM, VU3CDI, CROWN', NULL, NULL);
