(338, 'Theme: Entrepreneurship', 'Institution\'s Innovation Council (IIC)', '2021-08-21', '3:00 PM', '', 'Students from the Institute', 72, 0, 'To foster the culture of entrepreneurship, kindle discussions on entrepreneurship, and motivate students for the establishment of the start-ups.', 'Judge - Mr. Maharsh Patel, Successful Start-up Founder', 'On the occasion of World Entrepreneurs Day, the Institutions Innovation Council (IIC) of K. J. Somaiya Institute of Engineering and Information Technology (KJSIEIT), Sion, Mumbai organized a Debate Competition on the theme of Entrepreneurship. While limited teams were allowed for participation, 72 students watched the debate live. The event commenced sharply at 3:00 PM IST on Microsoft Teams with the student coordinator Ritesh Kumar Pandey (student of TY_IT) welcoming all the participants. This was taken over by the faculty coordinator Dr. Radhika Kotecha (Head of IT Department & Convener - IIC), who welcomed the chief guest & judge of the competition Mr. Maharsh Patel. Later, the rules of the competition were discussed. Each match was of 10 minutes with both the competing teams getting 5 minutes each. For each match, the topic for the debate was given 5 minutes before the match. \r\nRound 1 saw 5 matches with 5 winning teams moving on to Round 2. During Round 2 - Match 1, the team of Sharvil Dandekar & Taksha Limbhasia debated against the team of Priya Mudaliar, Samyukta Nair and Prachi Harwara on the topic Experience is the key to successful Entrepreneurship. There was a tie between and both the teams qualified for the semi-finals.\r\nAll the participants were students with equal calibre and potential but in the end, some stood out shining brighter than the others. The topic for the final round was Is Start-up India boosting Entrepreneurship? The finale saw Shashwati Singh (student of LY_ETRX) take on against the team of Sharvil Dandekar & Taksha Limbhasia (students of TY_IT). There were so many notable points presented by both sides, so sharp were the points that it actually made a commoner think about the fact but the point presented by Shashwati Singh during her conclusion was the game-changer which made her the winner of this Debate Competition. The Judge of the event Mr. Maharsh Patel congratulated and motivated all the participants with his wise words to do better in all the upcoming challenges and appreciated the confidence and knowledge that participants displayed during the whole competition. The event concluded with a group picture and a Thanking Note given by the student coordinator.', 'The participants participated in various debates where the topics were on the theme of Entrepreneurship.           ', 'Dr. Radhika Kotecha (Faculty Coordinator)\r\nMr. Ritesh Pandey (Student Coordinator)', 'Screenshot of First Round', 'Group Picture Captured During the Event', '', '', 'Debate1.jpg', 'Debate2.jpg', '', '', 'IMG-20210820-WA0005.jpg', 'Debate Competition', NULL, NULL),
(366, 'Recents Trends and Development in Networking', 'Mrs.Sheetal Jagtap', '0000-00-00', '', 'Online', '', 0, 0, 'To aware and motivate students about various trends and developments in Computer networking field.', '', '', '', 'Prof.Sheetal Jagtap, Assistant Professor, Department of Electronics ', '', '', '', '', '', '', '', '', '', 'Networking, trends, computer', NULL, NULL),
(367, 'Hands-on workshop on Innovation Solutions using PGM Systems', 'Prof.Pradnya Patil', '2021-09-07', '15:00', 'Online Mode', 'Third year students', 38, 0, '1.To learn Probabilistic Graphical Models\r\n2.To infer probabilities using Bayesian Networks\r\n3.To implement PGM systems in real life Machine Learning applications', 'Prof.Vincy Joseph\r\nME Computer Engg.\r\nTeaching to PG and UG level\r\nSubjects taught : soft computing, cyber security, NLP, AI,ML,SC,CSS etc\r\nArea of interest : Soft computing, Computer Architecture, Microprocessor, AI, Signal Processing\r\n', 'Prof.Prdnya Patil has started the session by welcoming all students and resource person Prof. Vincy  Joseph.\r\nProf.Vincy Joseph started the session by discussing basic probability concepts. She explained Bayes Network in detail and explained it with numerical examples. She also showed simulation of Bayes Network using BayesServer. The probabilistic Graphical Model was developed by Prof.Vincy Joseph as well as participant students. It was developed using Python programming in Google Colab.\r\nProf.Minal Sonkar ended the session with vote of thanks to resource person and all students.\r\nStudents liked the session and find it useful for upcoming use of Probabilistic Graphical Models while doing programs in Machine Learning projects.', 'To develop Probabilistic Graphical Model System using python Programming.', 'Prof.Minal Sonkar, Assistant Professor, Department of Computer Engineering', 'Introduction', 'Introduction to PGM', 'Code Implementation', 'Group Picture', 'Image1.png', 'Image2.png', 'Image3.png', 'Image4.png', 'PGM_Banner.png', 'PGM, Bayesian Networks, Probability, Joint/Conditional/Local Probability, CPD, CPT,Python, BayesServer', NULL, NULL),
(368, 'Recent trends and developments in computer networking', 'Department of Electronic Engineering', '2021-09-02', '10:00', '', 'Students of TY and LY , Electronics', 76, 0, 'To make  students aware about the recent developments in computer networking for enhancing the knowledge about networks.', 'Mr.Satish L. Kumar,\r\nGeneral Manager, Reliance Jio Infocomm ltd, Mumbai', 'Students come to know how 4G hardwares are replaced by 5G virtual devices. Satish sir explained about NFV-MANO-5G. Network function virtualisation is very important step in future network virtualisation. By the use of NFV, speed and capacity of data and voice communication increased. This information is very important for students who wants to do work in Networking Area.', ' Students will be able to explain use of NFV-MANO in 5G network.\r\nStudents will be able to compare 4G and 5G network with its hardware virtualisation.  ', 'Prof.Sheetal Jagtap, Assistant Professor, Department of Electronics.', 'Banner of the event', 'Speaker Mr.Satish Kumar from Reliance Jio', 'Lecture Slides shared by resource person', '', 'banner.png', 'Screen Shot 2021-09-02 at 11.03.39 AM.png', 'Screen Shot 2021-09-02 at 11.01.53 AM.png', '', '', 'computer networking, trends, opportunities', NULL, NULL),
(369, ' Inauguration-\'Pause\' - The Music Club of KJSIEIT', 'Uday Rote', '2021-09-04', '16:00', 'Online Mode', 'Student & faculty members of KJSIEIT', 60, 0, '1. To give an overview about the newly formed music club of KJSIEIT - Pause\r\n2. To give student performers a platform to perform and display their artistic talents.', '', 'The event started at 4.30. The host, Aditi Adurkar, introduced the club, the students in the club, and thanked the faculty members for coming for the inaugural. The students amazingly performed various songs in different genres, some playing an instrument, some singing, while some doing both! \r\n\r\nOrder of performances:\r\n\r\nSamriddhi Banerjee: Ghar More Pardesiya by Shreya Ghoshal\r\nManomay Kongwad: Abir gulal - Pandit Jitendra Abhisheki \r\nRhutuja Vispute: Moh moh ke dhaage by papon\r\nJanak Limbachia and Krupali Thakur: Kho Gaye Hum Kahan\r\nKrupali Thakur:\r\nDelzeen Machhi: Mamma mia by ABBA\r\nSaheel Patil: Pause by Prateek Kuhad\r\nSamriddhi Banerjee: Aapki Nazron by Lata Mangeshkar\r\nJanak Limbachia: O Sanam by Lucky Ali\r\n\r\nAfter the performances were done, the faculty members were invited to perform spontaneously. The event ended after a warm-hearted thank you note from Prof. Uday Rote at 6 pm.', '1. The Music Club \'Pause\' was established.\r\n2. The students as well as the faculty members got a platform to display their artistic talents. ', 'Uday Rote Assistant Professor Dept. Of IT', 'Students performing', 'Students performing', 'Faculty members performing', 'Team behind Pause', 'pause2.jpeg', 'pause3.jpeg', 'pause6.jpeg', 'pause1.jpeg', 'pause-inaug.jpeg', 'Music Club, inauguration', NULL, NULL),
