(376, 'Nutritional Series', 'NSS', '2021-09-07', '18:00', '', 'Students and Faculty of KJSIEIT, All NSS units', 35, 60, '1. To create awareness about good nutrition and health\r\n2. Reinforce specific nutrition-related practices or behaviours to change habits that contribute to poor health\r\n3. Create a motivation for change among people', 'Kuntal Joisher is an alumnus of Vivekanand Institute of Technology, Mumbai, and USC Viterbi School of Engineering, Los Angeles also he has been named one of Indias top 30 fitness influencers and has also been featured on the TEDx platform multiple times. Also, he is a well-respected photographer, and his work has been published in many esteemed newspapers and magazines.', 'The event commenced at 6:00pm. Speaker of the webinar Kuntal Joisher explained about resting and non-resting energy expenditure and he gave details about the fat loss fundamentals. He said that his aim was to be a climber who wanted to reach the top of Everest. He shared his experience of what all he faced while climbing to the worlds highest mountain.He wanted to express how being fit helped him to climb Everest. At the end, the query session resulted in participants raising their doubts regarding the maintenance of their respective body for a healthy and a balanced life.', 'The event ended on a high note with the participants learning about energy, fat loss and how they should practice a balanced diet in their daily life.\r\n  ', 'Prof. Pankaj Deshmukh ', 'Speaker of the event', 'Speaker sharing about fat loss fundamentals ', 'Speaker talking about energy expenditure', 'Participants attending the event', 'Screenshot_20210907-181333.jpg', 'Screenshot_20210907-182342.jpg', 'Screenshot_20210907-181339.jpg', 'Screenshot_20210906-180047.jpg', 'IMG-20210906-WA0001.jpg', 'To create awareness about good nutrition and health', NULL, NULL),
(377, 'Nutritional Series', 'NSS', '2021-09-06', '18:00', 'Zoom', '', 0, 0, '1. To create awareness about good nutrition and health\r\n2. Reinforce specific nutrition-related practices or behaviours to change habits that contribute to poor health\r\n3. Create a motivation for change among people', '', '', '', 'Prof. Pankaj Deshmukh', '', '', '', '', '', '', '', '', '', 'To create awareness about good nutrition and health', NULL, NULL),
(378, 'Why Mental Health Requires Attention', 'NSS ', '2021-09-12', '16:00', '', 'All KJSIEIT students and faculty , All NSS units', 35, 40, '1. Definition of mental health and why it requires attention\r\n2. Stigma attached to Mental Health.\r\n3. What is Anxiety and Depression\r\n4. To spread awareness about World Suicide Prevention Day', 'Ms. Manika Kadyan is a practising Counseling Psychologist, currently treating clients having problems like- Anxiety, Depression, Stress, Negativity, Anger Issues, Self Esteem and Self Doubt. \r\nShe is certified in Anxiety counselling, sleep counseling, Neuro linguistic Programming and Mindfulness. \r\nShe is also the founder of \"mansik care\", a mental health initiative towards promoting awareness. \r\nHer major focus is on preventative care and she aims to educate people about mental health in her endeavours.', 'The event commenced at 4:00pm. Speaker of the webinar Ms. Manika Kadyan explained why awareness about mental health is important. She also shared that her major focus is on preventative care and she aims to educate people about mental health in her endeavours. She explained why the stigma regarding mental health is there in the society. She explained the different causes of stress, depression and anxiety and how to fight them.\r\nAt the end, the query session resulted in participants raising their doubts regarding the different mental health issues and their doubts were answered by the speaker.\r\n\r\n\r\n', 'The event ended on a high note with the participants learning about the importance of spreading mental health awareness and how to help remove the stigma of mental health related issues in society.\r\n ', 'Prof. Pankaj Deshmukh', 'Speaker of the event', 'Speaker explaining causes of anxiety and depression', 'Participant asking their queries to the speaker', '', 'hn.jpg', 'dfks.jpg', 'dwdg.jpg', '', 'poster.jpg', 'mental, health', NULL, NULL),
(331, 'Management of Stress with Music Therapy', 'Department of Electronics Engineering jointly with Department of Artificial Intelligence & Data Science in association with Industry & Institute Interaction Cell', '2021-08-28', '5:30 PM', '', 'Students', 63, 0, 'To discuss management of stress with music therapy', 'Mr. Vivek Joshi, Musician', 'Dr. Wadhe, Dean of Industry & Institute Interaction Cell and Coordinator of the event, welcomed the Speaker, Pandit. Vivek Joshi, Musician, and Sarod Player, Principal Dr. Suresh Ukarande, Vice Principal Dr. Sunita Patil, Deans of various sections, Faculties, staff, students, and dear participants, on behalf of K. J. Somaiya Institute of Engineering & Information Technology, Sion. She mentioned that the webinar is jointly organized by the Department of Electronics Engineering with the Department of Artificial Intelligence & Data Science in Association with the Industry & Institute Interaction Cell of the college.\r\n\r\nShe mentioned that, due to Covid 19 Pandemic and its lockdown, the whole world is suffering a lot. The education institutes have also started their Teaching Learning Online. Also, being in Technical education, students need to learn various technical skills and courses online, though there are some restrictions to implement the learned skills with physical experimentation. This Online teaching and learning of the entire nation have impacted on stress level and happiness of the students. Depression issues are increasing in many because of this Covid-19 and also, change in our lifestyle because of it. Many people have lost their near and dear one. It leads to stress and depressions, mood swings, and many mental health issues. To get rid of this, and to get relief with good therapy, the college has planned this wonderful event of stress Management with Music Therapy.\r\n\r\nDr. Wadhe introduced the speaker Pandit Vivek Joshi!\r\n\r\nThe host of the program was Dr. Milind Nemade. \r\n\r\nHe did important discussions on stress, the nature of Music, different Raagas to cure different moods, stress, and depression. \r\n\r\nDr. Wadhe delivered the vote of thanks!\r\n', ' Students will be able to manage their stress and improve concentration with Music Therapy ', 'Dr. Vaishali Wadhe, Associate Professor, Department of Electronics Engineering', 'Pandit Vivek Joshi performing sarod with Yaman Raaga', 'Dr. Vaishali Wadhe introducing about the speaker and a host Dr. Milind Nemade', 'Dr. Milind Nemade, Host of the program is discussing with the speaker', 'Pandit Vivek Joshi is discussing about stress management with music therapy', '2.jpg', '1.png', '3.jpg', '4.jpg', 'AIDS-IIIC-Music Therapy Banner.jpg', 'Stress Management', NULL, NULL),
