(381, 'Guidance for Project Development', 'Sarika Mane', '2021-09-08', '13:45', '', 'TY  ETRX-Students', 20, 0, '1) To create awareness among the students for project development.\r\n2) To motivate the students for project development & competition participation', 'Mr. Prathamesh Rahate- Capgemini Pvt. Ltd., Airoli, Navi Mumbai', 'Mr. Prathamesh shared his views regarding the project development, importance of the participation in the various project competitions. \r\nDifferent projects were dicussed by the speaker. The session was successful and the students gained exposure to the projects. The session was appreciated by the students. When doing different projects and their potential industry jobs, this experience would be helpful.\r\nA total of 20 TY (ETRX) students participated in the project guidance session.\r\n', ' After completion of the industrial visit students will be able to,\r\n1.	Understood the importance of project development.\r\n2.	Understood the need of participation in various competitions\r\n ', '1. Prof. Sarika Mane, Assistant Professor', 'Webinar Guidance for Project Development-8thSeptember, 2021, By Mr. Prathamesh Rahate- Capgemini Pvt. Ltd', 'Webinar on Guidance for Project Development on, 8thSeptember, 2021, ', 'Webinar on Guidance for Project Development on, 8thSeptember, 2021, ', 'Webinar on Guidance for Project Development on, 8thSeptember, 2021, ', 'D (1).jpg', 'C (1).jpg', 'A (1).jpg', 'B (1).jpg', '', 'project development', NULL, NULL),
(382, 'Penetration Testing and Bug Bounties', 'Dr. Vaishali Gaikwad & Mrs. Jignasha Dalal', '2021-09-21', '16:00', 'Online Mode', 'Students & Faculties', 45, 69, '1. Demonstration of Penetration Testing and Bug Bounties.\r\n2. Working of Open Source Intelligence Tools.\r\n3. Google Dorking and GitHub Dorking to find sensitive information.\r\n4. Creating your own Google Dorks and Publishing it.\r\n', 'Bug Bounty Hunter', 'Dr. Vaishali Gaikwad welcomed the participants, introduced the speaker to the audience and coordinated the\r\nworkshop.\r\nThe expert speaker, Mr. Vaibhav Lakhani started the session by explaining the concept of Penetration Testing and Bug Bounties.\r\nProf. Jignasha Dalal gave vote of thanks to the speaker, participants and KJSIEIT.\r\nThe lecture was followed by a Question-Answer session, facilitating the participants to get inputs from\r\nspeakers on their queries related to the topic of the lecture. All speakers addressed the questions and provided\r\ntheir valuable recommendations for the same to the participants.', ' 1. Able to apply engineering knowledge in developing and designing solutions for different problems\r\nthrough the cyber security steps.\r\n2: Able to apply ethical principles and commit to professional ethics, responsibilities, and norms of the\r\nengineering practice towards the society.\r\n3: Enhance the communication of and ability to apply modern tools and technology apply for Penetration Testing and Bug Bounties.\r\n4: Ability to investigate ransomware in independent and life-long learning in the broadest context of\r\ntechnological change through cyber crime investigation methods.', '1. Dr. Vaishali Gaikwad, Convener- CSRC, Assistant Professor- Information Technology Department\r\n2. Mrs. Jignasha Dalal, Coordinator- CSRC, Assistant Professor- Computer Engineering Department', 'Introduction', 'Demonstration of Penetration Testing and Bug Bounties', 'Workshop Participants', '', 'Introduction.jpeg', 'Demonstration.jpeg', 'Participant List.jpeg', '', 'Banner.jpeg', 'Penetration Testing, Bug Bounties.', NULL, NULL),
(383, 'Developing Innovative Solutions using React Native', 'Dr. Vaishali Gaikwad', '2021-09-18', '10:00', '', 'Students and Faculties', 66, 25, '    1. Learn to prepare one code base for Desktop, web and mobile apps across all platforms in the field of Hybrid Application Development.\r\n    2. Learn open source programming language React Native which is used in Facebook, Instagram, Uber, Uber eats, Flipkart, Tesla, Skype, Pinterest, etc....', 'Mr. Badal Kotak Director, Image Online Pvt. Ltd., Mumbai', 'Dr. Vaishali Gaikwad welcomed the participants, introduced the speaker to the audience, and coordinated the workshop.\r\nThe expert speaker, Mr. Badal Kotak started the session by explaining the concept of React Native in Mobile Applications.\r\nThe lecture was followed by a Question-Answer session, facilitating the participants to get inputs from speakers on their queries related to the topic of the lecture. All speakers addressed the questions and provided their valuable recommendations for the same to the participants.\r\n', '1.  Able to apply engineering knowledge in developing and designing solutions for different problems through React Native.\r\n2. Able to apply ethical principles and commit to professional ethics, responsibilities, and norms of the engineering practice towards the society in the development of mobile applications \r\n3. Enhance the communication of and ability to apply modern tools and technology apply in programming.\r\n\r\n\r\n ', 'Dr. Vaishali Gaikwad, IET Coordinator, Assistant Professor, Information Technology Department', 'Conduction of Workshop', 'Conduction of Workshop', 'Conduction of Workshop', 'Attendance', 'Screenshot (425).png', 'Screenshot (426).png', 'Screenshot (428).png', 'Screenshot (436).png', 'react native banner (1).jpeg', 'React Native, Hybrid Application Development', NULL, NULL),
(384, 'Basics of React with Firebase Integration ', 'Prof. Uday Rote', '2021-09-18', '15:00', 'Online', 'Participants who want to learn react globally', 250, 350, '1. This Bootcamp aims to provide project-based learning of a very important javascript library and enables them to create industry-level web applications.\r\n2. By the end of the Bootcamp, each student will be familiar with this framework and will be able to build a to-do application with Firebase integration.', 'CSI-KJSIEIT\'s Joint Software Admin Mitanshu Reshamwala from LY Comps', 'The event started with CSI-KJSIEIT\'s Joint Software Admin Mitanshu Reshamwala from LY Comps introducing react to the participants.\r\nThe introductions took place and soon after he gave a small refresher regarding javascript and ES6. It was followed by a brief introduction of react components.\r\n\r\nDay 2 included applying the concepts learned on day 1 by making a to-do list in React with firebase integration.', 'Each student will be familiar with this framework and will be able to build a to-do application with Firebase integration. ', 'Prof. Uday Rote', 'Start of the bootcamp', 'Teaching react using project based approach', 'Learning about basic react application', 'Making a to-do list with firebase integration in react', 'day1.jpg', 'day11.jpg', 'unknown.png', 'day2.jpg', 'react11 (1).jpeg', 'Bootcamp, Workshop, React, Project making', NULL, NULL),
(385, 'Project Development in React with State Management', 'Prof. Uday Rote', '2021-09-25', '15:00', 'Online', 'Students globally who want to learn React', 250, 350, 'This Bootcamp aims to provide project-based learning of a very important javascript library and enables them to create industry-level web applications.\r\nThis Bootcamp will enhance the skills of the students and make them ready to build a variety of projects under this brilliant framework.\r\n', 'CSI-KJSIEIT\'s Joint Software Admin Mitanshu Reshamwala from LY Comps', 'The two-day event was a continuation of the React Bootcamp series which started on the 18th of September. On 25th, the boot camp started at 3:00 PM with the speaker, Mr Mitanshu Reshamwala, briefly revising the concepts taught in the last two sessions with the participants. Further, the participants conveyed the doubts which they encountered throughout the week between the sessions. Topics of authentication, handling of images with cloud storage and routing were discussed. On the next day, 26th of September, concepts of state management were explained by the speaker, and further, a payment portal was developed live, a follow-along example for the participants. Hence, the 4-day boot camp was concluded, with a participation of almost 600 participants, including participants who joined on Zoom as well as on YouTube live where the session was being streamed. The participants all left with pleasant reviews.', 'Participants became familiar with React framework and were be able to build various projects with it.', 'Prof. Uday Rote', 'Teaching the participants about Razorpay for payment gateway integration', 'Teaching react using project based approach', '', '', 'WhatsApp Image 2021-09-26 at 15.11.23.jpeg', 'WhatsApp Image 2021-09-26 at 15.33.49.jpeg', '', '', 'react22 (1).jpeg', 'Bootcamp, Workshop, React, Project making', NULL, NULL),
(386, 'Mental Health Awareness', 'Prof. Uday Rote', '2021-09-23', '16:00', 'Online', 'Faculty and Staff members of KJSIEIT', 90, 0, '- To raise awareness around Mental Health in this time of the pandemic \r\n- To understand the ways to deal with stress and anxiety.\r\n', 'Arouba Kabir is a Mental Health Therapist/Counselor. Founder of Enso Wellness. Colleged in Psychology, Trained in Positive Psychology, CBT, Hypnotherapy (Subconscious Mind), Therapeutic Art and Meditations. With an experience of 8 years in the field, Arouba has been working with individuals, couples, families and corporates. Based out of Gurgaon, she has been proactively using the lockdown period for creating awareness about mental health, it\'s importance and significance via various online mediums. She has successfully initiated and completed various online series, webinars and workshops with eminent personalities and celebrities. Aroubas work has been appreciated and published by many known national And International publications.\r\n', 'The event was to spread awareness on mental wellbeing for all the teachers and the staff members. The event commenced at 4:00 PM. The event started with a brief introduction of the speaker by the host of the Students\' Council and their work. Ms. Arouba went on to speak about the three stages of mental illness. The first one being anxiety and its physical and mental symptoms. The next stage was depression and its symptoms. The third and final stage was suicidal thoughts. The stages were well explained by some stats and the measures to prevent and overcome these mental illnesses were discussed. The speaker also mentioned ways to deal with stress. The speaker then took some doubts asked by the teachers and the staff members. The webinar finally concluded with a thanking speech and National Anthem.', ' The event ended on a very positive note with the teacher and the staff members getting knowledge and importance of mental wellbeing.', 'Prof. Uday Rote', 'Host Introducing the Speaker Arouba Kabir', 'Speaker Arouba Kabir', 'National Anthem to conclude', '', 'ss111.jpg', '2222.jpg', '3333.jpg', '', 'Mental Health Webinar.jpg', 'webinar, mental health', NULL, NULL),
(387, 'Machine Learning for Information Extraction from Remote Sensing Data', 'Prof. Sandeep Miashra & Prof. Pranali Hatode', '2021-09-16', '16:00', 'Zoom', '', 0, 0, 'To explain what remote sensing is, its application and how machine learning can be used to extract information from remote sensing data', '', '', '', 'Prof. Sandeep Mishra\r\nProf. Pranali Hatode', '', '', '', '', '', '', '', '', '', 'For any and everyone who is interested in Machine Learning for Information Extraction from Remote Sensing Data, this Webinar is a golden opportunity! You will get to ask us questions and we will explain how smarden.tech will cater to you in finishing your projects effortlessly!', NULL, NULL),
(375, 'What, Why, Where & How : AI', 'Department of Electronics Engineering ', '2021-09-14', '4:00 PM', '', 'Student and faculties', 68, 0, 'After completion of Guest Lecture students will be able to,\r\n1.	Understood the fundamentals of AI \r\n2.	AI\'s importance in recent era\r\n', 'Mr. Chandrashekhar Padole ', 'Speaker discussed the generalized view of cognitive system. He emphasized on the following points.\r\n	Data Preprocessing, \r\n	Data Analytics, \r\n	Machine Learning Algorithms \r\n	Industrial Examples\r\nStudents learned the fundamentals of AI. They understood the AI usage in industry. \r\nIn event students learned various usecases.  \r\nThe webinar was appreciated by the students. When doing different projects and their potential industry jobs, this experience would be helpful.\r\nA total of 68 students of KJSIEIT participated in the webinar.\r\n', ' 1.	Understood the fundamentals of AI \r\n2.	AI\'s importance in recent era\r\n', 'Asst. Prof. Pankaj Deshmukh\r\nAsst. Prof. Sarika Mane \r\nAsst. Prof. Sheetal Jagtap\r\n', '', '', '', '', 'pic5.png', 'pic 1.png', '2.jpg', 'pic2.png', 'What, Why, Where & How _ AI - Banner.jpg', 'AI', NULL, NULL),
(389, 'PCB Design for Grand Challenge', 'Prashant Upadhyay', '2021-09-18', '17:00', 'online', 'STUDENTS OF KJSIEIT partcipating in Grand Challenge', 51, 0, '1. To enhance PCB design skills  of students for Electronics circuits and system\r\n2. To prepare students to take part in Grand Challenge organized by CDAC, Noida', 'Mr. Omkar Samal, Electronics Lead, Robocon team ', 'Mr. Omkar started with giving instruction on installing software for Printed circuit Board implementation software Eagle. , Following information is shared \r\nEagle\'s UI is designed with what is called a modal interface.  That is, you select one mode, perform it a bunch of times, as opposed to selecting an object and applying an single operation at a time.  \r\nEagle has four basic views:  Library, Schematic, Board, and Control Panel.\r\n\r\nControl Panel is the main window, it launches everything else and when you close it, all subordinate windows get closed.\r\n\r\nLibrary - Allows you to manage and edit parts.  Advanced usage of this will not be covered in this tutorial\r\n\r\nSchematic - This is where you draw the schematic for your project.  It defines the parts you have in your project, and which pins on the parts should be connected.\r\n\r\nLayout Design (Board) - This is where you lay out the pieces of your project and physically connect the correct pins as defined in the Schematic.\r\n\r\nNote that the Schematic\'s job is only to define the parts and the connections between them.  Only in Board layout does it matter where the parts physically go.  On Schematics, parts are laid out where they make sense electrically, on Boards, they are laid out where they physically make sense, thus a resistor that is right next to a part in the Schematic may end up as far away from that part as possible in the Board.\r\n\r\nImplementation: Circuit  Design for LED Blink is implemented using timer 555, and queries of students were answered by Mr. Omkar.\r\n', ' 1. Design Printed circuit board for one or 2 layer PCB.\r\n   ', 'Prof. Prashant Upadhyay\r\nProf. Tilotamma Dhake', 'Circuit Schematic', 'Attended students', '', '', '555_blink.jpg', 'screenshot1.jpg', '', '', 'PCB Design for Grand Challenge - Banner (1).jpg', 'PCB Design, Circuit Design, Schematic and Layout Design for Printed circuit Board', NULL, NULL),
(390, 'Dream Job', 'Dr. Namrata Ansari and Dr. Hariram Chavan', '2021-09-23', '4.00 to 5.00pm', 'Online', 'Final year Students ', 68, 0, 'Pre-placement webinar on Data Engineering\r\n	To understand the basic concepts of Data Engineering.\r\n	To understand how acquiring a data engineering skillset can land you your dream job.\r\n', 'Mr. Jefferson Sathik, General Manager, Miles Education', 'Data scientists and data analysts analyze data sets to glean knowledge and insights whereas Data engineers build systems for collecting, validating, and preparing that high-quality data. At Futurense, we build scalable data engineering and analytics solutions that can help transform businesses\' disparate data into actionable insights. The main outcomes of this pre-placement talk will be: \r\n	The attendees were able to understand the basic concepts of Data Engineering.\r\n	Learners were able to understand data engineering scope in the market, and how acquiring this skill set can land you your dream job.\r\n\r\n', ' 	The attendees were able to understand the basic concepts of Data Engineering.\r\n	Learners were able to understand data engineering scope in the market, and how acquiring this skill set can land you your dream job.\r\n ', '1. Dr. Namrata Ansari, Professor Dept of EXTC,  Dean Academics \r\n2. Dr. Hariram Chavan, Professor Dept of IT, Dean Administration', 'Vision-DataEngineering', 'DataEngineeringInternship', 'DataEngineeringUpskilling', 'DaraEngineeringEmployment', '2. Webinar.jpg', '3. WebinarInternship.jpg', '3. WebinarSnap.jpg', '4. WebinarEmploment.jpg', 'DreamJobBanner.jpeg', 'Pre-placement webinar on Data Engineering', NULL, NULL),
(391, 'Blockchain Technology: The Future', 'Ms. Jignasha Dalal, Dr. Vaishali Gaikwad', '2021-10-06', '16:00', 'Online mode', 'SE, TE, BE COMP, ETRX, EXTC, IT', 25, 6, 'To kindle awareness about Blockchain Technology\r\nTo Introduce the concept of smart contract through solidity programming language\r\nTo Simulate local Ethereum Blockchain using Truffle and Remix\r\nTo Deploy the smart contract on public test network using Remix and Metamask ', 'Ms. Jignasha Dalal is working as an Assistant Professor at K.J. Somaiya Institute of Engineering and Information Technology in Computer Engineering Department. She has received her M.E Computer Degree in 2010. Currently she is pursuing her PhD degree with K.J. Somaiya College of Engineering, Mumbai, India. Her research interest includes Blockchain technology, real life applications of Blockchain technology, blockchain scalability problem and solutions, different consensus algorithms, DAG based architectures for blockchain and Cryptography. \r\nShe has total teaching experience of 15 years. She also has served as a member of Syllabus revision committee of Mumbai University for various subjects. She was also one of the chairpersons for Blockchain Honours syllabus for Mumbai University. She has also published few papers in international conferences and journals. She has been regularly invited as a speaker for workshops and webinars on Blockchain technology. \r\n', 'Ms. Jignasha Dalal has covered the following topics: 1) Introduction to Blockchain 2) Bitcoin 3) Ethereum 4) demonstration of truffle tool for local simulation of Blockchain.\r\nShe introduced the Concept of Blockchain technology with the terms decentralization, transparency and auditability. She also gave introduction to cryptographic primitives hash functions and digital signature.  She explained the Bitcoin platform in detail with UTXO model and Proof of Work consensus algorithm. \r\nThen she explained main features of Ethereum including smart contracts and gas. She explained some of the features of Solidity language through a smart contract. She also demonstrated the use of \"truffle\" tool. she explained the installation of truffle and how to use it. She demonstrated the tool with an example smart contract. Due to restriction in time, Remix and Metamask could not be covered. It was decided that one more session can be conducted to cover those topics. ', ' Participants will be able to\r\n1. Describe the concepts of Blockchain Technology\r\n2. Explain the Proof of Work algorithm\r\n3. Differentiate between Ethereum and Bitcoin\r\n4. Write a simple smart contract\r\n5. use the truffle tool for local simulation of Blockchain', '1. Prof. Jignasha Dalal, Assistant Professor in Computer engineering Dept., KJSIEIT, Sion\r\n2. Prof. Vaishali Gaikwad, Assistant Professor in Information Technology Dept., KJSIEIT, Sion', 'Introduction', 'Bitcoin', 'etherscan.io', 'Truffle', 'blsccreen1.jpeg', 'blscreen2.jpeg', 'blscreen3.jpeg', 'blscreen4.jpeg', 'Blockchain future.jpeg', 'Blockchain technology, smart contracts, truffle, remix, Metamask', NULL, NULL),
(392, 'Open-source technologies for Cloud Computing', 'Mrs. Tilottama Dhake', '2021-10-09', '16:00', '', 'LY EXTC Students, TY EXTC Students', 76, 0, 'To get hands on training in cloud computing using docker to create container', 'Prathamesh Rahate is currently working as an associate consultant at Capegemini and is an Alumini of our College. He then pursued Post Graduate Diploma in Big Data Analytics from CDAC ACTS Pune. He has achieved many certificates for his exceptional knowledge in IoT, Big Data Analysis, ML, Data Science, Microcontrollers, mongoDB, Docker-Composer, Arduino, CCS, Amazon EC2 and alottt more', 'Docker is an open platform for developers and sysadmins to build, ship, and run distributed applications, whether on laptops, data center VMs, or the cloud. But learning it might look complex as it comes with many technicalities. Docker Containers are the future of highly-scalable software systems and have cost and runtime efficient supporting infrastructure. \r\nThrough this workshop, students quickly learn how to work with containers and Docker with the help of practical activities.The workshop started with Introduction to Docker-What is Docker?, Architecture of Docker, Docker Components, Difference between Docker & Container, Difference between VM and Docker, Similarity between VM and Docker, How is Container different from Virtual Machine?, Top Reasons why to & why not to run Docker containers directly on Bare Metal System How is Docker Networking different from VM Networking, Understanding Docker Underlying Technologies. Next followed by demonstration on to build MicroServices using Container, Docker Engine Installation and Management, Working with Docker Image & Container--Creating Our First Image and Working With Multiple Images Packaging,  Working with Dockerfile, Accessing & Managing Docker Container, Getting Started with Docker Volume and last Docker Networking. \r\nBy the end of this workshop, students will able to utilize Docker containers in real-world use cases.', ' Students will able to creating their own images, run/stop/remove containers and allow containers to communicate with each other      ', 'Tilottama P. Dhake, Assistant Professor, Electronics and Telecommunication Department', 'CC Workshop Snapshot 1', 'CC Workshop Snapshot 2', '', '', 'CC workshop_Pic1.png', 'CC workshop_Pic2.png', '', '', 'CC workshop banner.png', 'Openstack, Docker, Kubernete', NULL, NULL),
(393, 'Software and Tools to Analyze Satellite Images in Remote Sensing', 'Prof. Vricha Chavan and Dr. Jayashree Khanapuri', '2021-09-23', '14:00', 'Online', '', 0, 0, '1. To spread awareness among students regarding Remote sensing and its applications\r\n2. Software tools used in Geographical Information Systems', 'GIS Expert', '', '', '1. Prof. Vricha Chavan, Department of Electronics and Telecommunication\r\n2. Dr. Jayashree Khanapuri, HoD, Electronics and Telecommunication', '', '', '', '', '', '', '', '', '', 'Geographical Information Systems, Remote Sensing, ARCGIS, ENVI, Satellite Image Analysis', NULL, NULL),
(394, 'Library Orientation ', 'Mrs. Gauri Gothivrekar', '2021-09-24', '11:00', 'Online', '', 0, 0, '1) To refresh students about Library facilities\r\n2) To achieve increase in use of Library resources ', '', '', '', 'Dean Academics', '', '', '', '', '', '', '', '', '', 'Library, Online library, E-books, E-journals', NULL, NULL),
(395, 'Basics of Python ', 'Department of EXTC and IoT committee', '2021-09-24', '15:00', '', 'Faculties,Staff  and students', 100, 0, '\r\nTo learn python Programming.\r\nUnderstand the basic concepts Python.', '', 'Speaker went over how, Python is commonly used for developing websites and software, task automation, data analysis, and data visualization. The python language is one of the most accessible programming languages available because it has simplified syntax and not complicated, which gives more emphasis on natural language. Due to its ease of learning and usage, python codes can be easily written and executed much faster than other programming languages.\r\nHe explained all the concepts with fun and easy examples, and taught us at a pace where we could try everything for ourselves', ' Everyone understood the basic concepts of Python. \r\nEveryone got to know the basic syntax and workings of Python\r\n', 'Dr.Hariram Chavan, Professor and Dean Administration\r\nDr.Namrata Ansari,Professor,Dean Academics\r\n', '', '', '', '', '', '', '', '', '', 'python ,basics', NULL, NULL),
(396, 'Python Programming', 'Department of EXTC and IoT cell', '2021-09-25', '15:00', 'Online', 'faculties,Staff  and students', 100, 0, 'To understand the basic concepts of Python Basics. \r\n To learn python Programming.\r\n', '', 'Speaker went over how, Python is an Object Oriented Language and explained, Object-oriented programming (OOP) is a method of structuring a program by bundling related properties and behaviours into individual objects. He explained how projects in python are executed and how abundance of libraries makes projects on python easier. \r\nSpeaker explained all the concepts with fun and easy examples. He even pro There was a question-and-answer session followed by a thank you note by Bhoomika Mam. \r\n', ' Intermediate python functionalities were made clear.\r\n Everyone got an understanding of programming in Python.\r\n', 'Dr. Hariram Chavan, Professor,Dean Administrative\r\nDr.Namrata Ansari,Professor,Dean Academics', '', '', '', '', '', '', '', '', '', 'python ,Programming', NULL, NULL),
(397, 'IMPORTANCE OF VOLUNTEERING', 'NSS', '2021-09-24', '17:00', 'Online', 'Students and Faculty of KJSIEIT, All NSS units', 40, 45, 'Show the importance of volunteering\r\nHighlight the importance of social work\r\nSolve queries regarding a career in social service', 'Mr Vikram Shahi  is a volunteer at Bhumi Foundation.Furthermore he works to engage the young students and also trains them to file civic complaints.His goal is to expand the cleanup initiatives,awareness and waste management programs throughout the city, and leverage the support of our civic group.                                             ', 'Speaker of the webinar Mr Vikram Shahi explained why volunteering is important and how it can bring changes in society as well as how someones small contribution can mean a lot. He shared his own experience about working as a volunteer.He furthermore talked how we can encourage students to participate in volunteering during the pandemic and how to keep them motivated.Later some of the volunteers shared their own experiences at NSS and how it has changed their perspective.', 'The event ended on a high note with the participants learning about the importance of volunteering and the works that are being done to bring positive change in the society.\r\n   ', 'Prof. Pankaj Deshmukh', 'Speaker talking about importance of volunteering', 'NSS-KJSIEIT volunteer sharing his experience as an NSS volunteer', 'NSS-KJSIEIT volunteer sharing her experience as an NSS volunteer', 'Participants attending the webinar', 'IMG-20210924-WA0004.jpg', 'Screenshot_20210924-175747.png', 'Screenshot_20210924-172141.png', 'IMG-20210924-WA0005.jpg', 'IMG-20210924-WA0002.jpg', 'volunteering', NULL, NULL),
(398, 'Machine Learning for Data Science Innovation ', 'IETE', '2021-09-30', '16:00', '', 'students', 30, 5, '1)To provide students with a thorough knowledge of Basics of Data Science, Python libraries.\r\n 2)To encourage multidisciplinary interaction as the participants, learn how to manage resources & execute tasks using them.\r\n3)Demonstration of supervised and unsupervised ML Algorithms.\r\n4)At the end participants would get a clear idea about Data science & its applications\r\n', '', 'The session began with introducing the participants to Data Science, Machine Learning and its various applications in innovation.\r\nDay 1 was mostly based on theory along with some prerequisites of Python Libraries. The participants were made understood about Data Science and how it is used in various applications along with the real life applications. \r\nThe participants were next introduced to different types of machine learning i.e. supervised, unsupervised, reinforcement learning etc. with a practical application of how each one of them is used in the industry. The next thing participant were introduced was about the Supervised Algorithm Linear Regression with live coding. At the end of Day 1 questions of participants were taken and answered.\r\n\r\nDay 2 began with the topic of Logistic Regression where in a model on Breast Cancer Detection was developed. The session continued with understanding the unsupervised algorithm KMeans Clustering. In KMeans Cluster Country Model was developed. The session ended with a discussion of applications and how to move forward in Data Science.\r\n', ' The session began with introducing the participants to Data Science, Machine Learning and its various applications in innovation.\r\nDay 1 was mostly based on theory along with some prerequisites of Python Libraries. The participants were made understood about Data Science and how it is used in various applications along with the real life applications. \r\nThe participants were next introduced to different types of machine learning i.e. supervised, unsupervised, reinforcement learning etc. with a practical application of how each one of them is used in the industry. The next thing participant were introduced was about the Supervised Algorithm Linear Regression with live coding. At the end of Day 1 questions of participants were taken and answered.\r\n\r\nDay 2 began with the topic of Logistic Regression where in a model on Breast Cancer Detection was developed. The session continued with understanding the unsupervised algorithm KMeans Clustering. In KMeans Cluster Country Model was developed. The session ended with a discussion of applications and how to move forward in Data Science.\r\n ', 'Prince Gada , student LY Computer Engineering	', 'Day 1: Basics of Data Science', 'Machine Learning Algorithm', 'Data Visualization', '', 'Screenshot (6).png', 'Screenshot (9).png', 'Screenshot (14).png', '', 'WhatsApp Image 2021-09-25 at 21.55.36.jpeg', 'Data Science, Machine Learning Algorithms', NULL, NULL),
(388, 'Engineers\' Day Celebration ', 'Student Council', '2021-09-21', '4:00 PM', 'Online Mode', 'Faculty, staff members and students of KJSIEIT', 135, 0, '-To celebrate the birth anniversary of Sir M. Visvesvaraya.\r\n-To elaborate the importance of Engineers and to celebrate their work and success.\r\n', '-', 'The event was dedicated to all the engineers around the globe, it was organized in order to pay tribute to one of the greatest civil engineers the nation has ever had Sir M. Visvesvaraya, and also to celebrate the hard work and contribution of engineers towards humanity. The event commenced at 4:00 PM and it started with an auspicious prayer, followed by a small gesture to address students by honorable Principal Dr. Suresh Ukarande sir and Vice Principal Dr. Sunita Patil ma\'am. Prof. Kavita Bathe of Computer Department, Prof. Milind Nemade of AI&DS Department, Prof. Vricha Chavan of EXTC Department. Prof. Radhika Kotecha of the IT Department and Prof. Rajesh Meshram of the BS&H Department expressed their thoughts and gratitude towards engineers for the various innovations that led to the development of the technology. Mr. Ronit Bhamere shared his thoughts towards the engineers. A video was prepared by the Students Council to feature the life journey of Sir M. Visvesvaraya and his contribution to the nation. The event came to an end with the national anthem.', ' The event ended on a high note with the students encouraged and celebrated Engineers Day with quite encouraging speeches from faculty members.', 'Prof. Uday Rote, Dean - Student Welfare', 'Students with faculty members honoring Engineers Day', 'Speeches given by respected Principal sir and Vice Principal ma\'am', 'Tribute Video for Engineer\'s Day', 'Speech given by Prof. Uday Rote, Dean of Student Welfare', 'IMG-20210921-WA0044.jpg', 'IMG-20210921-WA0014.jpg', 'IMG-20210921-WA0030.jpg', 'IMG-20210921-WA0037.jpg', 'engineers.jpg', 'Celebration, Engineer\'s Day', NULL, NULL);
