(341, 'Startup Success Story-1', 'National Innovation and Start up Policy(NISP)', '2021-09-03', '4:00 PM', 'Online Mode', 'Students, Faculty and staff members', 34, 0, '1) Promote innovation-driven entrepreneurship.\r\n2) To promote new technology/ knowledge/innovation-based startups.\r\n\r\n3) To facilitate quick commercialization of new technologies developed by innovators.\r\n\r\n4) To develop a vibrant startup ecosystem by connecting universities, financial institutions, industries and other institutions.\r\n', 'Mr. Sachin Kumbhoje', 'Mr. Sachin Kumbhoje, Building StartUp Ecosystem | Leading 3 Humanity-Plus Companies | EduTechpreneur | StartUp Mentor | Certified Trainer | Recruitment Specialist | Speaker | Author | Philanthropist,  the speaker began his success story with his graduation and postgraduation study and discussed how he developed his interest in entrepreneurship as well as reading books after postgraduation. Infosys foundation course enlightened him to start the startup and changed his life as a turning point. He explained how he has reached this position of handling three startups on his own without much financial support from others. He has suggested around ten books for the participants/beginners who are interested in starting the startup. \r\nHe also suggested tricks for the validation of ideas that can turn into a final useful product. He has also suggested government schemes for filing patents and receiving grants for startup ideas and also told how he has received funding for his startups. He also informed about appreciation for his startup by PM office as well as Magazine stories. Also, He shared his contact details so that he may help our students, faculty, and staff members during the startup ventures.', '  1. Acquired knowledge about starting a startup with ideas validation, schemes for filing patent and funding grants.', 'Dr. Sandhya Kadam', 'Mr. Sachin Kumbhoje delivering session', '', '', '', 'Startup story1.jpg', 'Startup Success Story1-photo.jpg', '', '', 'Banner_Startup Success Story-1_3rd September 2021.jpg', 'Startup Ecosystem, Startup Success Story, funding, patent', NULL, NULL),
(399, 'Critical thinking and communication skills', 'Prof.Minal Sonkar, Prof.Pallavi Patil', '2021-09-29', '15:00', 'Online Mode', 'All KJSIEIT students and faculties', 69, 0, '1.To guide students in making appropriate and responsible decisions, to create a desire fulfill individual goals, and to educate students about unproductive thinking,self-defeating emotional impulses, and self-defeating behaviors.\r\n2.To imparted to fine tune students attitudes,values,beliefs,motivation,desires,feelings,eagerness to learn,willingness to share and embrace new ideas,futuristic thinking,diplomacy and various skill sets of communication,manners so that they will be able to deal with different situations diligently and responsibly.', 'Personal Development coach, Motivational coach, Achievements Facilitator', 'Prof. Minal Sonkar and Pallavi Patil has started the session by welcoming all students and resource person Mr. Koustubh Wagh.\r\nSpeaker shared his experience on how communication skills and critical thinking is important to become successful. \r\nMr. Wagh explained how an individual can effectively communicate and emphasize on improving the communication skills to have an better impact.\r\nMr. Wagh explained the process of critical thinking and steps involved in critical thinking process. \r\nAt the end of the session all the queries of the students were resolved by Mr. Koustubh Wagh.\r\nProf. Mamta Borle ended the session with vote of thanks to resource person and all students and faculty members.', '1. Effectively communicate to verbal/oral communication and improve the listening skills.\r\n2. Actively participate in group communication activities.\r\n3. Become more effective individual through self motivation and practicing creative thinking.\r\n ', 'Prof. Jignasha Dalal, Assistant Professor, Department of Computer Engineering\r\nProf. Jyoti Wadmare, Assistant Professor, Department of Computer Engineering\r\nProf. Mamta Borle, Assistant Professor, Department of Computer Engineering\r\nProf. Bhagyashree Ingle, Assistant Professor, Department of Computer Engineering\r\nDr. Shivi Sharma, Assistant Professor, Department of Computer Engineering', 'Welcome session', 'Communication skills', 'Critical Thinking', 'Group Picture', 'Img1_Banner.png', 'Img2_communication skill.png', 'Img3_critical thinking.png', 'Img4_Group picture.png', 'Banner_Communication skill n critical thinking.jpg', 'decision making, goals , critical thinking, communication skills', NULL, NULL),
(400, 'Orientation Lecture series for Elective Subject Preferences (2021-22)', 'Dr.Milind Nemade', '2021-09-30', '13:30', '', 'TY & LY ETRX students', 109, 0, 'To have a basic awareness about elective subjects.', 'Assistant Professor', 'The Department of Electronics Engineering organized a Webinar on Orientation Lecture series for Elective Subject Preferences (2021-22) during 24th September to 30th September 2021. The resource speaker for the webinar was Prof.Sejal Shah, Prof.Sheetal Jagtap,Prof.Ganesh Wadmare,Prof.Vrinda Ullas,Prof.Sarika Mane,Prof.Devanand Bathe,Prof.Vidya Sagvekar, Assistant Professor from Department of Electronics Engineering.\r\n', 'After successful completion of course student will be able to: \r\n\r\nSelect the elective subject based on scope, opportunities and interest. ', 'Prof. Vidya Sagvekar, Assistant Professor, Department of Electronics Engineering', '', '', '', '', 'Industrial IoT.jpg', 'MEMS introductory lecture.jpg', '', '', '', 'Elective subject', NULL, NULL),
(401, 'Designing of PCB using Tina software and PCB machine', 'Prof. Mandar Bivalkar', '2021-10-02', '12:00', '402 Lab', 'Faculty, staff and project students', 15, 0, 'To demonstrate the circuit design and designing of PCB.\r\nTo investigate probable use of PCB design in projects', 'Mr. Manish Kambli is executive technical support at Renuka enterprises, Dombivli and Mr. Ashish Kulkarni is having 14+ yrs of experience PLC and IOT.', 'Event was useful for faculty and staff for development of hardware project.  Staff and students ask their queries regarding PCB design. ', '1) Students learn how to use PCB machine for PCB etching\r\n2) Faculty and staff got knowledge about PCB designing software.\r\n3) Faculty and staff find out probable use of PCB machine in hardware project development  ', 'Prof. Mandar Bivalkar', 'Demo for use of PCB design machine', '', '', '', 'WhatsApp Image 2021-10-02 at 4.31.15 PM (1).jpeg', 'WhatsApp Image 2021-10-02 at 4.31.15 PM (1).jpeg', 'WhatsApp Image 2021-10-02 at 4.31.14 PM.jpeg', 'WhatsApp Image 2021-10-02 at 4.31.15 PM.jpeg', 'banner (2).jpg', 'PCB designing', NULL, NULL),
