(406, 'General Aptitude for GATE -Tips and Tricks', 'T and P cell', '2021-10-05', '13:45', '', 'students', 44, 0, '1)To introduce students about the General Aptitude  of GATE exams\r\n2)To enable them to make an  appropriate decision for their higher degree', '', 'The webinar started with the introduction of the speaker given by Prof. Mandar Bivalkar. He said that it is important for the students  to get the information about the preparation of  competitive exams like GATE so this webinar will definitely help the students in that aspect.\r\n For this webinar 44 students registered. In this webinar they were taught about the GATE examination process and its requirements.\r\nFollowing points were covered.\r\n What is GATE\r\nThe syllabus of gate exam.\r\nHow to prepare Quantitative aptitude and reasoning\r\nIts course material and books to refer\r\nWhat should be the approach to study\r\nThe importance of Gate Exam in public sector. How it is useful for the female .\r\nThe registration was  free for all students. \r\n\r\n', 'Students learnt  the importance of GATE exam in higher studies   ', '1) Prof. Vidya Sagvekar , Assistant Professor, Department of AI&DS\r\n2)Prof. Mandar Bivalkar, Assistant Professor, Department of Electronics Engineering', 'Speaker giving introduction about GATE exams', 'Speaker explaining syllabus', 'Explanation about Aptitude and Reasoning', 'Participants', 'GATE Tips.png', 'GATE syllabus.png', 'GATE REasoning.png', 'GATE participants.png', 'GATE Banner.png', 'Aptitude, GATE, Higher study', NULL, NULL),
(407, 'Optimize receiver for digital signal', 'Prof. Rupali V Satpute', '2021-10-06', '11:00', 'Online Mode', 'Internal Students', 100, 0, 'To enhance the knowledge of optimize receiver for digital signal.', '', 'Guest lecture event started with introduction of speaker Prof. Biju Balakrishnan, done by Prof. Rupali Satpute. Prof. Biju Balakrishnan started with basics of topic and covered all the details of the topic. Around 100 students were present for the event. Students were very happy and satiesfied after this event.', ' Students are able to enhance the knowledge of optimize receiver for digital signal.', '1. Prof. Rupali Satpute, EXTC dept.', 'Student responding to the Speaker', 'Speaker while explaining the topic', 'Speaker while explaining the topic', '', 'Img 1.jpg', 'Img 2.jpg', 'Img 3.jpg', '', 'Banner.jpg', 'Digital signal, optimize receiver', NULL, NULL),
