(410, 'Indian Airforce Day', 'NSS', '2021-10-08', '16:00', 'Online', 'Students and Faculty of KJSIEIT, All NSS units', 45, 110, 'In this session the speaker will discuss his experiences in the prestigious Indian Air Force as a Sky diving and Parachute Jumping instructor, share knowledge about the same, share major incidents from his time there and address the queries and doubts of the attendees', 'Mr. Seraj Ahmed who is a retired Parachute Jump & Sky Diving Instructor.He served in the Indian Air Force for 21 years. He was a full-time member of International Institute of risk & saftey management.\r\n', 'The event was conducted on ZOOM & started at 4pm. Speaker of the webinar Mr. Seraj Ahmed explained his experience in the reputable Indian Air Force. He also told the cadets about the importance of Air Force Day. He also share about  how he trained thousands in the skill of sky diving in the Paradise Training School, in Agra. He provided bunch of knowledge to the students . They spoke about how the Indian Air Force protects the Indian airspace from all possible threats, harmonising with other branches of the Armed Force. At the end, the query session resulted in participants raising their doubts regarding the Indian Air Force its exams, courses, etc.\r\n', 'The event ended on a high note with the participants learning more about the career in Indian Air Force and its importance.\r\n', 'Prof. Pankaj Deshmukh', 'Speaker of the event', 'Speaker sharing his experience in Indian Airforce', 'Participants attending the event', '', 'Screenshot_20211008-160826.jpg', 'Screenshot_20211008-160845.jpg', 'Screenshot_20211008-162811.jpg', '', 'IMG-20211008-WA0005.jpg', 'Indian Airforce Day ', NULL, NULL),
(411, '8 Ball Pool', 'Dr. Vaishali Gaikwad', '2021-10-17', '11:30', 'Online Mode', 'Students', 7, 14, 'To pocket the 8 ball after having knocked in all of your other numbered balls.', 'NA', 'This is a normal Pool game wherein a White ball is struck with a cue in order to pocket Stripes or Solids (The two teams within the game). The ultimate goal is to pocket the 8ball after having knocked in all of your other numbered balls.\r\nIt is similar to a game of carrom where the only difference is that the 8th ball is somewhat like the queen that is pocketed in the very end.\r\nPocketing the 8th ball before having pocketed the rest is a foul which technically means that the entire match has therein been forfeit and lost.\r\nThe organizing team will be able to oversee the entire event by having one of the participants share their screens during the match.\r\n', ' Able to pocket the 8 ball after having knocked in all of your other numbered balls.', 'Dr. Vaishali Gaikwad, Coordinator IET On Campus- KJSIEIT, Assistant Professor, IT Department ', 'Conduction of Event', 'Attendance', 'Winner Announcement ', '', 'IMG-20211017-WA0025.jpg', 'IMG-20211017-WA0031.jpg', 'IMG-20211017-WA0093.jpg', '', '8 ball pool banner.jpg', 'Game, 8 ball, Pool', NULL, NULL),
(412, 'Crime Scene Investigation', 'Dr. Vaishali Gaikwad', '2021-10-17', '12:30', 'Online Mode', 'Students', 8, 5, 'Who done it where the ultimate goal for the participants is to figure out the hidden key.', 'NA', 'It is a classic Who done it where the ultimate goal for the participants is to figure out the hidden key.\r\nThe participants will first be given a somewhat comprehensive overview of what has taken place and what the entire situational updates are.\r\nFollowing the briefing, they will be provided a link to a google slide which will contain images of the crime scenes, the same will also hold multiple embedded links that lead to google forms.\r\nThe Google forms would have clues in the form of riddles that eventually help the participants, when combined with the rest of it, solve the mystery, as a whole.\r\nEvery Clues first letter would be a part of the Word that forms the Key so the participants final task would be to put it all together an guess the word that would be the intended Key.\r\n The key would then have to be entered in the form that is found through the lock on that final slide which will then signify the fact that the entire event has been exited.\r\nWinners will be declared on the basis of whether or not the participants have deciphered all the Clues accurately in the process of discovering the key.\r\nThe organizers will be able to oversee the entire event through Zoom where the participants will be sharing their screen.\r\n\r\n', 'To figure out the hidden key for solving case.', 'Dr. Vaishali Gaikwad, IET Coordinator, Assistant Professor, Information Technology Department', 'Conduction of Event', 'Attendance', '', '', 'Event.jpg', 'Attendance.jpg', '', '', 'Banner.jpg', 'Key, riddle, mystery, clue', NULL, NULL),
