(416, 'Lets make a deal', 'Ms.Chitra Bhole', '2021-10-16', '01:00', '', '', 9, 10, ' To flex the marketing skills wherein students will have to sell  the given/assigned product.', '', 'A Technical Festival Event under *RENAISSANCE* conducted on October 19 , 2021 (Tuesday) from 10AM\r\nIn this event  participants will have to sell us the given/assigned product. The challenge here would be the fact that they will be given these products right there and then (where the organizers will make the participant aware of their product by sharing their screen) after which they will have 5 minutes to device a selling strategy. The most convincing pitch towards the end of the event will be the ultimate winner.\r\n\r\nThe event winners are -\r\nWinner: Mitanshu Reshamwala\r\nRunner up: Snehal Koli', ' Event was conducted successfully; participants completed the game following the rules. The winner was declared based on the most convincing pitch ', 'Prof.Chitra Bhole,Assistant Professor,Computer Engg Dept', 'Fig1 Event Conduction Progress', 'Fig 2 Event in Progress', 'Fig 3 Event Progress', 'Fig 4 Event finishing Status', 'Lets make a deal-1.jpeg', 'Lets make a deal-2.jpeg', 'Lets make a deal-3.jpeg', 'Lets make a deal-4.jpeg', 'Lets make a deal.jpg', 'competition,skills', NULL, NULL),
(417, 'Let us get Trivial', 'Prof..Chitra Bhole', '2021-10-19', '10:00', '', 'Students', 15, 10, 'To motivate the students to use the concepts  from thier academics and enhance their skills of programming', '', 'A Technical Festival Event under *RENAISSANCE*   conducted on October 19 , 2021 (Tuesday) from 10AM to 1 PM.\r\nIn this competition question with portions of codes and  dealing with other various types of technical components wherein the participants will be asked to identify the accurate output or name of the component.\r\nTotal participants in the Lets us get Trival were 25.Out of which 15 participants were  internal and 10 particpants were external.\r\nThe game consists of 3 levels:\r\n	Level-1: Identify the Programming function/ Component name\r\n	Level-2: Identify the correct syntax of all\r\n	Level-3: Rapid fire round on general physics to components and code related questions\r\nThe Event \r\nWinner :  Ritesh Pandey\r\nRunner Up : Meet Patel\r\n\r\n', 'Event was conducted successfully; participants completed the game following the rules. Participants were disqualified as the levels escalated. Participant correctly answering most of the question in level 3 was declared as the winner.\r\n Students  will  be able to enhabce theircoding skills ', 'Prof.Sagar Mhatre,Assistant Professor,EXTC Department', 'Fig1 Event Conduction Progress', 'Fig 2 Game particiapnts portal', 'Fig 3 Event Progress', 'Fig 4 Event finishing Status', 'Lets get trivial-1.jpeg', 'Lets get trivial-2.jpeg', 'Lets get trivial-3.jpeg', 'Lets get trivial-4.jpeg', 'Lets get trivial.jpeg', 'coding,skills', NULL, NULL),
(418, 'Just A Minute(JAM)', 'Prof..Chitra Bhole', '2021-10-19', '12:00', 'Online Mode', 'Students', 6, 2, 'To enhance the thinking power and skills', '', 'A Technical Festival event under *Renaissance*. conducted on October 19, 2021(Tuesday) from 12pm onwards\r\nIn this Competition participants will have to sell us the given/assigned product. The challenge here would be the fact that they will be given these products right there and then (where the organizers will make the participant aware of their product by sharing their screen) after which they will have 5 minutes to device a selling strategy. The most convincing pitch towards the end of the event will be the ultimate winner.\r\nThe winners of this event is Ms.Sheetal Popat.\r\n', 'Event was conducted successfully, participants completed the game following the rules. Participants were given words in 3 levels as difficulty increased on each level. The participant who successfully completed all 3 levels was declared as winner ', 'Prof.Kavita Bathe,Assistent Proessor,Computer Engineering Department', 'Fig1 Event Conduction Progress', 'Fig 2 Game particiapnts portal', 'Fig 3 Event Progress', 'Fig 4 Event finishing Status', 'JAM -1.jpeg', 'JAM-2.jpeg', 'JAM-3.jpeg', 'JAM-4.jpeg', 'J.A.M.jpg', 'Skills,Thinking Power', NULL, NULL),
(419, 'Delve into abysmal depths of pre and post requisites of Career Path', 'Prof. Pradnya Kamble', '2021-10-13', '16:00', 'Online Mode', '', 77, 0, 'Students will be able to understand , techniques to crack TechnicalHRTelecom Company Interviews.\r\nStudents will be able to understand scoring in higher studies entrance exams.\r\n\r\n', 'Mr. Siddharth Sonak, Senior Executive at VOIS (Vodafone Intelligent Solutions), 2019-20 Alumnus,\r\n\r\nSiddharth is an alumnus of the EXTC department of our college. He has been a brilliant and diligent student with a knack for perfection during his college tenure. He was also a super-active member of the Training & Placement Cell of our college since his 3rd year.\r\n\r\nCurrently, he is working in VOIS - Vodafone Intelligent Solutions (a partner company of Vodafone UK) and is serving more than 17 countries in the European Union and other parts of the world. Apart from bagging a placement in VOIS, he has also bagged placement in the highest package offering company - Jaro Education - that visited our college and offered a remuneration of 12LPA. Moreover, he has marked a milestone in the history of our college by being the ONLY student (since the past 10yrs) to clear both the interview rounds for this company (Jaro). In addition, he also applied to Byju\'s off-campus drive and got selected there, too, for a hefty package of 10LPA.\r\n\r\nSo, today, he\'s here with us to help understand the methods that you can follow during your interview and also address the students who wish to pursue Master\'s after B.E. He will also answer doubts regarding the same.', 'Mr. Siddharth Sonak, Senior Executive at VOIS (Vodafone Intelligent Solutions), 2019-20 Alumnus,\r\ndelivered expert talk on how to appear for on campus/off campus interviews in Telecom sector as well as in finance sector  ,score high in higher studies entrance examinations like GRE TOEFL, CAT\r\nCompared to the ACT and the SAT, the GRE is typically considered more difficult because, even though the math tested on the GRE is a lower level than the math tested on the SAT and ACT, the GRE has more challenging vocabulary and reading passages, and the math problems have trickier wording or require higher-level. He mentioned Scoring at least a 110 for Testing of English as a Foreign Language (TOEFL) is not an impossible task. You simply need to start preparing early by first coming up with an effective study plan that will help you ace the test on your first try. He suggested to the students is that Practise  English every day and follow the official preparation advice provided in IELTS support pack and IELTS test sample papers. IELTS is no more difficult than any other exam. The questions are straightforward and designed to assess how well you can use your English  not to trick you or test your opinions.\r\nAlong with this he also gave tips to how to manage finances including education loan.', ' Students understood , techniques to crack Technical HR Telecom Company Interviews.\r\nStudents will be able to understand scoring in higher studies entrance exams.', 'Prof. Pradnya Kamble', '', '', '', '', 'WhatsApp Image 2021-11-29 at 12.48.48 PM.jpeg', '', '', '', 'Siddhart Banner.JPG', 'Cracking TechnicalHRTelecom Company Interviews , scoring in IELTS ', NULL, NULL),
(420, 'Latex For Beginners', 'Prof.Sheetal G. Jagtap', '0000-00-00', '', 'Zoom', '', 0, 0, 'To make students aware of Latex software.\r\n To create report, articles and papers professionally.', '', '', '', 'Prof. Sheetal G. Jagtap', '', '', '', '', '', '', '', '', '', 'Latex, document, class, figures, equations, title, bibliography', NULL, NULL),
(421, 'Latex for Beginners', 'Department of Electronics', '2021-10-20', '3:00pm', 'Online Mode', 'Students from TY and LY ETRX students , SY-AIDS students', 55, 0, 'To make students aware about LATEX software for creation of professional documents', 'Prof.Sheetal G. Jagtap , Assistant Professor, Electronics Dept. KJSIEIT', 'Prof. Sheetal Jagtap emphasised on  LATEX which is a document preparation system for producing professional-looking documents, it is not a word processor. She has given hands-on experience of Latex to all students. This session was online on MS teams.\r\n \r\n', ' This workshop enabled the learners to acquire an insight into LATEX software on overleaf.com, an online editor. \r\nThe students enabled to prepare Mini project report and final year project report in a professional way.\r\n   ', 'Prof.Sheetal G. Jagtap, Assistant Professor, Department of Electronics', 'students attending Latex workshop', 'Latex workshop on online mode', 'Banner of the event', '', 'Students attending Latex Workshop.png', 'Screen Shot 2021-10-20 at 3.07.00 PM.png', 'Screen Shot 2021-10-20 at 5.01.09 PM.png', '', '', 'Latex, class, documents, graphics, figures, bibliography, report, articles', NULL, NULL),
(409, '152nd Gandhi Jayanti & Non - violence Day', 'Student Council', '2021-10-02', '1:00 PM', 'Online', 'Students, Faculty and Staff members of KJSIEIT', 95, 0, '- To celebrate the birth anniversary of Mahatma Gandhi.\r\n- To honor the contribution of Mahatma Gandhi for the freedom of our nation.\r\n- Social message to all students to follow non-violence.\r\n', '. ', 'The celebration was focused on giving insights from the life of the father of our nation and taking inspiration from a patriot like him. The event commenced at 1 PM. The event began with the Somaiya Prayer, followed by an introduction about the significance of the day. The highlight of the event was a short documentary of Gandhijis life which was shown further. The documentary showcased the struggles faced by him and how he overcame them in a non-violent way for the betterment of the nation. Further, an eye-opening speech was given by the respected Principal sir on the occasion. A faculty of the college, Prof. Vricha Chavan, also gave a speech highlighting the birth anniversary of Lal Bahadur Shastri, another great freedom fighter. To conclude, pledges were taken for non-violence as well as a clean India, both led by Prof. Uday Rote and Prof. Sandhya Deshpande. Finally, the event ended with a renewed patriotic spirit by singing the National Anthem.\r\n', 'The event ended on a high note with the students and faculty inspired by the contribution of Gandhiji and motivated towards living a dedicated and non-violent life like his. The day was celebrated with a lot of motivation from all the participants. ', 'Prof. Uday Rote, Dean - Student Welfare', 'Documentary on Mahatma Gandhi\'s life', 'Speech by Principal Dr. Suresh Ukarande', 'Speech by Prof. Vricha Chavan', 'Students taking pledge', 'WhatsApp Image 2021-10-02 at 1.17.58 PM.jpeg', 'WhatsApp Image 2021-10-02 at 1.26.00 PM.jpeg', 'WhatsApp Image 2021-10-02 at 1.39.43 PM.jpeg', 'WhatsApp Image 2021-10-02 at 1.48.23 PM.jpeg', 'WhatsApp Image 2021-10-01 at 10.21.43 PM.jpeg', 'Webinar, Mahatma Gandhi Jayanti', NULL, NULL),
(423, 'Murder Mystery', 'Prof. Uday Rote', '2021-10-16', '13:30', 'Zoom', '', 0, 0, '1. To improve the logical reasoning and problem-solving abilities of the students\r\n2. To improve decoding skills and help in building aptitude.\r\n3. To underline the importance of Narrative play-based learning, whereby players explore, interact and make decisions with the narrative.\r\n4. To sharpen the thinking process and exercise the mind.', '', '', '', '1. Prof. Uday Rote, Convener - CSI', '', '', '', '', '', '', '', '', '', 'problem-solving, competition', NULL, NULL),
(424, 'BGMI', 'Prof. Uday Rote', '2021-10-19', '12:00', '', 'Students across various branches and institutes', 14, 45, '1. To improve the cognitive abilities of the students.\r\n2. To improve the time management skills of the participants by providing them with a timed environment.\r\n3. To underline the importance of Narrative play-based learning, whereby players explore, interact and make decisions with the narrative.\r\n4. To improve problem-solving and creativity skills.', 'NA', 'Introduction - The event started at sharp 12pm, with a total of 25 squads and 37 duos joining in. The Introduction was given by one of the Team Members, along with a display of the Event Sponsors. This was followed by a brief introduction of the Event Heads and a small interaction with the participants. Shortly after, Rules of the Event were explained in detail by Event Heads. The doubts of the participants, regarding the rules and the conduction of the event were cleared as well. Following this, room ID and password were shared on the WhatsApp group and squad matches were conducted\r\n\r\nQuad matches - The squad matches were conducted from 12:30pm to 3:00pm with all the participants enthusiastically involved in the game for obtaining the first rank. A total of 3 matches were conducted and the team that scored the most number of points in all of the 3 matches won the tournament.\r\n\r\nDuo matches - The squad matches were conducted from 3:30pm to 6:00pm with all the participants enthusiastically involved in the game for obtaining the first rank. A total of 3 matches were conducted and the team that scored the most number of points in all of the 3 matches won the tournament.', 'The Event of BGMIs was conducted efficiently, without any glitches, disruptions or untoward incidents, it was an interactive and fun event. Participants had a great time playing the game and gave a tough competition to each other.   ', '1. Prof. Uday Rote, Convener - CSI\r\n2. Prof. Nasim Shah', 'Sponsors Banner being displayed during the Event', 'Squad Game in Progress', 'Final Match in progress', '', '1.JPG', '2.JPG', '3.JPG', '', 'Banner.JPG', 'BGMI, competition, Gaming', NULL, NULL),
(425, 'Code Compile Run', 'Prof. Uday Rote', '2021-10-16', '13:30', '', 'Students across various branches and institutes', 27, 267, '1. To be a global-level coding competition aimed at beginners to get acquainted with competitive coding.\r\n2. To extend an exciting opportunity for the established programmers to test their knowledge.\r\n3. To foster logical thinking along with problem-solving and time management skills among the participants for problem-solving.', 'NA', 'Code Compile Run contest was created on HackerRank Platform. The contest had 5 questions of 100, 150, 200, 250 and 300 points respectively. The questions were ordered in increasing order of difficulty. The Contest started at 1:30 pm on 16th October 2021.\r\nParticipants had logged In into their HackerRank account and gone to the contest page.Once the contest was started the participants were able to start the contest and solve those 5 questions before the contest time ended. The Contest ended at 3:30 pm on 16th October 2021.\r\n\r\nThe judging criteria was as follows:\r\nAll the problems have the points allotted to them.\r\nParticipants are ranked according to the most problems solved. Ties will be broken by the total time for each user in ascending order of time.\r\nThe total time is the sum of the time consumed for each problem solved. The time consumed for a solved problem is the time elapsed from the beginning of the contest to the submission of the first accepted run. There is no time consumed for a problem that is not solved.\r\nThe decision of the event heads in declaring the results will be final. No queries in this regard will be entertained.\r\nAny participant found to be indulging in any form of malpractice will be immediately disqualified.\r\n', 'Event was conducted smoothly without any glitches or problems. It was a medium through which participants were able to expand their knowledge and skills on competitive programming. Event ended up with 373 participants signing up on hacker rank contest from which 204 participated while event was live.   ', '1. Prof. Uday Rote, Convener - CSI\r\n2. Prof. Reena Lokare', 'Event Poster being displayed while explaining rules', 'Challenges page of Contest', 'Leaderboard with 2 winners', '', '1.JPG', '2.JPG', '3.JPG', '', 'Banner.JPG', 'coding competition, global', NULL, NULL),
(426, 'Chess', 'Prof. Uday Rote', '2021-10-17', '14:00', '', 'Students across various branches and institutes', 23, 107, '1. To improve the calculation, logical thinking, memory, and concentration of students\r\n2. To promote chess as a sport, given we as a nation is really strong when it comes to competitions\r\n3. To spread awareness about the game and involve as many students as we can through this medium', 'NA', 'Introduction - The participants were asked to join the zoom meeting at 1:40.The event started at sharp 2:10 pm, with a total of 90 participants joining in. The Introduction was given by one of the Team Members, along with a display of the Event Sponsors. Shortly after, the Rules of the Event were explained in detail by Event Heads. The doubts of the participants, regarding the rules and the conduction of the event, were cleared as well. After this, the matches started and the event heads and volunteers started spectating the matches.\r\nThe first 8 rounds - A total of 8 rounds were conducted and points were assigned as follows: The points were 1 for the win,0 for loss, and 0.5 for a draw. So, All players were given eight rounds to gather points and at the end of all eight rounds, the top four were selected for the play-offs.\r\nPlay-offs - The top four players after the 8 rounds made it to the play-offs and matches were held with time control of 5+3 between them. The matches were between 1st and 2nd position and 3rd and 4th position. The loser from 1st and 2nd position and the winner from 3rd and 4th position played the next match and thus 2 players were selected for the finals.\r\nFinals - The final match was conducted with finals qualifiers and the winner of the final match was declared as the winner of the event.', 'A total of around 300 matches were played within a span of 4 hours and 30 minutes. The event was conducted smoothly without any disruptions in the flow. The players, coordinators and everyone involved had a splendid time and could witness and uphold the spirit of chess.\r\n ', '1. Prof. Uday Rote, Convener - CSI\r\n2. Prof. Vijaya Kirodkar', 'Match being spectated by Team Members', 'Group picture with the participants', 'A picture of the Finalists', '', '1.JPG', '2.JPG', '3.JPG', '', 'Banner.JPG', 'competition, game, strategy', NULL, NULL),
(427, 'Hogwarts Express', 'Prof. Uday Rote', '2021-10-18', '17:00', '', 'Students across various branches and institutes', 22, 46, '1. A test of memory and fandom of the popular Book and movie series Harry Potter.\r\n2. To improve problem-solving ability by solving challenging clues to make it to the final round.\r\n3. To organize a fun event dedicated to the Harry Potter fans.', 'NA', 'Introduction - The event started at sharp 5pm, with a total of 54 Participants joining in. The Introduction was given by one of the Team Members, along with a display of the Event Sponsors. This was followed by a brief introduction of the Event Heads and a small interaction with the participants. Shortly after, Rules of the Event were explained in detail by Event Heads. The doubts of the participants, regarding the rules and the conduction of the event were cleared as well. After this, the main event was started \r\n\r\nRound 1 - The first Round of the Event was conducted from 5:30pm to 5:40pm with all the participants enthusiastically involved in solving the Trivia questions on Wordwall. After the participants solved all the questions provided in Round 1, the round was concluded, and the participants successfully destroyed the First Horcrux and the holder of the Elder wand for the first round was announced. With this, the first round was concluded\r\n\r\nRound 2 - After a short break, the event heads explained the rules of the 2nd  round and the Wordwall link to solve the anagrams  was provided to the participants followed by Commencement of Round 2. From 5:40pm to 5:50, participants were involved in solving the anagrams, as fast as they could. Similar to the first round, the participants destroyed the 2nd Horcrux and the Holder of the Elder Wand for this round was announced in Round 2, the Round was ended.\r\n\r\nRound 3 - In this round, the participants were asked to guess the movie by the audio and the first 5 participants to answer correctly were scored accordingly. With this, the round 3 was ended\r\n\r\nRound 4 - The event heads explained the rules to round 4 and the puzzel.org link along with the google form was shared where the participants solved the jigsaw puzzle to solve the riddle and proceed to the next round. After solving the jigsaw puzzle and decoding the password from the initial 3 rounds, the first 20 participants entered the new Zoom Meeting and the other participants were eliminated.\r\n\r\nRound 5 - This round was called \"Scavenger Hunt\" where the participants were asked to send pictures of the correctly identified objects. After scoring the first 5 participants, the scores were calculated and the holder of the elder wand for this round was announced with the participants successfully destroying the 5th Horcrux.\r\n\r\nRound 6 - In this round, the participants had to guess the character by the dialogue that was displayed. The first 5 participants to answer correctly were scored based on each question. After successful completion of all the questions, based upon the scores the holder of the elder wand for the 6th round was announced and the 6th Horcrux was destroyed.\r\n\r\nRound 7 - The final round had participants guessing the wand moments on Wordwall which were shown to them at the beginning of the event. After all the participants had answered the questions, scores from the 5th,6th and 7th rounds were taken into consideration and the winner and runner-up were decided\r\n\r\nConclusion - Group Pictures were taken with all the 20 participants, but more importantly, with Winners and Runners Up as well. Following this, a small vote of thanks was given, and the Event was concluded.', 'The Event of Hogwarts Express was conducted efficiently, without any glitches, disruptions or untoward incidents, it was an interactive and fun event. Participants had a great time solving the clues and gave a tough competition to each other.     ', '1. Prof. Uday Rote, Convener - CSI\r\n2. Prof. Jignasha Dalal', 'Event heads giving explanation for solving puzzles and clues from rounds', 'Participants moving onto Phase 2 after elimination', 'A Group Picture with Participants', '', '1.JPG', '2.JPG', '3.JPG', '', 'Poster.JPG', 'competition, game, strategy', NULL, NULL),
(428, 'Bull Run', 'Prof. Uday Rote', '2021-10-17', '10:00', '', 'Students across various branches and institutes', 21, 39, '1. To analyze the stock market and crypto market and make maximum profits\r\n2. To improve calculation, logical thinking,  and decision making \r\n3. To involve students in financial markets and give them an opportunity to experiment with it.', 'NA', 'Introduction- The event started at sharp 9:00 am, with a total of 24 Participants joining in. The Introduction was given by one of the Team Members, along with a display of the Event Sponsors. This was followed by a brief introduction of the Event Heads and a small interaction with the participants. Shortly after, Rules of the Event were explained in detail by Event Heads. The doubts of the participants, regarding the rules and the conduction of the event were cleared as well. \r\n\r\nStock Market- The event for the stock market began sharply at 9:15 am. where participants had to trade with various companies and had to try to gain maximum profit. For excitement purpose leaderboard updates were shared to the participants on whatsapp group. The winner was announced at 4:30 pm.\r\nCrypto Trading- For crypto trading, a meeting was held to explain the rules and to clear all the doubts. The event for crypto trading started at 5:30 pm and the winner was announced at 4:30 pm, the next day.\r\n\r\nConclusion- Picture with the winner was taken. Following this, a small vote was given, and the event was concluded.\r\n', 'The event was conducted successfully without any disruptions in the flow. Everyone was satisfied with the efforts that were put in it.    ', '1. Prof. Uday Rote, Convener - CSI\r\n2. Dr. Mansing Rathod', 'Sponsor banner presented before the event', 'Event heads and team members clearing the doubts', '', '', '4.JPG', '5.JPG', '', '', 'Posterr.JPG', 'competition, game, strategy', NULL, NULL),
