(437, 'Super Capacitors & Storage of Energy', 'Medha Asurlekar', '2021-10-16', '12:00', 'Zoom', '', 0, 0, 'To kindle awareness about the\r\n1) Nanotechnology enabled energy systems\r\n2)Clean energy conversion and storage devices\r\n3)Self powered wearable and medical implants\r\n4)Batteries- Future Technologies', 'Major Achievements of Dr. Deepak Dubal\r\n Journal Articles: 180\r\n Patents : 8 (1 US Patent, 1 European, 1 Australian & 5 Indian Patents)\r\n Citations : 11,178 ( Google Scholar)\r\n', '', '', '1)Name: Sarvesh Soni\r\nE Mail ID: sarvesh.soni@somaiya.edu\r\nMobile No: 88506 04719\r\n\r\n2)Name: Sahil Deshmukh\r\nE Mail ID: sahil.vd@somaiya.edu\r\nMobile No: 88790 85630', '', '', '', '', '', '', '', '', '', 'super capacitors', NULL, NULL),
(438, 'Super Capacitors & Storage of Energy', 'IETE', '2021-10-16', '12:00', '', 'students', 101, 0, 'To kindle awareness about the\r\n1) Nanotechnology enabled energy systems\r\n2)Clean energy conversion and storage devices\r\n3)Self powered wearable and medical implants\r\n4)Batteries- Future Technologies', 'Major Achievements of Dr. Deepak Dubal\r\n Journal Articles: 180\r\n Patents : 8 (1 US Patent, 1 European, 1 Australian & 5 Indian Patents)\r\n Citations : 11,178 ( Google Scholar)\r\n', 'The Supercapacitors and Storage of Energy seminar was conducted on the 16th of October, 2021 from 12:00 PM till 1:30 PM\r\n\r\nThe Seminar started with the introduction of speaker Dr. Deepak Dubal, an Associate Professor at Queensland University of Technology(QUT), Australia. The speaker familiarized the participants with some of his notable works to inspire everyone. He later introduced all the participants into the world of energy and its storage. He engaged in the topic of nanotechnology and supercapacitors to explain their importance in storing energy.\r\n\r\nThe speaker then begins to describe clean energy conversion for storage devices and how waste-to-energy conversion can be used to inspire sustainability and circular economy. The seminar was later directed towards conclusion by exploring how these technologies can be used to make self-powered wearables and medical implants and introduced other futuristic battery technologies.\r\n\r\nThe workshop ended with a very engaging Q&A session.\r\n\r\n', ' Participants learnt the following : \r\n1.Nano-technology enabled energy systems.\r\n2.Clean Energy Conversion and storage devices.\r\n3.Waste-to-Energy : Sustainability and Circular Economy.\r\n4.Self Powered Wearable and Medical Implants.\r\n ', '1)Name: Sarvesh Soni\r\nE Mail ID: sarvesh.soni@somaiya.edu\r\nMobile No: 88506 04719\r\n\r\n2)Name: Sahil Deshmukh\r\nE Mail ID: sahil.vd@somaiya.edu\r\nMobile No: 88790 85630', 'Welcoming participants to Renaissance 2021-2022 Event', 'Speaker- Dr. Deepak Dubal introducing himself and the Topic', 'Speaker discussing new technologies', 'End of an insightful seminar', 'ss02.jpeg', '2.png', '8.png', 'Screenshot_174.png', 'WhatsApp Image 2021-10-12 at 12.41.48.jpeg', 'super capacitors', NULL, NULL);
