(439, 'Cross-Platform App Development with Flutter ', 'IETE', '2021-10-17', '11:30', '', 'students', 13, 0, '1)To Learn different widgets in flutter.\r\n2)To Learn styling and theming your applications.\r\n3)To Learn apps for multiple platforms using single code base.\r\n4)To Learn and build Adaptive and response applications.', '', 'The Cross-Platform App Development with Flutter workshop was conducted on the 17th of October, 2021 from 11:30 AM till 2:00 PM\r\n\r\nThe workshop started with Mr. Husain Lokhandwala introducing himself and the topics he will be covering in the Flutter workshop. He began the workshop by explaining the participants about the Flutter framework and its limitless applications.\r\n\r\nThe speaker then shared a github repository link to all the participants which contained the basic code of an app for keeping track of personal expenses . He gave participants a hands-on experience of using different types of widgets in Flutter. Theming and styling of the application was also covered.\r\n\r\nThe speaker later shared another github repository link of code which can be implemented for running the app over cross platforms. He explained to the participants about the code and its working so that they can implement running of the app on multiple platforms using Flutter framework. Later the knowledge impending workshop was concluded by the Speaker.\r\n\r\nThe workshop ended with a Q&A session.\r\n', ' Participants learnt the following : \r\n1.Application and implementation of various widgets in Flutter.\r\n2.Styling and theming their applications using Flutter.\r\n3.Building an app for keeping track of personal expenses.\r\n4.Running this app over 3 platforms- IOS, Android and Web using Flutter framework.\r\n ', '1)Name: Deep Zaveri\r\nE Mail ID: deep.zaveri@somaiya.edu\r\nMobile No: 77150 74129\r\n\r\n2)Name: Husain Lokhandwala\r\nE Mail ID: h.lokhandwala@somaiya.edu           \r\nMobile No: 70219 65251', 'Introduction to Workshop and Speaker- Mr. Husain Lokhandwala', 'Speaker teaching implementation of Flutter widgets', 'Explaining Widget tree', 'All participants list', '11_40_2.png', '12-2.png', 'ppt ss3.png', 'all participants.png', 'WhatsApp Image 2021-10-07 at 13.25.41.jpeg', 'Android studio, X-code ,Flutter-2.0', NULL, NULL),
(440, 'Basics of Raspberry-Pi & Its Applications', 'Sarika Mane', '2021-10-25', '12:00', '', '', 44, 0, '1. To understand the Basics of Raspberry-Pi \r\n2. To understand the usage of Raspberry-Pi in IoT Applications \r\n', 'Mr. Shashank  Karn, Senior Software Developer, Tech Mahindra India ', 'Speaker Shashank discussed about basics of the Raspberry Pi. He also discussed about the various software required for the Raspberry Pi working and he suggested the certain website from where to download the softwares.  He discussed the various applications in details such as home automation. He suggested the class different projects that can be developed with the help of Raspberry Pi. The question-and-answer session was followed by a thank you note by Prof.  Sarika Mane\r\n', 'The Participants understood the Basics of Raspberry-Pi.\r\nThe Participants understood  the usage of Raspberry-Pi in IoT Applications \r\n\r\n   ', 'Prof. Sarika Mane.\r\nProf. Vrushali Deole\r\n', 'Webinar conducted by Mr. Shashank  Karn, Senior Software Developer, Tech Mahindra ', 'Webinar on Basics of Raspberry-Pi & Its Applications', '', '', 'image.png', 'image (1).png', '', '', 'Basics of Raspberry-Pi & Its IoT Applications-Banner.jpg', 'R-Pi, IoT', NULL, NULL),
(441, 'ASTRONOMY QUIZ', 'Dr. Umesh Shinde', '2021-10-16', '01:30', 'Zoom', '', 0, 0, 'Quiz will have a total 6 teams and 5 rounds. Each round will have 5 questions. At the end of each round the team with the least score will be disqualified ', '', '', '', 'Dr. Umesh Shinde, BS&H ,Asst. Professor', '', '', '', '', '', '', '', '', '', 'QUIZ, ASTRONOMY', NULL, NULL),
(442, 'FIND YOUR WAY OUT', 'Dr. Umesh Shinde', '2021-10-17', '02:00', 'Zoom', '', 0, 0, 'Find your way out aims to get groups to try to complete challenges by working as a team and utilizing their problem solving skills to come up with strategic plans to help complete the challenges throughout the activity.', '', '', '', 'Dr. Umesh Shinde, BS&H ,Asst. Professor', '', '', '', '', '', '', '', '', '', 'TREASURE HUNT, PUZZLES, CROSSWORD,TECHNICAL', NULL, NULL),
