(404, 'My Journey to Microsoft', 'Computer Society of India (CSI)', '2021-10-09', '6:00 PM', 'Online', 'Students across institutes looking for guidance for getting placed in dream companies ', 82, 0, 'To give students a brief idea about jobs in the Corporate scenario.\r\nAn interactive discussion with industry professionals who are currently working in dream companies.\r\nStudents will be able to learn about the journey of the speaker and get inspired to work towards their goals.', 'Ms Purva Vasudeo completed her Bachelors of Engineering from Sardar Patel Institute of Technology. She did her masters in Computer Science from North Carolina State University. In Summer 2019, she did an internship at Microsoft. Currently, she is a full-time Software Engineer at Microsoft working on the Azure Web Apps PaaS platform on Linux.', 'The webinar was organized with the aim to familiarize participants with strategies, tips and tricks for building skills and profiles for placement. The event started at 6:00 PM, with a short introduction about the speaker. Further, the speaker gave a brief about her journey to getting placed at Microsoft, and some of the methods she used to work on her technical skills. The speaker mentioned the important sites like Leetcode to practice coding as well as suggested some common but efficient ways to study core subjects require to have a stronghold on coding. Thereafter, doubts from the participants were taken up by the speaker, which included questions about the work system at Microsoft, what kind of opportunities one can work within dream companies and general queries about technology. By the end of the webinar, all bases with regards to skills required for placement were covered. Therefore, the webinar was concluded by giving a hearty vote of thanks to the speaker for taking out time from their busy schedule.', ' Participants got a clear view of how they can work towards building their skills and profile for better chances at placement in dream companies like Microsoft. ', 'Prof. Uday Rote', 'Speaker giving common placement tips', 'Interaction with participants for further doubts', '', '', 'One.jpeg', 'Two.jpeg', '', '', 'WhatsApp Image 2021-10-08 at 11.26.53 AM.jpeg', 'placement, microsoft, azure', NULL, NULL),
(403, 'Mentoring session with Technical Analyst of Financial market.', 'Institution of Engineers (IEI)', '2021-10-01', '2:30 PM', 'Online', 'Students', 80, 9, 'To guide the student on Technical Analysis of The Indian Financial Market and help them to achieve the goals in that field.\r\nTo develop personal skills, qualities, and mind-set to lead and manage a new, growth-oriented venture.\r\n', 'Tejas Shigrekar,Technical Analyst at Angel Broking.', 'The session was very informative where in there were total 67attendee attending the session. Maximum number of participants were from EXTC, ETRX&ITdepartment. \r\nProfessors, Assistant Professors, Students and staff from KJSIEIT took active participation in the Session, which was held on Microsoft Teams platform. \r\nThe session was Started by Introducing the speaker, Mr. Mahesh Kadamfrom TE EXTC a student and Organizing Admin of IEI took this opportunity to welcome and introduce our speaker.\r\nThe speaker gave the Information on Technical Analysis of The Indian Financial Market and very detailed explanation of the Technical Analysis. The speaker addressed the risk and rewards while trading in the market. This was followed by different types of charts and trends that can be seen in charts. At last money management was also touched upon in the session.\r\n', ' Student learn about Technical Analysis of The Indian Financial Market and it help them to achieve the goals in that field.', 'PARTH BHANUSHALI   BE-EXTC', 'Speaker session', 'List of participant', 'Technical Analysis information', 'Types of chart', 'p1.png', 'p2.png', 'p3.png', 'p4.png', 'p5.png', 'The speaker gave the Information on Technical Analysis of The Indian Financial Market and very detailed explanation of the Technical Analysis. The speaker addressed the risk and rewards while trading in the market. This was followed by different types of charts and trends that can be seen in charts. At last money management was also touched upon in the session.', NULL, NULL),
(447, 'Next Generation Telecommunication Networks and Career Opportunities', 'Mrs. Pradnya Kamble', '2021-10-18', '09:00', 'Online Mode', 'BE TXTC Students', 106, 0, 'Students will be able to know Evolution of Mobile Technology from 4G to 5G.\r\nStudents will be able to know career opportunities in Telecom Sector.\r\n', 'Professional Experience :\r\nProfessional Experience :\r\nEngineering Work Experience :-\r\n Name of Company : Reliance Jio Infocomm Limited (RJIL)\r\n Duration : From 2016 to Present\r\n Current Role : Web Application Developer\r\no Communicating directly with Senior Technical Architect to establish project parameters.\r\no Understanding of Design and Architecture related to the Business Products\r\no Part of coding team and handling programming for Frontend as well as Backend\r\no Debugging and resolving Production Environment Issues\r\n Previous Roles :\r\no Part of Integration Architecture Team in Designing Solutions for various Business\r\nRequirements\r\no Conducted Group Discussions and Technical Interview rounds for Jio Bond Recruitment\r\nProgram Drive as part of Recruitment Team\r\no Mumbai Indians (MI - IPL) Team Engineer as a Technical Troubleshooter (Year - 2017)\r\no Head of Device Category(Service Validation Team), following up with network team\r\nunderstanding the issue and involved in resolving it.\r\no Part of Service Validation Team, actively involved in Testing and Deployment of the product\r\nTeaching Work Experience :-\r\n Name of Company : Eclate Tutorials\r\n Duration : From 2017 to 2018\r\n Role : Teaching Faculty for Biology Subject (Class : 11th , Maharashtra State Board) \r\n\r\nEngineering Work Experience :-05\r\n Name of Company : Reliance Jio Infocomm Limited (RJIL)\r\n Duration : From 2016 to Present\r\n Current Role : Web Application Developer\r\no Communicating directly with Senior Technical Architect to establish project parameters.\r\no Understanding of Design and Architecture related to the Business Products\r\no Part of coding team and handling programming for Frontend as well as Backend\r\no Debugging and resolving Production Environment Issues\r\n Previous Roles :\r\no Part of Integration Architecture Team in Designing Solutions for various Business\r\nRequirements\r\no Conducted Group Discussions and Technical Interview rounds for Jio Bond Recruitment\r\nProgram Drive as part of Recruitment Team\r\no Mumbai Indians (MI - IPL) Team Engineer as a Technical Troubleshooter (Year - 2017)\r\no Head of Device Category(Service Validation Team), following up with network team\r\nunderstanding the issue and involved in resolving it.\r\no Part of Service Validation Team, actively involved in Testing and Deployment of the product\r\n', 'Mr. Dharmin Mehta, Alumni EXTC, Full Stack Web Developer, at Reliance Jio conducted Expert lecture covered basics of 5G Technology, Evolution of 5G technology, he explained about how 5G evolution is hotly anticipated. The fifth-generation wireless network technology standard is one of the fastest and most robust technologies the world has ever seen. It\'s capable of faster speeds, lower latency and massive capacity.\r\nHe introduced 1. Milimeter wave\r\n2.Massive MMO\r\nMillimeter waves  often referred to as mmWaves or high-band 5G  are frequencies starting at 24 GHz and beyond. As radio waves increase in frequency, each wave narrows in length. Because of its high frequencies, mmWave has a limited range of only 300 to 500 feet and struggles to penetrate buildings.\r\n3.Beam Forming\r\nWhat is beamforming in 5G?\r\nImage result for beamforming 5g\r\nBeamforming Overview. Beamforming is used with phased array antennae systems to focus the wireless signal in a chosen direction, normally towards a specific receiving device. This results in an improved signal at the user equipment (UE), and also less interference between the signals of individual UE\r\n4. NOMA\r\nNon-orthogonal multiple access (NOMA) is one of the most promising radio access techniques in next-generation wireless communications.  Other closely related multiple access schemes in this context are lattice-partition multiple access, multi-user shared access, and pattern-division multiple access.\r\n5. Small Cells\r\nThe small cells used in 5G networks get their connection via a macrocells, before sending data from one small cell to another in a relay. This helps carry signals over much larger distances.\r\naling with these basics he also highlighted on the job opportunities in Telecom Sector.\r\n', ' Students understood basics of 5G.\r\nStudents understood  Evolution of Mobile Technology from 4G to 5G.\r\nStudents understood  career opportunities in Telecom Sector.', 'Mrs. Pradnya Kamble', '', '', '', '', 'WhatsApp Image 2021-11-29 at 1.12.29 PM (1).jpeg', 'WhatsApp Image 2021-11-29 at 1.12.29 PM.jpeg', '', '', 'Baner-Dharmin.jpg', 'Next Generation Telecommunication Networks and Career Opportunities', NULL, NULL),
