(456, 'Practicing Ethics and Modern Tools for Security', 'Mrs. Vijaya Umesh Pinjarkar ', '2021-10-20', '14:00', '', 'Students from Information Technology Department ', 70, 0, '1.	To select and apply appropriate security techniques, resources, and modern engineering and IT tools for the protection of data.\r\n\r\n2.	To apply ethical principles and commit to professional ethics and responsibilities in cyber security.\r\n', 'Mr.Adarsh Kant\r\nCyber Security Researcher, Cyber Forensics Investigator, Penetration Tester, Cyber Security Auditor, Business Developer Entrepreneur', 'Mrs. Vijaya Pinjarkar started this event by giving introduction of the speaker. Speaker started  workshop by telling the importance of security in digital era and security goals.\r\nEvent \"Practicing Ethics and Modern Tools for Security\" is  organised for third year Information Technology students. This workshop\r\ncovered IT tools for the protection of data as well as  professional ethics and responsibilities in cyber security.\r\nSpeaker taught installation  of different tool like CRYPTOLOCKER, RASSnet  and  conducted handson session on CRYPTOLOCKER, RASSnet,\r\n', ' 1.	Students will be able to apply appropriate security techniques, resources, and modern engineering and IT tools for the protection of data.\r\n\r\n2.	Students will be able to apply ethical principles and commit to professional ethics and responsibilities in cyber security.   ', 'Mrs. Vijaya Umesh Pinjarkar ', 'Screenshot1', 'Screenshot2', 'screenshot3', 'screenshot4', 'banner.jpg', '11.jpg', '22.jpg', '33.jpg', 'Banner.jpeg', 'modern tools , cyber security ', NULL, NULL),
