(458, 'API integration with Android', 'Mrs. Sarita Rathod', '2021-10-21', '13:00', 'Online Mode-Microsoft Team', 'Students of SYIT, KJSIEIT', 50, 0, '1. To learn and able to apply the modern tools and methodology like Android for mobile application development.\r\n2. To learn API integration with Android', 'Mr. Neel Shah and Mr. Jay Shah, Students LYIT, KJSIEIT', 'Prof. Sarita Rathod welcomed the participants, introduced and welcomed the speaker to the audience and announced to start the session. She has coordinated the workshop.   \r\nThe expert speaker, Mr. Neel Shah started the session by explaining the basic concept of  android , followed by the requirement of all software and tools for the mobile application development. He then highlighted about sample mobile applications example with the architecture, etc.\r\nHe has discussed how Android can be used in application development. \r\nThen, Mr. Neel has been given in detail the description about the  applications which they have developed for department of IT , KJSIEIT i. e. \"E- Notice Board\". He has been described about all module and its importance of application.\r\nThen Mr. Neel and Mr. Jay shown the complete demonstration of their E -Notice Board application. After that they explain the concept of API integration in android, how any API integrated in android application. They have explained the complete code use for integrating API in android application.\r\nThe talk was followed by a Question-Answer session, facilitating the participants to get inputs from speaker on their queries related to topic. Mr. Neel and Mr. Jay addressed the questions and provided their valuable recommendations for the same to the participants.\r\n\r\nThey have provided their contact details also  to students for any query or discussion in future.\r\nProf. Sarita Rathod has taken the feedback and attendance of participants.\r\n', '1. The program provided deep insights of the emerging area of technology Android which will be used as lifelong learning.\r\n2. Able to apply the modern tools and technology like Android for developing different applications. \r\n', 'Mrs. Sarita Rathod', '', '', '', '', '', '', '', '', '', 'Android, API, Mobile application development', NULL, NULL),
(422, 'React-a-thon', 'Computer Society of India (CSI)', '2021-10-17', '10:00 AM', '', 'Students across various branches and institutes', 2, 18, 'To organise an event so that the participants can compete with other participant\'s on the basis of their React coding skills.\r\n', 'NA', 'Introduction- The event was held on Google meet. The event commenced at 10am. The rules of the competition were explained again to the participants and the judges were introduced. \r\n\r\nRound 1- After that, different teams presented their pre-built projects. The judges provided their views and suggestions on the same. Round one ended after all the teams presented their projects.\r\n\r\nRound 2- Round two began at 12am. All the participants were provided 2 hours to implement the changes that the judges suggested. The projects were judged on the following criterias- Implementation of changes suggested by the judges, Knowledge of the language React, Creativity in the project topic and Future applications and scope of development.\r\n\r\nConclusion- The judges gave their final comments and the event was concluded with a vote of thanks. The winner was declared later that evening on our Instagram page. The event was  a giant success.\r\n', 'Event was conducted smoothly without any glitches or problems. It was a medium through which participants were able to expand their knowledge and skills on ReactJS Development. The participants learned a lot from the event and we\'re enthusiastic about joining such future endeavours of CSI KJSIEIT. The event was an overall success.   ', '1. Prof. Uday Rote, Convener - CSI\r\n2. Prof. Nisha Vanjari', 'Event heads explaining rules to the participants', 'Participants showing their original project', 'Judges suggesting changes for purpose of the competition', '', '1.JPG', '2.JPG', '3.JPG', '', 'Banner.JPG', 'react, hackathon, coding', NULL, NULL),
(459, 'Parent Teacher Meet', 'Dr. Sarita Ambadekar and Prof. Pradnya Patil', '2021-10-23', '11:00', 'Online Mode', 'SY,TY,LY students and parents', 130, 0, '1. To inform parents regarding various departmental activities, achievements, results, placements, etc.,\r\n2. To interact with parents of all students from SY,TY and LY Computer Engineering Department classes.', '', 'Parent Teacher Meet was conducted online using Zoom platform. Around 130 parents and students attended this meeting. Head of department Dr.Sarita Ambadekar briefed about achievements of Institute and Computer Engineering Department activities. She also discussed the academic calender and upcoming exam conduction policy. Parent interacted with her for various problems/doubts etc,. ', '1. To make parents aware about Institute\'s and department\'s Achievements and Activities.\r\n2. To make parents informed about upcoming ', 'Dr. Sarita Ambadekar, HOD of Computer Engineering Dept.\r\nProf. Pradnya Patil, Asst. Professor, Computer Engineering Dept.', 'Image 1', 'Image 2', 'Image 3', 'Image 4', 'Image1.png', 'Image2.png', 'Image3.png', 'Image4.png', 'PTM.png', 'PTM, interaction, parents, teacher', NULL, NULL),
