(463, 'Stock Market Insights', 'Prof. Uday Rote', '2021-10-30', '17:00', 'Online Mode', 'Students across various branches and institutes', 92, 2, 'To learn and get insights about the stock market and generate a passive source of income through it.', 'Mr. Hitesh Gadling & Mr. Sujoy Bhattacharya and Deepesh Rawool.\r\nFounders, Nexus Traders.\r\n\r\nSpeakers are Professional Traders and Investors in the Stock Market for the past 2 years. They have successfully trained more than 250 students with the aim of popularizing the concept of stock trading & investing to enable the youth to benefit from it.', 'The speaker discussed how one could invest in the stock market and earn a profit, and explained the advantages and disadvantages of trading in the stock market. The participants were given some useful tips that will help them to trade and avoid risks. The speaker also explained the steps to analyse the market.  He also discussed the drastic changes in the market and how to manage stocks at such times.    \r\n', 'The attendees had their doubts cleared regarding the stock market. They got to know about the advantages and disadvantages of trading in stock. They learnt to analyse the market and avoid losses.', 'Prof. Uday Rote, Dean - Student Welfare', 'Introduction of the webinar', 'Speaker showcasing stock market gains using tips', 'Speakers concluding the session', '', '1.JPG', '2.JPG', '3.JPG', '', 'Poster.JPG', 'webinar, stock market', NULL, NULL),
