(466, 'Entrepreneurial Case Study Presentation', 'IIC-KJSIEIT', '2021-10-18', '15:30', 'Online Mode', 'Students across the nation', 12, 0, 'To encourage entrepreneur skills in students and enhance the research and entrepreneurial mindset of the participants and improve their presentation skills.', '', 'Entrepreneurial Case Study Presentation is a case study presentation competition to encourage entrepreneur skills organized by the Institution\'s Innovation Council (IIC) of K J Somaiya Institute of Engineering and Information Technology (KJSIEIT). It is a platform where participants will have to submit a case study on any start-up of India in the given format and give a presentation of the same.', 'Participants were able to analyze the business models of Indian startups.\r\nParticipants were able to present their entrepreneur research work.\r\n', 'Prof. Harsh Bhor, IIC-KJSIEIT', 'Winners', 'Presentation Round', 'Presentation Round', 'Presentation Round', 'Meet - pgc-zvpu-jmw - Google Chrome 10_18_2021 6_02_12 PM.png', 'Meet - pgc-zvpu-jmw - Google Chrome 10_18_2021 5_41_35 PM.png', 'Meet - pgc-zvpu-jmw - Google Chrome 10_18_2021 4_50_33 PM.png', 'Meet - pgc-zvpu-jmw - Google Chrome 10_18_2021 4_41_44 PM.png', 'Banner.jpeg', 'Case Study, Presentation, Entrepreneurship', NULL, NULL),
(467, 'Designerthon', 'IIC-KJSIEIT', '2021-10-16', '10:00', 'Online Mode', 'Students across the nation', 17, 22, 'To let students use their creative ideas and come up with innovative prototype design solutions.', '', 'DESIGNERTHON  is a 50 hours UI/UX design competition organized by the Institution\'s Innovation Council (IIC) of K J Somaiya Institute of Engineering and Information Technology (KJSIEIT). It is a platform for students to use their creative ideas and come up with innovative prototype design solutions.', 'To use their creative ideas and design prototype solutions.\r\nTo design an innovative interface for the given problem statement.', 'Prof. Harsh Bhor, IIC-KJSIEIT', 'Winners', 'Runner Ups', 'Innovative Designs', 'Innovative Designs', 'Meet - afg-jycv-zpb - Google Chrome 10_21_2021 8_28_50 PM.png', 'Meet - afg-jycv-zpb - Google Chrome 10_21_2021 8_28_20 PM.png', 'D1.PNG', 'D2.PNG', 'Designerthon_Banner.jpg', 'Competition, UI/UX Designs, Innovative ideas', NULL, NULL),
(468, 'Innovathon', 'IIC-KJSIEIT', '2021-10-19', '15:30', 'Online Mode', 'Students across the nation', 27, 70, 'To let participants use their creative ideas and come up with the best possible solutions by solving real-world problem statements.', '', 'INNOVATHON is a 48-hour virtual hackathon organized by the Institution\'s Innovation Council (IIC) of K J Somaiya Institute of Engineering and Information Technology (KJSIEIT). It is a platform for students to use their innovative ideas and come up with the best possible solutions by solving real-world problem statements. It had 50+ teams participating across the nation. The event was conducted using online mode.\r\n', 'To use innovative ideas and come up with the best possible solutions.\r\nTo solve real-world problem statements.', 'Prof. Harsh Bhor, IIC-KJSIEIT', 'Closing Ceremony', 'Winners', 'Final Round', 'Judges Round 1 (Evaluation & Mentoring)', 'Meet - afg-jycv-zpb - Google Chrome 10_21_2021 8_34_45 PM.png', 'Meet - afg-jycv-zpb - Google Chrome 10_21_2021 8_29_14 PM.png', 'Meet - pgc-zvpu-jmw - Google Chrome 10_18_2021 5_30_38 PM.png', 'Meet - drq-vyjq-gjv - Google Chrome 10_20_2021 4_40_09 PM.png', 'Innovathon_Banner.jpg', 'Hackathon, Competition, Problem Solving ', NULL, NULL),
(469, 'The Soul of  Startup', 'Mr.Prashant Sawant ', '2021-10-26', '16:02', '', 'Student & Staff', 65, 2, 'To Understand Benefits of Startup.\r\nTo explore challenges for startup.', '', 'The session was conducted by Mrs. Kalpana Sinha, during her session she deliver a talk on the importance of positive thinking .\r\nalso she has explained the few startup journeys how to start their business and all.', ' After attending this session students were able to \r\n1. Understand the generation of Ideas from daily lifestyle.\r\n2. How to overcome on challenges. \r\n ', 'Dr,Hariram Chavan, Professor, Information Technology\r\nMr.Prashant Sawant, Assistant Professor.', 'Mrs.Kalpana Sinha', '', '', '', '1.jpg', '2.jpg', '233.jpg', '', '', 'Startup, Startup Benefits, Government Policy ', NULL, NULL),
(470, 'Radiance: A Soire of Lights - Twisted Taboo', 'Prof. Uday Rote', '2021-10-31', '12:15', 'Online Mode', 'Students across various branches and institutes', 11, 47, '1. To promote critical and strategic thinking skills in students. \r\n2. To engage the students in a fun activity. \r\n3. To build the time management skills of the participants.\r\n4. To celebrate the spirit of Diwali and encourage students to participate in cultural activities.', 'NA', 'On the event day, a zoom meeting was kept where all the rules were explained to them by the organizers. Participants were divided into 2 breakout rooms. Once participants started, the words were sent on Whatsapp on personal chat. The timer of 45 seconds will start and the person has to start explaining. As soon as any participant guesses the word, he/she would put it on the Chat Box. As soon as the correct answer is put in the chatbox, a volunteer will prompt the participant to go to the next word. In case the participant uses a forbidden word, the volunteer will prompt him to stop and go to the next word. \r\n\r\nTop 5 scorers from each room were then qualified for the final round, wherein the same rules were followed. The participants gave a tough competition to each other and played upholding a spirit of honesty. \r\n\r\nOverall, the event ended on a successful note, with the participants enjoying it regardless of winning or losing.\r\n', 'The event was conducted successfully with participants building time management skills and engaging in the fun activity.', '1. Prof. Uday Rote - Dean of Student Welfare', 'Sponsors Banner being displayed during the Event', 'Event heads and team members clearing the doubts', 'A Group Picture with Winners', '', '1.JPG', '2.JPG', '3.JPG', '', 'Poster.JPG', 'word game, guessing, activity', NULL, NULL),
(472, 'Radiance: A Soire of Lights - Glamorous Gala', 'Prof. Uday Rote', '2021-10-31', '18:15', 'Online Mode', 'Students across various branches and institutes', 4, 29, '1. To celebrate the spirit of Diwali and encourage students to participate in cultural activities.\r\n2. To promote more cultural activities in the college.\r\n3. To give the students a platform to showcase their talent.\r\n4. To make the students embrace their cultural heritage.', 'NA', 'The event began at 6:30 pm with all the 20 participants eagerly waiting to show off their traditional attire to the Judges, Ms. Saloni Mathur, and Ms. Kajal Lalwani, both renowned makeup artists and fashion icons.\r\nThe objective of this event was to make the contestants embrace the culture and heritage of our country. The event is divided into two parts, the Introduction round, and the second Quiz round. Participants rewarded with points by the evaluator will be segregated and the top 8 will qualify for round two. Round two involves questioning contestants and evaluating their instant responses. Contestants with the highest and second-highest scorers will be awarded prizes.\r\nThe participants had to do a ramp walk and briefly introduce themselves for the first round of the competition. All the contestants had put in great efforts for the competition. The judges appreciated their efforts and praised every look that was put before them. The judging criteria were based on Confidence,  Fashion sense, Personality, and Cultural Relevance.\r\nThe Top 8 contestants who managed to stun the judges with their outfits advanced to the final round. Each participant was asked 2 questions, one by each judge. Based on their ability to answer these questions, they were given scores by the judges. The top 2 scorers of this round were declared as winners for this event.\r\n', 'Participants got robust encouragement and confidence for future pageant events and learned a lot about current snappy trends from co-participants and invitees.\r\n', '1. Prof. Uday Rote - Dean of Student Welfare', 'Sponsors Banner being displayed during the Event', 'Participants moving onto Phase 2 after elimination', 'A Group Picture with Winners', '', '1.JPG', '2.JPG', '3.JPG', '', 'Poster.JPG', 'drama, performance, talent', NULL, NULL),
(471, 'Radiance: A Soire of Lights - House of Lights', 'Student Council', '2021-10-31', '2:45 PM', 'Online Mode', 'Students across various branches and institutes', 8, 55, '1. To test and develop the participants\' IQ, stenography skills & problem-solving abilities. \r\n2. To celebrate the spirit of Diwali and encourage students to participate in cultural activities. \r\n3. To conduct a team-building activity. \r\n4. To enhance the decoding and encoding skills of the students. \r\n5. To build the time management skills of the participants.', 'NA', 'The event started at 3:00 PM with a warm welcome from the hosts and an explanation of the rules. House of lights, based on an escape room started at 3 pm with 25 enthusiastic teams, each of 1-3 players. Initially, all the rules and regulations were explained to the participants in the Zoom meeting. A demonstration was provided to clarify all the doubts if any. According to the storyline, the participants were trapped in a mysterious house that was once the most beautifully lighted palace in the world. However, due to a curse, it has never let inside a ray of sunshine since a Millenium. The participants goal was to collect the books in the first 3 rounds to pave their way to the final round. In the final round, light up the rangoli-diya, to escape the darkness and remake the dark house into the beautiful house of lights.\r\nThe event was held over 4 rounds of increasing difficulty levels which included tricky riddles and questions which needed to be solved in a stipulated amount of time in order to make it to the next round. \r\nThe top 5 teams made it to the 4th and final round. The winning teams were decided on the basis of the fastest teams to have solved the clues in the final round. The participants showed great enthusiasm and left with happy reviews. Hence, the event was concluded.\r\n', 'The participants spent a fun yet productive time with the council during the House of Lights event. It was filled with thrilling, brainstorming, time-tackling questions. It concluded with a boost to participants\' IQ, a break from their daily schedules, and a joyous kickstart to the Diwali festival.', '1. Prof. Uday Rote - Dean of Student Welfare', 'Sponsors Banner being displayed during the Event', 'Event heads and team members clearing the doubts', 'A Group Picture with Participants', '', '1.JPG', '2.JPG', '3.JPG', '', 'Poster.JPG', 'escape room, strategy, mystery', NULL, NULL),
(473, 'Workshop on VHDL for Digital Logic Circuits', 'Dr. Sandhya Kadam', '2021-10-29', '11:00', 'Online Mode', 'Students, Faculty and staff members', 82, 0, '1. To implement combinational and sequential digital logic circuits using VHDL', 'Assistant Professor, Department of Electronics and Telecommunication', 'The Workshop on VHDL was conducted on 29th October 2021 by Prof. Sagar Mhatre.  Dr. Sandhya Kadam introduced Prof. Sagar Mhatre and his work in VHDL. Prof. Mhatre started with the discussion on the need and importance of VHDL in today\'s world. He also gave a comparison of Verilog and VHDL language. He explained various examples of VHDL along with hardware interfacing devices. He has also shown waveforms for the VHDL programs in a simulated environment. It was a nice experience of building electronics circuits in the digital era through hardware interfaced systems which have given the feel of the industrial environment in VHDL. He also discussed scope of VHDL programming in the Electronics industries for developing digital components and devices. He also suggested to the students to join him for his project in VHDL. He explained examples based on combinational and sequential circuits using VHDL. The examples given are VHDL implementations of logic gates, flip flops, multiplexers, etc. He also explained VHDL programming for digital devices and verified its operation through waveforms.', ' 1. Helped students to understand the importance of VHDL in Digital Circuits.\r\n2. Students learned VHDL language for digital devices', 'Dr. Sandhya Kadam', 'Workshop on VHDL by Prof. Sagar Mhatre', 'Workshop on VHDL by Prof. Sagar Mhatre', 'Workshop on VHDL by Prof. Sagar Mhatre', 'Workshop on VHDL by Prof. Sagar Mhatre showing hardware', 'VHDL workshop1.jpg', 'VHDL 3.jpg', 'VHDL2.jpg', 'VHDL 6.jpg', 'VHDL workshop Banner.jpg', 'VHDL, Combinational Circuits, Sequential circuits', NULL, NULL),
(474, 'Sensors in Industrial Applications', 'Ms. Swati Shinde,  Mr. Sandeep Mishra', '2021-10-30', '11:00', 'Online Mode', 'TY and SY students of Electronics and Telecommunication Department', 108, 0, 'To gain knowledge of sensors and transducers in industrial application.\r\nTo create career awareness in the field of sensor technology. \r\n', 'Mr. Vijay Lokhande, Operational Manager, Honeywell, Pune ', '\"Sensors in Industrial Applications\" expert talk was organized by EXTC department for SY and TY students. Introduction of resource person was given by Prof. Swati Shinde.\r\n Mr. Vijay Lokhande, Operational Manager, Honeywell, Pune gave insight of sensors used in various applications of industry along with how atomization work to be done using data acquisition system and supervisory system like SCADA. Honeywell  is a manufacturer of various sensors and supervisory system used in industrial application.\r\nThis was interactive session. Vote of Thanks given by Prof. Sandeep Mishra.', ' Students will be able to recognize sensors used in various application.\r\nStudents will be able to select sensors for various applications.', 'Ms. Swati Hemant Shinde\r\nMr. Sandeep Mishra', '', '', '', '', 'final ppt 1 (2).pptx.jpg', '', '', '', '', 'Sensors, transducers, technology ,applications', NULL, NULL),
(475, 'Act-A-Thon: Road And Traffic', 'Pankaj Sir', '2021-11-13', '15:00', 'Online', '', 0, 0, '- Orientation of how to file a complaint and what to watch out for!\r\n- Break to go out in the community and do the tasks on ground\r\n- Document the tasks and file civic complaints.\r\n- Meet back to share reflections, learnings and going ahead.', '', '', '', 'Prof Pankaj Deshmukh', '', '', '', '', '', '', '', '', '', 'Election', NULL, NULL),
(476, 'StockMIND - A Virtual Trading Platform', 'Computer Society of India (CSI)', '2021-11-13', '3:00 PM', '', 'Students across various branches and institutes', 93, 7, '1. To provide students with a platform to develop and sharpen skills that are highly valued in any industry. \r\n2. To help students learn many professional skills that are crucial in today\'s competitive corporate world.', 'Shubham Chourey', 'The event started at 3:00 PM sharp, with a brief introduction of the speaker and his background. The speaker went on the explain why the stock market is a highly beneficial concept to learn and also the different aspects of trading in such markets. Through the presentation, and case studies presented, the speaker was able to enlighten the audience to a method of learning the stock market, StockMIND, created by ICICI Securities. Stock Mind is a game that will be played on the virtual trading platform. The amount allocated to the participant to play the game will be purely virtual and hence help people learn about the market without losing money in the process. the event concluded with clearing the doubts of the participants.', 'The attendees had their doubts cleared regarding the stock market. They got to know about the application StockMIND which helps them with initial training for trading and its advantages. The event ended on a high note.         ', '1. Prof. Uday Rote - Dean of Student Welfare', 'Introduction of the webinar', 'Speaker explaining concepts of Stock Markets', 'Speaker explaining the benefits of the application through a case study', '', 'WhatsApp Image 2021-11-13 at 4.49.45 PM.jpeg', 'WhatsApp Image 2021-11-13 at 4.49.43 PM.jpeg', 'WhatsApp Image 2021-11-13 at 4.49.44 PM.jpeg', '', '1.JPG', 'stock market, finance', NULL, NULL),
(477, '\"Deep Learning & It\'s Applications\"', 'K J Somaiya Institute of Engineering & Information Technology, Mumbai', '2021-12-13', '09:00', 'Zoom', '', 0, 0, '1. To intuit the factors of deep learning in various domains of Engineering and Science.\r\n2. To provide a platform for academicians, researchers and industry experts to enrich their knowledge in developing the applications in the domain of deep learning to provide solutions for various real-world applications.\r\n3. To explore various research opportunities and challenges in the domain of Deep learning for\r\ndeveloping applications in the field of Engineering and Science.', '', '', '', 'Dr. Sunita Patil, Vice-Principal, KJSIEIT', '', '', '', '', '', '', '', '', '', 'Refresher Program, Faculty Development Program, Deep Learning, Applications, ISTE, AICTE', NULL, NULL),
(478, 'Workshop on C Programming for Embedded Systems', 'Prof. Sejal Shah', '2021-12-04', '09:00', 'CR203', '', 0, 0, '1) To teach students to write programs in C fit for industrial projects.\r\n2) To instill some confidence into students who are weak at programming in C.', '', '', '', 'Prof. Sejal Shah', '', '', '', '', '', '', '', '', '', 'Workshop, C, Embedded Systems', NULL, NULL),
(481, '', '', '0000-00-00', '', '', '', 0, 0, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, NULL),
(483, 'Research: The Birth of Innovation', 'Department of Computer Engineering in Association with Software Development Cell (SDC)', '2021-12-06', '09:00 AM to 11:00 AM', '', 'Faculties ', 29, 2, 'i) To select right journal for paper publication\r\nii) To disseminate thorough knowledge of the importance of literature survey in research work\r\niii) To enlighten academic writing of a  review paper\r\n', 'She is an assistant professor in the Computer Engineering department at K. J. Somaiya Institute of Engineering and Information Technology, Mumbai.\r\nShe is a part of the Software Consultancy Cell at KJSIEIT which undertakes many software projects development consultancy of various industries and educational institutions.\r\nShe is a research scholar at the Computer Engineering and Information Technology department at the College of Engineering Pune, Pune and working on the research titled as Remote Sensing based Crop Water Stress Assessment using Machine Learning. \r\nShe has three SCI-Indexed papers in high impact factors journals with many journals and national and international conferences publications. She has one International patent on her name with three published Indian and international patents.\r\nShe is an Innovation Ambassador awarded by MoE.\r\n', 'Below points were discussed\r\n1) Types of journal articles\r\n2) Publishers for journal articles\r\n3) Journal Selection - Factors to be considered\r\n4) How to start a literature review?\r\n5) Academic writing a - review paper.\r\n6) Submission process \r\n7) Software tools for academic writing.\r\n', 'i. Faculties and graduate students will be able to carry out effective literature review which will help them to formulate their research plan and in academic writing.\r\nii. Faculties and graduate students will develop an ability to write an effective review on recent research in their domain.     ', '1. Prof. Mrunali Desai, Assistant Professor, Computer Engineering Department\r\n2. Prof. Kavita Bathe, Assistant Professor, Computer Engineering Department\r\n3. Prof. Jignasha Dalal, Assistant Professor, Computer Engineering Department\r\n', 'Starting of Webinar', 'Outline of Presentation', 'Prticipants', 'Active Participants', 'Image1.png', 'Image2 Outline.png', 'IMG-20211206-WA0022.jpg', 'Image3 Participants.JPG', 'Banner1.jpg', 'Research, review paper, Innovative academic writing  ', NULL, NULL),
(484, 'Entrepreneurship - growth and competitiveness', 'Prof. Sandeep Miashra & Prof. Pranali Hatode', '2021-12-11', '16:00', 'Online', '', 0, 0, 'This section is designed to help you develop your entrepreneurial vision, initiate self development process and competitiveness.', 'Asst. Professor, SPIT, IEEE Bombay section', '', '', 'Mr. Rahul Akhade\r\nMr. Gunjan', '', '', '', '', '', '', '', '', '', 'Expert Talk', NULL, NULL);
