(486, 'Preparation Tips for Higher Studies', 'Medha Asurlekar', '2021-12-08', '16:30', 'Online', '', 0, 0, '	To provide students a thorough walkthrough over exams like GRE/GMAT/IELTS/TOEFL.\r\n	To provide guidance for profile building according to courses.\r\n	To explain the significance of LoRs and SoPs.\r\n	To briefly counsel on how to prepare for everything related to higher studies.\r\n	To guide students on how to shortlist countries and universities.\r\n', '', '', '', '1. Mr Prince Gada . IETE Chairperson\r\n2. Muffaddal Miyajiwala, IETE Vice Chairperson', '', '', '', '', '', '', '', '', '', 'GRE/GMAT/IELTS/TOEFL', NULL, NULL),
(487, 'Innovation and entrepreneurship in India : Opportunities and challenges', 'Kavita Bathe', '2021-12-18', '10:00', 'Online', '', 0, 0, 'To gain knowledge of entrepreneurship opportunities available in India, To motivate and guide  students for innovation', 'Product Developer and Manager,\r\nDeshpande Startups.', '', '', '1.Prof.Kavita Bathe Assistant Professor ,Department of Computer Engineering\r\n2.Prof.Shyamal Virnodkar , Assistant Professor ,Department of Computer Engineering\r\n3.Prof.Mrunali Desai, Assistant Professor ,Department of Computer Engineering', '', '', '', '', '', '', '', '', '', 'Innovation', NULL, NULL),
(488, 'Innovation and Entrepreneurship', 'Innovation Ambassadors', '2021-12-10', '09:00', 'Online', '', 0, 0, 'To strengthen the innovation and entrepreneurship ecosystem in the institute.', '', '', '', 'KJSIEIT - IIC Members and KJSIEIT Innovation Ambassadors', '', '', '', '', '', '', '', '', '', 'Faculty Development Program', NULL, NULL),
(489, 'Webinar on Entrepreneurship', 'Mrs .Seema K. Yadav', '2021-12-09', '14:30', 'Online Mode', ' Students of all Branches and Faculty ', 34, 0, 'To motivate students to have their own startup, to start their own business .Motivate them to take independent decision and to enhance decision making capability. To create job for themselves and for others and help society to increase employment.', 'Chairman and Managing Director- Comsolve Mediatech Pvt. Ltd.  \r\nDirector: Anuyash Diabetic Care Pvt. Ltd.\r\nPartner: Total Communications\r\nPartner: Pinnacle Institute of Fashion Technologies\r\n\r\n ', 'The speaker shared his experience of how he has started his own business after struggling a lot. The difficulties he faced during starting his business from a small scale and converting it into a large scale. He has shared tips on how to become a good and successful entrepreneur, the difference between an entrepreneur and a normal person. Also, he has focused the talk on money management and how to tackle failure in business. The webinar covers the details about the mindset and thought process required to be an entrepreneur. It also focuses on the management and technical skill required in startup/business.', ' The students and faculties are able to develop their thought processes to have their own startup/business. They are able to take independent decisions. They are able to work in a team and as an individual.    ', '1.Prof.Seema K. Yadav , Assistant Professor, Department of Information Technology.', 'Speaker and list of participants ', 'Speaker addressing the queries of participants ', 'Speaker and the participants', 'Start of the the webinar session', 'webinarimage1.jpeg', 'webinarimage5.jpeg', 'webinarimage3.jpeg', 'webinarimage4.jpeg', 'Webinarbanner.jpeg', 'Entrepreneur, company, startup, business', NULL, NULL),
(485, 'Amazon Web Services (AWS) Awareness  - Do\'s & Don\'ts', 'Alumni Committee', '2021-12-04', '4:00 PM', '', 'LY ETRX', 11, 0, 'To aware students about Amazon Web Services (AWS)- Do\'s & Don\'ts.\r\nTo aware about the use of AWS free tier services', ' Mr. Pranav V.G., Senior Consultant, Capgemini Technology India Pvt. Ltd. ', 'Speaker Mr. Pranav V.G. discussed about \r\nAWS Free Tier services\r\nAmazon S3\r\nAmazon EC2\r\nHow to delete instances created.\r\nBill optimization \r\nClosing Account etc.\r\nSteps to Close AWS Account\r\nDelete the instances Buckets, files in Amazon S3.\r\nTerminate the Amazon EC2 instances created. \r\nCheck Billing Dashboard. It should be INR 0.\r\nDo not share AWS accounts details, keys with others.\r\nCheck all the regions for instances created. \r\nAfter deletion of all instances, delete the account. ( Do not delete account directly)\r\n', 'The Participants understood the Amazon Web Services (AWS)- Do\'s & Don\'ts.\r\nThe Participants understood the about the use of AWS free tier services.\r\n\r\n      ', 'Ms. Sarika Mane- ETRX\r\nDr. Vrushali Deole-BS& H\r\n', 'Webinar on Amazon Web Services (AWS) Awareness - Do\'s & Don\'ts, on 04 December 2021 (Saturday) from 4:00 PM.', '', '', '', 'Event 1.jpg', '', '', '', 'Banner.jpg', 'AWS', NULL, NULL),
(490, 'Innovation and Industry trends', 'Prof.Rashmi Adatkar Prof.Rupali Kadu Prof. Amit kukreja', '2021-12-09', '11:00', 'Online', '', 0, 0, 'To kindle awareness about the recent innovation and various industry trends', '', '', '', 'Prof.Rashmi A\r\nProf. Rupali kadu\r\nProf. Amit k', '', '', '', '', '', '', '', '', '', 'Innovation', NULL, NULL),
